INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(92, 'DYNAMICA', '<p>Репертуар: Казахские и русские хиты 80-90х, а также восточные, западные песни!</p>', '0', 0, 2, 1, 2, 7, 1, NULL, '2017-04-08 04:20:33', '2017-04-19 04:44:02'),
(93, 'Armada live band', '<p>Состав группы &mdash; 7 человек. Выезд со своим аппаратом и инструментами в г. Атырау. В другие города только с инструментами, по техническому и бытовому райдеру. Группа славится широким современным репертуаром на русском, английском и французском языках. Исполняют казахские, русские ретро, зарубежные ретро и современные хиты.</p>', '0', 0, 2, 1, 2, 10, 3, NULL, '2017-04-08 04:26:17', '2017-04-19 02:39:38'),
(94, 'Renaissance', '<p>Live band &laquo;Renaissance&raquo; украсит любое ваше мероприятие. Одни из самых известнейших и востребованных в городе музыкантов. Опыт работы более 10 лет, в том числе и с огромным выбором репертуара. В репертуаре песни на казахском, русском, английском и других иностранных языках. Ретро хиты 80-90-х, современные хиты. Самая красивая музыка и самые зажигательные хиты и все это live band &laquo;Renaissance&raquo;.</p>', '0', 0, 2, 1, 2, 11, 3, NULL, '2017-04-08 04:31:00', '2017-04-19 04:44:48'),
(95, 'Live Band', '<p>Казахский поп. Ретро на русском!</p>', '0', 0, 2, 1, 2, 13, 3, NULL, '2017-04-08 04:34:56', '2017-04-19 04:44:58'),
(96, '\"West Sound`s Band\"', '<p>Лучший коллектив живой музыки Актобе и запада РК. Разнообразный репертуар, шоу! Украсят любое мероприятие! Возможны выезды.</p>', '0', 0, 2, 1, 2, 12, 4, NULL, '2017-04-08 04:36:53', '2017-04-19 03:54:01'),
(97, 'Группа «Ностальджи»', '<p>Группа &laquo;Ностальджи&raquo; из города Атырау &mdash; это музыкальные сопровождение с мужским вокалом на корпоратив, свадьбу, юбилей, день рождения, фуршеты, банкеты и т.д. Мы специализируемся на исполнении кавер версий от ретро композиций до современных хитов. Группа &laquo;Ностальджи&raquo; музыканты живого исполнения, исполнят и приукрасят ваш свадебный или корпоративный вечер красивыми песнями на казахском, русском, английском, французском, турецком, итальянском языках. Живой звук и профессионализм участников группы оставят яркие впечатления от любимых мелодий и сделает любое ваше торжество незабываемым! Живая музыка на празднике всегда выглядит дорого и презентабельно! Если вы хотите сделать ваше мероприятие ярким и незабываемым &mdash; кавер группа &laquo;Ностальджи&raquo; то что вам необходимо!!!</p>', '0', 0, 2, 1, 2, 14, 3, NULL, '2017-04-08 04:40:26', '2017-04-19 04:59:26'),
(98, 'Авто-кортеж', '', '0', 0, 2, 2, 2, 15, 3, NULL, '2017-04-08 04:44:49', '2017-04-08 04:44:49'),
(99, 'Лимузин Infinity QX56', '<p>Если вы хотите заказать вместительное авто на свадьбу с комфортным салоном, то вам стоит взять на прокат лимузин Infiniti QX56. Мощный красивый гигант белого цвета с выразительным внешним видом и салоном. Внутри очень удобно, а дизайн создает отличную атмосферу. Зеркальный потолок и отражающиеся спинки сидений.</p>', '0', 0, 2, 2, 2, 16, 3, NULL, '2017-04-08 04:51:21', '2017-04-19 05:03:31'),
(100, 'Аренда автобусов', '<p>Вместительный и удобный микроавтобус тойота хайс нередко заменяет собой целый кортеж и при этом прекрасно смотрится на любой свадьбе. Это удобный городской автобус, рассчитанный на 10 человек, на нем очень удобно развозить гостей после окончания торжества.</p>', '0', 0, 2, 2, 2, 17, 3, NULL, '2017-04-08 04:53:52', '2017-04-19 05:03:58'),
(101, 'Auto cortezh', '', '0', 0, 2, 2, 2, 18, 3, NULL, '2017-04-08 04:56:34', '2017-04-08 04:56:34'),
(102, 'ATYRAU TOYOTA CAMRY', '', '0', 0, 2, 2, 2, 19, 3, NULL, '2017-04-08 04:59:31', '2017-04-08 04:59:31'),
(103, 'Limousine Atyrau', '<p>Предлагаем лимузин Infiniti QX и Toyota, Land Cruiser Prado 150, Toyota Camry!</p>', '0', 0, 2, 2, 2, 20, 3, NULL, '2017-04-08 05:02:13', '2017-04-19 05:13:53'),
(104, '«Elite Cortezh Atyrau»', '<p>Более трёх лет &laquo;Elite Cortezh Atyrau&raquo; предоставляет автомобили представительского и эконом-класса в Атырау. У нас богатый опыт работы с клиентами и высокий уровень предоставляемых услуг. В центре нашего внимания всегда находятся те, для кого мы работаем &mdash; наши клиенты! Вы можете положиться на нас так же спокойно, как на самого близкого и проверенного друга. Все заботы мы берём на себя! Ваше удовольствие от сервиса &mdash; главный стандарт успеха для нас! Мы гарантируем, что у нас Вы получите качественное обслуживание и гибкие тарифы. В наших автомобилях Вы будете чувствовать себя по-настоящему комфортно! Наши преимущества: При любых погодных условиях внешнее состояние автомобиля и салона отвечают требованиям самых строгих заказчиков. Наших водителей отличают точность, корректность в общении с клиентом и отличное знание города. Наши автомобили находятся в отличном техническом состоянии, они надежны и комфортабельны. Подача автомобилей по предварительному заказу осуществляется круглосуточно. У нас гибкая политика цен, поэтому каждый заказ обсуждается индивидуально. Мы учитываем все Ваши пожелания и будем рады, если Вы пополните список наших постоянных клиентов. Помните! Разочарование от плохого сервиса длится дольше, чем радость от низкой цены!</p>', '0', 0, 2, 2, 2, 21, 3, NULL, '2017-04-08 05:04:21', '2017-04-19 05:14:18'),
(105, 'Прокат машин', '', '0', 0, 2, 2, 2, 22, 3, NULL, '2017-04-08 05:06:35', '2017-04-08 05:06:35'),
(106, 'Atyrau toilary', '<p>Машины марки Toyota Camry w50-55 с собственным оформлением.</p>', '0', 0, 2, 2, 2, 23, 3, NULL, '2017-04-08 05:10:03', '2017-04-19 05:14:31'),
(107, 'Атырау кортеж', '<p>Заказываем авто для торжеств и мероприятий:</p>\r\n<p>&mdash; с опытными водителями;</p>\r\n<p>&mdash; с чистыми ухоженными автомобилями;</p>\r\n<p>&mdash; с одинаковыми красивыми оформлениями.</p>\r\n<p>Гарантируем провести гулянки и покатушки на высшем уровне! А так же предоставляем скидки!</p>', '0', 0, 2, 2, 2, 24, 3, NULL, '2017-04-08 05:13:03', '2017-04-19 02:44:33'),
(108, 'Оңдағанова Бексана', '<p>Дәстүрлі әнші. Ғарифолла Құрманғалиев, М.Төрешов атындағы республикалық конкурстардың лауреаты.</p>', '0', 0, 2, 3, 2, 25, 3, NULL, '2017-04-08 05:20:54', '2017-04-19 05:14:51'),
(109, 'Орынгүл', '<p>Той бастар, келін кіргізу, қыз ұзату, құда қарсы алу, сүндет той, тұсау кесу, тілашар, туған күн, мерей той кештерін әдемі әнмен әрлеймін.</p>', '0', 0, 2, 3, 2, 26, 3, NULL, '2017-04-08 05:23:15', '2017-04-19 05:15:08'),
(110, 'Тамырлан', '<p>2008 жылы туылған, туғаннан өнер қуынған. Туған айы Сәуір, өзінің түрі тәуір жігіт. Шашы Қайраттай қиылған, сегіз жасынан сегіз қырлылық бұйырған, жеке продюсерлік орталығын Төреғали Төреәлі ашқан, содан бастап өнерге қадам басқан. Қолдаушы да, қорғаушысы да Анасы-Құралай. Әндерінің өзін, әдемі сөзін- ақын, композитор Ерболат Қарақойшы жазады. Бойы кішкентай болғанымен, ойы үлкен жігіт. Мұнайлы өлкенің шырайлы серісінің алған атақтары да аз емес. Облыстық &laquo;Айгөлек&raquo; балалар байқауының Гран-При иегері. &laquo;Жыл жаңалығы &mdash; 2016 &raquo;, &laquo;Жылдың жас әншісі-2016&raquo; марапаттарының иегері. Репертуарындағы авторлық әндері: &laquo;Бала тілегі&raquo;, &laquo;Қарттарүйі&raquo;, &laquo;Мен де бірсеніңбалаңмын&raquo;, &laquo;Маxаббатқаәліерте&raquo;.</p>', '0', 0, 2, 3, 2, 27, 3, NULL, '2017-04-08 05:26:12', '2017-04-19 05:17:16'),
(111, 'Инструментальное трио «Еркеназ»', '<p>Репертуар: казахские песни, куйи, попури, восточные песни. Блок 3-4 композиции.</p>', '0', 0, 2, 3, 2, 28, 3, NULL, '2017-04-08 05:28:26', '2017-04-19 05:17:49'),
(112, 'Муслим Яудаев', '<p>Муслим Яудаев - әнші, Музарт Live жобасының қатысушысы!</p>', '0', 0, 2, 3, 2, 29, 3, NULL, '2017-04-08 05:30:32', '2017-04-18 07:22:52'),
(113, 'Айболат', '', '0', 0, 2, 3, 2, 30, 3, NULL, '2017-04-08 05:32:29', '2017-04-08 05:32:29'),
(114, 'Зарина Кабдулова', '<p>Певица во дворце культуры имени Курмангазы. Свободно владеет 3-мя языками. Поет на 6 языках: русский, казахский, английский, французский, итальянский, румынский. Репертуар включает в себя ретро песни 80 &mdash; 90х , современные песни, Lounge песни, клубные зажигательные новинки, казахскиe народные и патриотические песни. Лауреатка различных областных музыкальных конкурсов. Пела в дуэте с известным Итальянским певцом Son Pascal на открытии ресторана Jida. Солистка группы &laquo;Renaissance&raquo;!<br />Имеет сертификат об окончании уроков по вокалу от джазовой певицы, композитора Amikaeyla Gaston (USA).</p>', '0', 0, 2, 3, 2, 31, 3, NULL, '2017-04-08 05:35:59', '2017-04-19 02:55:49'),
(115, 'Дуэт «Поющих ведущих»', '<p>Дорогие друзья спешим Вас порадовать появлением на рынке Казахстана единственного в своем роде дуэта &laquo;ПОЮЩИХ ВЕДУЩИХ&raquo; &nbsp;&mdash; Арслан Жомартулы и Гульнур Рахим!!! Арслан и Гульнур&nbsp;приготовили яркую потрясающую шоу программу на Ваши любимые праздники!<br />ВЕДЕНИЕ ПРАЗДНИКОВ НА ТРЕХ ЯЗЫКАХ: КАЗАХСКИЙ, РУССКИЙ, АНГЛИЙСКИЙ!<br />&mdash; Веселые, юмористические конкурсы!<br />&mdash; Яркая шоу программа!<br />&mdash; Индивидуальный подход к Вашему мероприятию!<br />&mdash; Роскошные образы ведущих!<br />&mdash; Довольные гости!<br />Ждем &nbsp;приглашения на Ваши мероприятия, и надеемся на &nbsp;сотрудничество!</p>', '0', 0, 2, 3, 2, 32, 3, NULL, '2017-04-08 05:39:29', '2017-04-19 05:24:01'),
(116, 'Дуэт ЖасSTAR', '<p>&laquo;Дуэт ЖасSTAR&raquo; &nbsp;&ndash; Атырауская поп-группа, образованная в 2010 году. В состав входят Аслан Ертелеуов&nbsp; и Актоты Аскар.</p>\r\n<p>&laquo;Дуэт ЖасSTAR&raquo; &nbsp;был образован в 2010 году художественным руководителем группы &nbsp;Гайсиной&nbsp; Махш Заитовной. После образования &nbsp;дуэт побеждал во многих&nbsp; международных музыкальных фестиваль-конкурсах:</p>\r\n<p>2011 год &mdash; Международный&nbsp; вокальный конкурс,&nbsp; город &nbsp;Кентау, 1 &ndash; ое место;</p>\r\n<p>2011 год &ndash; Международный&nbsp; конкурс&nbsp; &laquo;Многоголосие народов мира&raquo; г.Санкт-Петербург, победители конкурса;</p>\r\n<p>2012 год- &nbsp;фестиваль &mdash; конкурс вокального творчества &laquo;У черного моря&raquo; Украина, г.Ялта; лауреаты &laquo;ГРАН-ПРИ&raquo;.</p>\r\n<p>В 2011 году вышла первая авторская песня &laquo;Қазақстан&raquo;, специально подготовленная к 20- летию Независимости Республики Казахстан, написанная Атырауским композитором Бейсембеком Имашевым.&nbsp; В настоящее время в багаже группы насчитывается ни много ни мало около 10 авторских песен. Яркими &nbsp;из них можно назвать &laquo;Еуразия жүрегі&raquo; (2017г.) песня Б. Имашева, посвященная городу Атырау, &laquo;Ұнадыма&raquo; (2017г.), &laquo;Тыңда&raquo; (2017г.), написанная композитором Газизханом Шекербековым автором многих хитовых песен.</p>\r\n<p>&laquo;Дуэт ЖасSTAR&raquo; &nbsp;также популярен в EVENT- индустрии, как cover исполнители ( cover band ) многих популярных шлягеров 80-х, 90-х годов, а также хитов современности. Дуэт,&nbsp; по &mdash; новому обрабатывая ретро &mdash; песни, преподносит в виде попурри многие хиты Bonny M, Modern Talking, &nbsp;Haddaway и т.п.</p>\r\n<p>Каждая новая работа &laquo;ЖасSTAR&raquo; не похожа на предыдущие: в разнообразном репертуаре группы нет однотипных песен, артисты экспериментируют со звучанием и образами, раскрывают себя в разных жанрах и стилях, &nbsp;начиная с&nbsp; латино-американских песен легендарных групп как &nbsp;&nbsp;Gipsy Kings', '0', 0, 2, 3, 2, 33, 3, NULL, '2017-04-08 05:41:53', '2017-04-19 05:24:48'),
(117, 'Дуэт Зарина и Бакытгуль', '<p>Певицы дворца культуры имени Курмангазы в г.Атырау. Лауреаты областных конкурсов. Репертуар включает в себя песни на казахском, русском, английском!</p>', '0', 0, 2, 3, 2, 34, 3, NULL, '2017-04-08 05:44:04', '2017-04-19 05:24:58'),
(118, 'Шалқар', '<p>Тамада. Ведение на казахском языке!</p>', '0', 0, 2, 4, 2, 35, 3, NULL, '2017-04-08 05:46:07', '2017-04-19 05:25:11'),
