(124, 'Нурболат Алипкаиров', '<p>Нурболат Алипкаиров в шоу бизнесе более 15 лет. Тамада, ведущий на 2 языках. Имеется сертификат международного форума среди ведущих Russian Showman Week Москва! Дипломант, Лауреат, Победитель республиканских и международных конкурсов таких, как Жас Канат, Шабыт серебряный призёр Дельфийских игр и прочих конкурсов. Участник фестиваля 10 летия Астаны!</p>', '0', 0, 2, 4, 2, 41, 3, NULL, '2017-04-08 06:05:50', '2017-04-19 05:27:03'),
(125, 'Наурызбек', '<p>Барға шүкір, тәубе дейтін азына</p>\r\n<p>Жүрген жері әзіл-қалжың қазына.</p>\r\n<p>Тойын тойлау қазақ үшін түк емес</p>\r\n<p>Той қазаққа Құдай берген қазына!!!</p>\r\n<p>Сіздің тойда кездескенше!!!</p>', '0', 0, 2, 4, 2, 42, 3, NULL, '2017-04-08 06:08:06', '2017-04-19 03:14:01'),
(126, 'Мейірман', '', '0', 0, 2, 4, 2, 43, 3, NULL, '2017-04-08 06:10:22', '2017-04-08 06:10:22'),
