(129, 'Тамада Лукпан', '<p>Тәжірибелі асаба әр-түрлі ойындарымен сіздердің үйлену тойларыңызды, қыз-ұзату, құдалық, мерей той, шiлдехана т.б. мерекелік кештеріңізді жақсы етіп өткізуге дайын!</p>', '0', 0, 2, 4, 2, 46, 3, NULL, '2017-04-08 06:19:26', '2017-04-18 07:37:10'),
(130, 'Қоблан Ескендір', '<p>Теле &mdash; радиожүргізуші, Шоумен, Асаба &mdash; Қоблан Ескендір! Қазақ тілінде кез-келген қуанышыңызды жоғары деңгейде өткізуге ат салысамын!</p>', '0', 0, 2, 4, 2, 47, 3, NULL, '2017-04-08 06:21:35', '2017-04-19 05:27:54'),
(131, 'Жужа Сергей', '<p>&laquo;ЖУЖА СЕРГЕЙ &ndash; ВАШ ЛИЧНЫЙ ВЕДУЩИЙ&raquo;</p>\r\n<p>Организация и проведение торжественных мероприятий, свадеб, юбилеев, корпоративов, тематических вечеринок, выпускных и т.д. на высочайшем уровне. Рисование песком на стекле (sand-art). Выступление на мероприятиях с песочной анимацией с роликами на разную тематику.</p>', '0', 0, 2, 4, 2, 48, 3, NULL, '2017-04-08 06:23:47', '2017-04-19 05:28:31'),
(132, 'Жарас', '', '0', 0, 2, 4, 2, 49, 3, NULL, '2017-04-08 06:32:03', '2017-04-08 06:32:03'),
