(136, 'Даурен Адилов', '<p>Тамада. Ведение на казахском языке. г.Кулсары</p>', '0', 0, 2, 4, 2, 53, 3, NULL, '2017-04-08 06:40:33', '2017-04-19 05:30:12'),
(137, 'Даурен', '<p>Той болса кешікпей басталатын,</p>\r\n<p>Мен емес жан жұртта жасқанатың,</p>\r\n<p>Казағым той болса звондандар</p>\r\n<p>МЕН Даурен тойларынды баскаратың!</p>', '0', 0, 2, 4, 2, 54, 3, NULL, '2017-04-08 06:42:12', '2017-04-19 05:30:37'),
(138, 'Дамир Мурзагереев', '', '0', 0, 2, 4, 2, 55, 3, NULL, '2017-04-08 06:44:08', '2017-04-08 06:44:08'),
(139, 'Бауырбек', '', '0', 0, 2, 4, 2, 56, 3, NULL, '2017-04-08 06:45:43', '2017-04-08 06:45:43'),
(140, 'Асаба Асылбек', '<p>Айтыскер ақын, әзілкеш.</p>\r\n<p>Қолдағы қадірлеген бар асылын,</p>\r\n<p>Бет алған бағынтуға дара шыңын,</p>\r\n<p>Тізгінін тойларыңның ұстап жүрген</p>\r\n<p>Қазақтың қарапайым баласымын!</p>', '0', 0, 2, 4, 2, 57, 3, NULL, '2017-04-08 06:47:37', '2017-04-19 03:11:31'),
(141, 'MC Zufar', '<p>Ведущий, музыкант, showman, beatmaker.</p>', '0', 0, 2, 4, 2, 58, 3, NULL, '2017-04-08 06:49:27', '2017-04-19 05:31:08'),
(142, 'Arkhat Tamada', '<p>Актер театра и кино, телеведущий, тамада, ведущий различных мероприятий &mdash; на казахском и русском.</p>', '0', 0, 2, 4, 2, 59, 3, NULL, '2017-04-08 06:51:13', '2017-04-19 05:31:22'),
(143, 'Нуролла', '<p>Тәжірибелі асаба әр &mdash; түрлі ойындарымен сіздердің үйлену тойларыңызды, қыз-ұзату, құдалық, мерей той, шiлдехана т.б. мерекелік кештеріңізді жақсы етіп өткізуге дайын. Қазақ тілінде.</p>', '0', 0, 2, 4, 2, 60, 3, NULL, '2017-04-08 06:53:51', '2017-04-19 05:32:25'),
(144, 'Нуржан', '<p>Ведение на казахском языке. Город Кульсары.</p>', '0', 0, 2, 4, 2, 61, 3, NULL, '2017-04-08 06:55:18', '2017-04-19 05:32:29'),
(145, 'Нурбек Саламатов', '<p>Двуязычный ведущий, шоумен, тамада и асаба. Молодой, креативный, позитивный, шустрый. Конкурсы, интерактив, конкурсы с led экраном.&nbsp;</p>', '0', 0, 2, 4, 2, 62, 3, NULL, '2017-04-08 06:57:23', '2017-04-19 05:32:48'),
(146, 'Мерей Арыстан', '<p>Көргені жоқ өнерді жауып тұман,<br />Есесіне көп нұрлы жан ұқтырам.<br />Алла қуат дарытса, бұйырса егер,<br />Тауық жылын əдемі сауық қылам!</p>\r\n<p>Халықтың асабасы, ақынымыз,<br />Қуаныш, тойларында жақынымыз.<br />&laquo;Мерейім көтерілсін&raquo; десеңіздер,<br />Арыстанның Мерейін шақырыңыз!</p>', '0', 0, 2, 4, 2, 63, 3, NULL, '2017-04-08 06:59:08', '2017-04-18 07:32:38'),
(147, 'Махамбет Темирбек', '<p>Двуязычный ведущий, шоумен, тамада.</p>', '0', 0, 2, 4, 2, 64, 3, NULL, '2017-04-08 07:01:00', '2017-04-19 05:33:05'),
(148, 'Кудайберген', '<p>Лауреат Республиканских конкурсов, профессиональный певец. В качестве ведущего работает с 2006 года. Ведет на казахском!</p>', '0', 0, 2, 4, 2, 65, 3, NULL, '2017-04-08 07:07:09', '2017-04-19 05:33:15'),
(149, 'Куандык', '<p>1. Образованный, интеллигентный</p>\r\n<p>2. Молодой, энергичный</p>\r\n<p>3. Стильный, спортивный, обожаю пение и танцы.</p>\r\n<p>4. Веду на казахском, частично на русском</p>', '0', 0, 2, 4, 2, 66, 3, NULL, '2017-04-08 07:08:38', '2017-04-19 05:33:27'),
(150, 'Ерік Шоқанов', '<p>Ассаламуағаликум куаныштан көзінің жасы кеппеген</p>\r\n<p>Қазаннан асы кетпеген</p>\r\n<p>Келінін кызындай көрген</p>\r\n<p>Ұлына нақылын беріп</p>\r\n<p>Қызына ақылын беріп</p>\r\n<p>Тәрбиесі бузылмай келген</p>\r\n<p>Жаманға сақ келетін</p>\r\n<p>Жақсыға ат беретін</p>\r\n<p>Тойшыл қазақ елі, әулеттеріңізде</p>\r\n<p>Тек куаныш болсын Той болсын!</p>', '0', 0, 2, 4, 2, 67, 3, NULL, '2017-04-08 07:10:37', '2017-04-19 03:01:20'),
(151, 'Дуэт «Поющих ведущих»', '<p>Дорогие друзья спешим Вас порадовать появлением на рынке Казахстана единственного в своем роде дуэта &laquo;ПОЮЩИХ ВЕДУЩИХ&raquo; &nbsp;&mdash; Арслан Жомартулы и Гульнур Рахим!!! Арслан и Гульнур&nbsp;приготовили яркую потрясающую шоу программу на Ваши любимые праздники!<br />ВЕДЕНИЕ ПРАЗДНИКОВ НА ТРЕХ ЯЗЫКАХ: КАЗАХСКИЙ, РУССКИЙ, АНГЛИЙСКИЙ!<br />&mdash; Веселые, юмористические конкурсы!<br />&mdash; Яркая шоу программа!<br />&mdash; Индивидуальный подход к Вашему мероприятию!<br />&mdash; Роскошные образы ведущих!<br />&mdash; Довольные гости!<br />Ждем &nbsp;приглашения на Ваши мероприятия, и надеемся на &nbsp;сотрудничество!</p>', '0', 0, 2, 4, 2, 32, 3, NULL, '2017-04-08 07:13:54', '2017-04-19 05:24:13'),
(152, 'Бекболат Амиржанов', '<p>Кіші Өнер Академиясында Актер шеберлігі мамандығын 2011жылы бітіріп шықтым! Кешті тек қазақ тілінде ғана өткіземін. Менің жездем әрі ұстазым Сәбит Қожабеков деген М.Өтемісұлы атындағы драмма театрдың актері және асаба, сол кісінің қасында біршама жүріп, қызығып, осы жолға менде түстім! Асабалықты &mdash; өнер деп санамайтын жандар көп, бірақ соны ӨНЕР деп мойындайтындарға мен тер төгіп барымды салуға дайынмын!</p>', '0', 0, 2, 4, 2, 68, 3, NULL, '2017-04-08 07:15:43', '2017-04-19 05:33:53'),
(153, 'Асылжан Жумашев', '', '0', 0, 2, 4, 2, 69, 3, NULL, '2017-04-08 07:18:16', '2017-04-08 07:18:16'),
(154, 'Salem Studio', '<p>Снимаем свадьбы на высоком уровне. Индивидуальный подход и безупречный результат &mdash; это основа нашей работы.</p>', '0', 0, 2, 14, 2, 70, 3, NULL, '2017-04-08 07:21:16', '2017-04-19 03:40:22'),
(155, 'ART OF MEMORIES​', '<p>Видеостудия Art of memories. Высококачественная видеосъемка в формате HD, запись звука в формате HD. Съёмка с использованием операторского крана. Аэросъёмка. Постановочная съёмка Love story. Рекламные ролики. Корпоративное видео.</p>', '0', 0, 2, 5, 2, 71, 3, NULL, '2017-04-08 07:23:20', '2017-04-19 05:59:34'),
(156, 'Нуржан Жаксылыков', '', '0', 0, 2, 5, 2, 72, 3, NULL, '2017-04-08 07:40:30', '2017-04-08 07:40:30'),
(157, 'Рауан Мырзагереев', '<p>Қуанышты сәттеріңізді бейнетаспаға жазып беремін.</p>', '0', 0, 2, 5, 2, 73, 3, NULL, '2017-04-08 07:42:30', '2017-04-19 06:00:03'),
(158, 'БЕКЗАТ АБДУЛОВ​', '<p>Осуществляю профессиональную видеосъёмку свадеб, детских праздников, мероприятий, юбилеев, корпоративов, венчания и других сюжетов.</p>', '0', 0, 2, 5, 2, 74, 3, NULL, '2017-04-08 07:43:43', '2017-04-19 03:20:30'),
(159, 'Ayana Studio', '<p>Красиво запечатлим момент Вашей мероприятии!</p>', '0', 0, 2, 5, 2, 75, 3, NULL, '2017-04-08 07:49:28', '2017-04-19 06:02:25'),
(160, 'Аманат_kz', '<p>Фото/видео студия Amanat KZ изготовит: фотокнигу, пригласительные билеты, 3D баннеры, Love Story, рекламные ролики всем, кто хочет профессиональную и красивую работу.</p>', '0', 0, 2, 5, 2, 76, 3, NULL, '2017-04-08 07:52:48', '2017-04-19 03:19:17'),
(161, 'Аманат_kz', '<p>Фото/видео студия Amanat KZ изготовит: фотокнигу пригласительные билеты 3D баннеры Love Story рекламные ролики Всем, кто хочет профессиональную и красивую работу.</p>', '0', 0, 2, 14, 2, 76, 3, NULL, '2017-04-08 07:54:44', '2017-04-19 06:02:51'),
(162, 'Ayana Studio', 'Красиво запечатлим момент Вашей мероприятии!', '0', 0, 2, 14, 2, 75, 3, NULL, '2017-04-08 07:58:44', '2017-04-08 07:58:44'),
(163, 'ELITE VIDEO PRO', '<p>Elite video pro: Мы занимаемся производством видео-фотосъемки премиум-класса. Наша сплоченная дружная команда является лучшей в Казахстане. 22 года на рынке услуг. Elite video pro: Используем самое последнее оборудование такие как , кинокамеры Canon c100 , фотокамера Canon 5Ds, аэросъемка ( Dji Phantom 4 ) , операторский кран( от 3-х до 12 метров ), системы стабилизации Dji Ronin. Все операторы профессионалы прошедшие обучение в главном офисе в Алматы.</p>', '0', 0, 2, 5, 2, 77, 3, NULL, '2017-04-08 08:01:46', '2017-04-19 03:17:56'),
(164, 'A-Decor', '', '0', 0, 2, 5, 2, 78, 3, NULL, '2017-04-08 08:03:35', '2017-04-08 08:03:35'),
(165, 'RecStudio', '<p>&laquo;RecStudio&raquo;. Видео &mdash; это кинолента и живые воспоминания вашей жизни, что не теряет свою важность со временем, а наоборот, приобретает ценность годами. Я и моя команда будем искренне рады принять участие в самых прекрасных мероприятиях в вашей жизни и создать качественные и впечатлительные видео ролики для вас и ваших близких. Мы всегда идём в ногу со временем и в своей работе мы используем самые мощные аппараты, с помощью которых нам удаётся достичь наивысших результатов в видео индустрии. Доверьте нам ваши воспоминания и мы вас не подведём!</p>', '0', 0, 2, 5, 2, 79, 3, NULL, '2017-04-08 08:49:12', '2017-04-19 03:15:53'),
(167, '\"CROCK\"', '<p>Это совместная Украинско-Казахстанская рок группа. В составе команды: ударные, бас гитара (вокал), лидер-гитара (вокал), соло-гитара (вокал). В репертуар группы входят произведения, как собственного сочинения \"CROCK\", так и классики мирового рока, объединенной в cover проекте \"CROCK-road\", который состоит из песен таких известных рок-исполнителей как: Beatles, Eagles, Deep Purple, Nazareth, AC/DC, ZZ-top, Dire Straits, Guns and Roses, Roxett, Lynyrd Skynyrd, Eric Clapton, Tom Petty, BB-King, Zucchero, а также Российских и Украинских исполнителей: Песняры , ДДТ, ЧайФ, Ария, Синяя Птица, Веселые Ребята, Цветы, Чиж и К, ВВ, Табула Раса. Исключительно живая и добротная музыка 60 &mdash; 80-х годов в стиле blues, rock-n-roll, hard rock, pop-rock.</p>', '0', 0, 2, 1, 2, 80, 4, NULL, '2017-04-09 09:20:13', '2017-04-19 03:55:54'),
(168, '\"Show Time\"', '<p>Это молодая группа, состоящая из профессиональных и опытных исполнителей. Если вы ищете band, который украсит ваш праздник, будь то юбилей, свадьба, корпоратив или частная вечеринка, то вы на верном пути! Выступление команды &mdash; это исполнение самых горячих хитов всех времен, которое не оставит равнодушным даже самого взыскательного гостя. Тщательно учитывают формат мероприятия, интересы и пожелания заказчика, возрастные предпочтения публики. Вокалисты &mdash; это взрывной дуэт женского очарования и мужской харизмы на сцене, который раскачает любую аудиторию. Самые актуальные хиты на русском, английском, казахском языках! Никаких минусов и подложек &mdash; только живой звук!</p>', '0', 0, 2, 1, 2, 81, 4, NULL, '2017-04-09 09:22:07', '2017-04-19 03:57:21'),
(169, 'Лимузин \"Lincoln\"', '<p>Лимузин \"Lincoln\" белого цвета. Выезд на любые мероприятия.</p>', '0', 0, 2, 2, 2, 82, 4, NULL, '2017-04-09 10:30:37', '2017-04-19 03:59:48'),
(170, 'Mercedes — Benz S — klasse', '<p>Комплектация Long. Белого и черного цвета. Выезд на любые мероприятия.</p>', '0', 0, 2, 2, 2, 83, 4, NULL, '2017-04-09 10:32:47', '2017-04-19 04:00:27'),
(171, 'Лимузин \"Cadillac Escalade\"', 'Двадцати местный лимузин белого цвета.', '0', 0, 2, 2, 2, 84, 4, NULL, '2017-04-09 10:34:28', '2017-04-09 10:34:28'),
(173, 'Кортеж \"Kia Rio\"', '10 машин, цвет белый.\r\n\r\nПри заказе на более трех часов оформление в подарок.', '0', 0, 2, 2, 2, 85, 4, NULL, '2017-04-09 10:36:58', '2017-04-09 10:36:58'),
(174, 'Лимузин \"Карета\"', 'Обслуживание свадеб, выписка из роддома и другие торжества.', '0', 0, 2, 2, 2, 86, 4, NULL, '2017-04-09 10:39:34', '2017-04-09 10:39:34'),
(175, '\"VIP Club\"', '<p>Аренда VIP автомобилей: свадьбы, встречи, проводы, дни рождения, выписка из роддома, трансфер в аэропорт, вокзал.</p>', '0', 0, 2, 2, 2, 87, 4, NULL, '2017-04-09 10:41:39', '2017-04-19 04:02:59'),
(176, 'Toyota Camry, Toyota Prado', 'Цвет белый.\r\n\r\nВыезд на любые мероприятия.', '0', 0, 2, 2, 2, 88, 4, NULL, '2017-04-09 10:43:15', '2017-04-09 10:43:15'),
(177, 'Акимжан Шакиров', '<p>Профессиональный вокалист, разнообразный репертуар, исполнение авторских песен. Озвучит своим прекрасным исполнением любое Ваше мероприятие.</p>', '0', 0, 2, 3, 2, 89, 4, NULL, '2017-04-09 10:44:54', '2017-04-18 06:35:32'),
(178, 'Амин Ибраһим', '<p>Певец академическо &mdash; эстрадного жанра . Лауреат республиканских и международных конкурсов :</p>\r\n<p>\"Қарлығаш\" &mdash; Гран-при г. Актобе</p>\r\n<p>\"Айналайын\" &mdash; Гран-при г. Астана &nbsp;</p>\r\n<p>\"Дельфийские игры\" &mdash; золотая медаль, г.Степногорск</p>\r\n<p>\"Абай оқулары\" &mdash; лауреат 1 степени, г. Семей</p>\r\n<p>\"Ұлы мұра\" &mdash; лауреат 1 степени, г. Актобе</p>\r\n<p>\"Ақ көгершін\" &mdash; лауреат 1 степени, г. Кокшетау</p>\r\n<p>\"Классика\" &mdash; лауреат 2 степени, г. Актобе</p>', '0', 0, 2, 3, 2, 90, 4, NULL, '2017-04-09 10:47:29', '2017-04-18 06:34:43'),
(180, 'Трио \"Заңғар\"', '<p>В составе трио лауреаты республиканских и международных конкурсов &mdash; Хамзаев Ислам, Утемуратов Аманжол, Амин Ибраһим. Репертуар в академическом направлении.</p>', '0', 0, 2, 3, 2, 91, 4, NULL, '2017-04-09 10:51:38', '2017-04-18 06:35:21'),
(181, 'Шынтас пен Айнагуль', '<p>Қазақ әндерін нақышына келтіріп орындайтын республикамызға танымал отбасылық дуэт, қазақ эстрадасында сонымен қатар театр саласында өнер көрсетіп жүргендеріне 15 жылдай уақыт болды.</p>', '0', 0, 2, 3, 2, 92, 4, NULL, '2017-04-09 10:53:05', '2017-04-18 06:35:13'),
(182, 'Трио  \"Gold\"', '<p>Обладают прекрасными вокальными и хореографическими данными. Разнообразный репертуар. Мероприятия любого уровня.</p>', '0', 0, 2, 3, 2, 93, 4, NULL, '2017-04-09 10:55:17', '2017-04-18 06:35:02'),
(183, 'Мират Есетов', '<p>Музыкант 2007 &mdash; 2009 КазНАМ колледжінің &laquo;Вокал&raquo;, 2009 &mdash; 2013 Қазақ Ұлттық Өнер Университетінде &laquo;Театр, кино және теледидар&raquo; факультетінің муздрама театрының актері. 2012 жылы Астана қаласында қойылған &laquo;Сенің армандаған үйің&raquo; мюзиклінде жас елбасы ролін сомдады.</p>', '0', 0, 2, 3, 2, 94, 4, NULL, '2017-04-09 10:56:43', '2017-04-18 06:32:15'),
(184, 'Музбаева Майгуль', '<p>Т. Ахтанов атындағы облысық драма театрының актрисасы. 15 жылдан астам тәжірбиесі бар. Қыз ұзату, бесік той, тұсау кесу.</p>', '0', 0, 2, 3, 2, 95, 4, NULL, '2017-04-09 10:58:18', '2017-04-18 06:30:49'),
(185, 'Жоламан Жанабай', '<p>Қазақ еліне жаңа танылып келе жатырған жас Ақтөбелік әнші. Оның қоржынында біршама танымал әндермен қатар бірнеше жеке бейнебаян бар.</p>', '0', 0, 2, 3, 2, 96, 4, NULL, '2017-04-09 10:59:25', '2017-04-18 06:32:35'),
(186, 'Жанна Бикеева', '<p>Жанна Бикеева Занимается вокалом с 6 лет, в Актобе с 2004 года. Разнообразный репертуар: песни 80-90-х, современные и народные песни. Поет на казахском, русском, английском, узбекском языках.</p>', '0', 0, 2, 3, 2, 97, 4, NULL, '2017-04-09 11:00:48', '2017-04-18 06:55:58'),
(187, 'Айгерім Мамырова', '<p>Қазақ, орыс, ағылшын және араб тілінде ән айтатын жас әнші. Талантты әнші қыздың сахнада өнер көрсетіп жүргеніне 5 жылдан астам уақыт болды. Өнерпаздың қоржынында біршама танымал әндер мен жеке бейнебаяндар бар.</p>', '0', 0, 2, 3, 2, 98, 4, NULL, '2017-04-09 11:02:14', '2017-04-18 06:29:25'),
(188, 'Ерлан Отарбаев', '<p>Асаба, әнші.</p>', '0', 0, 2, 4, 2, 99, 4, NULL, '2017-04-09 11:03:33', '2017-04-18 06:40:10'),
(189, 'Дархан Рахымжан', '<p>Тележүргізуші, облыстық деңгейдегі салтанатты жиындар мен мерекелік кештер жүргізушісі, той асабасы. Әдептілік пен мәдениеттілікті сақтай отырып, түрлі қызықты ойын-конкурстармен той-қуанышыңызды жоғары деңгейде жүргізеді. Той-мерекені қазақ тілінде немесе қуаныш иесінің қалауына қарай әріптесімен бірге орыс тілдерінде жүргізеді. Телеведущий, ведущий различных мероприятий, корпоративов и частных вечеринок. Лицо телеканала &laquo;Казахстан &mdash; Актобе&raquo;, в прошлом &mdash; редактор тематических программ на республиканских каналах &laquo;Таң ТВ &raquo; и &laquo;НТК&raquo;. Языки проведения: казахский, русский (с очаровательной соведущей). Его программа включает в себя веселые игры, интересные конкурсы и массу положительных эмоций. Дархан и его очаровательная соведущая создадут атмосферу праздника и превратят ваш вечер в яркое шоу.</p>', '0', 0, 2, 4, 2, 100, 4, NULL, '2017-04-09 11:06:24', '2017-04-19 04:17:44'),
(190, 'Кужиев Карим', '<p>Начал профессиональную деятельность с 13 лет на телевидении. Проводит свадьбы, корпоративы, открытия, масштабные мероприятия, розыгрыши, различные проекты. Креативный подход к любому мероприятию, проведение на 2 языках, составление сценариев.</p>', '0', 0, 2, 4, 2, 101, 4, NULL, '2017-04-09 11:07:37', '2017-04-18 06:39:58'),
(191, 'Нұрсұлтан Назарғалиев', '<p>Асабалық кəсіпте 5 жыл. Тележүргізуші, журналист, жайдарманшы. Құрамда: беташаршы, звукоператор, əнші, барлық орта Азия аспаптарында композиция орындайтын күйші.</p>', '0', 0, 2, 4, 2, 102, 4, NULL, '2017-04-09 11:09:01', '2017-04-18 06:38:02'),
(192, 'Сисенов Асет', '<p>Асаба, шоумен, гитарист, актер. Қазақ тілінде, қазақтың керемет дәстүрлерімен нақыштап әдеби және әзіл сөзбен қалжыңдап, тамаша жанды дауыста ән салып, сағындырған әндеріңізді гитараның ырғағында тербелтіп, бір көңіл серпілтер &mdash; АСАБА, тойдың сәнін келтірері анық! Шақырылған қонақтардың сізге риза болып, тойдың өте жоғары деңгейге жеткізілуі, сізді еш өкіндірмесі анық!</p>', '0', 0, 2, 4, 2, 103, 4, NULL, '2017-04-09 11:10:38', '2017-04-18 06:39:30'),
(193, 'Сәрсенбекұлы Куатбек', '<p>Тәжірибелі асаба, жанды дауыста нақышын келтіріп ән салады.</p>', '0', 0, 2, 4, 2, 104, 4, NULL, '2017-04-09 11:11:47', '2017-04-18 06:39:19'),
(194, 'Мухит Нұрдәулетұлы', '<p>Әнші, асабалық тәжірибиесіне 5 жыл.</p>', '0', 0, 2, 4, 2, 105, 4, NULL, '2017-04-09 11:12:49', '2017-04-18 06:39:09'),
(195, 'Медеу Достаев', '<p>Режиссер, актер, продюсер театра сатиры \"Шымкент-шоу\". Ведущий свадеб на 2-х языках .&nbsp;</p>', '0', 0, 2, 4, 2, 106, 4, NULL, '2017-04-09 11:14:23', '2017-04-18 06:37:35'),
(196, 'Марат Достаев', '<p>Шоумен, актер сериалов, жюри в КВН \"Жайдарман\". В сумму гонорара входит: авиабилеты, гостиница, питание, транспорт по городу.</p>', '0', 0, 2, 4, 2, 107, 4, NULL, '2017-04-09 11:15:46', '2017-04-19 04:20:38'),
(197, 'Кали Бисикеев', '<p>2001 жылдан бастап асаба. Домбыра, баян, құдалық, қыз шығарып салу, беташар.</p>', '0', 0, 2, 4, 2, 108, 4, NULL, '2017-04-09 11:16:55', '2017-04-18 06:38:45'),
(198, 'Студия \"Dali\"', 'Профессиональная фото и видео съемка.', '0', 0, 2, 5, 2, 109, 4, NULL, '2017-04-09 11:18:53', '2017-04-09 11:18:53'),
(199, '\"Pro Photo Studio\"', '<p>&mdash; Фото</p>\r\n<p>&mdash; видео сьемка свадьбы</p>\r\n<p>&mdash; Услуги дизайна и монтажа</p>\r\n<p>&mdash; Пузырьки, дым, снег</p>\r\n<p>&mdash; Свадебные пригласительные на заказ</p>', '0', 0, 2, 5, 2, 110, 4, NULL, '2017-04-09 11:20:10', '2017-04-18 06:59:20'),
(200, 'M PRODUCTION VIDEO', '<p>Профессиональная съемка. Полностью меняют представление о свадебном видео. Это маленькая Вселенная, свадебного кино и если Вы попали в этот мир, то у Вас шикарный вкус, на отличные работы. В фильмах Вы не увидите скованности и стеснения, четко знают &mdash; как работать с парой, и при этом никогда не используют банальный сценарий.</p>', '0', 0, 2, 5, 2, 111, 4, NULL, '2017-04-09 11:21:26', '2017-04-18 06:36:26'),
(201, 'Юрий', 'Предоставление фото и видео услуг.\r\nИндивидуальный подход к каждому заказчику!', '0', 0, 2, 5, 2, 112, 4, NULL, '2017-04-09 11:22:35', '2017-04-09 11:22:35'),
(202, 'Султан Аралбаев', '<p>Әр түрлі видео-фотоның профессионалды түсіру: ADODE PREMIERE PRО, ADODE AFTER EFFECTS, ADODE PHOTOSHOP, ADODE LIGHTROOM программаларын қолданып, сапалы дәрежеде фото-видео монтаждау.</p>', '0', 0, 2, 5, 2, 113, 4, NULL, '2017-04-09 11:23:50', '2017-04-18 06:54:50'),
(203, 'Студия \"Корона\"', '<p>Cпециалисты студии готовы предложить каждому клиенту полный спектр услуг фото и видеосъемки. Команда высококлассных специалистов города Актобе: режиссеры, фотографы, видеооператоры, которые обладают первоклассным художественными вкусом, глубокими знаниями в данной области, а также высочайшим мастерством исполнения поставленных целей.</p>', '0', 0, 2, 5, 2, 114, 4, NULL, '2017-04-09 11:25:21', '2017-04-19 04:24:44'),
(204, 'Студия \"Rakhat\"', 'Это команда увлеченных, творческих и любящих свою работу профессионалов. Видео и фотосъемка — это основная специализация на протяжении 5-ти лет, многокамерная видеосъемка с операторским краном в формате Full HD придает большой объем, динамику и насыщенность вашему фильму, а так же квадрокоптер, который снимает с птичьего полета даря вашему фильму голливудские снимки. Располагая профессиональной аппаратурой и большим творческим потенциалом, следуя современным тенденциям съемки фото и видео, студия растет и развивается. Есть мнение, что собирать и бережно хранить нужно не вещи, а воспоминания. Пожалуй это и есть главное богатство, наши простые, но самые высокие человеческие ценности.\r\nРаботают по всем регионам РК.', '0', 0, 2, 5, 2, 115, 4, NULL, '2017-04-09 11:27:12', '2017-04-09 11:27:12'),
(205, 'Halima holding', 'Многообразие жанров съемки, одним из любимых является свадебная фотография!\r\nСвадьба — это один день, но с большой историей событий, маленьких и больших, смешных и эмоциональных. Команде фотографов очень нравится сохранять такие моменты на фотографиях, передавать эмоции. Потому что благодаря им фотографии становятся живыми, позитивными, как раз такими, как и должны быть.\r\n\r\nВидео — это язык, на котором команда видеографов говорит о красоте нашего мира, о том невыразимом, несказанном и прекрасном, о том что каждый из нас интересен и удивителен. Любят снимать детей, свадьбы, рекламные ролики и истории любви. У кого то они яркие и неудержимые, другие глубоко чувственны!', '0', 0, 2, 5, 2, 116, 4, NULL, '2017-04-09 11:29:20', '2017-04-09 11:29:20'),
(206, 'Студия \"Abyz\"', '<p>Профессионалы своего дела со стажем 5 лет:</p>\r\n<p>&mdash; ADOBE PREMIERE PRO CC</p>\r\n<p>&mdash; ADOBE LIGHTROOM</p>\r\n<p>&mdash; ADOBE PHOTOSHOP</p>\r\n<p>&mdash; ADOBE AFTER EFFECTS</p>\r\n<p>&mdash; VEGAS PRO</p>', '0', 0, 2, 5, 2, 117, 4, NULL, '2017-04-09 11:30:35', '2017-04-18 07:02:31'),
(207, 'Ербол Маханбет', '<p>Күйші, домбырашы. Басқа қалаларға шығу!</p>', '0', 0, 2, 6, 2, 118, 4, NULL, '2017-04-09 11:31:58', '2017-04-19 02:54:22'),
(208, 'Дания', 'Та самая, играющая на скрипке...', '0', 0, 2, 6, 2, 119, 4, NULL, '2017-04-09 11:33:22', '2017-04-09 11:33:22'),
(209, 'Ансамбль \"Мурагер\"', 'Талантливые ребята, играющие вот уже около 10 лет на казахских народных музыкальных инструментах. Отличаются оригинальностью подбора, техническими качествами, способствующим восприятию, как музыкантов — профессионалов, так и простых слушателей. Репертуар народная и современная музыка.', '0', 0, 2, 6, 2, 120, 4, NULL, '2017-04-09 11:34:49', '2017-04-09 11:34:49'),
(210, 'Квартет \"Классик\"', 'Состав из четырех человек: скрипка, альт, фортепиано, аккордион.\r\n\r\nУкрасят ваш праздник музыкальным оформлением!', '0', 0, 2, 6, 2, 121, 4, NULL, '2017-04-09 11:36:11', '2017-04-09 11:36:11'),
(211, 'Әлібек Ынтағали', 'Виртуоз, музыкант қазақтың қара домбырасымен қатар сыбызғы, саз сырнай дауылпаз т.б. көптеген аспаптарда ойнайтын біртуар азамат.', '0', 0, 2, 6, 2, 122, 4, NULL, '2017-04-09 11:38:31', '2017-04-09 11:38:31'),
(212, '\"Достық сазы\" ансамблі', 'Ғ. Жұбанова атындағы облыстық филармония жанынан құрылған \"Достық сазы\" фольклорлық ансамблі.', '0', 0, 2, 6, 2, 123, 4, NULL, '2017-04-09 11:40:14', '2017-04-09 11:40:14'),
(213, 'Акбота (кобыз)', 'Талантливая девушка, играющая на кобызe. Украсит своей прекрасной игрой любое ваше событие.', '0', 0, 2, 6, 2, 124, 4, NULL, '2017-04-09 11:41:31', '2017-04-09 11:41:31'),
(214, 'Илья Цибульский', '<p>Необычный саксофонист, играющий без пальцев. Илья не только играет, но и поет свои авторские песни, музыку и слова к которым пишет сам. Может приукрасить как и казахское мероприятие казахскими композициями, так и русские банкеты, свадьбы и.т.д.</p>', '0', 0, 2, 6, 2, 125, 4, NULL, '2017-04-09 11:42:51', '2017-04-18 06:23:07'),
(215, 'Аниматоры «Радуга — Актобе»', 'Агентство по организации праздников  с радостью поможет в  проведении детского праздника, дня рождения или поздравления с выездом. Вы найдете огромный выбор программ, большая галерея персонажей детских мультфильмов и сказок, которая постоянно пополняется.', '0', 0, 2, 7, 2, 126, 4, NULL, '2017-04-09 11:44:04', '2017-04-09 11:44:04'),
(216, 'Песочное и звездное шоу!', 'Первое в Актобе Песочное Шоу. Данный вид никого не оставит равнодушным и подарит массу позитивных эмоций. На ваших глазах рождаются картины из песка плавно перетекающие одна в другую, создавая единую сюжетную линию. Песочное шоу станет прекрасным подарком на день рождения, юбилей, свадьбу, новый год, а также украсит любую концертную площадку, корпоративное мероприятие. В темноте словно светлячки  зажигаются огоньки света, образуя на специальном холсте удивительные картины, которые сменяются одна за другой, образуя единую смысловую историю.\r\nУвлекательное звездное шоу является современным оригинальным искусством, в котором за считанные минуты на тёмном холсте художник пишет невидимую картину на вращающемся мольберте. Неважно корпоративная ли у Вас вечеринка, юбилей или свадьба, звездное шоу сделает незабываемым любое торжество. Сказочный процесс ее создания увлечет зрителей Вашего мероприятия, а конечный результат поразит всех своей красотой. Что же рисует художник остается загадкой до самого финала шоу. Картина проявляется только в конце выступления, когда художник эффектно забрасывает полотно золотым или серебряным песком, являя собравшимся портрет именинника, молодоженов или фирменный знак.  Звездное шоу приятно поразит всех Ваших гостей! А после сияющая картина станет оригинальным украшением интерьера и напоминанием о чудесном дне!', '0', 0, 2, 7, 2, 127, 4, NULL, '2017-04-09 11:46:28', '2017-04-09 11:46:28'),
(217, 'Татевик \"Make up\"', 'Занимается визажем 2 года.\r\n\r\nВозможен выезд.', '0', 0, 2, 9, 2, 128, 4, NULL, '2017-04-09 11:47:42', '2017-04-09 11:47:42'),
(218, 'Студия \"KeratinKaz\"', '<p>Полный спектр салонных услуг:</p>\r\n<p>- Прически</p>\r\n<p>- Макияж</p>\r\n<p>- Наращивание ресниц</p>\r\n<p>- Шугаринг</p>\r\n<p>- Улиткотерапия</p>\r\n<p>- Маникюр</p>\r\n<p>- Кератиновое выпремление + лечение волос</p>', '0', 0, 2, 9, 2, 129, 4, NULL, '2017-04-09 11:49:00', '2017-04-19 03:06:53'),
(219, 'Елена', '<p>Стаж работы 3,5 года. Обучалась и повышала квалификацию у мастеров Казахстана и России: Гоар Аветисян (Москва), Олег Гуськов (Астана), Ольга Романова (Москва). В арсенале услуг имеется: макияж любой сложности, моделирование бровей, обучение в рамках освоения профессии \"Визажист\", обучение для себя \"Сама себе визажист\" и авторский курс по моделированию бровей &mdash; \"Архитектура бровей\".</p>', '0', 0, 2, 9, 2, 130, 4, NULL, '2017-04-09 11:50:28', '2017-04-19 03:03:38'),
(220, 'Абилова Назгуль', '<p>Опыт работы визажистом с июня 2015 года.</p>\r\n<p>Квалификации: Базовый курс-школа Makeupstodio (сертификат международного образца, май 2015 г.)</p>\r\n<p>Повышение квалификации , мастер-классы:</p>\r\n<p>&mdash; Нурмухамедова Зарина (июнь 2015 г.)</p>\r\n<p>&mdash; Абдулаева Диля (июнь 2015 г.)</p>\r\n<p>&mdash; Романова Ольга (март 2016 г.)</p>\r\n<p>&mdash; Санди Бексырга (январь 2017 г.)</p>', '0', 0, 2, 9, 2, 131, 4, NULL, '2017-04-09 11:51:59', '2017-04-19 04:30:45'),
(221, '\"Gloria\"', 'Свадебные платья, вечерние наряды, аксессуары.\r\n\r\nПроизводство Турция.', '0', 0, 2, 10, 2, 132, 4, NULL, '2017-04-09 11:53:20', '2017-04-09 11:53:20'),
(222, '\"Аққу\"', '<p>&mdash; Қыз ұзату</p>\r\n<p>&mdash; Үйлену тойы</p>\r\n<p>&mdash; Беташар</p>\r\n<p>&mdash; Свадьбы</p>\r\n<p>&mdash; Юбилеи</p>\r\n<p>&mdash; Корпоративы</p>\r\n<p>&mdash; Дни рождения</p>\r\n<p>&mdash; Вечеринки</p>', '0', 0, 2, 11, 2, 133, 4, NULL, '2017-04-09 11:54:34', '2017-04-19 03:11:50'),
(223, 'Шоу — балет \"Айша бибі\"', '<p>Тойларыңызға ерекше әсем билер мен ең әдемі рәсімдер! \"Қыз ұзату\", \"Тұсау кесер\", \"Сыңсу\", \"Беташар\" қызметтерімен тойыңыздың сәнін келтіруге дайын.</p>', '0', 0, 2, 11, 2, 134, 4, NULL, '2017-04-09 11:56:11', '2017-04-19 04:31:58'),
(224, 'Шоу балет \"Арт Сункар\"', '3 жылдан артық тәжірибесі бар қыздардан құралған мың бұралған бишілер. Репертуарында қазақша, стилизованный қазақша, бразилия, шығыс,  латино, световой би, келін алып шығу және неон вальсімен тойыңыздың сәнін келтіріп, ажарын аша түседі.', '0', 0, 2, 11, 2, 135, 4, NULL, '2017-04-09 11:57:34', '2017-04-09 11:57:34'),
(225, 'Шоу — балет \"Ай меру\"', '<p>Қазақша, жастар биі, испан биі, заманауи билерімен халықтың алдында жүргеніне 1 жылдан астам уақыт болды.</p>', '0', 0, 2, 11, 2, 136, 4, NULL, '2017-04-09 11:58:51', '2017-04-19 03:11:13'),
(226, '\"Шабыт шоу\"', '<p>Филиал в городе Актобе, руководитель Дарбаева Галия Жумагалиевна, начали свою деятельность в мае 2016 года, в составе 10 девушек. Танцы: казахский, индийский, цыганский (с гостями), самбо (светодиодное), андижанский, вальс . Сопровождение, встреча гостей, беташар.</p>', '0', 0, 2, 11, 2, 137, 4, NULL, '2017-04-09 12:00:44', '2017-04-19 04:33:29'),
(227, 'Шоу — балет \"Самрук\"', '<p>&mdash; Яркие номера</p>\r\n<p>&mdash; Театрализованный выход невесты</p>', '0', 0, 2, 11, 2, 138, 4, NULL, '2017-04-09 12:01:49', '2017-04-19 03:13:07'),
(228, 'Шоу — балет \"Асылым\"', '<p>Поднимут настроение своими красивыми танцами, закружат в свадебном танце, все на профессиональном уровне.</p>\r\n<p>&mdash; Выход невесты</p>\r\n<p>&mdash; Яркие номера</p>\r\n<p>&mdash; Театрализованный выход невесты</p>\r\n<p>&mdash; Инструментальное выступление</p>\r\n<p>&mdash; Флешмоб для друзей жениха и невесты&nbsp;</p>', '0', 0, 2, 11, 2, 139, 4, NULL, '2017-04-09 12:03:01', '2017-04-19 03:10:00'),
(229, '\"Комплимент\"', 'Изготовление бонбоньерок, пригласительные открытки, тойбастар и многое другое. Индивидуальный дизайн.', '0', 0, 2, 13, 2, 140, 4, NULL, '2017-04-09 12:04:29', '2017-04-09 12:04:29'),
(230, '\"Pro Photo Studio\"', '<p>&mdash; Фото</p>\r\n<p>&mdash; видео сьемка свадьбы</p>\r\n<p>&mdash; Услуги дизайна и монтажа</p>\r\n<p>&mdash; Пузырьки, дым, снег</p>\r\n<p>&mdash; Свадебные пригласительные на заказ</p>', '0', 0, 2, 13, 2, 141, 4, NULL, '2017-04-09 12:05:50', '2017-04-18 07:00:04'),
(231, '\"Anapin\" photo studio', '<p>&mdash; Фотосьемка свадеб</p>\r\n<p>&mdash; Love Story</p>\r\n<p>&mdash; Детей</p>\r\n<p>&mdash; Создание фотокниг</p>\r\n<p>&mdash; Виньетки</p>\r\n<p>&mdash; Пригласительные</p>\r\n<p>&mdash; Аренда мольбертов</p>', '0', 0, 2, 13, 2, 142, 4, NULL, '2017-04-09 12:07:00', '2017-04-18 07:13:13'),
(232, '\"AikerimArt\"', 'Изготовление бонбоньерок, обертки на шоколад, магниты, подарки с фотошоколадками, фотопазлы, визитки, сертификаты, флаера, дизайн, список рассадки гостей, 101 причина, фотобутафория, различные значки для кудалар, топперы, наклейки.', '0', 0, 2, 13, 2, 143, 4, NULL, '2017-04-09 12:08:46', '2017-04-09 12:08:46'),
(233, 'Студия \"Dali\"', 'Профессиональная фото и видео съемка.', '0', 0, 2, 14, 2, 144, 4, NULL, '2017-04-09 12:10:02', '2017-04-09 12:10:02'),
(234, '\"Pro Photo Studio\"', '<p>&mdash; Фото</p>\r\n<p>&mdash; видео сьемка свадьбы</p>\r\n<p>&mdash; Услуги дизайна и монтажа</p>\r\n<p>&mdash; Пузырьки, дым, снег</p>\r\n<p>&mdash; Свадебные пригласительные на заказ</p>', '0', 0, 2, 14, 2, 145, 4, NULL, '2017-04-09 12:11:11', '2017-04-18 06:57:57'),
(235, 'Юрий', 'Предоставление фото и видео услуг.\r\nИндивидуальный подход к каждому заказчику!', '0', 0, 2, 14, 2, 146, 4, NULL, '2017-04-09 12:12:21', '2017-04-09 12:12:21'),
(236, 'Султан Аралбаев', '<p>Әр түрлі видео-фотоның профессионалды түсіру: ADODE PREMIERE PRО, ADODE AFTER EFFECTS, ADODE PHOTOSHOP, ADODE LIGHTROOM программаларын қолданып, сапалы дәрежеде фото-видео монтаждау.</p>', '0', 0, 2, 14, 2, 147, 4, NULL, '2017-04-09 12:13:33', '2017-04-18 06:57:00'),
(237, 'Студия  \"Корона\"', 'Cпециалисты студии  готовы предложить каждому  клиенту полный спектр услуг фото и видеосъемки. Команда высококлассных специалистов города Актобе: режиссеры, фотографы, видеооператоры, которые обладают первоклассным художественными вкусом, глубокими знаниями в данной области, а также высочайшим мастерством исполнения поставленных целей.', '0', 0, 2, 14, 2, 148, 4, NULL, '2017-04-09 12:14:50', '2017-04-09 12:14:50'),
(238, 'Anapin photo studio', '<p>&mdash; Фотосьемка свадеб</p>\r\n<p>&mdash; Love Story</p>\r\n<p>&mdash; Детей</p>\r\n<p>&mdash; Создание фотокниг</p>\r\n<p>&mdash; Виньетки</p>\r\n<p>&mdash; Пригласительные</p>\r\n<p>&mdash; Аренда мольбертов</p>', '0', 0, 2, 14, 2, 149, 4, NULL, '2017-04-09 12:15:58', '2017-04-19 03:15:21'),
(239, 'Студия \"Rakhat\"', '<p>Это команда увлеченных, творческих и любящих свою работу профессионалов. Видео и фотосъемка &mdash; это основная специализация на протяжении 5-ти лет, многокамерная видеосъемка с операторским краном в формате Full HD придает большой объем, динамику и насыщенность вашему фильму, а так же квадрокоптер, который снимает с птичьего полета даря вашему фильму голливудские снимки. Располагая профессиональной аппаратурой и большим творческим потенциалом, следуя современным тенденциям съемки фото и видео, студия растет и развивается. Есть мнение, что собирать и бережно хранить нужно не вещи, а воспоминания. Пожалуй это и есть главное богатство, наши простые, но самые высокие человеческие ценности. Работают по всем регионам РК.</p>', '0', 0, 2, 14, 2, 150, 4, NULL, '2017-04-09 12:17:33', '2017-04-19 04:36:12'),
(240, '\"Halima holding\"', '<p>Многообразие жанров съемки, одним из любимых является свадебная фотография! Свадьба &mdash; это один день, но с большой историей событий, маленьких и больших, смешных и эмоциональных. Команде фотографов очень нравится сохранять такие моменты на фотографиях, передавать эмоции. Потому что благодаря им фотографии становятся живыми, позитивными, как раз такими, как и должны быть.</p>', '0', 0, 2, 14, 2, 151, 4, NULL, '2017-04-09 12:19:24', '2017-04-19 04:36:37'),
(241, 'Студия \"Abyz\"', '<p>Профессионалы своего дела со стажем 5 лет:</p>\r\n<p>&mdash; ADOBE PREMIERE PRO CC</p>\r\n<p>&mdash; ADOBE LIGHTROOM</p>\r\n<p>&mdash; ADOBE PHOTOSHOP</p>\r\n<p>&mdash; ADOBE AFTER EFFECTS</p>\r\n<p>&mdash; VEGAS PRO</p>', '0', 0, 2, 14, 2, 152, 4, NULL, '2017-04-09 12:20:27', '2017-04-18 07:03:17'),
(242, 'Projector Band', '', '0', 0, 2, 1, 2, 153, 4, NULL, '2017-04-09 23:53:04', '2017-04-09 23:53:04'),
(243, 'Royal Flush Band кавер-группа', 'Royal Flush Band – устроят самое настоящее шоу на любой площадке. Вокалисты кавер – группы большие профессионалы своего дела, их мастерство и приятный тембр голоса будут радовать ваш слух, а тело невольно будет стремиться к танцу! Кавер – группа Royal Flush Band – это круглосуточная поставка хорошего настроения!', '0', 0, 2, 1, 2, 154, 4, NULL, '2017-04-09 23:55:32', '2017-04-09 23:55:32'),
(244, 'TOP BAND', '«TOP BAND»-музыкальный коллектив, исполняющий современную танцевальную музыку, а также лучшие образцы хитов, уже ставших классикой мировой эстрады. Гармоничное сочетание репертуара, звучания и сценического образа группы делают ее неподражаемым музыкальным украшением любого праздника. Коллектив отличается неординарным подходом к выступлениям.', '0', 0, 2, 1, 2, 155, 4, NULL, '2017-04-09 23:56:37', '2017-04-09 23:56:37'),
(245, 'Toyota Land Cruiser Prado 150, 200', '<p>Прокат белых джипов Тойота на свадьбу и другие торжества. Прокат белых джипов Toyota Land Cruiser Prado 150, 200. В наличии более 8 джипов в идеальном состоянии. Закажите себе один головной джип или кортеж из нескольких белых джипов на вашу свадьбу или на другое памятное событие! Гарантируем высокий уровень обслуживания, пунктуальность и самые низкие цены в городе.</p>', '0', 0, 2, 2, 2, 156, 4, NULL, '2017-04-09 23:58:59', '2017-04-19 04:37:54');
