(246, 'Волга', '<p>Прокат Газ &mdash; 21 &laquo;Волга&raquo; на свадьбу &ndash; это идеальное, выгодное и неординарное решение, подчеркивающее Вашу индивидуальность, хороший вкус, статус и ценящих удобство. Также обслуживаем: Выписки из роддома; Вип-такси до аэропорта/ЖД вокзала и встреча с аэропорта/ЖД вокзала.</p>', '0', 0, 2, 2, 2, 157, 4, NULL, '2017-04-10 00:00:27', '2017-04-19 04:38:26'),
