(251, 'Қызғалдақ', '<p>Мерей тойдың көркін келтіріп, әсем әнмен тербетуге ат салысатын әнші қыздарыңыз! Репертуарда &laquo;Саржайлау&raquo;, &laquo;Қазақстаным алға!&raquo;, &laquo;Қайдасың?&raquo;, &laquo;Асыл досым&raquo;, &laquo;Ару ғұмыр&raquo;, &laquo;Ана жүрегі&raquo;, &laquo;Арнадым саған әнімді&raquo;, &laquo;Өмір өзен&raquo;, &laquo;Жұбайлар жыры&raquo;, &laquo;Тойға тілек&raquo; сияқты әндер бар.</p>', '0', 0, 2, 3, 2, 162, 4, NULL, '2017-04-10 00:09:11', '2017-04-19 04:39:54'),
(252, 'Кәусар дуэті', '', '0', 0, 2, 3, 2, 163, 4, NULL, '2017-04-10 00:10:11', '2017-04-10 00:10:11'),
(253, 'Маэстро', '', '0', 0, 2, 3, 2, 164, 4, NULL, '2017-04-10 00:11:06', '2017-04-10 00:11:06'),
(254, 'Нурбол Темиргалиев', '<p>Нурбол Темиргалиев солист КО им. К. Байжанова (филармония г. Караганды). Классический и эстрадный вокал. Казахский, Русский, Итальянский репертуар.</p>', '0', 0, 2, 3, 2, 165, 4, NULL, '2017-04-10 00:12:24', '2017-04-19 04:40:31'),
(255, 'Алибек Саликов', '<p>Хотите услышать песни любимых исполнителей на своем празднике? Энергичный и харизматичный Алибек Саликов с удовольствием исполнит их для вас и ваших гостей. Он дарит людям хорошее настроение, и поет всегда только живым голосом. В репертуаре артиста &mdash; современная популярная музыка, хиты разных лет, а также собственное творчество. Выступление артиста на вашем торжестве сделает событие ярким и запоминающимся. Алибека Саликова отличает исполнение и только живым голосом, артист готов петь для вас весь вечер, а еще &mdash; он знает, как удержать зал, чем заинтересовать всех участников праздника, работая с каждым гостем. Вся его жизнь &mdash; музыка. На песни Алибека сняты клипы в Москве и Казахстане. В общем, за плечами артиста большой опыт концертно &mdash; гастрольной, клубной и ресторанной деятельностей. Помимо выступлений, Алибек Саликов имеет собственную студию &ldquo;Salikoff Production&rdquo;, где занимается созданием аранжировок, сочинением музыки для тв и радио, съёмками видеоклипов и т. д.</p>', '0', 0, 2, 3, 2, 166, 4, NULL, '2017-04-10 00:13:47', '2017-04-19 04:41:26'),
