(259, 'Ксения Готовская', 'Здравствуйте!\r\nМеня зовут Ксения Готовская, занимаюсь организацией и проведением мероприятий 9 лет. Профессиональная организация и проведение мероприятий в современном формате. Без пошлости, заезженных конкурсов и избитых стишков. Предложу интересные концепции мероприятий со свежими конкурсами, интерактивами, флешмобами и красивыми церемониями. Русский и английский языки конферанса.', '0', 0, 2, 4, 2, 170, 4, NULL, '2017-04-10 00:18:35', '2017-04-10 00:18:35'),
(260, 'Вероника Наместникова', 'Ведущая, поэт — песенник, сценарист — Вероника Наместникова.\r\nОрганизация и проведение мероприятий (классика, стилизованные), написание сценариев, написание поздравительных стихов и текстов песен, исполнение каверов известных произведений.', '0', 0, 2, 4, 2, 171, 4, NULL, '2017-04-10 00:19:34', '2017-04-10 00:19:34'),
(261, 'Вальдемар', 'Отличный Ведущий для Вашего мероприятия! Все самые актуальные виды проведения праздника.\r\n\r\nМега Дед мороз!', '0', 0, 2, 4, 2, 172, 4, NULL, '2017-04-10 00:21:24', '2017-04-10 00:21:24'),
(262, 'Аргын Нурашев', '', '0', 0, 2, 4, 2, 173, 4, NULL, '2017-04-10 00:22:58', '2017-04-10 00:22:58'),
(263, 'Аян Амамбаев', 'SHOWMAN\r\nЛюблю, то дело, которым занимаюсь. Всегда подхожу к любому мероприятию с душой, благодаря чему у гостей остаются только позитивные эмоции и воспоминания!', '0', 0, 2, 4, 2, 174, 4, NULL, '2017-04-10 00:24:08', '2017-04-10 00:24:08'),
(264, 'Наталья Баянова', '', '0', 0, 2, 4, 2, 175, 4, NULL, '2017-04-10 00:25:14', '2017-04-10 00:25:14'),
(265, 'Мерей Калиаскар', '<p>Ведущий в концертном объединении им. Кали Байжанова. Журналист-Телеведущий. Язык ведения: казахский, русский Можете ли вы представить себе современную свадьбу или юбилей без хорошего ведущего праздника? Конечно, нет, ведь это человек, который задает тон торжеству влюбленных.</p>', '0', 0, 2, 4, 2, 176, 4, NULL, '2017-04-10 00:26:27', '2017-04-19 04:43:58'),
(266, 'Марат Оспанов', '', '0', 0, 2, 4, 2, 177, 4, NULL, '2017-04-10 00:28:40', '2017-04-10 00:28:40'),
(267, 'Куат Шаншарбаев', '<p>Ведущий, шоумен Куат Шаншарбаев, опыт работы почти 10 лет. Язык ведения: русский (свободно), казахский (разговорный), английский (по сценарию). Стиль ведения: интерактивный (постоянное общение с публикой).</p>', '0', 0, 2, 4, 2, 178, 4, NULL, '2017-04-10 00:30:25', '2017-04-19 04:44:31'),
(268, 'Кирилл Куликов', 'Свадебное видео в Караганде, Астане и других городах Казахстана. Мы ориентированы на создание качественного и индивидуального свадебного видео. Нас выбирают за современный стиль съемки, высококачественный монтаж и приятную атмосферу во время свадебного дня. Сниматься у нас легко и приятно!', '0', 0, 2, 5, 2, 179, 4, NULL, '2017-04-10 01:20:46', '2017-04-10 01:20:46'),
(269, 'Бараев Рустам', 'Качественное видео, по приемлемым ценам!', '0', 0, 2, 5, 2, 180, 4, NULL, '2017-04-10 01:21:53', '2017-04-10 01:21:53'),
(270, 'Bekmurza Brothers', '', '0', 0, 2, 5, 2, 181, 4, NULL, '2017-04-10 01:22:43', '2017-04-10 01:22:43'),
(271, 'Олжас Устемиров', 'Съемка свадебного мероприятия, Қыз ұзату – Проводы, Дня рождения и других торжественных событий в любом городе Казахстана.', '0', 0, 2, 5, 2, 182, 4, NULL, '2017-04-10 01:27:02', '2017-04-10 01:27:02'),
(272, 'Gabit Kyraubaev', '', '0', 0, 2, 5, 2, 183, 4, NULL, '2017-04-10 01:28:06', '2017-04-10 01:28:06'),
(273, 'Абай Ашимов', 'Здравствуйте, я Абай Ашимов! \r\n\r\nЯ с радостью готов предложить вам свои услуги в Караганде.\r\n\r\nА именно, съемку свадебного видео, lovestory, Қыз Ұзату на профессиональном оборудовании в HD-качестве.\r\n\r\nВедь свадьба — это один из самых ярких моментов в жизни. А услуги видеооператора (видеографа) придутся как нельзя кстати.\r\n\r\nВаш свадебный фильм запечатлит самые яркие и счастливые моменты, сохранит атмосферу радости и будет радовать вас и ваших близких даже спустя годы.', '0', 0, 2, 5, 2, 184, 4, NULL, '2017-04-10 01:30:01', '2017-04-10 01:30:01'),
(274, 'Дуэт ДиАР', '', '0', 0, 2, 6, 2, 185, 4, NULL, '2017-04-10 01:34:05', '2017-04-10 01:34:05'),
(275, 'Трио МЕЦЦО', 'Трио МЕЦЦО для вашего торжества:\r\n\r\nВстреча Гостей\r\nПредложение руки и сердца,\r\nПризнание в любви,\r\nПримирение,\r\nПоздравление с днем рождения,\r\nВыписка из роддома\r\nВыезд к гостям на домашние праздники.', '0', 0, 2, 6, 2, 186, 4, NULL, '2017-04-10 01:35:17', '2017-04-10 01:35:17'),
(276, 'Людмила Пропищан', 'Очаровательная скрипка для вашего торжества:\r\n\r\nПредложение руки и сердца,\r\nПризнание в любви,\r\nПримирение,\r\nПоздравление с днем рождения,\r\nВыписка из роддома\r\nВыезд к гостям на домашние праздники', '0', 0, 2, 6, 2, 187, 4, NULL, '2017-04-10 01:36:16', '2017-04-10 01:36:16'),
(277, 'Айгуль Аужанова', 'Аужанова Айгуль Жаксылыковна – магистр искусств. С отличием закончила Казахскую национальную консерваторию имени Курмангазы. Является лауреатом международных и республиканских конкурсов, таких как: Международный фестиваль-конкурс «Шабыт», Республиканский конкурс имени Курмангазы, Республиканский конкурс имени Таттимбета. Гастролировала с концертами по разным городам Казахстана, как в составе оркестров, так и сольно, а также в такие страны как: Англия, США, Южная Корея, КНР, Румыния, Бельгия, Австрия, Германия, Россия, Турция, Франция, Белоруссия.\r\n\r\nСегодня Айгуль является педагогом специализированной музыкальной школы интернат, и концертмейстером группы Кобыз Академического оркестра казахских народных инструментов имени Таттимбета. Ежегодно дает сольные концерты в школах Караганды, и в концертном зале «Шалкыма» в сопровождении оркестра. Активная концертная деятельность, виртуозное владение инструментом, харизматичность – нашли отклики в сердцах поклонников творчества Айгуль.\r\n\r\nВашему вниманию представляются сольные номера, для того чтобы Вы могли насладиться разнообразным звучанием   инструмента.', '0', 0, 2, 6, 2, 188, 4, NULL, '2017-04-10 01:38:41', '2017-04-10 01:38:41'),
(278, 'Нона Васенцова скрипка', '', '0', 0, 2, 6, 2, 189, 4, NULL, '2017-04-10 01:42:12', '2017-04-10 01:42:36'),
(279, 'Мөлдір Юламанова', 'Сопровождение танца молодоженов мыльными пузырями, искусственным снегом, дымом, фейерверками. Дорожка для молодых с холодным огнем.', '0', 0, 2, 7, 2, 190, 4, NULL, '2017-04-10 01:45:15', '2017-04-10 01:45:15'),
(280, 'ART light', '<p>Art Light &mdash; лазерное и световое шоу Наше световое и лазерное шоу сделают любое торжество сказочным и неповторимым! Лазерное анимационное шоу; Световая Картина; Лазерная дискотека; Тяжелый дым.</p>', '0', 0, 2, 7, 2, 191, 4, NULL, '2017-04-10 01:47:13', '2017-04-19 04:51:25'),
(281, 'Шоу пародий', '<p>Шоу пародий звезды России и зарубежа. Переодевание гостей Выкуп невесты проводит Верка Сердючка Работа в интерактиве корпоратив, свадьба, юбилей, день рождения, любой сабантуй: Пугачева, Аллегрова, Ратару, Распутина, Кадешева, Сердючка, Пьеха, Басков, Киркоров, Лионьтьев, Псай, Шер, Глория Гейгер, Плавали, Долина. А также создание новых образов. Работа в дуэте с ведущими.</p>', '0', 0, 2, 7, 2, 192, 4, NULL, '2017-04-10 01:48:25', '2017-04-19 04:52:57'),
(283, 'Лазерное шоу', '<p>Лазерное шоу. СОПРОВОЖДЕНИЕ ТАНЦА МОЛОДОЖЕНОВ ЛАЗЕРНЫЙ КЛИП ДИСКОТЕЧНОЕ ШОУ.</p>', '0', 0, 2, 7, 2, 196, 4, NULL, '2017-04-10 03:20:07', '2017-04-19 04:53:43'),
(284, 'Бумажное шоу для взрослых мероприятий -«Бумер», для детских «Пришельцы»', '<p>Здравствуйте! Могу Вам предложить оригинальное шоу для танцевального перерыва, дискотеки, детского праздника. Бумажное шоу для взрослых мероприятий &laquo;Бумер&raquo;, для детских &laquo;Пришельцы&raquo;. В шоу входит: 2 аниматора-танцора, бумажная пушка, блестящие флаги и огромный 5-м сачок, 3 мешка бумажного серпантина, динамичная музыка. Взрослое и детское шоу отличаются костюмами аниматоров и музыкальной подборкой. Во взрослом шоу у аниматоров серебристо-белые клубные костюмы, на детском шоу используются костюмы инопланетян.</p>', '0', 0, 2, 7, 2, 197, 4, NULL, '2017-04-10 03:22:05', '2017-04-19 04:54:24'),
(285, 'Тяжелый Дым', '<p>Сопровождение первого танца молодоженов: Тяжелым дымом на сухом льду; Тяжелым дымом на жидкости; Мыльными пузырями; Снегом; Свето музыкой; Сердцем; с подсветкой; Холодным фейерверком; Конфетти.</p>', '0', 0, 2, 7, 2, 198, 4, NULL, '2017-04-10 03:25:03', '2017-04-19 04:55:26'),
(286, 'Sugar Dance', '', '0', 0, 2, 7, 2, 199, 4, NULL, '2017-04-10 03:26:01', '2017-04-10 03:26:01'),
(287, 'Sandland', 'Студия рисования песком SandLand предлагает оригинальное  Песочное шоу на Вашу свадьбу!  Песочное шоу никого не оставит равнодушным, растрогает Вас до слёз и принесёт Вам массу положительных эмоций!  Песочные картины создаются прямо на ваших глазах, плавно перетекающие одна в другую, создавая единую сюжетную линию. Каждое Песочное шоу — это уникальное, эксклюзивное шоу, созданное специально для Вас!\r\nПесочное шоу украсит любое мероприятие от небольшой частной вечеринки до торжественной свадьбы! Включите в проведения свадьбы что-то новое, чтобы само торжество получилось красочным и незабываемым!', '0', 0, 2, 7, 2, 200, 4, NULL, '2017-04-10 03:27:49', '2017-04-10 03:27:49'),
(288, 'Janelle', '<p>Приглашаем вас провести банкет и мероприятие на высоком уровне! У нас большой роскошный зал до 250 персон. Предварительный заказ &mdash; большие скидки!</p>', '0', 0, 2, 8, 2, 201, 4, NULL, '2017-04-10 03:31:44', '2017-04-19 04:56:20'),
(289, 'Салон красоты Одиссея', '<p>Маникюр, педикюр (SPA, аппаратный), покрытие гель-лаком, лечение ногтей, наращивание ногтей (акрил, гель), наращивание ресниц, косметология, парикмахерские услуги, бронзирование (автозагар), моделирование, SPA, окрашивание бровей, электроэпиляция (удаление нежелательных волос навсегда), воск, шугаринг, дизайн и роспись ногтей, микроблейдинг, татуаж.</p>', '0', 0, 2, 9, 2, 202, 4, NULL, '2017-04-10 03:33:14', '2017-04-19 04:59:47'),
(290, 'Балжан Сембекова Свадебный стилист — визажист', '<p>Свадебный стилист makeup &amp; hair Сембекова Балжан. Так же предлагаю вам качественное наращивание ресниц, любая процедура ПМ по последней технологии (брови, веки, губы), качественный маникюр и гель покрытие. Работаем только с люксовыми материалами!</p>', '0', 0, 2, 9, 2, 203, 4, NULL, '2017-04-10 03:34:28', '2017-04-19 05:00:41'),
