(295, 'Алтын-Ай', '<p>Беташар- Шаңырак, Вуаль Любой танец: Казахский танец, Узбекский танец, Уйгурский танец, Цыганский танец, Восточный танец, Испанский танец, Лезгинка, Карнавальная самба, Карнавальное представление в масках, Карнавальный, восток в шляпах, первый танец молодоженов на пуантах, Танец, Тойбастар, Танец Қара жорға (с гостями), Обряд на Қыз Ұзату (песня, текстовка, шанырак, вывод жениха), Обряд Сыңсу (танец, песня, ақжол, сәукеле, камзол), Обряд Тұсау кесер (танец, текстовка, ақжол, Радуга), Обряд Кұда қарсы алу (песня,арқан керу).</p>', '0', 0, 2, 11, 2, 208, 4, NULL, '2017-04-10 03:56:06', '2017-04-19 05:09:40'),
