(297, 'Шоу-балет Феникс', 'Шоу-балет Феникс предлагает: танцевальные номера различных жанров для вашего торжества! Свадьба,  юбилеи, корпоративы! Постановка свадебного танца! А также танец сюрприз для ваших гостей, жениха или невесты в вашем исполнении!', '0', 0, 2, 11, 2, 210, 4, NULL, '2017-04-10 03:59:52', '2017-04-10 03:59:52'),
