(300, 'Дизайн-студия ES', '', '0', 0, 2, 13, 2, 213, 4, NULL, '2017-04-10 04:06:10', '2017-04-10 04:06:10'),
(301, 'BonPri', 'Театр начинается с вешалки, а свадьба с пригласительного. Ведь именно свадебное приглашение создает первое впечатление о предстоящем празднике. Одна не большая открытка несет в себе не только текст, но и всю идею свадьбы. Цвета, текстуры, стиль, материалы – все это расскажет о Вашем празднике лучше любых слов!\r\n\r\nБонбоньерка (отфр. bon bon — конфетка) – это маленькая коробочка или кулек с конфетами, которую, в знак благодарности и признания, молодожены дарит гостям. Перенимая интересные свадебные традиции у западных стран, нельзя не вспомнить о бонбоньерках. Бонбоньерки можно наполнять не только конфетами, но и радостными мелочами. В нашей стране с особым интересом относятся к этой традиции, ведь каждый присутствующий на свадьбе получает знак внимания!', '0', 0, 2, 13, 2, 214, 4, NULL, '2017-04-10 04:07:13', '2017-04-10 04:07:13'),
(303, 'Almas Studio', '<p>&laquo;Алмас&raquo; студиясы өз жұмысын 2005 жылы бастады. Құрылған уақыттан бастап біздің ұжым мүшелері өздерінің кәсіби шеберлігін үздіксіз шыңдап келеді. Видео мен фото өнері бойынша Мәскеу, Астана, Алматы, Атырау қалаларында өткен талай майталман шеберлердің мастер класстарын өткеріп, мол тәжірибе жинақтады. Студияның техникалық жабдықталуы аймақтағы ең үздіктердің қатарында. Сапа мен шыңдарлы шығармашылық біздің күнделікті талабымыз. Студия жетекшісі, журналист, фотограф, режиссер Арман Хайруллин. Cондай ақ бізде жарық &mdash; лазер қызметі бар.</p>', '0', 0, 2, 5, 2, 215, 3, NULL, '2017-04-10 04:13:35', '2017-04-19 06:05:11'),
(304, 'Almas Studio', '<p>&laquo;Алмас&raquo; студиясы өз жұмысын 2005 жылы бастады. Құрылған уақыттан бастап біздің ұжым мүшелері өздерінің кәсіби шеберлігін үздіксіз шыңдап келеді. Видео мен фото өнері бойынша Мәскеу, Астана, Алматы, Атырау қалаларында өткен талай майталман шеберлердің мастер класстарын өткеріп, мол тәжірибе жинақтады. Студияның техникалық жабдықталуы аймақтағы ең үздіктердің қатарында. Сапа мен шыңдарлы шығармашылық біздің күнделікті талабымыз. Студия жетекшісі, журналист, фотограф, режиссер Арман Хайруллин. Cондай ақ бізде жарық &mdash; лазер қызметі бар.</p>', '0', 0, 2, 14, 2, 215, 3, NULL, '2017-04-10 04:14:46', '2017-04-19 06:05:23'),
(305, '«МАСЕЕВТВ»', '<p>Меня зовут Николай Масеев, я основатель бренда &laquo;МАСЕЕВТВ&raquo;. Почему бренда? С 2006 года, когда я начал свою деятельность в событийной видеографии, я стал работать на свое имя. А чтобы наработать имя необходимо качественно и кропотливо выполнять свою работу. Главной целью для себя мы ставим создание продукта который несет людям эмоции, эмоции которые заставляют вас заново переживать тот день вашей жизни. Сегодня МАСЕЕВТВ, это динамично развивающаяся легальная компания, которая объединяет одинаковых по духу творческих людей, готовых в ритме вашего события сохранить эмоции важного для вас момента жизни. На данный момент наша команда готова провести видеосъемку в любой точке ЕАЭС. (Россия, Казахстан, Беларусь)</p>', '0', 0, 2, 5, 2, 216, 3, NULL, '2017-04-10 04:17:14', '2017-04-19 03:10:01'),
(306, 'Домбрист Нуролла', '<p>Как же казахское мероприятие без национального инструмента &mdash; Домбыра!</p>', '0', 0, 2, 6, 2, 217, 3, NULL, '2017-04-10 04:22:30', '2017-04-19 06:05:52'),
