(318, 'Дмитрий Юсупов', '<p>Свадебная съемка от начало до конца: Фотографии от 600 до 800 шт. Все обработанные и записаны на 2 копии оформленных диска. Фото книга для жениха и невесты разворотом 40х20 см. 10 разворотов. Портрет на холсте 40х60 см. Почасовая сьемка Съемка в студии в день свадьбы.</p>', '0', 0, 2, 14, 2, 228, 4, NULL, '2017-04-11 03:12:03', '2017-04-19 05:12:48'),
(319, 'Анастасия Тычинская', '<p>Многие думают, что фотография &mdash; это лишь картинка из нашей жизни. Я думаю, что каждое фото, сделанное на нашем жизненном пути &mdash; это маленький рассказ, маленькая история, которая повествует нам о том, какие эмоции мы испытываем, какие события происходили вокруг нас. Свадебная фотография &mdash; это удивительный мир ярких эмоций, красок и чувств. Смотря фотографии со своей свадьбы вы раз за разом будете окунаться в атмосферу того самого дня, когда сказали друг другу &laquo;Да&raquo;. Каждая фотография, сделанная на вашей свадьбе должна быть особенной. Ведь для каждой девушки день ее свадьбы &mdash; самый счастливый в ее жизни!!! Все виды съёмки!!! Свадьба, Юбилей, студийная съёмка и многое другое.</p>', '0', 0, 2, 14, 2, 229, 4, NULL, '2017-04-11 03:13:43', '2017-04-19 05:13:19'),
(320, '«SARMAD»', '<p>&laquo;SARMAD&raquo; этно-фольклорлық ансамблі, Халықаралық және Республикалық конкурстардың лауреаты, Батыс өңіріндегі тұңғыш фольклорлық ансамбль. Бірнеше рет шет елдерде халық намысын қорғап келе жатқан топ 2013 жылы құрылды. 2016 жылы &laquo;Ұлы дала дүбірі&raquo; атты жеке концертін берді. Ансамбль жанры: заманауи стильдеги әндер мен күйлер, этно фольклорлы шығармалар. Барлық шығармаларды жанды дауыста орындаймыз. Ансамбль жетекшісі: Бауыржан Ақтаев.</p>', '0', 0, 2, 6, 2, 227, 3, NULL, '2017-04-11 03:13:56', '2017-04-19 06:06:05'),
(323, 'Zhan Sargozov', '', '0', 0, 2, 14, 2, 230, 4, NULL, '2017-04-11 03:15:32', '2017-04-11 03:15:32'),
(324, 'Оксана Красноступ', '', '0', 0, 2, 15, 2, 231, 4, NULL, '2017-04-11 03:37:57', '2017-04-11 03:41:37'),
(325, 'VINTAGE', '', '0', 0, 2, 15, 2, 232, 4, NULL, '2017-04-11 03:39:53', '2017-04-11 03:42:21'),
(326, '«Күй тартыс»', '<p>Салтанатты шараға күй тартыс орындаймыз (2-3 жігіт)</p>', '0', 0, 2, 6, 2, 233, 3, NULL, '2017-04-11 03:41:20', '2017-04-19 06:06:18'),
(327, 'Ансамбль «Нарын»', '<p>Фольклорлық ансамбль &laquo;Нарын&raquo; қазақ халық күйлерін орындайды!</p>', '0', 0, 2, 6, 2, 234, 3, NULL, '2017-04-11 03:44:12', '2017-04-19 06:06:26'),
(328, 'Салтанат Байкежанова', '<p>Оформление свадьбы: тканью, цветами, шарами.</p>\r\n<p>Баннера: с 3д цветами, с 3д бабочками.</p>\r\n<p>Фотозоны, бонбоньерки, пакеты на тойбастар, регистрационная арка, стенд списков с рассадкой гостей.</p>', '0', 0, 2, 15, 2, 235, 4, NULL, '2017-04-11 03:44:26', '2017-04-19 05:15:28'),
(329, 'Дизайн-студия ES', '<p>Дизайн-студия ES: Оформление свадебного президиума, пресс стены из ткани и других элементов, арки для регистрации вместе со столиком для регистрации, банты на стулья, кованная скамейка, кованные стойки (для регистрации), мартинницы для стола гостей со цветами и нумерацией (гортензия, роза), нумерация столов в рамочках, мольберт с рассадкой гостей, пригласительные и бонбоньерки.&nbsp;</p>', '0', 0, 2, 15, 2, 236, 4, NULL, '2017-04-11 03:49:57', '2017-04-19 05:18:45'),
(330, 'WEDDINGLAND', 'Особенное — для особенных!\r\n\r\nМы создаем свадьбы нового поколения! Такая узкая специализация позволяет нам погружаться целиком и полностью в каждый проект, проживать каждую историю и всегда добиваться идеального результата! Мы не просто воплощаем в жизнь Ваши мечты, мы делаем это профессионально!\r\nСвадьба — это мечта, это сказка, которую хочется прожить, позвольте себе сделать ее совершенной!', '0', 0, 2, 15, 2, 237, 4, NULL, '2017-04-11 03:54:41', '2017-04-11 03:54:41'),
(331, 'Dial Art', '', '0', 0, 2, 15, 2, 239, 4, NULL, '2017-04-11 03:56:46', '2017-04-11 03:56:46'),
(332, 'Рафаэль', '', '0', 0, 2, 6, 2, 238, 3, NULL, '2017-04-11 03:57:55', '2017-04-11 03:57:55'),
(333, 'Dariol', '', '0', 0, 2, 16, 2, 240, 4, NULL, '2017-04-11 03:58:47', '2017-04-18 02:41:17'),
(334, 'Инструментальное трио «Еркеназ»', '<p>Репертуар: казахские песни, кюйи, попури, восточные песни. Блок 3-4 композиции.</p>', '0', 0, 2, 6, 2, 241, 3, NULL, '2017-04-11 04:02:07', '2017-04-19 06:06:38'),
(335, 'Жазира Ауэзова', '<p>Мерекелік кешті қазақтың ұлттық аспабы қобыздың үнімен әрлеймін!</p>', '0', 0, 2, 6, 2, 242, 3, NULL, '2017-04-11 04:04:56', '2017-04-19 06:06:52'),
(336, 'Овакимян Артур', '<p>Окончил Ереванскую Государственную консерваторию им. Комитаса, по классу скрипки. Сейчас работает в ДК Курмангазы г. Атырау. В репертуаре &mdash; казахские, цыганские, греческие, восточные, русские, зарубежные произведения, классика в эстрадной!</p>', '0', 0, 2, 6, 2, 243, 3, NULL, '2017-04-11 04:11:04', '2017-04-19 06:07:28'),
(337, 'Нурик Смит', '<p>Иллюзион шоу 15-20 минут. Микромагия 1 час.</p>', '0', 0, 2, 7, 2, 244, 3, NULL, '2017-04-11 04:14:26', '2017-04-19 06:09:34'),
(338, 'Нигметов Нурмукан', '<p>Иллюзион шоу. Микромагия.</p>', '0', 0, 2, 7, 2, 245, 3, NULL, '2017-04-11 04:16:28', '2017-04-19 06:09:55'),
(339, 'Бахытжан Жамаледенов', '<p>&bull; Фееричное выступление фокусника (10-20 мин), в котором есть потрясающий красочный номер + крупные фокусы с левитацией + появление живого голубя и кролика!</p>\r\n<p>&bull; Микромагия (30 мин или 1 час) фокусы с маленькими предметами (отсюда и название) на близком расстоянии от зрителя. Фокусник находится среди гостей, показывает различные удивительные трюки в режиме постоянного общения со зрителями.</p>\r\n<p>&bull; Фокусник на детский праздник &ndash; 15 мин. Шоу включает номер + крупные фокусы + появление голубя!!!</p>', '0', 0, 2, 7, 2, 246, 3, NULL, '2017-04-11 04:19:13', '2017-04-19 06:10:21'),
(340, 'СВАДЕБНОЕ ШОУ', '<p>Осуществит выезд на ваш праздник, для создания незабываемых впечатлений и эмоций.</p>\r\n<p>В комплект предоставляемых услуг входит: генератор мыльных пузырей; генератор дыма; генератор снега; прожектор; светомузыка.</p>\r\n<p>Сделаем все на высшем уровне!</p>', '0', 0, 2, 17, 2, 247, 3, NULL, '2017-04-11 04:21:26', '2017-04-19 06:10:47'),
(341, 'Панда и Медведь', '<p>Панда и медведь ростом 3,5 метра весело проведут ваше мероприятие. Веселые танцы и крутые фотографии с пандой и медведем.</p>', '0', 0, 2, 7, 2, 248, 3, NULL, '2017-04-11 04:26:03', '2017-04-19 06:10:55'),
(342, 'Нурбек — Бармен шоу', '<p>Бармен-шоу; кофе-брейк; выездной коктейль бар; пирамида шампанского, коктейльная карта.</p>', '0', 0, 2, 7, 2, 249, 3, NULL, '2017-04-11 04:30:04', '2017-04-19 06:11:06'),
(343, 'Арткупаж', '<p>1. 2 аниматора, 1 час работы &ndash; (Миньоны, пираты, феи Винкс, леговечеринка, монстр Хай, клоуны, Джерри, фиксики, вечеринка с индейцами&hellip;)</p>\r\n<p>2. Кэнди бар</p>\r\n<p>3. Коктейль бар</p>\r\n<p>4. Шоу мыльных пузырей</p>\r\n<p>5. Ростовые куклы</p>\r\n<p>6. Продажа гелиевых шаров и аэродизайн</p>\r\n<p>7. Бумажная вечеринка</p>\r\n<p>8. Аренда принадлежностей для организации детских мероприятий</p>\r\n<p>9. Организация утренников</p>', '0', 0, 2, 7, 2, 250, 3, NULL, '2017-04-11 04:32:15', '2017-04-19 06:11:50'),
(344, 'Queen stylist', '<p>Студия красоты &laquo;Queen stylist&raquo;. Услуги: прическа, макияж, наращивание ресниц, маникюр, педикюр, наращивание ногтей.</p>', '0', 0, 2, 9, 2, 251, 3, NULL, '2017-04-11 04:43:31', '2017-04-19 06:12:08'),
(345, 'Hairstylist', '<p>В каждом мероприятии девушек украшает прическа!</p>', '0', 0, 2, 9, 2, 252, 3, NULL, '2017-04-11 04:45:40', '2017-04-19 06:12:18'),
(347, 'Сая', '<p>Парикмахерские услуги. Наращивание ресниц. Макияж. Коррекция бровей. Окрашивание бровей хной. Шугаринг.</p>', '0', 0, 2, 9, 2, 254, 3, NULL, '2017-04-11 04:55:38', '2017-04-19 06:12:28'),
(348, 'Кундыз Ныгметова', '<p>Свадебный макияж. В основном работаю выездом. Сертифицированный визажист.</p>', '0', 0, 2, 9, 2, 255, 3, NULL, '2017-04-11 04:58:37', '2017-04-19 06:16:34'),
(349, 'Студия красоты и SPA салон «Гульзада»', '<p>Студия Красоты &laquo;Гульзада&raquo; распахнула свои двери для первых посетителей в 2015 году. С этого времени и по сегодняшний день мы не перестаем радовать своих клиентов доброжелательным отношением и индивидуальным подходом к каждому из них. Высокий профессионализм наших мастеров и современное оборудование позволяют угодить даже самым высоким требованиям наших клиентов. Гульзада &mdash; это студия красоты в Атырау, где вы получите высококлассный сервис и максимальное удовольствие от работы мастеров, которые помогут Вам создать неповторимый образ, стильный и безупречно элегантный. Наши цены Вас приятно порадуют, не все студии красоты в Атырау смогут предложить вам такие качественные услуги по разумной цене. В нашей студии красоты Вы можете приобрести профессиональные косметические линии для домашнего использования ведущих производителей индустрии красоты. Наши мастера помогут Вам подобрать профессиональные средства по уходу за волосами, кожей лица и тела.</p>', '0', 0, 2, 9, 2, 256, 3, NULL, '2017-04-11 05:01:22', '2017-04-19 06:16:49'),
(350, 'Алуа Меркибаева', '', '0', 0, 2, 9, 2, 257, 3, NULL, '2017-04-11 05:03:43', '2017-04-11 05:03:43'),
(351, 'Сальсабиль', '<p>Услуги: Макияж (дневной, легкий, возрастной, вечерний, свадебный).</p>\r\n<p>Свадебная прическа.</p>\r\n<p>Наращивание ресниц.</p>\r\n<p>Татуаж бровей, татуаж губ.</p>\r\n<p>Маникюр (гель покрытие, свадебный,френч).</p>', '0', 0, 2, 9, 2, 258, 3, NULL, '2017-04-11 05:07:12', '2017-04-19 06:17:26'),
(352, 'Айгерим Тулепова', '<p>Предлагаю вам услуги визажиста, макияж на все случаи жизни. (Свадебный, Вечерний, Дневной, 3D Макияж, Smokey Eyes). Обучалась г.Алматы, Салон Gaukharvizazh. Сертифицированный визажист. В работе используется только профессиональная косметика. (Inglot, Make-up Atelier, Mary-low, Anastasia BH, кисти от Zoeva).</p>', '0', 0, 2, 9, 2, 259, 3, NULL, '2017-04-11 05:12:01', '2017-04-19 06:17:40'),
(353, 'Interbeauty', '<p>Косметология: пилинги химические, инъекционные процедуры. Маникюр и педикюр. Парикмахерские услуги. Процедуры по телу. Посещение солевой комнаты.</p>', '0', 0, 2, 9, 2, 260, 3, NULL, '2017-04-11 05:14:26', '2017-04-19 06:17:56'),
(355, 'Я — Невеста', '', '0', 0, 2, 10, 2, 262, 3, NULL, '2017-04-11 05:19:52', '2017-04-11 05:19:52'),
(356, 'Аяулым', '<p>В свадебном салоне &laquo;Аяулым&raquo; вас порадуют широкий выбор недорогих свадебных платьев, а так же большой выбор свадебных аксессуаров как для невесты, так и для подружек.</p>', '0', 0, 2, 10, 2, 263, 3, NULL, '2017-04-11 05:23:04', '2017-04-19 06:18:08'),
(357, 'Хан қызы', '<p>Огромный выбор напрокат свадебных платьев в салоне &laquo;Хан қызы&raquo;!</p>', '0', 0, 2, 10, 2, 264, 3, NULL, '2017-04-11 05:25:32', '2017-04-19 06:18:25'),
(358, 'Ардақ', '<p>Огромный выбор платьев в свадебных салоне &laquo;Ардақ&raquo;.</p>', '0', 0, 2, 10, 2, 265, 3, NULL, '2017-04-11 05:28:03', '2017-04-19 06:18:39'),
(359, 'Amoremio', '<p>Продажа и прокат свадебных платьев.</p>', '0', 0, 2, 10, 2, 266, 3, NULL, '2017-04-11 05:31:31', '2017-04-19 06:19:42'),
(364, 'Ерке сылқым', '<p>Свадебный салон &laquo;Ерке сылқым&raquo; предлагает на ваш выбор красивые свадебные и вечерние платья! Милые Дамы! Eсли у вас скоро свадьба и вы еще не выбрали свой свадебный наряд&hellip; Предлагаем вам посмотреть наш каталог с шикарными свадебными платьями.</p>', '0', 0, 2, 10, 2, 267, 3, NULL, '2017-04-11 05:34:17', '2017-04-19 03:24:13'),
(365, 'Рамиль Якупов Микромагия', 'Приукрасьте своё торжество магией! Работаю на любых мероприятиях, будь то корпоратив или день рождения.\r\n\r\nБольшой опыт общения со зрителями!\r\n\r\nМикромагия — это фокусы на расстоянии вытянутой руки. Отлично подходят для встречи гостей.\r\n\r\nХорошее настроение и море позитива гарантировано!\r\n\r\nВы не верите в карточную магию?! Тогда я иду к вам!', '0', 0, 2, 7, 2, 193, 4, NULL, '2017-04-11 05:35:00', '2017-04-11 05:35:00'),
(366, 'Атырау дәстүр биі', '<p>Той бастар, келін кіргізу, қыз ұзату, құда қарсы алу, сүндет той, тұсау кесу, тілашар, туған күн, мерей той кештерін әсем би және әншімен әрлеп береміз.</p>', '0', 0, 2, 11, 2, 268, 3, NULL, '2017-04-11 05:41:58', '2017-04-19 06:19:59'),
(367, '«Шашу» ән-би тобы', '<p>&laquo;Шашу&raquo; ән-би тобы &mdash; той бастар, келін кіргізу, қыз ұзату, құда қарсы алу, сүндет той, тұсау кесу, тілашар, туған күн, мерей той кештерін әсем би және әншімен әрлеп береміз!</p>', '0', 0, 2, 11, 2, 269, 3, NULL, '2017-04-11 05:43:48', '2017-04-19 06:20:23'),
(368, 'Томирис', '', '0', 0, 2, 11, 2, 270, 3, NULL, '2017-04-11 05:45:24', '2017-04-11 05:45:24'),
(369, '«Кыздар-ай»', '<p>Туған күндеріңізді салтанатты түрде ашады. Шоу (қазақша әндер жәнеде әсем билер)</p>', '0', 0, 2, 11, 2, 271, 3, NULL, '2017-04-11 05:48:20', '2017-04-19 06:20:36'),
(370, '«Құралай» ән-би тобы', '<p>&laquo;Құралай&raquo; ән-би ансамблi &mdash; үйлену той, қыз ұзату, сыңсу, туған күн, шілдехана, тұсау кесу рәсімдерін жасайды. Әдемі ән, шебер бишілер тойыңыздың сәнін келтіреді.</p>', '0', 0, 2, 11, 2, 272, 3, NULL, '2017-04-11 05:50:44', '2017-04-19 06:20:49'),
(371, 'Искра', '<p>Танцевальная группа &laquo;Искра&raquo; в городе Атырау выступают с дагестанскими танцами на свадьбах, банкетах и на других мероприятиях.</p>', '0', 0, 2, 11, 2, 273, 3, NULL, '2017-04-11 05:52:52', '2017-04-19 06:20:59'),
(372, 'Атырау ән-би тобы', '<p>Атырау ән-би тобы &mdash; той бастар, келін кіргізу, қыз ұзату,құда қарсы алу ,сүндет той , тұсау кесу, тілашар, туған күн, мерей той кештерін әсем би және әншімен әрлеп береміз!</p>', '0', 0, 2, 11, 2, 274, 3, NULL, '2017-04-11 05:55:31', '2017-04-19 06:21:15'),
(373, 'Шоу балет «Фламинго»', '', '0', 0, 2, 11, 2, 275, 3, NULL, '2017-04-11 06:02:36', '2017-04-11 06:02:36'),
(374, '«Шолпанай»', '', '0', 0, 2, 11, 2, 276, 3, NULL, '2017-04-11 06:05:13', '2017-04-11 06:05:13'),
(375, 'Оңдағанова Бексана', '<p>Дәстүрлі әнші. Ғарифолла Құрманғалиев, М.Төрешов атындағы республикалық конкурстардың лауреаты.</p>', '0', 0, 2, 6, 2, 25, 3, NULL, '2017-04-11 06:42:09', '2017-04-19 05:14:58'),
(377, 'Хафиз', '<p>&laquo;Хафиз&raquo; ән-би тобы: той бастар, келін кіргізу, қыз ұзату, құда қарсы алу, сүндет той, тұсау кесу, тілашар, туған күн, мерей той кештерін жаңа бағдарламамен салтанатты түрде жоғарғы деңгейде өткіземіз! Бағдарламада: әшекейленген ақ жол, шаңырақ, спецэффекттар, мыңбұралған бишілер.</p>', '0', 0, 2, 11, 2, 277, 3, NULL, '2017-04-11 07:45:35', '2017-04-19 06:32:23'),
(378, 'Жібек жолы', '<p>Танцевальный коллектив &laquo;Жібек жолы&raquo; &mdash; оригинальная эффектная хореография и профессиональное исполнение номеров по традиционным казахским обычаям и не только. Танцевальный коллектив &laquo;Жібек жолы&raquo; украсит Ваш праздник. Мы гарантируем Вам высокий исполнительский профессионализм и яркие впечатления от нашего выступления.</p>\r\n<p>Основными критериями нашей работы являются:</p>\r\n<p>&mdash; Надежность</p>\r\n<p>&mdash; Мобильность</p>\r\n<p>&mdash; Гибкая ценовая политика</p>', '0', 0, 2, 11, 2, 278, 3, NULL, '2017-04-11 07:47:48', '2017-04-19 06:32:46'),
(380, 'Аяна', '<p>Аяна ән-би тобы тойларыныздың мәні мен сәнің келтіреді! Көңілді әндер мен көңілді билер, және де ақылына көркі сай қазақтың сұлу қыздары!</p>', '0', 0, 2, 11, 2, 280, 3, NULL, '2017-04-11 07:53:56', '2017-04-19 06:32:59'),
(381, 'Ай-Назым', '<p>Открытие и закрытие свадеб и мероприятий, 7 метровые светящиеся цветы, дым, мыльные пузыри для вашего торжества!</p>', '0', 0, 2, 11, 2, 281, 3, NULL, '2017-04-11 07:55:42', '2017-04-19 06:33:24'),
(382, 'Tort na zakaz atyrau', '<p>Сладости для Радости! Вкусные и свежие торты и десерты украсит ваш стол!</p>', '0', 0, 2, 16, 2, 282, 3, NULL, '2017-04-11 07:58:26', '2017-04-19 06:33:33'),
(383, 'Кондитерская Raffine', '<p>Кондитерская Raffine предлагает элитные десерты популярные во всем мире. Цель нашей компании-клиентоориентированность, создание эксклюзивного брэнда. Мы дорожим своей репутацией верного и надежного партнера,постоянно развиваемся,стараясь соответствовать самым строгим требованиям наших клиентов.</p>\r\n<p>5 фактов об изделиях Raffine :</p>\r\n<p>1)Выпечка из натуральных продуктов;</p>\r\n<p>2)Квалифицированные сотрудники;</p>\r\n<p>3)Разумная ценовая политика;</p>\r\n<p>4)В ногу со временем (тщательно прорабатываются новые десерты и выпечка популярная во всем мире);</p>\r\n<p>5) И наконец! Качественный Каазахстанский бренд!</p>', '0', 0, 2, 16, 2, 283, 3, NULL, '2017-04-11 08:00:02', '2017-04-19 06:34:01'),
(384, 'Гульнара', '<p>Торты на дни рождения.</p>', '0', 0, 2, 16, 2, 284, 3, NULL, '2017-04-11 08:01:52', '2017-04-19 06:34:16'),
(385, 'Тоқаш', '<p>Кулинария &laquo;Токаш&raquo; принимает заказы на выпечку, горячие блюда, холодные блюда, десерты, торты, пирожные, салаты, пиццу, на любые мероприятия и в любом количестве! Заказы принимаются предварительно за 2 дня.</p>', '0', 0, 2, 16, 2, 285, 3, NULL, '2017-04-11 08:03:29', '2017-04-19 03:50:45'),
(386, 'Cake Atyrau Asem', '<p>Сладости на заказ сделанное с любовью! Торты, пирожные, капкейки. Заказы принимаются предварительно за 2-3 дня.</p>', '0', 0, 2, 16, 2, 286, 3, NULL, '2017-04-11 08:06:41', '2017-04-19 06:34:37'),
(387, 'Торты от Любы Шомоди', '<p>Торты оформляются живыми цветами. Торты оформленные цветами в стиле английской лепки.</p>', '0', 0, 2, 16, 2, 287, 3, NULL, '2017-04-11 08:13:58', '2017-04-19 06:36:35'),
(388, 'Dolce vitа di', '<p>Торты на заказ на все случаи жизни: свадебные, детские, тематические, candy bar, пирожные, капкейки и многое другое предлагает для Вас кондитерская Dolce vita di. Мы предлагаем разнообразие нежных начинок на основе взбитых сливок, различных муссов, использование как классического белого, так и слоеных или шоколадных коржей. Используем только натуральные и свежие ингредиенты!</p>', '0', 0, 2, 16, 2, 288, 3, NULL, '2017-04-11 08:17:23', '2017-04-19 06:36:45'),
(389, 'Сауран фуд', '<p>Принимаем заказы на выпечку, горячие блюда, холодные блюда, десерты, торты, пирожные, салаты, пиццу, на любые мероприятия и в любом количестве!</p>', '0', 0, 2, 16, 2, 289, 3, NULL, '2017-04-11 08:18:54', '2017-04-19 06:37:01'),
(390, 'Асемхат', '<p>Салон &laquo;Асемхат&raquo; &mdash; оформление пригласительных, бонбоньерок, обертки для шоколадок. Сделаем все на ваш вкус!</p>', '0', 0, 2, 13, 2, 290, 3, NULL, '2017-04-12 03:52:39', '2017-04-19 06:37:13'),
(391, 'Рекламное агенство «Сункар»', '<p>Банера. Объемные Буквы и инициалы. Аренда конструкции под баннер. Аренда мольбертов. Рассадочные карточки.</p>', '0', 0, 2, 13, 2, 291, 3, NULL, '2017-04-12 03:57:34', '2017-04-19 06:37:27'),
(392, 'Жайлыбаев Нурболат', '', '0', 0, 2, 14, 2, 292, 3, NULL, '2017-04-12 04:00:53', '2017-04-12 04:00:53'),
(393, 'Inside pro', '<p>Детские, семейные и индивидуальные фотосессии. Фотосессии с декорациями в студии!</p>\r\n<p>Базовый пакет: количество фото &mdash; 350-400, 20 фото для альбома с авторской ретушью, фотожурнал с 20 фото, готовые фото передаются в диске, 10 фото передаются в электронном виде, срок 30-40 дней.</p>\r\n<p>Стандарт пакет: количество фото &mdash; 400-500, 30 фото для альбома с авторской ретушью, фотожурнал с 30 фото+фотография на холсте, готовые фото передаются в диске, 10 фото передаются в электронном виде, срок 30-40 дней.</p>\r\n<p>Премиум пакет: количество фото &mdash; 500-600, 30 фото для альбома с авторской ретушью, фотожурнал с 30 фото+ 2 мини альбома с 15 фото+фотография распечатанная на холсте, готовые фото передаются в диске, 10 фото передаются в электронном виде, срок 30-40 дней.</p>', '0', 0, 2, 14, 2, 293, 3, NULL, '2017-04-12 04:03:52', '2017-04-19 06:38:02'),
(394, 'Элеонора Флаум', '<p>Для меня, фотография&hellip; не просто красивая картинка&hellip; это воспоминание&hellip; это кусочек жизни&hellip; Эмоции и жизнь &mdash; такой смысл я стараюсь вложить в каждую фотографию &mdash; будь то свадебную, репортажную или портретную. В каждом снимке маленький, но очень интересный кусочек этого мира.</p>', '0', 0, 2, 14, 2, 294, 3, NULL, '2017-04-12 04:11:26', '2017-04-19 06:38:23'),
(395, 'Сайд Мынбаев', '<p>Предлагаю выполнение красочных и неповторимых фотосессий. Свадьбы, Love Story.</p>', '0', 0, 2, 14, 2, 295, 3, NULL, '2017-04-12 04:13:49', '2017-04-19 06:40:24'),
(396, 'Ринад Райсов', '<p>С радостью проведет съёмку любого вашего мероприятия: церемонию бракосочетания, свадебную прогулку, банкет, детский день рождения, выписку из роддома. Фотограф постарается учесть все ваши пожелания, поможет раскрепоститься и улыбнуться, чтобы снимки получились живыми и яркими.</p>', '0', 0, 2, 14, 2, 297, 3, NULL, '2017-04-12 04:15:54', '2017-04-19 06:40:41'),
(397, 'Нариман Есенгазиев', '<p>Друзья делаем свадебные фотомозайки на любые мероприятия. Фотомозайка &mdash; это лучший подарок для Ваших близких! Мы гарантируем непередаваемые эмоции радости на лицах Ваших друзей и родных. Множество воспоминаний в одной картине.</p>', '0', 0, 2, 14, 2, 298, 3, NULL, '2017-04-12 04:19:28', '2017-04-19 07:05:31'),
(398, 'Максим Лобиков', '<p>Снимаю стильные и эмоциональные свадебные фотографии для красивых, влюбленных и счастливых!</p>', '0', 0, 2, 14, 2, 299, 3, NULL, '2017-04-12 04:22:31', '2017-04-19 07:05:40'),
(399, 'Константинова Рита', '<p>Привет! Меня зовут Рита. Люблю новые места и живые эмоции. Снимаю свадьбы, кыз узату и предсвадебное love story. Делаю свою работу с любовью и заботой о Ваших воспоминаниях.</p>', '0', 0, 2, 14, 2, 300, 3, NULL, '2017-04-12 04:24:37', '2017-04-19 07:05:52'),
(400, 'Жанарыс Изтилеуов', '<p>Сделаю съёмку Вашего праздника лёгкой и ненавязчивой. Индивидуальный творческий подход &mdash; гарантия того, что в Вашем архиве окажется настоящий шедевр, смотреть который будет интересно не только Вам, но и Вашим родным и друзьям.</p>', '0', 0, 2, 14, 2, 301, 3, NULL, '2017-04-12 04:29:26', '2017-04-19 07:06:11'),
(401, 'Ержан Нурпеисов', '<p>Сделайте подарок себе или подарите фотосессию своим любимым и близким! Индивидуальный подход к каждому клиенту!!!</p>', '0', 0, 2, 14, 2, 302, 3, NULL, '2017-04-12 04:31:48', '2017-04-19 07:06:24'),
(402, 'Ербол Дюсупов', '<p>Свадебный и семейный фотограф. Снимает по всему Казахстану. Является членом Ассоциации Профессиональных Фотографов Казахстана.</p>', '0', 0, 2, 14, 2, 303, 3, NULL, '2017-04-12 04:35:02', '2017-04-19 07:06:45'),
(403, 'Владислав Хорн', '<p>Свадебное фото &mdash; лучший способ вспомнить самые трогательные, самые яркие и самые красивые моменты Свадебного Торжества! Кураж и веселье на банкете, смешные ситуации на выкупе, слезы радости и счастья во время регистрации можно раз за разом переживать вновь, просматривая фотографии снова и снова.</p>', '0', 0, 2, 14, 2, 304, 3, NULL, '2017-04-12 04:36:48', '2017-04-19 07:06:56'),
(404, 'Бекзат Кадирбеков', '<p>Бекзат Кадирбеков &mdash; профессиональный фотограф города Атырау, участник различных выставок и семинаров. Занятия фотографией, постепенно превратились для меня в серьезное увлечение. Именно фотография дала мне возможность творчески выражать самые разнообразные художественные идеи, раскрывать для себя неожиданные стороны знакомых вещей, подмечать интересные черты окружающих меня людей. К своему делу отношусь творчески, с желанием и интересом. Каждую фотосессию планирую до мелочей, придумываю новые идеи, предлагаю индивидуальные решения. Стараюсь делать съемку комфортным и приятным для всех событием. Уверен, что этого во многом зависит результат. Так же вхожу в Топ-10 лучших свадебных фотографов Казахстана по мнению авторитетных сайтов в сфере фото индустрии. Стаж работы 9лет.</p>', '0', 0, 2, 14, 2, 305, 3, NULL, '2017-04-12 04:38:58', '2017-04-19 07:07:06'),
(405, 'Ануар Мухиев', '<p>Я &mdash; свадебный фотограф города Атырау. Фотография &ndash; это в первую очередь моя жизнь и мое увлечение, а уж потом работа! Ведь, когда твое увлечение совпадает с твоей работой, это приносит радость и удовольствие не только мне но и тем для кого ты работаешь. Основное направление моего творчества: свадебная фотосьемка, предсвадебная фотосьемка, Love story, семейная сьемка и сьемка детей. Фотографией профессионально занимаюсь с 2014 года. Ваши фотографии будут полны жизни и эмоций благодаря умению фотографа. Я понимаю всю важность этих незабываемых моментов для Вас! Для меня важно, чтобы мои снимки радовали Вас на протяжении долгих лет.</p>', '0', 0, 2, 14, 2, 306, 3, NULL, '2017-04-12 04:40:55', '2017-04-19 07:07:19'),
(406, 'Андрей Миронов', '<p>Фотографии наполнены нежностью. Постановочные съемки с легкостью и естественностью репортажа выполняются в стиле случайно выхваченного кадра.</p>', '0', 0, 2, 14, 2, 307, 3, NULL, '2017-04-12 04:43:03', '2017-04-19 07:07:27'),
(407, 'Абзал Насипкали', '<p>Стильная фотография для красивых, влюбленных, настоящих людей. Или просто счастливых.</p>', '0', 0, 2, 14, 2, 308, 3, NULL, '2017-04-12 04:45:54', '2017-04-19 07:18:09'),
(409, 'Алмазов Адиль', '', '0', 0, 2, 14, 2, 311, 3, NULL, '2017-04-12 04:50:51', '2017-04-12 04:50:51'),
(411, 'Цветочный салон «Гүлдер әлемі»', '<p>Свыше 15 лет сеть цветочных салонов &laquo;Гүлдер әлемі&raquo; предоставляет обширный ассортимент голландских, колумбийских и эквадорских цветов любых размеров по самым приемлемым ценам в городе! Лучшим украшением на вашем мероприятий будут красивейшие букеты, евро букеты, свадебные букеты, либо другие композиций по вашему желанию!</p>', '0', 0, 2, 15, 2, 314, 3, NULL, '2017-04-12 04:59:36', '2017-04-19 07:18:41'),
(412, '«Центр Счастливых Событий»', '<p>Оказывает свои услуги на свадебном рынке в городе Атырау с мая 2014 года. За это время мы воплотили в жизнь много красивейших свадебных проектов и зарекомендовали себя как знающие и любящие свое дело специалисты. У каждой пары своя история любви, своя сказка , и именно по этому, Мы делаем свадьбы не похожие друг на друга, мы воплощаем в жизнь даже самые невероятные мечты! Основные направления работы нашего агентства :</p>\r\n<p>- Оформление торжеств</p>\r\n<p>- Флористика</p>\r\n<p>- Организация свадебных церемоний в европейском стиле</p>\r\n<p>Мы обязательно предложим классические и тематические варианты оформления.</p>\r\n<p>Доработаем или разработаем дизайн, в том случае если у вас есть свои идеи. Поделимся мыслями, идеями, советами!</p>', '0', 0, 2, 15, 2, 315, 3, NULL, '2017-04-12 05:01:54', '2017-04-19 07:19:33'),
(413, 'Букет Атырау', '<p>Букеты и композиции любой сложности, на любой повод и случай. Классические букеты, композиции в шляпных коробках.</p>', '0', 0, 2, 15, 2, 316, 3, NULL, '2017-04-12 05:04:11', '2017-04-19 03:49:33'),
(414, 'Ramus Wedding & Decor', '<p>Это команда профессиональных декораторов и флористов, готовых превратить Вашу мечту об идеальном свадебном оформлении в реальность. Мы предоставляем услуги декора и оформления торжеств на любой вкус и бюджет. От экономичных, но не менее красивых вариантов, до масштабных эскиз-проектов. Любая сложность, тематика и детали. Вы получите красиво оформленный зал, качество предоставляемых услуг, а Ваши гости &mdash; нужную атмосферу настоящего праздника.</p>', '0', 0, 2, 15, 2, 317, 3, NULL, '2017-04-12 05:05:59', '2017-04-19 07:19:51'),
(415, 'Katrin event agency', '<p>Мы занимаемся оформлением свадеб, юбилеев, дни рождения и т.д. Так же организовываем и оформляем детские праздники.</p>', '0', 0, 2, 15, 2, 318, 3, NULL, '2017-04-12 05:11:19', '2017-04-19 03:48:43'),
(416, 'Creative flowers atyrau', '<p>Студия флористики и декора CreativeFlowersAtyrau Мы рады предложить Вам:</p>\r\n<p>&gt; Всегда в наличии свежие розы из лучших плантаций Эквадора, Колумбии и Кении</p>\r\n<p>&gt; Евро букеты по вашим желаниям</p>\r\n<p>&gt; Вкусные коробки с французскими макарунами и цветами</p>\r\n<p>&gt; Эксклюзивные шляпные коробки</p>\r\n<p>&gt; Деревянные ящики с композициями</p>\r\n<p>&gt; Свадебная флористика любой сложности из экзотических цветов</p>\r\n<p>&gt; Ежедневно с 10.00 до 20.00</p>\r\n<p>&gt; Доставка с 8.00 до 24.00 ( по предварительным заявкам)</p>', '0', 0, 2, 15, 2, 319, 3, NULL, '2017-04-12 05:13:13', '2017-04-19 07:20:50'),
(417, '«Ms.Florist»', '<p>&laquo;Ms.Florist&raquo; ориентирована на покупателя с тонким чувством стиля и красоты. Неповторимый стиль, креативность флористов и широкий ассортимент цветов не оставит равнодушным ни одного клиента, однажды побывавшего в цветочной студии &laquo;Ms.Florist&raquo;. К каждому клиенту индивидуальный подход. Наши флористы создадут букет либо композицию любой сложности, учитывая все Ваши пожелания, а наша эксклюзивная и стильная упаковка сделает флористический презент оригинальным и незабываемым. Мы очень надеемся, что придя к нам однажды, Вы будете возвращаться в нашу студию вновь и вновь! Добро пожаловать в Ms.Florist!!! Студия Флористики &laquo;Ms.Florist&raquo; оказывает следующие услуги:</p>\r\n<p>Букеты и композиции любой сложности, на любой повод и случай; (классические букеты, композиции в шляпных коробках);</p>\r\n<p>Свадебная Флористика (букеты невест, бутоньерки, браслет);</p>\r\n<p>Оформление мероприятий (настольные композиции, композиции со свечами, канделябра и т.д).</p>', '0', 0, 2, 15, 2, 320, 3, NULL, '2017-04-12 05:15:11', '2017-04-19 07:21:17'),
(418, 'LED Show Service', '<p>Прокат лэд экранов, световое оборудование, звуковой аппаратуры, фермы, сцены, дымо генераторы, следящие пушки, лэд пол.</p>', '0', 0, 2, 17, 2, 321, 3, NULL, '2017-04-12 05:16:58', '2017-04-19 07:21:26'),
(419, 'KEY RECORDS', '<p>Мы &mdash; творческий коллектив занимающийся всем, что связанно с музыкой ОТ и ДО. И не стоит бояться наших цен, ведь при всём этом мы остаёмся одной из самых доступных студий звукозаписи в Атырау, предлагая нашим клиентам не только качественный звук.</p>', '0', 0, 2, 17, 2, 322, 3, NULL, '2017-04-12 05:18:45', '2017-04-19 07:22:19'),
(420, 'Ali records Aset', '<p>Студия звукозаписи</p>', '0', 0, 2, 17, 2, 323, 3, NULL, '2017-04-12 05:19:58', '2017-04-19 07:22:23'),
(421, 'Бахытжан Рекордс', '<p>Запись на музыкальных инструментах. Аранжировка, обработка, запись песен. Аренда музыкальной аппаратуры. Профессиональная студия.</p>', '0', 0, 2, 17, 2, 324, 3, NULL, '2017-04-12 05:21:11', '2017-04-19 07:22:30'),
(422, 'Адильжан Демешов', '<p>СПЕЦЭФФЕКТЫ НА СВАДЬБУ! Украсит Ваш праздник и подарит незабываемое впечатление. Шоу из спецэффектов: мыльные пузыри, генератор дыма, генератор снега, прожектор из пяти разных цветов. Сопровождение девушек в национальном костюме. Жар-жар, сынсу, келін кіргізу.</p>', '0', 0, 2, 7, 2, 325, 3, NULL, '2017-04-12 05:22:26', '2017-05-18 23:26:23'),
(423, 'Оne.kz', '<p>1. Аренда проекционного оборудования (Проектор, экран для проектора)</p>\r\n<p>2. Аренда 3Д экрана и проектора (Экран имеет способность показывать с двух сторон и эффект LED экрана)</p>\r\n<p>3. Аренда микрофона и колонок</p>\r\n<p>4. Разработка видео роликов (юбилейное видео, свадебное Love story, еске алу)</p>\r\n<p>5. Разработка 3D mapping (Анимационное видео разного типа и тематики) ​</p>', '0', 0, 2, 17, 2, 326, 3, NULL, '2017-04-12 05:24:08', '2017-04-19 07:22:47');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(428, 'ACTION', '<p>ВИА &laquo;ACTION&raquo; &ndash; профессиональные музыканты, работающие в самых разных стилях и жанрах. Это один из авторитетных и востребованных музыкальных коллективов в столице, играющих &laquo;в живую&raquo;, основан в 2007 году известным музыкантом Газизом Койшыбаевым. За 7 лет своего существования коллектив успешно выступает на различных концертных площадках, корпоративных мероприятиях, семейных торжествах, презентациях, выставках и др.</p>\r\n<p>В составе группы 6 участников:</p>\r\n<p>&mdash; Амина Жаксыбаева &ndash; вокал;</p>\r\n<p>&mdash; Орынбасар Абуов &ndash; вокал;</p>\r\n<p>&mdash; Али Нуртазаев &ndash; клавишные, бэк-вокал;</p>\r\n<p>&mdash; Назар Тажибаев &ndash; лидер-гитара, бэк-вокал;</p>\r\n<p>&mdash; Мейрам Жанибеков &ndash; бас гитара;</p>\r\n<p>&mdash; Рахымжан Серикбаев &ndash; барабаны.</p>\r\n<p>Коллектив постоянно обновляет и расширяет свой репертуар. В работе сочетаются такие стили и направления, как джаз, джаз-рок, кантри, рок, рок-н-ролл, дискотека 80-х, западная поп-музыка. Серьёзное отношение к сценическому виду является неотъемлемой частью выступления. Программа выступления ВИА &laquo;ACTION&raquo; составляется индивидуально с учётом вкусов и пожеланий Заказчика. Тем самым отличное настроение, масса положительных эмоций гарантированы. ВИА &laquo;ACTION&raquo; не ограничивает себя стилевыми рамками. Концертная программа коллектива рассчитана на широкую аудиторию. В репертуаре группы песни на многих языках мира: казахский, русский, английский, итальянский, французский, испанский, бразильский, турецкий, узбекский, индийский, грузинский. ВИА &laquo;ACTION&raquo; &ndash; красивое, качественное и слаженное звучание, живое исполнение и шоу, которое никого не оставит равнодушным!</p>', '0', 0, 2, 1, 2, 327, 3, NULL, '2017-04-12 22:49:17', '2017-04-19 07:23:24'),
(429, 'Assau Band', '<p>Assau live band &mdash; новый столичный проект, (экс группа Мегабит) музыкальная группа для любых мероприятий: от поздравления шефу, свадеб, юбилеев до масштабных новогодних корпоративов &ndash; у нас найдется музыка на любой вкус и праздник. Каждое выступление &mdash; это эмоции: яркий вокал, переплетение жанров музыки, вкусное соло инструментов. За плечами группы выступления в лучших клубах Астаны, на площадках столичных мероприятий, корпоративных и частных праздневств, фестивалях, а также частных мероприятиях по Казахстану. Также группа сотрудничает на корпоративных мероприятиях с: Казмунайгаз, КазЦинк, НурОтан, КазИншуранс, Хабар, Казмунайгазсервис, КазМедиа и др. Помимо исполнения каверов, группа пишет свои авторские песни.</p>', '0', 0, 2, 1, 2, 328, 3, NULL, '2017-04-12 22:50:55', '2017-04-19 07:23:32'),
(430, 'Рахат Live Band', '<p>Рахат Live Band украсит ваши праздники новыми и старыми хитами, зарубежный, казахский, русский репертуар. Вы получите полный драйв на танцполе и море &mdash; море замечательных эмоций и позитива. 100% живой звук.</p>', '0', 0, 2, 1, 2, 329, 3, NULL, '2017-04-12 22:52:53', '2017-04-19 07:24:01'),
(431, 'ABAT Band', '<p>&nbsp;ABAT Band &mdash; музыканты, которые каждый день работают со звездами казахстанской эстрады, выступали на одной сцене вместе с Сосо Павлиашвили, Анной Седоковой, Роем Джонсоном и многими другими! И самое главное команда, которая выступала перед Президентом! Ни один Live Band не может похвастаться таким огромным опытом в сфере шоу-бизнеса, как мы!</p>\r\n<p>ABAT Band- это лучшие музыканты, пользующиеся лучшими технологиями в сфере музыки, всегда с ответственностью и профессионализмом относятся к своему звучанию и имиджу, они проведут ваше мероприятие на самом высшем уровне, оставив о себе только лучшее впечатление! Выбрав нас, вам остается только с удовольствием наблюдать, как лучший телевизионный band страны превращает ваш праздник в грандиозное шоу!</p>', '0', 0, 2, 1, 2, 330, 3, NULL, '2017-04-12 22:55:11', '2017-04-19 07:24:29'),
(432, 'The Song Band', '<p>Молодая вокально &mdash; инструментальная кавер &mdash; группа удивит вас своим талантом и харизматичностью. Неординарный подход к репертуару и его исполнению. Украсит ваш праздник и поднимет всем настроение!</p>', '0', 0, 2, 1, 2, 331, 3, NULL, '2017-04-12 22:56:47', '2017-04-19 07:24:46'),
(433, 'Группа «Архив»', '<p>Позитивная, яркая, жизнерадостная музыкальная группа с мужским и женским вокалом. Поднимает настроение гостей, с первых минут появления на сцене. Большой репертуар песен, который постоянно обновляется, причем не только современными хитами, но и старыми шлягерами. Группа Архив способна превратить взрослых и пожилых гостей на Вашей свадьбе, в молодых и энергичных &laquo;Королей танцпола&raquo;.</p>', '0', 0, 2, 1, 2, 332, 3, NULL, '2017-04-12 22:59:03', '2017-04-19 07:25:41'),
(434, 'Americano Band', '<p>&laquo;The Americano band&raquo; &ndash; это современная команда, пожалуй, с самым богатым репертуаром в Астане. В их творческой копилке более сотни композиций. А в составе &mdash; гитара, бас гитара, саксофон, ударные, клавишные и очаровательные солисты (мужской и женский вокал). Этот коллектив без прикрас можно назвать универсальным.</p>', '0', 0, 2, 1, 2, 333, 3, NULL, '2017-04-12 23:00:58', '2017-04-19 07:25:51'),
(435, 'Группа Nyza', '<p>На данный момент команда имеет в своем репертуаре сотни композиций зарубежных и отечественных исполнителей, а также авторские песни, которые получили популярность и признание, занимая лидирующие чарты, на столичном радио &laquo;ОРДА FM&raquo; и на телеканале &laquo;Gakku&raquo;. В репертуаре присутствуют композиции на казахском, русском, английском, испанском и многих других языках.</p>\r\n<p>Группа &laquo;Ny-Za&raquo; это море позитива, драйв и отличная атмосфера для Вашего мероприятия. Незабываемый вечер Вам обеспечен, если Вы разделите его вместе с нами. Каждое событие любого масштаба, будь то корпоратив крупной компании, шикарная свадьба, или знаменательный юбилей.</p>', '0', 0, 2, 1, 2, 334, 3, NULL, '2017-04-12 23:04:51', '2017-04-19 07:26:04'),
(436, 'UpSulut Band', '<p>UpSalut band &mdash; абсолютное качество! Мы можем сыграть все! Кавер группа UpSalut band &mdash; это топовый коллектив на праздник, свадьбу, новый год. Бешеная энергетика группы, артистичность исполнителей и, конечно же, сногсшибательная, стильная внешность группы &mdash; это залог успеха вашего ивента, в совокупности с живой музыкой позволяет артистам разнообразить репертуар, и одинаково легко исполнять поп и рок, хиты 80-ых и супер современные треки, петь на русском, английском, французском, итальянском, испанском, казахском языках. Любые мероприятия от скромных праздников до свадеб и тысячных корпоративов неизменно проходят с восторгом и танцами. Нам доверяют! С нами удобно потому, что: Кавер группа Абсолют Бэнд &mdash; асы в своем деле, полностью отвечающие за результат своего труда! UpSalut band &mdash; кавер-группа, способная удовлетворить запросам самой взыскательной публики! Кавер-группа UpSalut band &mdash; абсолютное качество!</p>', '0', 0, 2, 1, 2, 335, 3, NULL, '2017-04-12 23:06:12', '2017-04-19 07:26:15'),
(437, 'Rodina Band', '<p>Группа &laquo;Rodina Band&raquo; создана 10 лет назад. Исполняют песни на 5-ти языках: казахский русский английский французский итальянский &laquo;RODINA band&raquo; за время своей работы успели побывать с выступлениями в: ОАЭ (Дубай) Москве Грозном Омске Румынии Группа состоит из профессиональных и опытных музыкантов!</p>', '0', 0, 2, 1, 2, 336, 3, NULL, '2017-04-12 23:11:16', '2017-04-19 07:26:24'),
(438, 'Lime Band', '<p>Группа основана одними из лучших музыкантов города! Музыкантами которым светит яркое будущее и всеобщее признание! В составе группы яркие, красивые, талантливые, и по своему индивидуальные личности. Lime Live Band это группа которая ломает все стереотипы и представления о группах! группа *L L B* работает с современными технологиями которые используются в мировой музыкальной практике! технологий которые вы повседневно слышите у мировых звезд таких как Rihanna, Pitbull, Shakira, Beyonce, Will i am, Linkin Park&hellip;и т.д. группа *L L B* постоянно работает над техникой своего выступления и качеством звучания что не разу не оставляло равнодушным слушателей всех возрастов! Если вы дорогой читатель и гость нашей страницы думаете что это из раздела фантастики то вы очень и очень ошибаетесь! вам стоит лишь проследить за новостями узнать где мы! и удивиться!!!</p>', '0', 0, 2, 1, 2, 337, 3, NULL, '2017-04-12 23:17:00', '2017-04-19 07:26:41'),
(440, 'ESCALADE', '<p>Вместимость &mdash; 25 мест.</p>', '0', 0, 2, 2, 2, 338, 3, NULL, '2017-04-13 00:44:19', '2017-04-19 07:26:48'),
(441, 'Skillz band', 'Группа «Skillz» — это команда из шести профессионалов своего дела. Они молодые, талантливые и неординарные. Каждый из них интересен как личность.\r\n\r\nНесмотря на свою молодость, за время своего существования «Skillz» дали более 200 концертов на площадках самой разной величины.\r\n\r\nОни выступали на одной сцене с группами: «Boney M», «London Beat», «Рондо», «Серебро», Юлией Савичевой, Александром Ревой и т.д.\r\n\r\nГруппа «Skillz» во главе с продюсером – очень позитивная команда и в свободное время старается поделиться своим позитивом с теми, кому он так необходим. Доброй традицией группы стали выездные благотворительные концерты в детских домах г.Алматы.\r\n\r\n', '0', 0, 2, 1, 2, 341, 6, NULL, '2017-04-13 00:51:46', '2017-04-13 00:51:46'),
(443, 'Фонограф', 'Группа «Фонограф» живое исполнение музыки в любом формате и исполнении!', '0', 0, 2, 1, 2, 342, 4, NULL, '2017-04-13 00:56:54', '2017-04-13 00:56:54'),
(444, 'Toyota Land Cruiser 200', '<p>Аренда Toyota Land Cruiser 200 имеет массу преимуществ в рамках такого мегаполиса, как Астана. Это сочетание скорости, комфорта и презентабельности, которые так необходимы для деловых людей. Аренда внедорожника выручит вас, если вам необходимо обеспечить трансфер, встречу или поездки по городу или за его пределами. У силовых структур недаром этот внедорожник используют в качестве сопровождения колон с охраной. Частные охранные структуры по отзывам, выбираю чаще всего именно этот джип, внедорожник черного цвета.</p>', '0', 0, 2, 2, 2, 340, 3, NULL, '2017-04-13 00:57:23', '2017-04-19 07:27:06'),
(445, 'RIME', '«RIME» — это блистательный и первый среди равных музыкальный коллектив.\r\nОснова успеха заключается в высоком мастерстве и профессионализме музыкантов. Яркие и ослепительные образы артистов создают атмосферу праздника топ-уровня. Чтобы по-настоящему понять, что из себя представляет группа «RIME», нужно услышать их живое концертное выступление.', '0', 0, 2, 1, 2, 343, 6, NULL, '2017-04-13 01:00:06', '2017-04-13 01:00:06'),
(446, 'Toyota Haice', '<p>Пассажирские перевозки на микроавтобусах Тойота Хайс это прекрасный вариант для поездок как по городу, так и за город, на дальние расстояния. Представительный внешне и комфортабельный внутри, этот автомобиль подчеркивает лучшие качества японских автомобилей. Пассажирские кресла имеют особую эргономичную конструкцию, поэтому даже после долгой поездки вы не почувствуете усталости. Комфорт посадки и высадки продуман здесь до мелочей, о чем свидетельствует широкая сдвижная боковая дверь и удобная ступень на входе в салон.</p>', '0', 0, 2, 2, 2, 344, 3, NULL, '2017-04-13 01:00:39', '2017-04-19 07:27:47'),
(447, 'Mercedes Sprinter LUX', '<p>Вы собираетесь в дальнюю поездку или вам нужен транспорт для комфортабельной перевозки высокопоставленных лиц? Специально для вас мы предлагаем арендовать микроавтобус Mercedes Sprinter LUX. Данный микроавтобус надёжен и комфортабелен, в нем есть 15 сидячих мест, которые расположены максимально удобно для пассажиров. Простор и комфорт, который не оставит равнодушным ни одного человека &ndash; это основные характеристики этого микроавтобуса.</p>', '0', 0, 2, 2, 2, 347, 3, NULL, '2017-04-13 01:03:34', '2017-04-19 07:28:00'),
(448, 'Prosppect Live', 'Prosppect Live — первоклассный музыкальный коллектив для любой аудитории.\r\nМы играем Все! От программы для аперитива до лучших танцевальных хитов. Только живые голоса и качественная музыка, исполненная на высоком профессиональном уровне! Мы отличаемся качественным живым звуком и уделяем этому внимание в первую очередь!\r\nШирокий разноплановый репертуар охватывает большое количество мероприятий — свадьбы, юбилеи, вечеринки для друзей или корпоративные вечера. Любой ваш праздник пройдет под отличное музыкальное сопровождение. На сегодняшний день репертуар группы состоит из классики мировой эстрады, современных хитов, а также произведений лучших казахстанских и советских композиторов. Мы исполняем композиции на разных языках, а также можем выучить любимые вами композиции на любом языке, сделав ваш праздник по настоящему особенным.\r\n\r\nТакже Prosppect Live обеспечивает мероприятия технической поддержкой — звуковое, световое, видео-оборудование, спецэффекты. Разрабатываем сценарии, оригинальные идеи, поможем выступить с нами на сцене и сделать совместное оригинальное поздравление. Мы работаем для Вас!\r\nМы гарантируем отличное настроение и массу позитивных эмоций.', '0', 0, 2, 1, 2, 346, 6, NULL, '2017-04-13 01:04:18', '2017-04-13 01:04:18'),
(449, 'Phoenix band', 'Никогда еще ожог не был столь приятным!\r\nPhoenix – это буйное сочетание стиля и харизмы в одном флаконе, по-настоящему пьянящий коктейль из драйва, позитива и взрывного репертуара, который всегда сведет с ума окружающих!\r\n\r\nPhoenix – первый среди равных музыкальный коллектив, который с полным правом можно причислить к тем, кто никогда не оставляет равнодушных и об пламя которого так неистово хочется обжечься.', '0', 0, 2, 1, 2, 349, 6, NULL, '2017-04-13 01:08:03', '2017-04-13 01:08:03'),
(450, 'NATAN', '«NATAN» – первоклассный коллектив, обладающий уникальным для нашей той-cцены чувством стиля, музыкальным вкусом и создающий интересные аранжировки безупречного качества. Группа исполняет казахские-народные, ретро и современные хиты. NATAN — это индивидуальный подход, высокое мастерство, поразительные костюмы и профессионализм музыкантов.', '0', 0, 2, 1, 2, 350, 6, NULL, '2017-04-13 01:12:49', '2017-04-13 01:12:49'),
(451, 'Mercedes S 222', '<p>Аренда Mercedes S-class 222 прекрасно подойдет для свадьбы или другого торжественного события. Стильный черный цвет позволяет декорировать автомобиль любыми украшениями, а просторный салон позволит с комфортом разместиться молодоженам или гостям торжества.</p>', '0', 0, 2, 2, 2, 348, 3, NULL, '2017-04-13 01:13:28', '2017-04-19 07:29:58'),
(452, 'Оркестр «ZARATUSHTRA BAND»', 'Оркестр “ZARATUSHTRA BAND”под управлением Руслана Бутабаева.\r\n“ЛУЧШИЙ LIVE-BAND” СТРАНЫ по версии Ежегодной Музыкальной Премии “АСТАНА ЖҰЛДЫЗЫ” 2014.\r\nZARATUSHTRA BAND — это только живой звук!\r\nЛучшие  музыканты РК и СНГ.\r\nСильный вокал.\r\nЯркие образы.Зажигательный перфоманс. Огромный репертуар.\r\nВ СОСТАВЕ коллектива 13 профессиональных  музыкантов каждый из которых ,является  солистом и  яркой индивидуальностью.\r\n\r\nВ ПРОГРАММЕ оркестра : мировые хиты, итальянская классика, зажигательное RETRO, DISCO, LATINO, ELECTRO SWING.\r\nКазахская народная  и популярная музыка в интерпретации оркестра звучит свежо и оригинально.', '0', 0, 2, 1, 2, 352, 6, NULL, '2017-04-13 01:14:25', '2017-04-13 01:15:36'),
(453, 'Mercedes S 222', '<p>Аренда Mercedes S-class 222 прекрасно подойдет для свадьбы или другого торжественного события. Автомобиль хорош для деловых поездок. Он поможет произвести положительное впечатление, подчеркнет Ваш статус и безупречный вкус. Очень часто пользуются арендой Mercedes S-class 222 с водителем руководители и топ-менеджеры крупных предприятий.</p>', '0', 0, 2, 2, 2, 351, 3, NULL, '2017-04-13 01:14:44', '2017-04-19 07:31:04'),
(454, 'Mercedes S 221', '<p>Для тех, кто ценит непревзойденный комфорт, стиль и безопасность наша компания рада предложить вам аренду с водителем Mercedes S500 w221 черный. Этот автомобиль является прямым подтверждением ваших жизненных достижений и аксессуаром самодостаточной личности. Рекомендуем взять именно этот автомобиль представительского класса с водителем. Его просторный, комфортабельный салон дарит полное ощущение необходимого комфорта, не ограничивает движение. Чувствуется, что в данный автомобиль вложено все мастерство и творческий потенциал команды инженеров и дизайнеров производителя.</p>', '0', 0, 2, 2, 2, 353, 3, NULL, '2017-04-13 01:16:10', '2017-04-19 07:31:10'),
(455, 'Black&White', 'Black&White – это творческая команда.\r\nВ планах группы записать альбом с авторскими песнями.\r\nКазахстанцы знают нас по нашим клипам:\r\nКлип «Он екi» с 2010 г. ежегодно транслируется многими музыкальными каналами в преддверии Нового Года.\r\nКлип «Бурымды кыз», является своеобразным “весенним гимном”.\r\nГруппа неоднократно принимала участие в национальных музыкальных проектах и несколько лет подряд номинировалась на премию ЕМА в разделе “лучшая живая группа”.\r\n\r\nВы и ваши гости будете довольны на все 100%.', '0', 0, 2, 1, 2, 354, 6, NULL, '2017-04-13 01:17:29', '2017-04-13 01:17:29'),
(456, 'Mercedes S 221', '', '0', 0, 2, 2, 2, 355, 3, NULL, '2017-04-13 01:18:01', '2017-04-13 01:18:01'),
(457, 'Mercedes G 500', '<p>Аренда мерседес гелендваген &ndash; это отличный вариант для деловых поездок, для сопровождения, для охраны. Mercedes гелендваген внушает уважение всем своим величественным видом. На сегодняшний день это настоящая легенда.</p>', '0', 0, 2, 2, 2, 357, 3, NULL, '2017-04-13 01:19:32', '2017-04-19 07:31:20'),
(458, 'ПопКорн', 'НАША МУЗЫКА СПОСОБНА ВООДУШЕВЛЯТЬ!\r\nОгромный опыт работы на большой сцене, высокий профессионализм музыкантов и потрясающие голоса вокалистов делают эту группу по-настоящему «Топовой»! Постоянное обновление репертуара, стильные костюмы от культовых дизайнеров, яркое, незабываемое шоу! Если Вы ценители музыки, то тогда мы обязательно встретимся с Вами на наших выступлениях!\r\n\r\n', '0', 0, 2, 1, 2, 356, 6, NULL, '2017-04-13 01:19:36', '2017-04-13 01:19:36'),
(459, 'Mercedes G 500', '', '0', 0, 2, 2, 2, 358, 3, NULL, '2017-04-13 01:21:03', '2017-04-13 01:21:03'),
(460, 'BEATRATE', 'Одна из самых необычных групп в музыкальной сфере Казахстана. Созданная в 2008 году, она скорыми темпами привлекла себе внимание и завоевала любовь слушателей. Группа обладает уникальным звучанием и каждый исполняемый ими трек звучит в их собственном ремиксе. BEATRATE исполняют песни на английским, французском, казахском, итальянском и русском языках. За плечами команды тысячи живых выступлений!', '0', 0, 2, 1, 2, 359, 6, NULL, '2017-04-13 01:23:07', '2017-04-13 01:23:07'),
(461, 'КИЛИМАНДЖАРО', 'Группа  Килиманджаро это музыкальное сообщество настоящих талантов одержимых единой и несгибаемой целью — веселить жизнь!', '0', 0, 2, 1, 2, 345, 4, NULL, '2017-04-13 01:25:00', '2017-04-13 01:25:00'),
(462, 'STEREO', 'Живая музыкальная группа STEREO – это тот самый яркий момент, который оставит незабываемые впечатления!\r\nА все потому, что жизнь слишком коротка, чтобы отказываться от настоящего праздника, который дарит своим выступление эта непохожая на других группа.\r\nВ репертуар группы входят ретро-хиты, танцевальные хиты в формате Европа Плюс, а также Хиты Российской и Отечественной эстрады.\r\nУчастники группы являются лауреатами многочисленных конкурсов и фестивалей, среди которых:\r\nДельфийские игры\r\nШабыт\r\nХрустальная магнолия\r\nX-Factor\r\nThe Spirit of Tengri\r\nЖанна Орынбасарова', '0', 0, 2, 1, 2, 361, 6, NULL, '2017-04-13 01:26:28', '2017-04-13 01:26:28'),
(463, 'Mercedes G 5.5 лимузин', '<p>Вместимость &mdash; 15 мест.</p>', '0', 0, 2, 2, 2, 360, 3, NULL, '2017-04-13 01:27:28', '2017-04-19 07:31:32'),
(464, 'TEXAS', 'Невероятный драйв и 100% живой звук от live band «TEXAS»!', '0', 0, 2, 1, 2, 362, 4, NULL, '2017-04-13 01:28:21', '2017-04-13 01:28:21'),
(465, 'Lexus LX 570', '<p>Обычная поездка по заданному вами маршруту, превратиться в комфортную и захватывающую поездку, которая может продолжаться до тех пор, пока вы сами не остановите ее. Это железное чудо, обладает двигателем в 5,6 литра и набирает скорость 100 км за считанные секунды. Укрепленный кузов и всевозможные системы против вибрации обеспечит комфортабельность поездки. Внедорожник оснащен всевозможными мерами безопасности, что дает возможность расслабиться и чувствовать себя в безопасности. Наша транспортная компания предоставляет услуги по аренде автомобиля Лексус LX 570 с личным водителем. Наш работник обладает такими преимуществами как:</p>\r\n<p>&bull; Высокий уровень вождения.</p>\r\n<p>&bull; Отличное знание всех автомобильных дорог города.</p>\r\n<p>&bull; Знание автомобильного кодекса.</p>\r\n<p>&bull; Спокойность.</p>\r\n<p>&bull; Уравновешенность.</p>\r\n<p>&bull; Презентабельный внешний вид.</p>', '0', 0, 2, 2, 2, 364, 3, NULL, '2017-04-13 01:30:15', '2017-04-19 07:31:50'),
(466, 'ALYOR', 'Band ALYOR из Ташкента с большим удовольствием украсят Ваш Праздник!\r\nЖивое исполнение казахских, иностранных и традиционных узбекских песен в репертуаре cover!', '0', 0, 2, 1, 2, 365, 4, NULL, '2017-04-13 01:31:16', '2017-04-13 01:31:16'),
(467, 'VEGAS', '<p>Живое исполнение LIVE Band Vegas.</p>', '0', 0, 2, 1, 2, 368, 4, NULL, '2017-04-13 01:33:47', '2017-04-19 05:21:27'),
(468, 'Asialimo', 'Cadillac Escalade (номер 053) — 25 местный, салон бежевая кожа с черными вставками, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 7 TFT мониторов, стробы, 3 лазера.\r\nHummer H2 (номер 440) —  6 колёсный, 20 местный, салон чёрная кожа с серыми вставками, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 1 TFT монитор, 2 лазера.\r\nCadillac Escalade (номер 450) — 17 местный, ламбо двери, салон бежевая кожа с черными вставками, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 7 TFT мониторов, стробы, 3 лазера.\r\nHummer H2 (номер 597) —  15 местный, салон светлый, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 3 TFT монитора, 2 лазера.\r\nChrysler 300C в стиле Ролс Ройса (номер 008) — 9 местный, салон светлая кожа, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 1 TFT монитор, лазер.\r\nChrysler 300C (номер 997) — 10 местный, салон светлая кожа с черными вставками, зеркальный потолок с эффектом звездного неба, цветная подсветка бара и салона, CD, DVD, 1 TFT монитор, лазер.', '0', 0, 2, 2, 2, 366, 6, NULL, '2017-04-13 01:33:56', '2017-04-13 01:33:56'),
(469, 'Camry 50-55', '<p>Тойота Камри &ndash; это оптимальное сочетание традиционно высокого японского качества, азиатской утонченности и европейского комфорта. О безопасности и говорить не приходится, многочисленные тест-драйвы убеждают нас в том, что эта модель выдержала самые сложные испытания и будет отличным спутником в дороге.</p>', '0', 0, 2, 2, 2, 367, 3, NULL, '2017-04-13 01:37:16', '2017-04-19 07:31:55'),
(470, 'Bentley Continental Flying Spur Белый', '', '0', 0, 2, 2, 2, 370, 3, NULL, '2017-04-13 01:41:00', '2017-04-13 01:41:00'),
(471, 'Токтар Сериков и Бейбит Сейдуалиева', 'Токтар и Бейбит — самая лиричная и загадочная пара отечественной эстрады, которую узнают и любят все казахи. Они давно не скрывают, что их объединяет не только творчество, но и узы брака. А то, с какой нежностью Токтар и Бейбит относятся друг к другу, видно из их концертных выступлений и песен. Возможность продуктивно совмещать певческую карьеру и семейную жизнь Сериков и Сейдуалиева подтвердили в 2009 году — они были признаны лучшими исполнителями казахстанской эстрады и удостоены престижной национальной музыкальной награды «Алтын самрук».', '0', 0, 2, 3, 2, 369, 6, NULL, '2017-04-13 01:41:25', '2017-04-13 01:41:25'),
(472, 'Escalade', '<p>Марка, модель: escalade</p>\r\n<p>Тип: Джип</p>\r\n<p>Цвет: Черный</p>\r\n<p>Тонировка: Есть</p>', '0', 0, 2, 2, 2, 371, 4, NULL, '2017-04-13 01:42:14', '2017-04-19 05:21:47'),
(473, 'Лимузин Линкольн таун', '<p>Легендарный классический лимузин Lincoln TownCar, вместимость 8-9 человек. Рестайлинговый, 2007 год.</p>', '0', 0, 2, 2, 2, 372, 3, NULL, '2017-04-13 01:45:21', '2017-04-19 07:35:31'),
(474, 'Chrysler', '<p>Марка, модель: chrysler</p>\r\n<p>Количество мест: 15</p>\r\n<p>Тип: Лимузин</p>\r\n<p>Цвет: Белый</p>\r\n<p>Тонировка: Нет</p>', '0', 0, 2, 2, 2, 373, 4, NULL, '2017-04-13 01:45:57', '2017-04-19 05:22:14'),
(475, 'Тамара Асар', 'Тамара Асар великолепно выступает на сцене, и все зрители слушают ее с большим благоговением. За кулисами это очень скромная женщина, и во многом в ней воплощаются главные казахские ценности. У многих ее внутренние качества вызывают огромное уважение и желание подражать. Наверняка это послужило критерием для того, чтобы выбрать именно ее для обряда провода невесты. Не говоря уж о ее вокальных данных, хочется подчеркнуть ее ораторские способности – на проводах невесты она произносила торжественную речь, и все молча слушали – но не в тягучей обстановке, а в легкой и улыбчивой. После того, как все было сказано, Тамара повела невесту по ак жолу к выходу, сопровождая шествие пением. То была яркая кульминация того вечера, которая запомнилась всем.', '0', 0, 2, 3, 2, 374, 6, NULL, '2017-04-13 01:46:31', '2017-04-13 01:46:31'),
(476, 'Лимузин Крайслер 300С', '<p>Новый Крайслер 300С второго поколения. Единственный в Казахстане. Салон класса Luxury. 3D пол и потолок, световое и лазерное шоу. Профессиональная акустическая система.</p>', '0', 0, 2, 2, 2, 375, 3, NULL, '2017-04-13 01:48:17', '2017-04-19 07:35:41'),
(477, 'Ninety one', 'Казахстанская поп-группа была основана в 2014 году и уже успела завоевать огромную популярность не только в Казахстане, но и за пределами страны. Первый сингл под названием «Айыптама» вышел 1 сентября 2015 года. Коллектив считается основоположниками корейского попа в Казахстане. Благодаря им появилось новое название в музыке в формате Q-pop (Qazaq pop). Продюсером является солист группы «Орда» Ерболат Беделхан.', '0', 0, 2, 3, 2, 376, 6, NULL, '2017-04-13 01:49:11', '2017-04-13 01:49:11'),
(478, 'Лимузин Гелендваген', '<p>Новый Лимузин Гелендваген G63 AMG 2016 года. Единственный в Астане Гелендваген с 5й чайко дверью. Салон оснащен 2 кондиционерами и 2 печками. Эксклюзивный 3D-Видео пол и потолок, 3D бар, световое и лазерное шоу.</p>', '0', 0, 2, 2, 2, 377, 3, NULL, '2017-04-13 01:50:34', '2017-04-19 07:35:51'),
(479, 'Нурман Avto', '', '0', 0, 2, 2, 2, 379, 4, NULL, '2017-04-13 01:51:38', '2017-04-13 01:51:38'),
(480, 'Серик Ибрагимов', 'Қазақ эстрадасының жарық жұлдызы, талантты, жас әнші Серік Ибрагимов.', '0', 0, 2, 3, 2, 378, 6, NULL, '2017-04-13 01:51:59', '2017-04-13 01:51:59'),
(481, 'Mercedes G class', '<p>Mercedes G-500 &ndash; брутальный, надежный, стильный и современный внедорожник. Гелендваген отличник концерна Мерседес. Этот мощный автомобиль не подведет Вас никогда. Ему под силу дорога любой сложности.</p>', '0', 0, 2, 2, 2, 380, 3, NULL, '2017-04-13 01:53:19', '2017-04-19 07:35:57'),
(482, 'Орда', 'Группа «Орда» образовалась, когда два семейных подряда — братья Бедельхан и братья Оразбековы, вместе выступали с танцевальными и музыкальными номерами в известном тогда театре «Бауыржан-шоу».\r\n\r\nГруппа выступала в составе шоу. Главным постановщиком танцевальных номеров стал Ерболат Беделхан. В этот период они сочинили первые песни — «Белгiсiз жан» и «Махаббатым».\r\n\r\nВ 2002 году группа отделилась от театра и обрела собственное имя. В состав группы вошли три брата Бедельхан: Ерболат, Жанболат и Есболат. Основным направлением их деятельности тогда были танцы. Также в группу вошли Дастан и Рустем Оразбековы.\r\n\r\nВ 2003 группа записывает первую песню и снимает первый клип на “Узбекфильме”. Песня “Кеш менi“ становится хитом. Она 24 недели держится лидером чартов, попадает в ротацию на музыкальные каналы. Внезапно группу без особой раскрутки и продюсера накрывает слава.\r\n\r\nВ 2007 году казахстанская диаспора приглашает группу на концерт в Лондон. В этот год они выпускают клипы на два своих ярких хита — “Jam on” и “Қилы заман“. Оба клипа снимаются в России — один в Москве, а другой на “Ленфильме”. Группа закрепляет свой статус успешного коллектива. Они выпускают первый альбом — “1”.\r\n\r\nЗа время своего творчества “Орда” попробовала себя в разных стилях: народные песни, попса, фолк, рок, R&B, хип-хоп, клубная музыка. В каждом из них группе удавалось создавать неплохие качественные треки на казахском, английском и русском языках. Не забывали они и о танцах, демонстрируя свои таланты в клипах и на концертах. В скором времени, группа фактически пришла к “самоуправлению”. Директором коллектива становится Жанболат Беделхан, а менеджером Рустем Оразбеков. Члены группы всегда гордились своей независимостью от менеджеров и продюсеров, и свободой в творчестве, в решениях о проведении концертов.', '0', 0, 2, 3, 2, 382, 6, NULL, '2017-04-13 01:54:32', '2017-04-13 01:54:32'),
(483, 'Rolls royce', 'Rolls royce белый, Rolls royce черный и лимузин.', '0', 0, 2, 2, 2, 381, 4, NULL, '2017-04-13 01:55:58', '2017-04-13 01:55:58'),
(484, 'МузАрт', '<p>В 2001 году в апреле месяце образовалась группа &laquo;МузАРТ&raquo;. В составе группы основными солистами являются Мейрамбек Бесбаев, Сакен Майгазиев и Кенжебек Жанабилов. Оценив возможности друг друга, ребята решили объединиться и создать эстрадную группу. В Казахстане сегодня много групп, но это трио сумело найти свое неповторимое лицо: в репертуаре группы есть и эстрадные и народные песни, но приоритет отдается ретро. Все это объединено одним национальным колоритом. В стране они пользуются большим успехом, их приглашают на различные концерты, конкурсы, выступления. Песню &laquo;Уш коныр&raquo;, написанную президентом Казахстана, Нурсултан Абишевич поручил спеть ребятам из группы &laquo;МузАрт&raquo;. 2001 г. М. Бесбаев вышел на профессиональную сцену и дал отчетный концерт. 2003 г. 16-17 декабря у трио &laquo;МузАрт&raquo; прошел концерт под названием &laquo;Өз елім&raquo; (т.е. Свой народ). 2003-04г. Став популярным по всему Казахстану, группа &laquo;МузАрт&raquo; решила покорять зарубежье . Они стали гастролировать по КНР и по России. 2005г. В Составе группы произошли изменения, поменялся солист группы Жанабилов Кенжебек. 2006г. Дали сольный концерт в Турции, в городах Стамбул и Анкара. 2008г. В мае месяце прошел сольный концерт ансамбля &laquo;МузАрт&raquo;. По многочисленным просьбам слушателей, ансамбль дал три дня подряд концерт с полным аншлагом, даже яблоку негде было упасть. После, ребята отправились гастролировать по Южному и Восточному Казахстану, побывав в 8-ми городах. Концерты проходили на стадионах, там концерты прошли так же на ура. Поступают предложение выступить сольным концертом из разных стран, таких как: Англия, Россия, Монголия, Китай. Об ансамбле &laquo;МузАрт&raquo; снимается документальный фильм. Группа не раз давала благотворительные концерты. Казахстанские сотовые связи выпустили ринг тоны ансамбля &laquo;МузАрт&raquo;, прибыли от которых поступают в детские дома. Сейчас группа пишет свой очередной, сольный альбом.</p>', '0', 0, 2, 3, 2, 383, 6, NULL, '2017-04-13 01:57:26', '2017-04-20 06:17:49'),
(485, 'Эскалайд', 'Дымовое шоу, лазерное шоу  на Эскалайд!', '0', 0, 2, 2, 2, 384, 4, NULL, '2017-04-13 01:58:20', '2017-04-13 01:58:20'),
(486, 'Дуэт «Дара»', '', '0', 0, 2, 3, 2, 386, 3, NULL, '2017-04-13 01:59:28', '2017-04-13 01:59:28'),
(487, 'Макпал Исабекова', 'Казахстанская эстрадная певица. Обрела популярность как участница проекта SuperStar KZ, ставшая известной поп-звездой. Начинающая актриса.\r\n\r\nВ 2014 году певица сыграла главную роль в фильме «Загнанная» в жанре драма-экшн режиссера Сапара Толегена.', '0', 0, 2, 3, 2, 385, 6, NULL, '2017-04-13 01:59:31', '2017-04-13 01:59:31'),
(488, 'Мадина Садвакасова', 'Казахстанская поп — певица, победительница молодёжного конкурса «Жас Канат» (1999), «Человек года» Кызылординской области. Была солисткой Президентского оркестра и ансамбля «Гулдер», телеведущая. Кроме того, является дипломированным психологом. Заслуженный деятель Республики Казахстана (2011).', '0', 0, 2, 3, 2, 388, 6, NULL, '2017-04-13 02:03:48', '2017-04-13 02:03:48'),
(489, 'Жігіттер тобы', '<p>История группы &ldquo;Жігіттер&rdquo; начинается в Шымкенте, когда четыре студента Южно-Казахстанского университета им. Ауэзова, ранее выступавшие на различных вокальных конкурсах, вместе поехали на международный конкурс &ldquo;Арай&rdquo;. Заняв там второе место, они не остановились на достигнутом, и приняли участие еще в нескольких конкурсах и выиграли Гран-при на конкурсе имени Шамши Калдаякова. Студенты-нефтяники быстро переквалифицировались в артистов и уехали делать карьеру в Алматы. Там первое время у них не было денег на то, чтобы снять клип или сделать аранжировку на свои песни. При помощи старших коллег и продюсера Ергали Абдраимова, они сняли первый клип на песню &laquo;Ерке қыз&raquo;, которая стала хитом. Записав еще несколько песен, они выпустили сборник песен &mdash; &laquo;Ерке қыз&raquo;. Первый сольник во Дворце Республики состоялся в 2006 году. Спустя некоторое время, выходит их второй альбом &ldquo;Бақытты бол&rdquo;. В первый состав квартета вошли: Ерсінбек Байжанов, Ердос Канаев, Баглан Абдраимов и Еркин Нуржанов, но затем Нуржанова заменил Мырзахан Маханов. В 2010 году группа выпустила два клипа на песни &laquo;Туған жер&raquo; и &laquo;Балқадиша&raquo;. В 2011 стали ходить слухи о возможном распаде группы. Это было связано с болезнью одного из солистов: у Ердоса Канаева была обнаружена вторая стадия зоба и язва желудка. Однако певцу удалось справиться с болезнью, и группа продолжила творческую деятельность. В 2011 они выпустили два альбома. Группа известна тем, что исполняет преимущественно серьезные и даже грустные песни. Также они всегда говорили о своей приверженности народному творчеству. Участники группы даже не танцуют при исполнении песен. &ldquo;Жігіттер&rdquo; по сей день активно продолжают творческую деятельность, выступают на концертах, появляются в телепередачах, записывают свои песни. Один из их последних клипов на песню &ldquo;Келсенші кунім&rdquo; был снят на станциях алматинского метро.</p>', '0', 0, 2, 3, 2, 389, 6, NULL, '2017-04-13 02:05:26', '2017-04-20 06:16:47'),
(490, 'ДЕРВИШИ', '<p>Участники международного фестиваля &laquo;Азия Дауысы&raquo; 1999 г., приз за лучшую аранжировку (песня \"Сады Жаркента\"), приз &laquo;Золотая домбра&raquo; в конкурсе \"7 лучших песен Казахстана\" внутри фестиваля. 2002 г. Турция, Анталия, фестиваль &laquo;Мега хит 2002&raquo;. Призеры казахстанского фестиваля &laquo;Золотой диск&raquo; 2000, 2001, 2002, 2003 гг.</p>\r\n<p>2005 г. Рустам Хашимов (ритм -гитара, бэк-вокал), взят в группу после смерти А.Масимова 2007 год, декабрь. Адиль Жамбакиев, в связи с назначением директором Уйгурского театра, уходит из группы.</p>\r\n<p>2008 год, февраль &mdash; взят в группу Вилямов Ханзат (бас-гитара, бэк-вокал). Настоящий состав группы: Д.Бахаров (солист, композитор, аранжировщик, продюсер), Р.Хамраев, Р.Хашимов, Х.Вилямов. С гастролями побывали &mdash; Венгрия, Болгария, Узбекистан, Кыргызстан, Турция, Азербайджан, Индия, Тайланд. Выпущено: 5 альбомов, 2 VCD, 2 DVD. Снято 2 музыкальных фильма-сказки.</p>', '0', 0, 2, 3, 2, 392, 6, NULL, '2017-04-13 02:14:12', '2017-04-20 06:14:51'),
(491, 'Беркут и Аиша', 'На первой встречи, между Аишой и Беркутом пробежала искра и стало понятно , что этот союз принесет зрителям и слушателям большое количество удачных творений!!!', '0', 0, 2, 3, 2, 393, 6, NULL, '2017-04-13 02:16:29', '2017-04-13 02:16:29'),
(492, 'Алтынай Жорабаева', '<p>Лауреат Х-Международного фестиваля &laquo;Азия дауысы&raquo;, Казахстан 2001 год. Дипломант Международного конкурса &laquo;Славянский базар&raquo;, Витебск 2003 год. Лауреат VIII-го Международного конкурса &laquo;Discovery&raquo;, который прошел в Болгарии, 2004 год. Обладательница Гран-при песенного конкурса &laquo;Янтарная звезда&raquo;, который прошел в Латвии, в городе Юрмала, 2004 год. Лауреат песенного конкурса &laquo;Александрия&raquo;, который прошел в Египте, 2005 год. Обладательница двух золотых и двух серебряных медалей чемпионата мира по исполнительскому мастерству, США, Голливуд 2005 год. Лауреат государственной молодежной премии &laquo;Дарын&raquo;, 2004 год. Заслуженный деятель Республики Казахстан, 2006 год. Почетный гражданин Казыгуртского района, 2008 год. Почетный гражданин района &laquo;Толе би&raquo;, 2013 год. Обладатель ордена &laquo;Курмет&raquo; 2016 год.</p>', '0', 0, 2, 3, 2, 394, 6, NULL, '2017-04-13 02:17:58', '2017-04-20 06:11:11'),
(493, 'Алишер Каримов', 'Казахстанский поп-исполнитель Алишер Каримов. Родился в городе Джамбул (сейчас этот город носит название Тараз). Впервые вышел на сцену в пять лет с песней «Чайхана» на Республиканском конкурсе «Әншi балапан» получил «Приз зрительских симпатий». Принимал участие в международных конкурсах и фестивалях в Турции, Болгарии, Франции.', '0', 0, 2, 3, 2, 395, 6, NULL, '2017-04-13 02:19:57', '2017-04-13 02:19:57'),
(494, 'Али  Окапов', 'Впервые Али появился на сцене в роли пианиста. До сих пор певец вспоминает концерт в летнем лагере, где ему пришлось надеть костюм шамана. В раннем возрасте Али не привлекала сцена или написание и исполнение песен и музыки. Но тот концерт дал толчок музыкальному развитию Окапова, после чего он пересмотрел свои взгляды на карьеру певца.\r\nПозже, наряду с исполнением песен Али Окапов был задействован в разных проектах. В 2008 году он стал преподавать в танцевальной школе «Вlack style dance studio», одновременно отвечал за клавиши в группе «Нot 10 band». А через год обрел новое дыхание, став солистом команды «SLANG». Также является фронтменом группы «FOX band».\r\n\r\nСамым сложным и в то же время решительным шагом на пути к вершинам славы для Али стало участие на «Фабрике звезд Казахстан». Певец благодарен матери, которая поддержала его решение участвовать. В условиях конкурса значилось, что петь нужно под фонограмму, но Окапов не поддержал эти условия, предложив организаторам живой звук. Благодаря ему и нескольким ребятам-единомышленникам жюри изменило условия конкурса, отныне все участники должны будут петь без фонограммы.\r\nАли Окапову было вдвойне трудно выступать во время конкурса, со всех сторон на него сыпались критические замечания. Многие думали, что ему как сыну Розы Рымбаевой успех обеспечен, но он хотел всего добиться сам.\r\n\r\nНесколько раз Али Окапов занимал второе место на конкурсах («Дельфийские игры» в Алматы и «Алматы журегiмде»). Одержал победу на конкурсе «Актобе jazz», пробился в финал «Фабрики звезд KZ». В его кармане уже лежат такие номинации как «Дебют года» по версии «Саз алемi 2012», «Лучший дебют» по версии «EMA muzzone awards», а еще его называют «Самым завидным женихом» по версии HIT TV.', '0', 0, 2, 3, 2, 396, 6, NULL, '2017-04-13 02:22:00', '2017-04-13 02:22:00'),
(495, 'Жанболат пен Жазира', 'Өнерімен елді тәнті еткен Жанболат пен Жазира есімі көпшілікке жақсы таныс. Сахнада жұбы жазылмаған қос әнші өмірде де көпке үлгі болардай берекелі отбасы.', '0', 0, 2, 3, 2, 397, 6, NULL, '2017-04-13 02:25:07', '2017-04-13 02:25:07'),
(496, 'Квартет Mezzo', 'Казахстанская музыкальная группа Mezzo покорила солистов квартета Il Divo в Астане.\r\n\r\nНедавно в Астане выступил прославленный мировой оперный квартет Il Divo, занесенный в Книгу рекордов Гиннесса. После сольного концерта интернациональный квартет встретился с четверкой вокалистов из казахстанской группы Mezzo. Казахстанцы поприветствовали иностранных гостей, рассказали свою историю и в неформальной обстановке исполнили отрывок из самой известной песни Il Divo — Regres a mi.\r\n\r\nГости из Великобритании были приятно удивлены и покорены профессионализмом и талантом казахстанских артистов, снимали их на видео и аплодировали им. «Для первой казахстанской группы, работающей в жанре неоклассики, эта встреча имела большое значение, ведь Il Divo по всему миру демонстрирует тот самый уровень, к которому стремятся молодые певцы из Mezzo», — рассказал продюсер музыкального коллектива.\r\n\r\nГруппа Mezzo подарила коллегам свой диск на память о встрече в Астане, признавшись, что следует за ними по миру — посещали их концерты в Лондоне, Москве. А солисты Il Divo дали молодым артистам напутствие и выразили надежду, что в самом ближайшем будущем казахстанцы покорят сердца слушателей по всему миру.', '0', 0, 2, 3, 2, 398, 6, NULL, '2017-04-13 02:29:19', '2017-04-13 02:29:19'),
(497, 'Дильназ Ахмадиева', 'Дильназ Ахмадиева является продолжателем династий двух артистических семей, начала свою карьеру в возрасте 4 лет, она снялась в детском фантастическом фильме «Волшебное яблоко». Двумя годами позже она исполнила известную в то время песню «Аист на крыше» на сцене Уйгурского театра города Алма-Ата, играла в спектаклях уйгурского театра. В 10 лет по заказу «ОРТ» Казахское телевидение сняло её сольное танцевальное выступление в 30-минутной передаче. В 1993 году Дильназ впервые вышла на самую большую в Алматы сцену Дворца Республики им. Ленина.\r\nВ 1997 году окончила лицей, в 2002 году завершила обучение на факультете английского языка Казахского Государственного университета международных языков по специальности «переводчик — референт».\r\nС 1997 года работает солисткой — вокалисткой Государственного Республиканского Уйгурского театра. Работала с продюсерами Русланом Тохтахуновым, Гульвирой Илахуновой (песня «Ты меня больше не увидишь»), Адилем Жамбакиевым (песня «Может однажды»).\r\nВ 2002 году представила Казахстан на международном песенном конкурсе «Новая волна» в Юрмале (Латвия).\r\nВ 2004 году, после съемок в казахстанском проекте «Кочевник» (роль Хоши) она проходит курсы актерского мастерства в Голливуде, штат Калифорния.\r\nВ 2012 году получила звание «Заслуженный деятель Республики Казахстан».', '0', 0, 2, 3, 2, 399, 6, NULL, '2017-04-13 02:31:33', '2017-04-13 02:31:33'),
(498, 'Акбота Керимбекова', 'Акбота Керимбекова-певица Казахстанской эстрады.', '0', 0, 2, 3, 2, 400, 6, NULL, '2017-04-13 02:33:25', '2017-04-13 02:33:25'),
(499, 'Айқын', 'Впервые Айкын засветился на экранах в качестве финалиста первого мега-проекта «Superstar.kz». Когда он по итогам голосования выбыл из числа претендентов на победу, жюри было в недоумении, а поклонницы певца устроили настоящий митинг в его защиту. Но Айкын не остался просто очередным участником конкурса по штампованию звезд, где если ты не дойдешь до финала, то «канешь в лету».\r\n\r\nЧерез некоторое время Айкын начинает сотрудничать со «звездным» продюсером Эриком Тастембековым. Итогом творческого союза становится песня Корабли. На песню снимается клип и пускается в ротацию на крупнейшие музыкальные каналы Казахстана. Народ начинает вспоминать того самого простого алматинского парня. Далее выходит чувственный клип на песню «Как дела?». Песня становится большим хитом и об Айкыне узнают все больше людей. Однако же главным хитом Айкына становится песня «Жалгыз Сен». На песню был снят клип. Съемки клипа проходили в одном из торговых центров Алматы. Песня пользовалась большим спросом, а клип на него крутили по всем музыкальным каналам Казахстана.\r\n\r\nВ 2006 году Айкын представляет Казахстан на конкурсе молодых исполнителей «Новая волна 2006». Из пяти тысяч претендентов на право представлять свою страну в Москве на полуфинале конкурса выбрали только 80 человек, 6 из них – казахстанцы и  только Айкын смог доказать реальность своего «звездного» статуса.', '0', 0, 2, 3, 2, 401, 6, NULL, '2017-04-13 02:34:56', '2017-04-13 02:34:56'),
(500, 'Айгуль Иманбаева', 'Айгуль Иманбаева — актриса, певица, журналистка, телеведущая.\r\nРодилась в поселке им. Кенена Азирбаева Кордайского района, Жамбылской области.\r\nВ 1994 г. поступила в театральное отделение Национальный академии искусств имени Т. Жургенова; в 2002 г. поступила на факультет «журналистики» Казахского Национального университета им. Аль-Фараби. \r\nОкончив академию в 1998 г., начала творческую карьеру преподавателем в эстрадно-цирковом колледже имени Ж. Елебекова. Занимала преподавательскую должность в консерватории им. Курмангазы.\r\nРаботает актрисой в академическом театре им. Г. Мусрепова с 1999 года.\r\nС открытием передачи «Ұят болмасын» на телеканале «Хабар» в 2001 г. работала ведущей, играла в образе невестки. \r\nВ 2001 г. на первом Республиканском конкурсе юмора удостоилась главного Приза, ставила пародии на певцов.\r\nОбладатель главного Приза конкурса «Қазақ әндері» в рамках международного конкурса «Азия дауысы» (2004).\r\nВ театре играла различные главные и интересные роли: Жибек в спектакле «Қыз Жібек», Газизу в «Пай, пай, жас жұбайлар ай» , Гульжан в «Таланған тағдыр», Алму в «Алма бағы», Клару в «Көгілдір такси», Акмарал в «Желтоқсан желі» и многие другие.\r\nВ 2005 г. сыграла образ матери главы государства в фильме «Сүйінші», снятом агентством «Хабар».\r\nКарьеру на эстраде начала в 1999 году. Её песня «Таңғы елес» завоевала место в сердце народа, и в 2006 г. получила Государственную премию молодежи «Дарын». В том же году провела первый сольный отчетный концерт под названием «Таңғы елес». Снялась в видеоклипах на песни: «Жаным», «Махаббат мұңы», «Таңғы елес 1», «Мен ғашық өмір», «Үмітім менің», «Шарайна», «Әдемі қыз», «Таңғы елес 2».', '0', 0, 2, 3, 2, 402, 6, NULL, '2017-04-13 02:36:36', '2017-04-13 02:36:36'),
(501, 'Расул Жармагамбетов', 'Певец с голосом непревзойденной силы и красоты. Актер театра и кино. Бархатный баритон артиста проникает в самое сердце слушателя, даря наслаждение проникновенного и живого вокала. Безупречное исполнение международных и авторских песен эстрадного и оперного жанра на казахском, русском, итальянском языках никого не оставляет равнодушным. Многократный лауреат международных и республиканских конкурсов. Член жюри детского Евровидения. С легкостью поможет вам создать круг истинных ценителей вашей личности!', '0', 0, 2, 3, 2, 403, 6, NULL, '2017-04-13 02:37:58', '2017-04-13 02:37:58'),
(502, 'Анастасия Кожухарова', '<p>Анастасия Кожухарова &ndash; молодая, талантливая оперная певица, представляла Казахстан в номинации &laquo;Лучший женский голос&raquo; в оперной премии The Opera Ball Award 2015. В 2013 году закончила Казахскую Национальную Консерваторию им. Курмангазы, по специальности &laquo;оперный вокал&raquo;. По различным программам проходила обучение в Италии у Маэстро Альберто Алжери и по программе академической мобильности в Польше в Варшавском Университете музыки им. Шопена (профессор Ядвига Раппе). В 2013 году была обладателем стипендии от фонда Первого Президента РК Лидера Нации. В этом же году ездила на мастер класс к Мадам Монтсеррат Кабалье и брала у неё уроки. Свободно владеет итальянским, английским и немецкими языками. Записала свой диск. Победа в 2011 году на международном форуме в Болгарии. 2 место в Казахской Романсиаде (Казахстан) в 2011 году. Вторая премия на международном конкурсе оперных певцов в Казахстане 2013. В 2014 году выиграла грант от Австрийской стороны на участие в международном мастер классе для оперных певцов. Выиграла приз зрительских симпатий в конкурсе им. Лео Слезака, выступала на престижной сцене Шёнбрун опера. В мае 2015 дала сольный концерт в Вене из двух отделений по их приглашению. Обладатель третьей премии в международном оперном конкурсе в Японии.</p>', '0', 0, 2, 3, 2, 404, 6, NULL, '2017-04-13 02:39:46', '2017-04-20 06:07:42'),
(503, 'Трио «Асыл»', '<p>Группа &laquo;ASSYL&raquo; состоит из трех очаровательных девушек. Группа является вокально-инструментальной командой, несет в себе этническую направленность, которая выражается как в профессиональном вокале и хореографии, так и в живом исполнении на национальном, одном из древнейших инструментов &mdash; Кобыз. Группа позиционирует себя как ЭТНО, не ограничивая себя в одном определенном стиле. Позитивные и динамичные треки &laquo;зажигают&raquo; желание потанцевать, а душевные &ndash; задуматься, и вызывают букет эмоций и чувств. ASSYL можно назвать новой, яркой казахстанской этно-группой. Каждая работа проявляет суть этой новой группы, игрой на электро-кобызах и неповторимыми этническими казахскими мотивами. Время настало&hellip;смотреть очередную работу группы!</p>', '0', 0, 2, 3, 2, 405, 6, NULL, '2017-04-13 02:41:20', '2017-04-20 06:06:10'),
(505, 'Трио «Асыл»', 'Группа «ASSYL» состоит из трех очаровательных девушек.\r\nГруппа по сути является вокально-инструментальной командой, несет в себе этническую направленность, которая выражается как в профессиональном вокале и хореографии, так и в живом исполнении на национальном, одном из древнейших инструментов — Кобыз.\r\nГруппа позиционирует себя как ЭТНО, не ограничивая себя в одном определенном стиле. Позитивные и динамичные треки «зажигают» желание потанцевать, а душевные – задуматься, и вызывают букет эмоций и чувств. ASSYL можно назвать новой, яркой казахстанской этно-группой.\r\n\r\nКаждая работа проявляет суть этой новой группы, игрой на электро-кобызах и неповторимыми этническими казахскими мотивами.  Время настало…смотреть очередную работу группы!', '0', 0, 2, 6, 2, 405, 6, NULL, '2017-04-13 02:46:16', '2017-04-13 02:46:16'),
(506, 'Chrysler', '<p>Черный крайслер 882 VBA.</p>', '0', 0, 2, 2, 2, 387, 4, NULL, '2017-04-13 02:49:35', '2017-04-19 05:22:46'),
(507, 'Umberto Project', '<p>DJ Umberto Project является кубинской группой, основанной в 2011 году. В состав группы входят: Даниэла Савоурнин (вокал), Александр Искьердо (вокал-перкуссия), Умберто Сармиенто (Dj Умберто) вокал, перкуссия и директор группы. Группа имеет широкий репертуар. В репертуар группы входят: латино, зарубежные и казахские хиты в аранжировках от Дж Умберто. Dj Umberto Project &mdash; предоставляет не только мастер-класс для своей публики но так же исполняет Flash-Mob и барабанное шоу, таким образом публика участвует в Интерактиве. Выступления группы видели и слышали не только на национальной эстраде а так же на международных площадках. За период своей карьеры группа не однократно разделяла сцену с известными артистами Шоу-бизнеса.</p>', '0', 0, 2, 3, 2, 406, 6, NULL, '2017-04-13 02:50:37', '2017-04-20 06:05:34');
