(508, 'Gelendewagen', '<p>Марка, модель: gelendewagen</p>\r\n<p>Количество мест: 4</p>\r\n<p>Тип: Джип</p>\r\n<p>Цвет: Черный</p>\r\n<p>Госномер: 141CVA</p>\r\n<p>Тонировка: Есть</p>', '0', 0, 2, 2, 2, 407, 4, NULL, '2017-04-13 02:51:09', '2017-04-19 05:23:10'),
(509, 'SIN-FRONTERA', '<p>SIN-FRONTERA &mdash; ЛАТИНСКАЯ ГРУППА.</p>\r\n<p>Яркая, зажигательная кубинская группа &laquo;Sin Frontera&raquo;. Группа Sin Frontera перепела один из самых популярных казахстанских хитов \"Аспанга караймын\", без которого не обходится ни одна свадьба. Казахстанская группа \"Уш Терек\" (Арман Алим, Нурмаганбет, Kenny Jey) и кубинская группа Sin Frontera (Rodyn Fernandez, Omar Arango Torres, Efrain Yohandi Fuentes) исполнили традиционную казахскую свадебную песню \"Жар-жар\" в казахско-кубинском стиле, которая пользуется большим спросом на свадьбах.</p>', '0', 0, 2, 3, 2, 408, 6, NULL, '2017-04-13 02:52:15', '2017-04-20 07:32:31'),
(510, 'Auto', '<p>Обслуживание любых торжеств (делегация, выставка, форум, саммит, свадьба, қыз ұзату, выписка из роддома, и т.д. ) встречи, проводы. Возможность аренды машин (премиум, бизнес, эконом) с водителем почасовой, посуточно выезд в любую точку Казахстана. Контроль качества обслуживания клиентов. VIP встречи.</p>', '0', 0, 2, 2, 2, 409, 4, NULL, '2017-04-13 02:53:40', '2017-04-19 05:23:47'),
(511, 'La Fres-k ', '<p>La Fres-k кубинская группа, основанная в 2003 из Arisnubia Martinez Lores и других. Начало профессиональной карьеры под международным контрактом с &laquo;La fine production&raquo; и &laquo; Art blank&raquo;. В августе 2009 Fres-k подписывает контракт с престижным музыкальным предприятием Musicalia, для того, чтобы работать в Казахстане, где они работают по сегодняшний день. Также у них было много выступлений в различных городах Казахстана с большим принятием публики.</p>', '0', 0, 2, 3, 2, 410, 6, NULL, '2017-04-13 02:54:27', '2017-04-20 06:03:17'),
(512, 'Bentley', '<p>Марка, модель: bentley</p>\r\n<p>Количество мест: 4</p>\r\n<p>Тип: Седан</p>\r\n<p>Цвет: Белый</p>\r\n<p>Госномер: 001XKM</p>\r\n<p>Тонировка: Нет</p>', '0', 0, 2, 2, 2, 411, 4, NULL, '2017-04-13 02:55:39', '2017-04-19 05:24:20'),
(513, 'Дуэт «АРНАУ»', 'Дуэт «АРНАУ»: искренность исполнения, запоминающийся вокал. В его состав вошли Нуржан Керменбаев. И новая солистка — Салтанат Бакаева.\r\n\r\nПричин для создания дуэта «Арнау» несколько: в настоящее время отечественная эстрада нуждается в качественных и оригинальных казахско-язычных проектах, развивающих современную масс-культуру и шоу-бизнес Казахстана в целом, во-вторых, формат вокального романтического дуэта изначально привлекает повышенный интерес со стороны публики, в-третьих, в искренности исполнения можно не сомневаться, так как участников связывают теплые дружеские отношения.\r\n\r\nОб участниках дуэта:\r\nНуржан Керменбаев родом из Карагандинской области, родился в шахтерской семье в городе Сатпаев. Певческие таланты проснулись рано. Закончил Жезказганский музыкальный колледж по специальности: ДХО — Дирижерско-Хоровое отделение в 2009 году. В 2006году выиграл национальный телевизионный проект «SUPERSTAR.KZ-3». В 2009 году представлял Казахстан на международном конкурсе популярных молодых исполнителей в городе ЮРМАЛА, ЛАТВИЯ — «НОВАЯ ВОЛНА».\r\nСалтанат Бакаева — родилась в Алматинской области. С 5 лет поступила в среднюю специализированную музыкальная школа им. Куляш Байсеитовой по классу: домбра и общее фортепиано. В 2005 году поступила в Казахскую Национальную академию искусств им. Т. Жургенева по специальности: актриса музыкального театра и кино. Работала в ТЮЗе имени Габита Мусрепова. На данный момент является актрисой Академического Драматического театра им. М. Ауэзова.\r\n\r\n', '0', 0, 2, 3, 2, 390, 6, NULL, '2017-04-13 02:57:50', '2017-04-13 02:57:50'),
(514, 'Арслан Джумаев', 'С марта 2017 года, Арслан Джумаев занимает первую строчку среди самых востребованных шоуменов Казахстана в свадебной индустрии, по мнению «LOFFICIEL KAZAKHSTAN».\r\nАрслан, всегда может приятно удивить новыми идеями и нестандартным подходом, каждое его мероприятие это необычное и яркое представление. В отличие от многих, Арслан имеет свой собственный стиль и следует ему.\r\nВедущий на телеканале “MUZZONE”, актер. Арслан занимается ведением мероприятий с 2006 года, и за 11 лет работы успел провести более 1000 различных событий. Является профессионалом своего дела, каждое его мероприятие это всегда необычное и яркое представление.', '0', 0, 2, 4, 2, 414, 6, NULL, '2017-04-13 03:00:30', '2017-04-13 03:00:30'),
(515, 'VIVA трио', '', '0', 0, 2, 3, 2, 413, 4, NULL, '2017-04-13 03:00:34', '2017-04-13 03:00:57'),
(516, 'Спирина Ольга', 'Спирина Ольга в настоящее время ведущая утренней познавательно –развлекательной программы на казахском языке “Жаңа күн” на телеканале “Хабар”. Не так давно состоялся актерский дебют в телесериале “Агент Z” (режиссер М. Бидосов).\r\n\r\nПроекты: XIX сессия Ассамблеи народа Казахстана (2012 г.), концерт — презентация хореографического коллектива “ASTANA BALLET” (2013 г.), дневники IX Международного Кинофестиваля “Евразия” (телеканал “Хабар” 2013 г.), правительственный концерт посвященный независимости РК (г. Астана, ЦКЗ «Казахстан», 2013 г.), дни культуры Астаны в Санкт-Петербурге (г. Санкт-Петербург, Михайловский театр, Государственная академическая капелла, 2014 г.).', '0', 0, 2, 4, 2, 415, 6, NULL, '2017-04-13 03:01:43', '2017-04-13 03:01:43'),
(517, 'TIANA', 'TIANA – очаровательная молодая певица из России, обладательница чарующего голоса и широкого диапазона. Ежегодная участница Международного джазового фестиваля и победительница множества музыкальных конкурсов. В ее репертуаре собраны  самые лучшие зарубежные хиты и всемирно известные джазовые композиции. TIANA выступала на одних площадках с такими именитыми артистами, как группа IOWA, , KREC, певица Вера Брежнева, Татьяна Овсиенко, Мадина Садвакасова, звезды COMEDY CLUB Дмитрий Хрусталев и Марина Кравец, звезды лейбла BLACK STAR MOT, Kristina Si, NATAN, DJ KAN, MC DONI, HANNA.', '0', 0, 2, 3, 2, 416, 4, NULL, '2017-04-13 03:02:54', '2017-04-13 03:02:54'),
(518, 'Тимур Дорогой', '<p>Тимур Дорогой работает на рынке корпоративных услуг с конца прошлого века и представляет полный спектр услуг, связанный с проведением корпоративного и специального мероприятия любой сложности: конференция, PR-акция, юбилей компании, новогодний корпоративный праздник, загородный выезд, детский праздник и многое другое.&nbsp;</p>', '0', 0, 2, 4, 2, 417, 6, NULL, '2017-04-13 03:03:17', '2017-04-20 07:25:40'),
(519, 'Kaba', '<p>Музыкант на любые мероприятия! Замечательный певец Kaba украсит своим выступлением любое мероприятие. Певец исполняет огромное количество песен разных исполнителей (от музыки 80-х, до современных западных исполнителей) на разных языках, очень артистичен. Качественная аппаратура на любой зал! Эстрадное пение! Опыт работы 6 лет. Широкий репертуар от востока до запада, дискотека разных поколений. Отличное качество предоставляемых услуг на любое мероприятие.</p>', '0', 0, 2, 3, 2, 412, 3, NULL, '2017-04-13 03:03:56', '2017-04-19 07:36:13'),
(520, 'Руслан Искаков', 'Руслан Искаков – шоумен современности!\r\nВы мечтаете о ярком празднике? Желаете удивить близких неповторимым шоу? И получить при этом максимум положительных эмоций? Руслан Искаков — шоумен с талантом от бога. Он не просто ведущий, он Шоумен. Да, именно так – с большой буквы. Не тратьте время на поиски, ведь перед вами – экстравагантный, словно Гэтсби, стильный, как Хавьер Бардем, веселый, как Эдди Мерфи – Руслан Искаков. Он харизматичный, он перспективный, он просто лучший двуязычный ведущий.\r\nРуслан всегда выходит за рамки скучного ведения праздников, каждый раз придумывая новые конкурсы и танцевальные номера, которые никогда не повторяет.\r\nИзюминкой Руслана Искакова является профессионализм во всем –он не только эпатажный казахский шоумен, но и поэт.\r\n\r\nПоручив Руслану Искакову праздник, вы можете быть уверены в торжественности и яркости вашего мероприятия. Он раскрасит вашу жизнь, обеспечит стопроцентный положительный результат и заставит всех еще долго вспоминать ваш праздник как лучшее событие проходящего года!', '0', 0, 2, 4, 2, 418, 6, NULL, '2017-04-13 03:04:40', '2017-04-13 03:04:40'),
(521, 'Сандра', 'В репертуаре такие направления как: lounge, pop, jazz, country, soul, так же присутствуют казахские современные песни и конечно же авторские произведения самой певицы. Программа длится от двух до трех часов. Возможен выезд в другие города.', '0', 0, 2, 3, 2, 419, 4, NULL, '2017-04-13 03:05:24', '2017-04-13 03:05:24'),
(522, 'Нугманов Даурен', 'Ведущий. Тамада. Организатор.\r\nПроведение и организация любых торжественных мероприятий на казахском, русском языках:\r\nВсе виды свадеб, детские праздники, асенди, хангаб, корпоративы, тимбилдинги, презентации, юбилеи, разработка индивидуального сценарного плана', '0', 0, 2, 4, 2, 420, 6, NULL, '2017-04-13 03:05:54', '2017-04-18 03:16:10'),
(523, 'Самат & Назгуль', 'Эстрадалық әрі дәстүрлі әндерді орындайтын танымал дуэт. Кез-келген салтанатты кештерде түрлі тақырыптағы әндермен қызықтырады. Кешіңізді сәнді әрі мәнді өткізгіңіз келсе Самат & Назгүлді шақырыңыз.\r\nПопулярный дуэт, Самат & Назгуль, исполняют эстрадные и народные песни. Наполнят ваш праздник незабываемым выступлением.', '0', 0, 2, 3, 2, 423, 4, NULL, '2017-04-13 03:07:25', '2017-04-13 03:07:25'),
(524, 'Мухамед Жанов', '<p>Мухамед Жанов - ведущий, шоу-мэн.</p>\r\n<p>Обладает непринужденностью, чувством юмора, смекалкой и находчивостью. Он невероятно легко и быстро умеет найти общий язык со всеми гостями, никому не даст заскучать и поразит всех своими искрометностью и талантом.</p>\r\n<p>Мухамед Жанов Входит в ТОП 10 лучших ведущих Казахстана. В сфере ивент индустрии считается самым стильным ведущим. Индивидуальный подход к каждому мероприятию. Постоянное обновление своей шоу-программы. Отличный юмор.</p>', '0', 0, 2, 4, 2, 422, 6, NULL, '2017-04-13 03:07:35', '2017-04-20 07:38:46'),
(525, 'Оралхан Алтынбеков', '<p>Оралхан предлагает вашему вечеру много задушевных и танцевальных песен.</p>', '0', 0, 2, 3, 2, 421, 3, NULL, '2017-04-13 03:08:32', '2017-04-19 07:36:42'),
(526, 'Новобранцева Людмила', 'Новобранцева Людмила Александровна, музыкальное сопровождение всех мероприятий: свадьбы, юбилеи корпоративы, дни рождения.\r\nРепертуар разносторонний каз, рус, заруб, lounge, pop.\r\nСтаж работы 15 лет.', '0', 0, 2, 3, 2, 424, 4, NULL, '2017-04-13 03:08:51', '2017-04-13 03:08:51'),
(527, 'Кумар Лукманов', 'Популярный ведущий, высококлассный шоумен, опытный координатор всего праздничного процесса. Клиенты из разных частей света оценили профессионализм Кумара Лукманова как организатора и ведущего мероприятия. Создает авторские программы и индивидуальные сценарии исходя из пожеланий и возможностей заказчиков. Уже на первой встрече с Кумаром, он предложит вам различные варианты проведения вашего мероприятия, но единственным что останется не изменным — это неповторимый стиль. Всегда ярко, интересно, качественно, интеллигентно!', '0', 0, 2, 4, 2, 425, 6, NULL, '2017-04-13 03:09:26', '2017-04-13 03:09:26'),
(528, 'Кайрат Тунтеков', '“Super Star” байқауының жеңімпазы! Ерекше дауыс иесі, сіздердің кез келген қуаныштарңызда бірге!', '0', 0, 2, 3, 2, 427, 4, NULL, '2017-04-13 03:10:53', '2017-04-13 03:10:53'),
(529, 'Кирилл Мейстер', '“Шоумен и телеведущий Кирилл Мейстер – настоящий профессионал, входящий в ТОП 10 лучших шоуменов в Алматы»!\r\nПрофессиональный ведущий мероприятий на 4-х языках с многолетним опытом работы на телевидении и в ивент-индустрии. В настоящее время официальный ведущий программы «Ревю» на НТК.\r\n\r\nМастерски Кирилл Мейстер справляется с любым объемом зрителей, как на официальном, так и на частном мероприятии.\r\nКирилл Мейстер– это:\r\n— интересный и интеллигентный ведущий;\r\n— уникальная и авторская шоу-программа;\r\n— яркие и теплые эмоции гостей;\r\n— Европейский светский стиль ведения, без пошлостей и глупых конкурсов;\r\n— грамотная речь, превосходная дикция и поставленный на телевидении голос;\r\n— большой багаж проведения разноплановых мероприятий на четырех языках;\r\n— приятная внешность и умение удерживать внимание любой публики;\r\n— неординарность и наличие безмерной харизмы;\r\n— интересно и со вкусом на русском, английском, французском и казахском языках.', '0', 0, 2, 4, 2, 428, 6, NULL, '2017-04-13 03:11:02', '2017-04-13 03:11:02'),
(530, 'Айдана', '', '0', 0, 2, 3, 2, 429, 4, NULL, '2017-04-13 03:12:10', '2017-04-13 03:12:10'),
(531, 'Ильяс Ибраимов', 'Молодой, энергичный, с энтузиазмом, не люблю использовать обычные шаблоны и типичные  подходы к мероприятиям, предпочитаю оригинальность и креативность!\r\nОсобенности:\r\nВеду мероприятия на казахском, русском и английском языках. Выступаю как исполнитель на домбре и участник дуэта «Сезім» (домбра и кобыз).', '0', 0, 2, 4, 2, 430, 6, NULL, '2017-04-13 03:12:32', '2017-04-13 03:12:32'),
(532, 'Иса Алимусаев', '<p>&laquo;Қазақстан дауысы&raquo; жобасының финалисті.</p>\r\n<p>Музартlive жобасының финалисті.</p>\r\n<p>Әр түрлі тілде ән айтады: Ағылшын, орыс, қазақ, өзбек, италиян тілдерінде.</p>', '0', 0, 2, 3, 2, 431, 4, NULL, '2017-04-13 03:14:04', '2017-05-26 05:30:28'),
(533, 'Дильмурат Джамбакиев', 'Актер театра им. М.Ю. Лермантова, объединяющий в себе все профессиональные качества ведущего, шоумена, тамады, конферансье. Его действительно можно назвать человеком-праздником.', '0', 0, 2, 4, 2, 432, 6, NULL, '2017-04-13 03:14:08', '2017-04-13 03:14:08'),
(534, 'Арман Қарынсау', 'Арман Қарынсау 2013 жылы өткен «Жұлдызды сәт» телевизиялық байқауының жеңімпазы.', '0', 0, 2, 3, 2, 433, 4, NULL, '2017-04-13 03:15:22', '2017-04-13 03:15:22'),
(535, 'Вадим Фишер', 'Трехъязычный ведущий Вадим Фишер (Қаз, Рус, Eng)\r\n\r\nЕсли Вы зашли на мою страницу, наверняка Вам интересно узнать кто такой Вадим Фишер. И так, немного о себе: На рынке event-индустрии я работаю уже 10 лет. Веду мероприятия свободно на трех языках, а именно:казахский, русский, английский. Хорошо разбираюсь во многих традициях и обычаях, которые обязательно должны присутствовать при проведении свадьбы, годика ребёнку или разрезания пут. Конечно, я бы мог Вам расписать целое резюме о проведенных мною мероприятиях, но смотреть лучше, чем читать.', '0', 0, 2, 4, 2, 434, 6, NULL, '2017-04-13 03:15:51', '2017-04-13 03:15:51'),
(536, 'Айнура Нурашова', 'Певица с замечательным голосом, в репертуаре которой современные и народные казахские песни.', '0', 0, 2, 3, 2, 435, 4, NULL, '2017-04-13 03:16:45', '2017-04-13 03:16:45'),
(538, 'Dj Эльдарадо', 'Тамада — ведущий на казахском, русском  и английских  языках. Организатор мероприятий любого формата. Знание всех обрядов , обычай и традиций.', '0', 0, 2, 4, 2, 436, 4, NULL, '2017-04-13 03:18:27', '2017-04-13 03:20:04'),
