(542, 'Арстан  Мырзагереев', '<p>ШОУМЕН, 3-х ЯЗЫЧНЫЙ ВЕДУЩИЙ. Языки проведения: РУССКИЙ, КАЗАХСКИЙ, АНГЛИЙСКИЙ (С очаровательной соведущей). Проведение своих мероприятий Арстану доверяют такие компании как Тенгиз Шевроил, Казахмыс, КазМунайгаз, Казактелеком, Эир Астана, Темир банк, Альянс полис, Акимат г. Алматы, и т.д. Ну конечно не будем забывать о множестве людей доверивших Арстану проведение самых ярких и красочных праздников своей семьи будь то свадьба, узату, тусау кесер, юбилей или день рожденья. Какие именно мероприятия проводит Арстан? &mdash; спросите вы. Ответ прост &mdash; какие угодно &mdash; главное чтобы были люди которые хотят повеселиться от души и узнать друг друга получше, либо по светски пообщаться со своей целевой аудиторией в формальной или не формальной обстановке! Есть своя команда и при взаимном желании Арстан берет шоу-программу мероприятия под ключ &mdash; 10 лет опыта на сцене дали очень много знакомств с самыми лучшими артистами во всех сферах шоу индустрии. Так же есть небольшой БОНУС: Блок танцевальных песен. Зажгем от души!</p>', '0', 0, 2, 4, 2, 440, 6, NULL, '2017-04-13 03:21:35', '2017-04-20 07:23:45'),
(543, 'Фархат Балкыбекулы', 'Шоумен-филолог, журналист.', '0', 0, 2, 4, 2, 441, 4, NULL, '2017-04-13 03:22:23', '2017-04-13 03:22:23'),
(544, 'Арстан и Тахир', 'Проведение свадеб, корпоративов, концертов, шоу программ на русском, казахском, английском языках. Слаженный коллектив ведущих не оставит равнодушными ни одного гостя от 6 до 70 лет! Яркая шоу-программы, конкурсы, зажигательные пародийные музыкальные хиты как отечественного, так и мирового звездного олимпа, блестящие шуточные сценки в лучших КВН-овских традициях, да и просто хорошее настроение и позитивный настрой – все это ждет вас на самом незабываемом вечере, который проведут для вас Участники Лучшего Дуэта Ведущих – Арстан Мырзагереев и Тахир Султан!', '0', 0, 2, 4, 2, 443, 6, NULL, '2017-04-13 03:22:54', '2017-04-13 03:22:54'),
(545, 'Серик Абдуали', '', '0', 0, 2, 4, 2, 444, 4, NULL, '2017-04-13 03:23:20', '2017-04-13 03:23:20'),
(546, 'Азамат Аскарович', '', '0', 0, 2, 3, 2, 442, 3, NULL, '2017-04-13 03:23:47', '2017-04-13 03:23:47'),
