(548, 'Ардак Ережепов', '<p>Двуязычный ведущий. Автор юмористического проекта &laquo;Әзіл-Студио&raquo; 31 канал. Автор и актер юмористичекского проекта &laquo;Ризамын&raquo; 31 канал. Автор и актер музыкального проекта &laquo;Қазақша концерт&raquo; 31 канал. Участник казахстанской лиги КВН. Отличный ведущий на свадьбы, юбилеи, ұзату той, тұсау кесер, корпоративные мероприятия&hellip;</p>', '0', 0, 2, 4, 2, 445, 6, NULL, '2017-04-13 03:24:26', '2017-04-20 07:24:44'),
(549, 'Рысбек', '', '0', 0, 2, 4, 2, 449, 4, NULL, '2017-04-13 03:25:27', '2017-04-13 03:25:27'),
(550, 'Are You Ready', '', '0', 0, 2, 3, 2, 447, 3, NULL, '2017-04-13 03:25:42', '2017-04-13 03:25:42'),
(551, 'Андрей  Малышев', '<p>Андрей Малышев - популярный ведущий и шоумен.</p>\r\n<p>Имеет огромный опыт работы на радио и музыкальных ТВ-каналах, был ведущим кинофестивалей и презентаций, государственных концертов и корпоративов. Язык ведения: казахский, русский, английский.</p>\r\n<p>Индивидуальный подход к каждому мероприятию. Постоянное обновление своей шоу-программы. Отличный юмор.</p>', '0', 0, 2, 4, 2, 448, 6, NULL, '2017-04-13 03:25:52', '2017-04-20 07:38:01'),
