(557, 'Burhan Style', '<p>Burhan Style &mdash; шоу барабанов в исполнении продюссера и основателя Бахром Убайдуллаева!</p>', '0', 0, 2, 7, 2, 454, 4, NULL, '2017-04-13 03:29:33', '2017-05-27 06:30:56'),
(558, 'Хор филармонии при акимате города Астаны', '<p>Камерный хор государственной Академической филармонии. Лауреат международных конкурсов. Молодой энергичный коллектив, поющий в любом направлении (джаз, классика, эстрада). Сделает необычным и красочным ваше мероприятие. Услуги: вывод невесты, предложение руки и сердца, дни рождения, юбилеи, свадьбы.</p>', '0', 0, 2, 3, 2, 456, 3, NULL, '2017-04-13 03:31:23', '2017-04-19 07:38:12'),
(559, 'Нуржан Баймаханов', 'Музыка воодушевляет весь мир, снабжает душу крыльями, способствует полету воображения: музыка придает жизнь и веселье всему существующему… Ее можно назвать воплощением всего прекрасного и всего возвышенного.\r\nПрофессиональный саксофонист г. Шымкент Нуржан Баймаханов! Джазовая музыка на Ваш праздник!', '0', 0, 2, 6, 2, 457, 4, NULL, '2017-04-13 03:31:23', '2017-04-13 03:31:23'),
(560, 'Группа Килиманджаро', '<p>Оригинальность налицо! В выступлении этой группы даже самый взыскательный зритель отыщет нечто подходящее и для себя. И всё дело не в уникальности репертуара или особенностях вокала, как и заведено на театральных подмостках, всё дело в подаче. Даже самая возможно незнакомая или на скептический взгляд заунывная песня вырывается вулканом эмоции и позитива. Группа Килиманджаро &mdash; это музыкальное сообщество настоящих талантов одержимых единой и несгибаемой целью &ndash; веселить жизнь! Заказать группу Килиманджаро в Астане, не сложнее чем заказать любого другого столичного певца, сложнее всего найти соответственный этому яркому представлению какой либо аналог. Группа Килиманджаро яркое, шумное, веселое и самое эмоциональное музыкальное шоу среди всего вокального великолепия нашего каталога.</p>', '0', 0, 2, 3, 2, 458, 3, NULL, '2017-04-13 03:32:51', '2017-04-19 07:38:18'),
(561, 'Махмуд Урумбаев', 'Только живая музыка способна затронуть самые тонкие струны человеческой души.\r\nАккордеонист, исполнитель оригинальной, авторской музыки — Махмуд Урумбаев!', '0', 0, 2, 6, 2, 459, 4, NULL, '2017-04-13 03:33:01', '2017-04-13 03:33:01'),
(562, 'Гапуров Бахытжан', 'Инструментальное исполнение на скрипке Бахтияра Гапурова. Скрипач, исполнитель оригинальной и авторской музыки.', '0', 0, 2, 6, 2, 460, 4, NULL, '2017-04-13 03:34:09', '2017-04-13 03:34:09'),
(563, 'Las Vegas', 'А вот этого вы точно не видели! Представьте, что любой галстук оживает и превращается в кобру у вас на мероприятии или девушка сидя на стуле взлетит в воздух, телепортируется на кресло из ниоткуда. Ну или вот такой эффект: из обычного пакета молока появляются 5 разных напитков по заказу зрителей: пепси, тархун, сок и т.д. Заинтригованы?… и это далеко не весь список наших эффектов.', '0', 0, 2, 7, 2, 461, 4, NULL, '2017-04-13 03:36:55', '2017-04-13 03:36:55'),
(564, 'Группа «SUNJEE»', '<p>Группа &laquo;SUNJEE&raquo; &mdash; это новое вокально-инструментальное трио, в котором объединились солистка &mdash; лауреат Международных конкурсов, поющая на 3-х языках &mdash; Сангина Шарипова. Представитель электронной музыки Dj Dumitresku и домбрист-виртуоз Дамир Сансызбаев! Мы подарим вам незабываемые впечатления и отличное настроение! Репертуар состоит из зарубежных и казахских песен в современной обработке. Хронометраж выступления одного блока составляет в среднем 15 минут.</p>', '0', 0, 2, 3, 2, 462, 3, NULL, '2017-04-13 03:37:03', '2017-04-19 07:38:27'),
(565, 'Муратбек Хайролда', '<p>2015 жыл &laquo;Қазақстан Даусы&raquo; байқауының жеңімпазы.</p>', '0', 0, 2, 3, 2, 463, 3, NULL, '2017-04-13 03:39:23', '2017-04-19 07:38:39'),
