(570, 'ROYAL квартеті', '<p>Группа &laquo;Рояль&raquo; это необыкновенный квартет в сочетании звонкого голоса теноров и бархатных голосов баритона. Квартет &laquo;Рояль&raquo; создался совсем недавно в конце 2014 года, но они уже успели полюбиться своим слушателям. Ребята выступают в эстрадном и классическом жанрах.</p>', '0', 0, 2, 3, 2, 468, 3, NULL, '2017-04-13 04:04:05', '2017-04-19 07:40:37'),
(571, 'Juliya KHAN', '<p>Репертуар: современные песни, эстрадные, ретро, шансон 80х.</p>', '0', 0, 2, 3, 2, 469, 3, NULL, '2017-04-13 04:05:44', '2017-04-19 07:40:43'),
(572, 'Gentelman', '', '0', 0, 2, 3, 2, 470, 3, NULL, '2017-04-13 04:06:46', '2017-04-13 04:06:46'),
(573, 'Astana A Capella', '', '0', 0, 2, 3, 2, 471, 3, NULL, '2017-04-13 04:08:09', '2017-04-13 04:08:09'),
(574, 'Турар Рахимберлин', '<p>Турар Рахимберлин &mdash; яркий представитель казахстанской эстрады, автор многих песен, в том числе автор гимна фестиваля &laquo;Алматы &mdash; моя первая любовь&raquo;, композитор! На счету Турара выступления на всевозможных мероприятиях по всему Казахстану. Также есть тематические песни про Алматы, Астану, Казахстан, и даже Экспо!</p>', '0', 0, 2, 3, 2, 472, 3, NULL, '2017-04-13 04:09:47', '2017-04-19 07:41:07'),
(575, 'Барыс тобы', '<p>Инструментально &mdash; вокальный дуэт! (с домброй) В репертуаре все эстрадные, народные песни.</p>', '0', 0, 2, 3, 2, 473, 3, NULL, '2017-04-13 04:11:13', '2017-04-19 07:41:13'),
(576, 'Сұңқар тобы', '', '0', 0, 2, 3, 2, 475, 3, NULL, '2017-04-13 04:13:06', '2017-04-13 04:13:06'),
(577, 'Сарыарқа тобы', '<p>Топ қоржынында жиырмадан астам авторлық әндер бар. Жастар арасында &laquo;Хор қызы &laquo;( әні: Қ.Баекенов, сөзі: Қ.Жүнісов), &laquo;Жастық дәурен&raquo; (әні:М.Қабылов, сөзі С.Смагулов), &laquo;Бойжеткен&raquo; ( әні:М. Қабылов,сөзі: Қ.Жүнісов) деген әндері халыққа кеңінен таралып, сұранысқа ие болды. Аталмыш әндерге бейнебаян түсіріліп, Отандық арналарда көрсетілімге шықты. Топ еліміздегі көптеген игі іс &mdash; шаралар мен қайырылымдылық концерттерге белсенді қатысып келеді. Көптеген әндеріміз Отандық радиоларда әртүрлі ән байқауларына түсіп, жоғарғы рейтингтен көрінді. Топтың алғашқы &laquo;Хор қызы&raquo; атты ән жинағы үнтаспа болып, 2014 жылы 3000 дана болып шығарылды (Дастан студиясы). Үнтаспаға Ахмедияр Есмұхановтың &laquo;Жаз айы&raquo;, &laquo;Боз дала&raquo;, &laquo;Балапаным&raquo;, &laquo;Айзада&raquo;, &laquo;Қарағанды&raquo;, Айбек Қалиевтің &laquo;Айнұрым&raquo;, Әкім Ысқақтың &laquo;Жан аға&raquo;, Қайрат Темірғалидің &laquo;Аяулы анашым&raquo;, Нартай Алтайдың &laquo;Жаңа жыл&raquo;, Мұрат Қабыловтың &laquo;Жастық дәурен&raquo;, &laquo;Бойжеткен&raquo;, &laquo;Астана&raquo; және де жоғарыда аталған Қайрат Баекеновтың &laquo;Хор қызы&raquo; әні енген.</p>', '0', 0, 2, 3, 2, 476, 3, NULL, '2017-04-13 04:18:52', '2017-04-19 07:41:34'),
(578, 'Лаура Айтпаева', '', '0', 0, 2, 3, 2, 477, 3, NULL, '2017-04-13 04:20:15', '2017-04-13 04:20:15'),
(579, 'Жумабаев Айдын', '', '0', 0, 2, 3, 2, 478, 3, NULL, '2017-04-13 04:23:01', '2017-04-13 04:23:01'),
(580, 'Дидар Мансур', '', '0', 0, 2, 3, 2, 480, 3, NULL, '2017-04-13 04:32:00', '2017-04-13 04:32:00'),
