(582, 'БУМ тобы', '', '0', 0, 2, 3, 2, 483, 3, NULL, '2017-04-13 04:34:28', '2017-04-13 04:34:28'),
(583, 'Jambo', '<p>Выступление длится 30 минут &mdash; Вокал на разных языках, в том числе на казахском.</p>\r\n<p>&mdash; Интерактивы с гостями</p>\r\n<p>&mdash; Барабан шоу</p>\r\n<p>&mdash; Аккробатические номера</p>', '0', 0, 2, 7, 2, 482, 4, NULL, '2017-04-13 04:34:29', '2017-04-19 05:29:22'),
(584, 'Dream Lights', 'Шоу проект Dream Lights это огненное, светодиодное, ультрафиолетовое, пиротехническое шоу!\r\nНаше шоу проводится на профессиональном  уровне и именно благодаря нам, гости не могут отвести восхищенных глаз от завораживающего танца с огнем и светом, который показывает почти неограниченную свободу и ловкость человеческого тела.', '0', 0, 2, 7, 2, 485, 4, NULL, '2017-04-13 04:35:55', '2017-04-13 04:35:55'),
(586, 'Шоу со змеями', 'Шоу группы «Айсана», восточные танцы со змеями, с огнем, с мечом, с неоновыми бабочками, с живыми голубями. Красивый выход молодоженов. Стаж 12лет!', '0', 0, 2, 7, 2, 486, 4, NULL, '2017-04-13 04:37:27', '2017-04-13 04:37:27'),
(587, 'Шоу мыльных пузырей!', 'ШОУ МЫЛЬНЫХ ПУЗЫРЕЙ можно заказать на любое мероприятие! Пусть это будет Детский праздник, День Рождения, Свадьба, Юбилей, 8 Марта, 23 Февраля, 7 Мая, День Святого Валентина и все возможные мероприятия!', '0', 0, 2, 7, 2, 487, 4, NULL, '2017-04-13 04:39:08', '2017-04-13 04:39:08'),
(588, 'Шоу Медведей', '', '0', 0, 2, 7, 2, 488, 4, NULL, '2017-04-13 04:40:20', '2017-04-13 04:40:20'),
(589, 'Супер шоу для взрослых', '<p>Очаровательная Лейла и Экзотическая негритянка Ми Ми, породие на Григория Лепса поразит ваших гостей родных и близких. Для любого рода мероприятий. Встреча гостей, тематические вечеринки, исполнение различных песен, необычно поздравить вторую половинку, свадьбы, юбилеи, и все по вашему желанию и вашей фантазии.&nbsp;</p>', '0', 0, 2, 7, 2, 489, 4, NULL, '2017-04-13 04:42:11', '2017-04-19 05:30:49'),
(590, 'Иллюзионист Чингиз Ибрагимов', 'Чингис Ибрагим — профессиональный Иллюзионист, Фокусник-Манипулятор, Менталист!\r\n\r\nХотите удивить своих гостей? Иллюзионист Чингис Ибрагим создает невероятное магическое шоу, которое поражает воображение каждого зрителя!', '0', 0, 2, 7, 2, 490, 4, NULL, '2017-04-13 04:43:29', '2017-04-13 04:43:29'),
(591, 'Иллюзион шоу', 'Шоу программа, которая поразит каждого гостя торжества.\r\nИзумительные фокусы и загадочная игра исполнении добавит вечеру таинственности.', '0', 0, 2, 7, 2, 491, 4, NULL, '2017-04-13 04:44:54', '2017-04-13 04:44:54'),
(592, 'Дисней', 'Лучшие праздники в компании любимых героев. Более  25 сказок и постановок. Профессионализм  аниматоров на высшем уровне. Самые интересные и позитивные актеры. Неотъемлемой частью программы являются мыльные пузыри. У нас всё самое лучшее для Вас! Твистинг в подарок от организации!', '0', 0, 2, 7, 2, 492, 4, NULL, '2017-04-13 04:46:20', '2017-04-13 04:46:20'),
(593, 'Акниет Алтынбек', '', '0', 0, 2, 3, 2, 493, 3, NULL, '2017-04-13 04:47:11', '2017-04-13 04:47:11'),
(594, 'Айслу Жак', '<p>Айслу Жак &ndash; яркая певица, обладательница незабываемого голоса! Ее харизма и необыкновенный колорит голоса завораживает и заставляет проникнутся до глубины души. Является лауреатом международных конкурсов, финалистка проектов &laquo;Х-ФАКТОР&raquo; &laquo;ГОЛОС КАЗАХСТАНА&raquo;. Солистка эстрадно-джазового оркестра. Обширный, разнообразный исполнительский репертуар: Популярные песни, современные отечественные и зарубежные хиты, disco 80-x, зажигательные ретро шлягеры, романсы, французский шансон, jazz, soul, lounge, хиты на английском, французском , русском и итальянском языках! Реальный вокал &mdash; реальные хиты! Живое исполнение &mdash; живые эмоции! Имеет Высшее музыкальное профессиональное образование.</p>', '0', 0, 2, 3, 2, 494, 3, NULL, '2017-04-13 04:48:42', '2017-04-19 07:43:34'),
(595, '«Royal Palace»', '<p>Кухня: азербайджанская, азиатская, белорусская, восточно-европейская, европейская, кавказская, казахская, русская, узбекская</p>\r\n<p>Количество мест: 450</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 495, 4, NULL, '2017-04-13 04:48:46', '2017-04-19 05:32:07'),
(596, 'Нурлан Тукенов', '<p>Нурлан Тукенов &mdash; &laquo;Жас Қанат 2015&raquo; байқауының жартылай финалисті, &laquo;Лучший город KZ&raquo;, &laquo;X-factor 3&raquo;, &laquo;Қазақстан Дауысы&raquo;, &laquo;Жұлдызды сәт&raquo; жобалардың қатысушысы.</p>', '0', 0, 2, 3, 2, 496, 3, NULL, '2017-04-13 04:52:31', '2017-04-19 07:43:40'),
(597, 'Камшат Бактыгалиева', '<p>Камшат Бактыгалиева &ndash; безумно талантливая исполнительница Астаны. Обширный репертуар исполнительницы позволяет ей подстраиваться под абсолютно разную аудиторию.</p>', '0', 0, 2, 3, 2, 497, 3, NULL, '2017-04-13 04:53:47', '2017-04-19 07:43:47'),
(598, 'RIXOS BALL ROOM', '<p>Кухня: Национальная, Европейская Итальянсая, Азиатская</p>\r\n<p>Количество мест: 100-400</p>\r\n<p>Парковка: 100</p>', '0', 0, 2, 8, 2, 498, 4, NULL, '2017-04-13 04:54:13', '2017-04-19 05:32:28'),
