(602, 'Трио Алтын', '<p>Впервые в Астане, инструментально &mdash; вокальная шоу &mdash; группа &laquo;АЛТЫН&raquo; подарит отличное настроение Вам и Вашим гостям! Группа &laquo;АЛТЫН&raquo; своей неповторимой музыкой и гармоничностью оставит неизгладимое впечатление слушателям! Креативный репертуар, артистичные солисты, красивое общее сочетание &mdash; дополнит еще красоту вашему мероприятию! Нежная мелодия скрипки, необычный тембр дарбуки и флейты, изящность композиции подарит радость вам!!!</p>', '0', 0, 2, 3, 2, 501, 3, NULL, '2017-04-13 04:58:07', '2017-04-19 07:45:23'),
(603, 'Grand Holiday Hall', '<p>Кухня: Национальная, Европейская</p>\r\n<p>Большой зал: 500</p>\r\n<p>Малый зал: 300 Банкетный зал: 250</p>\r\n<p>Свет, звук: есть</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 503, 4, NULL, '2017-04-13 04:58:55', '2017-04-19 05:33:49'),
