(605, 'Зарина Божакова', '<p>Божакова Зарина &mdash; полуфиналистка телевизионного проекта &laquo;Казахстан Дауысы&raquo;, лауреат международных конкурсов. Зарина поёт на сцене с малых лет, первый дебют на сцене состоялся в 5 летнем возрасте. И с тех пор она не видит своей жизни без сцены. Зарина поет на больших площадках нашей столицы, имеет опыт работы на телевидении, в программе &laquo;Тунги студияда Нурлан Коянбаев&raquo;. Зарина обладает очень сильным голосом, и в репертуаре певицы имеются песни на казахском, русском и иностранных языках самых разных стилей и жанров. Каждое выступление Зарины наполнено мощной энергетикой, праздником и хорошей музыкой.</p>', '0', 0, 2, 3, 2, 504, 3, NULL, '2017-04-13 05:01:26', '2017-04-19 07:45:40'),
(606, 'Шафран', '<p>Кухня: европейская, казахская</p>\r\n<p>Количество мест: 200</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 506, 4, NULL, '2017-04-13 05:01:42', '2017-04-19 05:34:37'),
(607, 'Марина Бейсехан', '<p>Марина Бейсехан активно поддерживает знаменательные даты в истории столицы и страны в целом, выступая на концертных площадках города.</p>\r\n<p>Репертуар:</p>\r\n<p>&bull; Авторские</p>\r\n<p>&bull; Ретро</p>\r\n<p>&bull; Lounge</p>\r\n<p>&bull; Романсы</p>', '0', 0, 2, 3, 2, 507, 3, NULL, '2017-04-13 05:02:30', '2017-04-19 07:45:57'),
(608, 'Ұлы Тау', '<p>Кухня: Европейская, Казахская</p>\r\n<p>Количество мест: 500</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 508, 4, NULL, '2017-04-13 05:03:30', '2017-04-19 05:34:59'),
(609, 'Терция тобы', '<p>ТЕРЦИЯ тобы &mdash; 2013 аяғында жаңадан құрылған топ. Жалпы топ құрамында Боранбаев Жәнібек пен Еркебұлан Сауранбекұлы өнер көрсетеді. Өнер жолын 2007жылдан бастаған бұл жігіттер кезінде &laquo;Арман&raquo; тобында одан кейін &laquo;АрШат&raquo; топтарында өнер көрсетіп, талай байқауларда жүлделі орын алып жүрген өнерпаздар. 2015 жылы Астана радиосының &laquo;ӘН ШЕРУ&raquo; байқауынан &laquo;СЕН ЖАЙЛЫ&raquo;, &laquo;СЕН ҒАНА&raquo; және &laquo;ЖАНЫМ-АУ&raquo; әндері халықтың ықыласына бөленіп үлгерді. &laquo;ТЕРЦИЯ&raquo; тобы қазір Астана қаласында той саласы бойынша да, концерттік бағдарламаларға тығыз жұмыс атқарады.</p>', '0', 0, 2, 3, 2, 509, 3, NULL, '2017-04-13 05:03:30', '2017-04-19 07:46:21'),
(610, 'Айжан Султанова', '<p>Айжан Султанова &mdash; финалистка вокального телепроекта &laquo;Х-Фактор Украина 2015&raquo;. Айжан Султанова поет на сцене уже не один год. Является лауреатом международных конкурсов. Каждое выступление Айжан наполнено неиссякаемой энергией, праздником и хорошей музыкой.</p>', '0', 0, 2, 3, 2, 510, 3, NULL, '2017-04-13 05:04:49', '2017-04-19 07:46:48'),
