(621, 'Группа Alem Star', '<p>Выкладываться на 100% на сцене и дарить отличное настроение своим слушателям &mdash; вот главная задача группы &laquo;ALEMSTAR&raquo;. В репертуаре группы авторские песни разных жанров, на разных языках. Их зажигательные песни, танцевальные постановки придают каждому мероприятию особую атмосферу.</p>', '0', 0, 2, 3, 2, 520, 3, NULL, '2017-04-13 05:17:44', '2017-04-19 07:47:09'),
(622, 'Усадьба Ладушки', '<p>Кухня: Национальная, Европейская Итальянсая, Азиатская</p>\r\n<p>Количество мест: 80</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 522, 4, NULL, '2017-04-13 05:18:32', '2017-04-19 05:41:30'),
(623, 'Братья Жугунусовы', '<p>Группа &laquo;Братья Жугунусовы&raquo; состоит из 3 &ndash; х человек. Это 3 родных братьев: Рустем, Мирас, Мухаммед &ndash; Али Жугунусовы. На сегодняшний день &laquo;Братья Жугунусовы&raquo; очень успешный проект, они часто гастролируют, участвуют в съемках различных передач.</p>', '0', 0, 2, 3, 2, 523, 3, NULL, '2017-04-13 05:19:06', '2017-04-19 07:47:16'),
(624, 'Көркем', '<p>Кухня: Национальная, Европейская</p>\r\n<p>Количество мест: 800</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 524, 4, NULL, '2017-04-13 05:20:14', '2017-04-19 05:41:46'),
(625, 'Нурсултан Карабалиев', '<p>Лауреат 2 премий Республиканского конкурса молодых исполнителей &laquo;Жас канат&raquo; (2014г), обладатель &laquo;Гран-при&raquo; Республиканского песенного конкурса &laquo;Ән жүрегім &mdash; Астана&raquo; (2014г). В репертуаре более 60-ти песен: мировые хиты, песни казахстанских композиторов, авторские произведения. Работает в основном в живую, в редких случаях под фонограмму.</p>', '0', 0, 2, 3, 2, 525, 3, NULL, '2017-04-13 05:20:36', '2017-04-19 07:47:20'),
(626, 'Арайлым Баярлина', '<p>Арайлым является победителем республиканского конкурса &laquo;Жас канат-2010&raquo;, обладателем первого места международного соревнования &laquo;Звездный мост&raquo; в Черногории и международного конкурса &laquo;Шабыт-2009&raquo;. Весь этот путь подарил опыт работы на сцене, уверенность в голосе и личный почерк выступления.</p>', '0', 0, 2, 3, 2, 526, 3, NULL, '2017-04-13 05:22:24', '2017-04-20 03:08:38'),
(627, 'Казахстан 2050', '<p>Кухня: Национальная, Европейская</p>\r\n<p>Количество мест: 200-600</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 527, 4, NULL, '2017-04-13 05:22:35', '2017-04-19 05:42:02'),
(628, 'Трио BestZ', '<p>Трио BestZ инструментально-вокальная группа в составе:</p>\r\n<p>Еркебулан Мурат &mdash; Саксофонист. Финалист проекта &laquo;МузАрт Live&raquo;, победитель конкурса &laquo;Алтынбек Коразбаев&raquo; и т.д.</p>\r\n<p>Аскарбек Бейбарыс &mdash; Битбоксер. Участник проекта &laquo;Шоу Талантов&raquo; в Китае.</p>\r\n<p>Нуртаза Ералы - Инструменталист. Участник проекта &laquo;Лучший город KZ&raquo;.&nbsp;</p>', '0', 0, 2, 3, 2, 528, 3, NULL, '2017-04-13 05:24:30', '2017-04-20 03:09:16'),
