(630, 'Сайлаубек Игликов и Ақбота Макежанова', '<p>Сайлаубек Игликов и Ақбота Макежанова дуэт с аппаратурой, весь вечер поют казахские, современные танцевальные песни. Репертуар: песни Шамші Қалдаяқова, Тореғали, Беркут Айша, Жанболат и Жазира. Работают с 2015 года в Астане.</p>', '0', 0, 2, 3, 2, 530, 3, NULL, '2017-04-13 05:26:40', '2017-04-20 03:09:34'),
