(633, 'Камила Жумабаева', '<p>Камила Жумабаева &mdash; певица с большим опытом! Разнообразный стиль исполнения на казахском, русском и английском языке (Эстрадный, RnB, Блюз, Джаз и многое другое).</p>', '0', 0, 2, 3, 2, 533, 3, NULL, '2017-04-13 05:30:38', '2017-04-20 03:10:06'),
(634, 'Достар', '<p>Кухня: Национальная, европейская</p>\r\n<p>Количество мест: 250-600</p>\r\n<p>Звук, свет: есть</p>', '0', 0, 2, 8, 2, 534, 4, NULL, '2017-04-13 05:30:51', '2017-04-19 05:43:05'),
(635, 'Дуэт Өркен', '<p>Инструментальный дуэт &laquo;Өркен&raquo; представляет Вам русский и зарубежный репертуар, xиты 80-90x, песни из кинофильмов, казаxские песни! Мы сделаем красочным и незабываемых любое Ваше праздничное мероприятие!</p>', '0', 0, 2, 3, 2, 535, 3, NULL, '2017-04-13 05:32:09', '2017-04-20 03:10:27'),
(636, 'Бахчи Сарай', '<p>Кухня: Восточная, Уйгурская</p>\r\n<p>1 этаж: 60 чел.</p>\r\n<p>2 этаж: 150 чел.</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 536, 4, NULL, '2017-04-13 05:32:18', '2017-04-19 05:43:33'),
(637, 'Балым', '<p>Кухня: Европейская, Национальная</p>\r\n<p>Количество мест: 400</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 537, 4, NULL, '2017-04-13 05:34:40', '2017-04-19 05:43:52'),
(638, 'Баққон', '<p>Кухня: Национальная, Европейская</p>\r\n<p>Количество мест: 200 &mdash; 500</p>\r\n<p>Малый зал: 50 &mdash; 200</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 538, 4, NULL, '2017-04-13 05:35:51', '2017-04-19 05:44:11'),
(639, 'Афсона', '<p>Кухня: европейская, казахская, узбекская, уйгурская</p>\r\n<p>Количество мест: 120</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 540, 4, NULL, '2017-04-13 05:37:22', '2017-04-19 05:45:19'),
(640, 'Арман', '<p>Кухня: европейская, казахская</p>\r\n<p>Количество мест: 600</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 541, 4, NULL, '2017-04-13 05:38:35', '2017-04-19 05:45:39'),
(641, 'Ведущие Адиль и Ерландо', '<p>Дуэт шоу-ведущих Адиль и Ерлан, заключает в себе, полностью двуязычное ведение (казахский, русский), обилие шуток и искрометного юмора, огромное количество интересных игр и конкурсов, отличное сочетание как официального, так и развлекательного ведения. Имея достаточный опыт выступления на самых престижных площадках Казахстана, они зарекомендовали себя, как хорошо слаженный дуэт, умеющий найти нестандартный выход из любой непредвиденной ситуации. Особой чертой их симбиоза, является постоянное обновление сценария. На сегодняшний момент, данные ведущие, одно из лучших сочетаний в Астане, в соотношении цена &mdash; качество. Пригласив этот дуэт, вы на самом деле будете чувствовать праздник от начала и до конца.</p>', '0', 0, 2, 4, 2, 539, 3, NULL, '2017-04-13 05:38:51', '2017-04-20 03:10:45'),
(642, 'Алтын Сарай', '<p>Кухня: Национальная, Европейская</p>\r\n<p>Количество мест: 750</p>\r\n<p>Малый зал: 80</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 542, 4, NULL, '2017-04-13 05:39:41', '2017-04-19 05:46:17'),
(643, 'Джамиля Ашимова', '<p>Яркие внешние данные в сочетании с великолепным ораторским мастерством, которое постоянно совершенствуется Джамилей на протяжении 15 лет работы в качестве ведущей, позволяют ей проводить мероприятия на высоком уровне &mdash; как академического, так и развлекательного характера, будь-то свадьба или юбилей, презентация или День Рождения, корпоративный вечер, концерт или TEAM BUILDING. Джамиля никогда не останавливается на достигнутом, и, уже будучи Лауреатом конкурса ведущих &laquo;Жас Қанат-2000&raquo;, с систематической периодичностью проходит обучение в авторской школе event-менеджеров и ведущих &laquo;Князевъ&raquo; г. Москва. Отличительной чертой мероприятий, проводимых Джамилей, является разработка эксклюзивного сценария, наполненного креативными идеями с соблюдением традиций и концепцией каждого мероприятия!</p>', '0', 0, 2, 4, 2, 543, 3, NULL, '2017-04-13 05:40:39', '2017-04-20 03:11:09'),
(644, 'Алтын Қазына', '<p>Кухня: восточная, европейская, кавказская, казахская,</p>\r\n<p>Количество мест: 180</p>\r\n<p>Парковка: есть</p>', '0', 0, 2, 8, 2, 544, 4, NULL, '2017-04-13 05:41:03', '2017-04-19 05:47:25'),
(645, 'Алибек Абдилов', '<p>Алибек Абдилов &mdash; ведущий-конферансье, тамада. Ведущий концертов всех уровней (включая правительственные). Опыт работы на сцене составляет более 10 лет. Сегодня является ведущим главной радиостанции Казахстана &mdash; Қазақ радиосы.</p>', '0', 0, 2, 4, 2, 545, 3, NULL, '2017-04-13 05:42:21', '2017-04-20 03:11:16'),
(646, 'Алатау', '<p>Кухня: Национальная, европейская</p>\r\n<p>Количество мест: 600</p>\r\n<p>Дополнительный зал: 80, 250</p>', '0', 0, 2, 8, 2, 546, 4, NULL, '2017-04-13 05:42:27', '2017-04-19 05:47:49'),
(647, 'Азамат и Антон', '<p>В свадебном сегменте проведения подобных торжеств, Азамат и Антон самые поздние: из 13 лет истории своего дуэта, проводить свадьбы ребята попробовали лишь спустя 6 интереснейших лет. Наверное, поэтому, где бы они не появились, будь то благотворительные вечера, презентации, юбилеи компаний или клубные вечеринки, не знающие их люди даже и не подумают, что Азамат и Антон занимаются свадьбами. Являясь эфирными &laquo;радийщиками&raquo;, запас словарности и непресного речевого обихода у обоих поистине неисчерпаем. Их сценарий единит общая цель &mdash; они оба не любят паузы и &laquo;провисания&raquo; в шоу программе. Они не загоняют темп вечера, они его постоянно корректируют, и их откровенно раздражает творческая некомпетентность. Поэтому, в случае любого тревожного сигнала в шоу-программе, они оба падают на амбразуру.</p>', '0', 0, 2, 4, 2, 547, 3, NULL, '2017-04-13 05:43:39', '2017-04-20 03:11:43'),
(648, 'Адиль Сейфуллин', '<p>Один из самых зажигательных шоуменов столицы. Солидный опыт игры в КВН,развил в Адиле потрясающее чувство ситуационного юмора. Который так важен на праздничном событии. Он действительно тот, кого можно назвать мастером слова,и мастером развлекательных мероприятий. Работает в паре с личнымзвукооператом,который помимо того что выделяет музыкально все сценарные моменты, так же выступает в роли ди-джея в танцевальных антрактах.</p>', '0', 0, 2, 4, 2, 548, 3, NULL, '2017-04-13 05:45:44', '2017-04-20 03:12:33'),
(649, 'Адильбек Макумов', '<p>Всесторонне активный и творчески развитый шоумен. Ярый противник тойских штампов и сторонник новых идей для вековых свадебных обрядов. Адильбек один из редких ведущих в столице который может по праву хвалится ранней броней на заказы. Адильбека рекомендуют самые неожиданные клиенты из разных сфер и структур. Это значит, что свадебная программа Адильбека отвечает даже самым высоким запросам в сфере проведения отличных мероприятий. Адильбек проводит Вашу свадьбу под ключ благодаря основным наиважнейшим аспектам: музыкальное оборудование до 200 гостей, вокальная программа от стационарного певца Медета, и уникальное языковое соотношение казахского и русского языка.</p>', '0', 0, 2, 4, 2, 550, 3, NULL, '2017-04-13 05:46:52', '2017-04-20 03:13:08'),
(650, 'Golden Class', 'Люксовый салон «Golden Class» — это новый уровень изысканного сервиса и комфорта в индустрии красоты города Шымкент. Открыв свои двери в 2015 году, мы предлагаем Вам широкий выбор услуг для погружения в удивительный мир эстетики и релаксации.', '0', 0, 2, 9, 2, 549, 4, NULL, '2017-04-13 05:47:45', '2017-04-13 05:47:45'),
(651, 'Наргиз Рахимбаева', 'Совершенство Вашего образа без особых усилий!\r\nНаргиза – член Ассоциации визажистов Казахстана, участница Чемпионатов Казахстана (2 место) и Узбекистана (1 место) в категории «Мастер».\r\nНаргиза очень гордится открытием собственной школы красоты в Шымкенте и теперь все, кто решил получить профессию в сфере бьюти-индустрии смогут пройти обучение по различным направлениям, начиная от маникюра, заканчивая профессиональным макияжем.', '0', 0, 2, 9, 2, 551, 4, NULL, '2017-04-13 05:49:06', '2017-04-13 05:49:06'),
(652, 'Дархан Жусупов', '<p>Дархан отличный ведущий на любое мероприятие: проведение свадеб, корпоративов, юбилеев, торжеств, узату, тусау кесеров, выпускных, новогодних вечеров, концертов, презентаций, промо-акций и других праздничных событий. Проведение на казахском и русском языках. Если вы услышите как он говорит на казахском, то сами захотите так же красноречиво выражать себя. Собираетесь отмечать свой праздник? Не забудьте пригласить Дархана ведущим торжества &mdash; он сделает его незабываемым!</p>', '0', 0, 2, 4, 2, 552, 3, NULL, '2017-04-13 05:49:44', '2017-04-20 03:13:22');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(653, 'Сания Ильясова', 'Сания Ильясова академия салонного бизнеса — лучший макияж в Шымкенте!\r\n\r\nШымкент – четвертый регион, где появился салон «SaniyaIlyassova». Сначала мы открыли два салона в Алматы, потом в Астане,  Актау, сейчас Шымкент, через несколько месяцев будет и в Атырау. Мы предоставляем все виды салонных услуг:  прически, визаж, коррекция бровей, все виды маникюра и педикюра, шугаринг, татуаж и другие процедуры.', '0', 0, 2, 9, 2, 553, 4, NULL, '2017-04-13 05:50:46', '2017-04-13 05:50:46'),
(654, 'Меиржан Алиакбаров', '<p>С большой ответственностью и щепетильностью подойдет корганизацию и проведению мероприятий; будь это семейный праздник в узком кругу, или будь это праздник городского или республиканского масштаба. В силу своего большого опыта в организации и проведении праздников и крупномасштабных концертных программ, его мероприятия проходят на высоком уровне с непревзойденным качеством. Меиржан так же является прекрасным вокалистов с уникальным, красивым, сильным голосом. Его песни не оставляют равнодушными в зале ни одного слушателя. Профессиональное исполнение и правильно подобранный репертуар станет самым красочным украшением любого праздника.</p>', '0', 0, 2, 4, 2, 554, 3, NULL, '2017-04-13 05:51:24', '2017-04-20 03:13:33'),
(655, 'LashMaker', 'Свадебное наращивание ресниц от лучшего мастера Шымкента!\r\n\r\nЭто красиво! Ресницы становятся длинными и густыми, а глаза — яркими, взгляд – выразительным.\r\nЭто экономно! Не нужно покупать дорогую тушь.\r\nЭто практично! Драгоценное утреннее время не надо тратить на «рисование глаз».\r\nЭто безболезненно и безопасно! Процедура совершенно не вредит здоровью.\r\nМилые девушки! Пусть ваши глаза очаровывают и восхищают всех и всегда!', '0', 0, 2, 9, 2, 555, 4, NULL, '2017-04-13 05:52:16', '2017-04-13 05:52:16'),
(656, 'Сейдахмет Шахаризат', '<p>Красивые тосты, интересные игры, довольные гости и чувственная свадьба, всё это следует искать только в одной программе, программе Сейдахмет Шахаризата.</p>', '0', 0, 2, 4, 2, 556, 3, NULL, '2017-04-13 05:53:17', '2017-04-20 03:13:44'),
(657, 'Нәзiк', '«Нәзiк» — уникальное место, где на завтрак, обед и ужин Вам подадут… красоту.\r\nУверенность мастеров салона подкреплена профессионализмом, опытом работы с разными клиентами и ежедневным совершенствованием. Эстетика — в индивидуальном подходе, когда прислушиваются к любым капризам гостя салона и готовы советовать.', '0', 0, 2, 9, 2, 557, 4, NULL, '2017-04-13 05:53:27', '2017-04-13 05:53:27'),
(658, 'Меруерт Женисовна', 'Международная школа визажа MERUERT Zhenisovna в г. Шымкент. Мы поможем создать вам неповторимый образ и подчеркнуть естественность!', '0', 0, 2, 9, 2, 559, 4, NULL, '2017-04-13 05:55:02', '2017-04-13 05:55:02'),
(659, 'Шынгыс Куанышканов', '<p>Качественное проведение торжественных мероприятий в Астане вместе с ведущим Шынгысом Куанышкановым. Вместе со стандартным набором услуг по проведению тоев, Шынгыс предлагает, чуть ли не самое важное &ndash; профессиональное спокойствие которое приходит к клиентам уже после первой встречи с этим ведущим. Прекрасно понимает задачи по организации свадьбы и успешно претворяет в жизнь свои задумки по сценарию.</p>', '0', 0, 2, 4, 2, 558, 3, NULL, '2017-04-13 05:55:49', '2017-04-20 03:14:27'),
(660, 'Зарина Нурмухамедова', 'Зарина Нурмухамедова – визажист, стилист, преподаватель международного уровня, директор Ассоциации визажистов Казахстана, основатель профессиональной школы красоты.', '0', 0, 2, 9, 2, 560, 4, NULL, '2017-04-13 05:56:26', '2017-04-13 05:56:26'),
(661, 'Диана Болшынбаева', '<p>Непревзойденный мастер макияжа и визажист Международного уровня &mdash; Диана Болшынбаева. Абсолютный чемпион Азии и Казахстана 2015 г. 2015 году 1 место &laquo;Чемпионат средней Азии&raquo; г. Алматы, &nbsp;в 2015 году &laquo;Чемпионат Казахстана&raquo; 2 и 3 место в двух номинациях, в 2015 году Сертифицированный тренер по макияжу международного уровняб в 2016 году Судья по макияжу.</p>', '0', 0, 2, 9, 2, 562, 4, NULL, '2017-04-13 05:57:44', '2017-04-19 05:50:11'),
(662, 'Аскар Сулейменов', '<p>Аскар Сулейменов &ndash; постановщик и исполнитель вашего праздника! Умело дирижирует публикой так, что она ощущает себя единым оркестром цельной композиции. Шоумен, которого заслушаются даже официанты и простые прохожие. Хотя здесь немного преувеличено: официантам нельзя много слушать. Тем не менее, гостям нравится и каждый доволен. Аскар Сулейменов при помощи заготовленных искрометных монологов подогреет интерес к виновникам торжества, а при помощи креативных конкурсов заставит с головой втянуться самых сдержанных и осторожных гостей.</p>', '0', 0, 2, 4, 2, 561, 3, NULL, '2017-04-13 05:57:46', '2017-04-20 03:14:36'),
(663, 'Невеста', '', '0', 0, 2, 10, 2, 563, 4, NULL, '2017-04-13 05:59:02', '2017-04-13 05:59:02'),
(664, 'Айгуль Бекмаганбетова', '<p>Ведущая-певица в одном лице&nbsp;- Айгуль Бекмаганбетова! Индивидуальный сценарий, написанный по специальному заказу без лишних громких слов.. красивые народные песни в эстрадной обработке на вывод и проводы невесты, а также танцевальные сеты в ее исполнении сэкономят вам кругленьую сумму семейного бюджета)) Красивые эксклюзивные наряды от дизайнеров, безупречный макияж и прическа несомненно будут отмеченны вашими гостями.</p>', '0', 0, 2, 4, 2, 564, 3, NULL, '2017-04-13 05:59:39', '2017-04-20 03:15:04'),
(665, 'Paris', '<p>Мы открылись чтобы радовать гостей и жителей города самыми красивыми дизайнерскими моделями свадебных нарядов. Директор дома моды Париж по себе знает как не просто найти &laquo;Свое&raquo; платье, потому приняла решение облегчить задачу жительницам солнечного Шымкента тем, что кусочек Парижа теперь и у нас в городе. А как известно, в Париже мечтает побывать каждая девушка! Париж &mdash; это столица моды и кто как не французские дизайнеры знают и умеют создавать изысканные и неповторимые силуэты для милых невест. В платье от дома моды &laquo;Paris&raquo; вы почувствуете, что быть красивой-легко!</p>', '0', 0, 2, 10, 2, 565, 4, NULL, '2017-04-13 06:00:34', '2017-04-19 05:50:42'),
(666, 'Жаке Саттаров', '<p>7 лет играл в КВН прошел обучения юмора в Сочи, играл в телевизионной Высшей лиге Казахстана это говорит о том что к юмору я отношусь очень серьезно. Хотите чтобы у вас на мероприятии были известные звезды, как Кайрат Нуртас, Витас, Николай Басков, В.В.Путин, Рамзан Кадыров и т.д вы их увидите от меня так как я пародист разговорного и вокального жанра. Участвовал во многих Казахстанских юмористических проектах такие как Бурабай азил фест, Таланты, Жұлдызды Сәт, выступал с пародиями на звезд отечественного и мирового шоу бизнеса, так как я пародирую разговорным и вокальным жанром около 70 личностей всего мира не включая разные звуки (животные, техника и т.д). Веду мероприятие разного уровня и сложностей около 5 лет, юмор и шутки от меня которые звучат на мероприятии полная ИМПРОВИЗАЦИЯ&hellip; А мероприятие по моему мнению в первую очередь держится на правильном и качественном юморе. На каждый праздник отношусь серьезно и индивидуально. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 566, 3, NULL, '2017-04-13 06:01:10', '2017-04-20 03:15:15'),
(667, 'Назик', 'Cвадебный мир Назик – место, где каждая влюбленная пара, готовящаяся к самому торжественному событию в своей жизни – свадьбе, чувствует себя комфортно и уютно. В салоне созданы все условия, чтобы и жених и невеста максимально быстро нашли именно те наряды, которые наиболее соответствуют их стилю, типу внешности, телосложению и другим параметрам.\r\n\r\nСвадебный мир Назик в г. Шымкент – это действительно сказочный, волшебный, прекрасный мир, где каждый гость окунается в торжественную атмосферу: современный и удобный интерьер, работа индивидуального консультанта, широкий ассортимент. Будьте уверены, у нас вы найдете то, о чем всегда мечтали. Мы создаем идеальные гармоничные пары «свадебное платье – мужской костюм».\r\n\r\nСтрана производитель: Казахстан', '0', 0, 2, 10, 2, 567, 4, NULL, '2017-04-13 06:01:59', '2017-04-13 06:01:59'),
(668, 'Бейсен Ибраимович', '<p>Ведущий Бейс Бейсенов убеждён, что каждое торжественное мероприятие &ndash; это маленькая жизнь. И он сделает всё, чтобы вы прожили и прочувствовали её на полную! Бейс Бейсенов &ndash; интеллигентный, эрудированный и позитивный ведущий. Он моментально реагирует на изменения в настроении гостей и общается с публикой в интересной, живой манере. У него в запасе неиссякаемый источник свежих идей, незаежженых шуток и оригинальных сценариев. Бейс &ndash; один из редких шоуменов, идеально чувствующих ту самую &laquo;золотую середину&raquo;. Энергичность, тонкое чувство такта и позитив делают его идеальным ведущим! Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 568, 3, NULL, '2017-04-13 06:02:26', '2017-04-20 03:15:28'),
(669, 'Арман Момынов', '<p>Арман Момынов &mdash; Ведущий шоумен, ринг анонсер профессионального клуба &laquo;Астана Арланз&raquo;, Ведущий всех значимых спортивных мероприятий в Республике Казахстан. Язык ведения: казахский, русский, английский.</p>', '0', 0, 2, 4, 2, 570, 3, NULL, '2017-04-13 06:04:11', '2017-04-20 03:33:20'),
(670, 'Malinelli', '«Malinelli» – мир итальянской  роскоши, способный вскружить голову любой моднице! «Malinelli» так долго работает на свадебном рынке, что может угадать  мечты всех своих невест, сохранив индивидуальность и итальянский шарм.', '0', 0, 2, 10, 2, 569, 4, NULL, '2017-04-13 06:04:32', '2017-04-13 06:04:32'),
(671, 'Галым Галиакбаров', '<p>Язык ведения: русский, казахский</p>', '0', 0, 2, 4, 2, 572, 3, NULL, '2017-04-13 06:05:48', '2017-04-20 03:33:38'),
(672, 'Beria', '<p>Свадебный салон &laquo;Beria&raquo; &mdash; это-то самое место, с которого начинается Ваш праздник. Безусловно, выбор свадебного платья не прост, но мы постараемся сделать все, что бы для вас это запоминалось как самый приятный момент к подготовке свадьбы. У нас самый большой ассортимент свадебных платьев в Шымкенте. Наш свадебный салон приглашает Вас в сказку, где Вы окунетесь в мир изумительных тканей и оригинальных силуэтов свадебных платьев. Каждый наряд &ndash; это произведение искусства и ослепительной красоты. Побывав у нас в гостях Вы убедитесь, что наш салон следит за развитием свадебной моды. Эксклюзивные заказы: принимаются.</p>', '0', 0, 2, 10, 2, 571, 4, NULL, '2017-04-13 06:06:25', '2017-04-19 05:58:49'),
(673, 'Бахтияр Арынгазин', '<p>Язык ведения: казахский, русский, турецкий. Опыт работы: 10 лет.</p>', '0', 0, 2, 4, 2, 573, 3, NULL, '2017-04-13 06:07:26', '2017-04-20 03:33:46'),
(674, 'Шiркiн-ай', 'Cвадебный салон Шіркін-Ай – место, где каждая влюбленная пара, готовящаяся к самому торжественному событию в своей жизни – свадьбе, чувствует себя комфортно и уютно.', '0', 0, 2, 10, 2, 574, 4, NULL, '2017-04-13 06:08:15', '2017-04-13 06:08:15'),
(675, 'Мұра', '<p>Ұлттық қолөнер орталығы. Бізде ұлттық той киімдері мен сыйлықтар таба аласыздар.</p>\r\n<p>Страна производитель: Казахстан</p>\r\n<p>Эксклюзивные заказы: принимаются</p>', '0', 0, 2, 10, 2, 576, 4, NULL, '2017-04-13 06:09:39', '2017-04-19 05:59:27'),
(676, 'Равиль Омаров', '<p>Равиль Омаров &mdash; яркий, интеллигентный, веселый ведущий. Опыт + профессионализм + юмор = Равиль Омаров. Язык ведения: Русский</p>\r\n<p>&mdash; Интерактивные конкурсы и юмористические монологи;</p>\r\n<p>&mdash; Помощь в разработке сценария;</p>\r\n<p>&mdash; Диджей (ноутбук с музыкой, без аппаратуры)</p>\r\n<p>&mdash; Второй со-ведущий на казахском языке при необходимости.</p>', '0', 0, 2, 4, 2, 575, 3, NULL, '2017-04-13 06:09:48', '2017-04-20 03:36:44'),
(677, 'Мери', '<p>Свадебные и детские наряды. Свадебные аксессуары.</p>', '0', 0, 2, 10, 2, 577, 4, NULL, '2017-04-13 06:11:10', '2017-04-19 05:59:44'),
(678, 'Женис Имангалиев', '<p>Язык ведения: русский</p>', '0', 0, 2, 4, 2, 578, 3, NULL, '2017-04-13 06:11:54', '2017-04-20 03:36:55'),
(679, 'Камилла', '<p>Страна производитель: Китай</p>\r\n<p>Эксклюзивные заказы: принимаются</p>', '0', 0, 2, 10, 2, 579, 4, NULL, '2017-04-13 06:12:45', '2017-04-19 05:59:59'),
(680, 'Азат Абыкен', '<p>Язык ведения: русский, казахский, английский. Авторский подход к мероприятию, наполнение танцевального и интерактивного жанра.</p>', '0', 0, 2, 4, 2, 580, 3, NULL, '2017-04-13 06:13:51', '2017-04-20 03:37:18'),
(681, 'Жания', '<p>Прокат и продажа: Свадебных платьев, Национальных платьев, Аксессуары для невесты.</p>', '0', 0, 2, 10, 2, 581, 4, NULL, '2017-04-13 06:14:24', '2017-04-19 06:00:38'),
(682, 'Жамиля', 'Мир моды «Жамиля», представляет вашему вниманию свадебные и вечерние наряды, большой выбор аксессуаров и платьев порадует вас!\r\n\r\nСтрана производитель: Украина', '0', 0, 2, 10, 2, 582, 4, NULL, '2017-04-13 06:15:46', '2017-04-13 06:15:46'),
(683, 'Жаклин', 'Продажа и прокат свадебных платьев!', '0', 0, 2, 10, 2, 584, 4, NULL, '2017-04-13 06:17:13', '2017-04-13 06:17:13'),
(684, 'Нурболхан Шарипов', '<p>Язык ведения: казахский</p>', '0', 0, 2, 4, 2, 583, 3, NULL, '2017-04-13 06:17:41', '2017-04-20 03:37:31'),
(685, 'Жадди', 'Прокат и продажа свадебных, вечерних, бальных платьев.', '0', 0, 2, 10, 2, 585, 4, NULL, '2017-04-13 06:18:52', '2017-04-13 06:18:52'),
(687, 'Жанжігіт', '<p>Жанжiгiт &ndash; истинный последователь классического понимания профессионализма, замечательный оратор. Сценарий план для каждого мероприятия индивидуальный. Язык ведения: казахский</p>', '0', 0, 2, 4, 2, 588, 3, NULL, '2017-04-13 06:20:13', '2017-04-20 03:32:10'),
(688, 'Атамекен', 'Свадебный салон «Атамекен » создан для невест, кто ищет что-то новое и особенное. В нашем салоне вам предложат лучший выбор национальных свадебных платьев, и помогут создать образ, который подчеркнет ваш стиль и вашу неповторимость.\r\n\r\nПлатья разработанные в нашей дизайнерской студии отличаются качеством, элегантностью и изяществом. Они исполнены в самых разнообразных материалах и цветах — мы с удовольствием предложим вам текстурные и цветовые сочетания по каждому понравившемуся платью. А многообразие стилевых решений и оригинальность элементов декора в оформлении нарядов приятно удивят даже самых взыскательных невест.\r\n\r\nКазахские национальные свадебные платья невест весьма прекрасны и многообразны. Существует множество вариантов пошива брачных нарядов для казахских невест. Пошив национального свадебного платья – дорогостоящее удовольствие. Но ручная работа, ручная вышивка казахских узоров – сложная работа, которую необходимо оплачивать. А в случае если свадебное платье украшается драгоценными камнями или жемчугом – то стоимость подобного наряда, конечно, будет невероятно дорогой. Однако возможно поступить гораздо проще, можно заказать казахское национальное свадебное платье напрокат в свадебном салоне «Атамекен».', '0', 0, 2, 10, 2, 587, 4, NULL, '2017-04-13 06:20:51', '2017-04-13 06:20:51'),
(689, 'Акмарал', '<p>Индивидуальный пошив национальных, свадебных платьев на заказ.</p>', '0', 0, 2, 1, 2, 590, 4, NULL, '2017-04-13 06:22:23', '2017-04-19 06:01:46'),
(690, 'Жалгас Азганбаев', '<p>Несмотря на молодой возраст Жалгас Азганбаев уже успел побывать организатором, сценаристом многих масштабных мероприятий, ну и, конечно же, ведущим. Он провел огромное количество мероприятий, был даже и актером и радио ведущим. Имеет двухлетний опыт работы журналистом в медиа-сфере. Ответственный подход к мероприятию, креативный подход, умение разобраться в любой экстренной ситуаций, многолетний опыт проведения мероприятий, мероприятия любой сложности и для любой возрастной категорий и тысячи довольных зрителей, все это &mdash; Жалгас Азганбаев! Как говорится: &laquo;Талантливый человек &mdash; талантлив во всем&raquo;. Это его главный девиз. Пригласите его на свое мероприятие, и вы сами убедитесь в этом лично! Язык ведения: русский, казахский</p>', '0', 0, 2, 4, 2, 589, 3, NULL, '2017-04-13 06:22:27', '2017-04-20 03:32:23'),
(691, 'Аида', 'Прокат свадебных и вечерних платьев!', '0', 0, 2, 10, 2, 591, 4, NULL, '2017-04-13 06:23:51', '2017-04-13 06:23:51'),
(692, 'Турар Рахимберлин', '<p>Турар Рахимберлин &mdash; опыт работы более 7 лет, ведущий телеканала Муззон. На счету у Турара проведение множества всевозможных мероприятий различного уровня и различной степени сложности. Но самое главное, что ни один человек еще не остался недоволен работой Турара Рахимберлина! И ваш праздник будет на все 100%! Язык ведения: русский</p>', '0', 0, 2, 4, 2, 592, 3, NULL, '2017-04-13 06:24:26', '2017-04-20 03:38:25'),
(693, 'Алмас Мырзакулов', '<p>Ведущий, шоумен, певец, саксофонист. Язык ведения: казахский, русский, английский</p>', '0', 0, 2, 4, 2, 593, 3, NULL, '2017-04-13 06:25:42', '2017-04-20 03:38:31'),
(694, 'Азат Токов', '<p>Проводит мероприятия с 2010 года.</p>\r\n<p>Свадебные мероприятия</p>\r\n<p>Проводы</p>\r\n<p>Юбилеи</p>\r\n<p>Дни рождения</p>\r\n<p>Тусау кесер тойы</p>\r\n<p>Сүндет тойы</p>\r\n<p>Тілашар тойы</p>\r\n<p>Шілдехана</p>\r\n<p>Корпоративные мероприятия</p>\r\n<p>Язык ведения: казахский, русский</p>', '0', 0, 2, 4, 2, 594, 3, NULL, '2017-04-13 06:26:59', '2017-04-20 03:39:11'),
(695, 'Видеомастер', 'Профессиональная Фото-Видео Съёмка и Монтаж различных торжеств (свадьбы, юбилеи, детские, корпоративные, праздники, Love Story (История Любви) национальные торжества).\r\n\r\n— Многокамерная Фото-Видео Съёмка (1-6 камер)\r\n\r\n— Фото и видео Love Story\r\n\r\n— Эксклюзивные фотокниги, фото на холсте\r\n\r\n— Проектор, DVD-плеер, экран\r\n\r\n— Услуги выездной фотостудии\r\n\r\n— Различное телевизионное оборудование (пульты, ПТС, операторские краны (3-12м.), Rec-стойки, SteadyCamи т.д. и т.п.)\r\n\r\n— Организовываем прямые трансляции (проводные, беспроводные) на мероприятиях на LCD экранах  (105-150 см) и на LED экранах размером до 4 метров\r\n\r\n— Аренда и прокат светового, звукового оборудования, LED экранов\r\n\r\n— Профессиональный линейный и нелинейный монтаж\r\n\r\n— Запись с кассет (любого формата) на диск\r\n\r\n— Работа с видео высокого разрешения (FullHD 1920×1080) и дисками Blu-ray\r\n\r\n— тиражирование, брэндирование дисков и многое другое.', '0', 0, 2, 5, 2, 595, 6, NULL, '2017-04-13 08:40:45', '2017-04-13 08:40:45'),
(696, 'Видеомастер', '<p>Профессиональная Фото-Видео Съёмка и Монтаж различных торжеств (свадьбы, юбилеи, детские, корпоративные, праздники, Love Story (История Любви) национальные торжества).</p>\r\n<p>&mdash; Многокамерная Фото-Видео Съёмка (1-6 камер)</p>\r\n<p>&mdash; Фото и видео Love Story</p>\r\n<p>&mdash; Эксклюзивные фотокниги, фото на холсте</p>\r\n<p>&mdash; Проектор, DVD-плеер, экран</p>\r\n<p>&mdash; Услуги выездной фотостудии</p>\r\n<p>&mdash; Различное телевизионное оборудование (пульты, ПТС, операторские краны (3-12м.), Rec-стойки, SteadyCamи т.д. и т.п.)</p>\r\n<p>&mdash; Организовываем прямые трансляции (проводные, беспроводные) на мероприятиях на LCD экранах (105-150 см) и на LED экранах размером до 4 метров</p>\r\n<p>&mdash; Аренда и прокат светового, звукового оборудования, LED экранов</p>\r\n<p>&mdash; Профессиональный линейный и нелинейный монтаж</p>\r\n<p>&mdash; Запись с кассет (любого формата) на диск</p>\r\n<p>&mdash; Работа с видео высокого разрешения (FullHD 1920&times;1080) и дисками Blu-ray</p>\r\n<p>&mdash; тиражирование, брэндирование дисков и многое другое.</p>', '0', 0, 2, 14, 2, 595, 6, NULL, '2017-04-13 08:43:26', '2017-04-20 07:13:49'),
