(700, 'Адиль Сейфулин', '<p>Один из самых зажигательных шоуменов столицы. Солидный опыт игры в КВН,развил в Адиле потрясающее чувство ситуационного юмора. Который так важен на праздничном событии. Он действительно тот, кого можно назвать мастером слова,и мастером развлекательных мероприятий. Работает в паре с личным звукооператом, который помимо того что выделяет музыкально все сценарные моменты, так же выступает в роли ди-джея в танцевальных антрактах. Язык ведения: русский, казахский.</p>', '0', 0, 2, 4, 2, 597, 3, NULL, '2017-04-13 08:49:05', '2017-04-20 03:39:52'),
(701, 'AiDiStuDiO', 'Многокамерная видеосъемка придает фильму наибольшую динамику и увлекательность.\r\nДоверьте свой самый счастливый день в вашей жизни нам,и мы запечатлим его ярче ваших воспоминаний!!!\r\nВ нашей студий мы используем современное профессиональное оборудование для видео фотосъемки\r\nКачество-Full HD, DVD.', '0', 0, 2, 5, 2, 598, 6, NULL, '2017-04-13 08:51:42', '2017-04-13 08:51:42'),
(702, 'Айбат Никулин', '<p>Язык ведения: казахский, русский</p>', '0', 0, 2, 4, 2, 599, 3, NULL, '2017-04-13 08:52:43', '2017-04-20 03:39:57'),
(703, 'AiDiStuDiO', '<p>Многокамерная видеосъемка придает фильму наибольшую динамику и увлекательность. Доверьте свой самый счастливый день в вашей жизни нам,и мы запечатлим его ярче ваших воспоминаний!!! В нашей студий мы используем современное профессиональное оборудование для видео фотосъемки Качество-Full HD, DVD.</p>', '0', 0, 2, 14, 2, 598, 6, NULL, '2017-04-13 08:53:11', '2017-04-20 07:13:03'),
(704, 'Бакытжан Касымов', '<p>Язык ведения: казахский</p>', '0', 0, 2, 4, 2, 600, 3, NULL, '2017-04-13 09:00:46', '2017-04-20 03:40:02'),
(706, 'Еркебұлан Сауранбекұлы', '<p>Язык ведения: казахский</p>', '0', 0, 2, 4, 2, 602, 3, NULL, '2017-04-13 09:02:15', '2017-04-20 03:40:06'),
(707, 'Kozhevnikov production', 'Неоспоримый талант, чуткость к людям, внимательность к деталям и индивидуальный подход позволяет достичь самых лучших результатов в работе!\r\nНаша студия предоставляет любые виды студийных и выездных фото услуг. Наличие профессиональной фототехники в сочетании с большим опытом позволяет проводить съемку самого широкого диапазона и любого уровня сложности.\r\n\r\nВ область наших услуг входят следующие направления:\r\nПрофессиональная фото и видеосъемка свадеб, венчания; детских праздников, утренников, годиков; дней рождения, юбилеев; корпоративных вечеринок, школьного выпускного; проведение фотосессий, портфолио; выписка с роддома, семейная съемка, Love story. Съемки для газет и журналов, фоторепортажи конференций, съемка архитектуры, предметная съемка.\r\n\r\nВ жизни каждого из нас бывают такие моменты, когда хочется, чтобы время остановилось, но это невозможно, оно стремительно продолжает двигаться вперед, и только фотограф и видеограф имеет над ним власть. Самые трогательные моменты вашей жизни – мы оставим их в вашей памяти в виде прекрасных фотографий', '0', 0, 2, 5, 2, 601, 6, NULL, '2017-04-13 09:02:56', '2017-04-13 09:02:56'),
(708, 'Думан Айсин', '<p>Язык ведения: казахский, русский</p>', '0', 0, 2, 4, 2, 603, 3, NULL, '2017-04-13 09:03:48', '2017-04-20 03:40:11'),
(709, 'TVC студия', 'ТВЦ — это группа людей, которых объединяет стремление к хорошему кино и многолетний опыт в видеосъемке и монтаже телепрограмм для местных телеканалов и независимые видеосъемки телепроектов, концертов, шоу, видеороликов и другого медиа контента. Вы видели наши работы, если просто смотрите ТВ.\r\nЕсли Вы решили заказать видеоролик в Алматы, то Вы пришли в правильное место. Создание и производство видеороликов и рекламы в Алматы. Видеосъемка свадеб, лав стори, узату, банкетов и детских праздников. Видеоролики в Алматы по доступным ценам. Профессиональная видеосъемка в Алматы на цифровые DSLR камеры в высочайшем качестве. Услуги аэросъемки с использованием двух и более квадкоптеров. Высококачественная видео и фотосъемка в Алматы.', '0', 0, 2, 5, 2, 604, 6, NULL, '2017-04-13 09:05:11', '2017-04-13 09:05:11'),
(710, 'Ержан Гомаров', '<p>Проводит үйлену той, беташар, қыз узату, юбилей, 1 &mdash; жас, диплом алу,сүндет той, мероприятие любой сложности.</p>', '0', 0, 2, 4, 2, 605, 3, NULL, '2017-04-13 09:05:35', '2017-04-20 03:40:19'),
(711, 'TVC студия', '<p>TVC студия &mdash; это группа людей, которых объединяет стремление к хорошему кино и многолетний опыт в видеосъемке и монтаже телепрограмм для местных телеканалов и независимые видеосъемки телепроектов, концертов, шоу, видеороликов и другого медиа контента. Вы видели наши работы, если просто смотрите ТВ. Если Вы решили заказать видеоролик в Алматы, то Вы пришли в правильное место. Создание и производство видеороликов и рекламы в Алматы. Видеосъемка свадеб, лав стори, узату, банкетов и детских праздников. Видеоролики в Алматы по доступным ценам. Профессиональная видеосъемка в Алматы на цифровые DSLR камеры в высочайшем качестве. Услуги аэросъемки с использованием двух и более квадкоптеров. Высококачественная видео и фотосъемка в Алматы.</p>', '0', 0, 2, 14, 2, 604, 6, NULL, '2017-04-13 09:06:26', '2017-04-20 07:12:52'),
(712, 'KM Production', 'Kmproduction — агентство по фото и видеосъемке полного цикла.\r\nНаша команда фотографов и видеографов занимается профессиональной фото и видеосъемкой событий различного уровня – свадеб, презентаций, концертов и различных клубных праздников. Фото-Видеосъемка является для нас не хроникальным репортажем, а одним из инструментов, с помощью которого мы создаём художественные истории.\r\nПрофессионалы своего дела, от 5 лет опыта работы. Индивидуальный подход к каждому клиенту.\r\nНаши Услуги:\r\n\r\n— Видео-фото съемка Cвадебного дня\r\n\r\n— Видео-Фото Съёмка Love Story\r\n\r\n— Видео-фото съемка Проводов\r\n\r\n— Видео-фото съемка Юбилея, Дня рождения\r\n\r\n— Видео-фото съемка Корпоратива\r\n\r\n— Видео-фото съемка Выписки из роддома\r\n\r\nСохраните лучшие моменты в жизни, с детальной проработкой от идеи до результата вместе с KMproduction!', '0', 0, 2, 5, 2, 607, 6, NULL, '2017-04-13 09:08:54', '2017-04-13 09:08:54'),
(713, 'KM Production', '<p>Kmproduction &mdash; агентство по фото и видеосъемке полного цикла. Наша команда фотографов и видеографов занимается профессиональной фото и видеосъемкой событий различного уровня &ndash; свадеб, презентаций, концертов и различных клубных праздников. Фото-Видеосъемка является для нас не хроникальным репортажем, а одним из инструментов, с помощью которого мы создаём художественные истории. Профессионалы своего дела, от 5 лет опыта работы. Индивидуальный подход к каждому клиенту. Наши Услуги:</p>\r\n<p>&mdash; Видео-фото съемка Cвадебного дня</p>\r\n<p>&mdash; Видео-Фото Съёмка Love Story</p>\r\n<p>&mdash; Видео-фото съемка Проводов</p>\r\n<p>&mdash; Видео-фото съемка Юбилея, Дня рождения</p>\r\n<p>&mdash; Видео-фото съемка Корпоратива</p>\r\n<p>&mdash; Видео-фото съемка Выписки из роддома</p>\r\n<p>Сохраните лучшие моменты в жизни, с детальной проработкой от идеи до результата вместе с KMproduction!</p>', '0', 0, 2, 14, 2, 607, 6, NULL, '2017-04-13 09:09:53', '2017-04-20 07:12:32'),
(714, 'Рамиль Беляков', '<p>Энергетика и активность, юмор и креатив, уверенность и ответственность &ndash; именно эти качества позволяют добиться максимального результата и провести действительно яркое и интересное мероприятие. Организация и проведение мероприятий &mdash; основная деятельность этого человека. Все мероприятия, в которых участвует Рамиль, проходят &laquo;на ура&raquo;, повторений не допускается. Индивидуальный подход к каждому мероприятию. Возможность написания уникального сценария, подготовка в плотном контакте и с учетом всех пожеланий клиента.</p>', '0', 0, 2, 4, 2, 606, 3, NULL, '2017-04-13 09:10:24', '2017-04-20 03:40:28'),
(715, 'Руслан Аспан', '<p>Он опытный артист и прекрасно знает, как следует дорожить зрительским вниманием. Свой творческий путь Руслан начал с эстрадных азов и отточив вокальные навыки, постигнув тайны сценического поведения и искусство владения микрофоном, он стал самым неподражаемым ведущим. Руслан готов предложить самый большой репертуар мировых хитов, ретро шлягеров, лирических баллад. Так, где шоумен &laquo;разговорник&raquo; не дотянется к душам зрителя, это всегда сможет сделать песня, идущая от сердца профессионала. Остановите свой выбор на Руслане, и он обязательно оправдает высокий статус вашего свадебного шоу! Современный беташар.За вечер сменяет 3 костюма, и по залу ездит на electroboard!</p>', '0', 0, 2, 4, 2, 608, 3, NULL, '2017-04-13 09:12:19', '2017-04-20 04:09:53'),
(716, 'Greenlight studio', 'Добро пожаловать в удивительный и волшебный мир фотографии и видео! Мы – команда из 9 талантливых, амбициозных и творческих фотографов Алматы. Глава нашей компании – Азиз Зульяров – уже известен в нашем городе и завоевал признательность клиентов. Мы безумно любим свою работу и с вдохновением подходим к каждой фото и видеосъемке.\r\n\r\nНаша цель – подчеркнуть лучшее, передать чувства, переживания и настроение, «поймать» живые эмоции. Мы знаем, как важно оттачивать мастерство, поэтому стараемся всегда узнавать что-то новое и предложить Вам неординарные решения, выбирать лучшие площадки для съемки. В работе используем лучшее съемочное и осветительное оборудование, необычные реквизиты. Мы стремимся в работе к совершенству, поэтому отдаем готовые фотографии или видео, только когда уверены в их безупречности. Рекомендации и положительные отзывы наших постоянных клиентов – лучшая награда для нас!\r\n\r\nДополнительные услуги:\r\n— фотокнига на 20-30 разворотов из ваших свадебных фотографий\r\n— Фотосъемка для себя в студии или на выезде\r\n— Фотосъемка Юбилеев, Дни рождения\r\n— Моделям: портфолио, тесты, снэпшоты\r\n— Семейные фотосессии\r\n— Услуги профессионального визажиста и другие виды съемок.\r\n\r\nЛюбая видеосъемка подразумевает съемку в наилучшем качестве FullHD и при заказе от 100 тысяч видеопродукт отдается помимо дисков еще и на флешке для комфортного просмотра в максимальном качестве на больших телевизорах.\r\nДоверьте, профессионалам запечатлеть ваши счастливые моменты!', '0', 0, 2, 5, 2, 609, 6, NULL, '2017-04-13 09:12:53', '2017-04-13 09:12:53'),
(717, 'Айдар Курумбаев', '<p>Проводит такие мероприятия как: шілдехана, тұсау кесер, сүндет той, тілашар, қыз узату, үйлену той, құда түсіру, құда аттандыру, корпоративные вечера, презентации, концерты. Предлагает оригинальную, новую и модную программу, в которой будут современные конкурсы, юмористические сценки, танцевальные игры, викторины, блок юмора, миниатюры в стиле КВН, яркие костюмы и много хорошей и качественной музыки. Будут представлен неординарный вид ведения вашего мероприятия, в котором будут преобладать живое общение, море юмора, обаяния и приятных для Вас сюрпризов.</p>', '0', 0, 2, 4, 2, 610, 3, NULL, '2017-04-13 09:14:01', '2017-04-20 04:10:02'),
(718, 'Greenlight studio', '<p>Добро пожаловать в удивительный и волшебный мир фотографии и видео! Мы &ndash; команда из 9 талантливых, амбициозных и творческих фотографов Алматы. Глава нашей компании &ndash; Азиз Зульяров &ndash; уже известен в нашем городе и завоевал признательность клиентов. Мы безумно любим свою работу и с вдохновением подходим к каждой фото и видеосъемке. Наша цель &ndash; подчеркнуть лучшее, передать чувства, переживания и настроение, &laquo;поймать&raquo; живые эмоции. Мы знаем, как важно оттачивать мастерство, поэтому стараемся всегда узнавать что-то новое и предложить Вам неординарные решения, выбирать лучшие площадки для съемки. В работе используем лучшее съемочное и осветительное оборудование, необычные реквизиты. Мы стремимся в работе к совершенству, поэтому отдаем готовые фотографии или видео, только когда уверены в их безупречности. Рекомендации и положительные отзывы наших постоянных клиентов &ndash; лучшая награда для нас!</p>\r\n<p>Дополнительные услуги:</p>\r\n<p>&mdash; фотокнига на 20-30 разворотов из ваших свадебных фотографий</p>\r\n<p>&mdash; Фотосъемка для себя в студии или на выезде</p>\r\n<p>&mdash; Фотосъемка Юбилеев, Дни рождения</p>\r\n<p>&mdash; Моделям: портфолио, тесты, снэпшоты</p>\r\n<p>&mdash; Семейные фотосессии</p>\r\n<p>&mdash; Услуги профессионального визажиста и другие виды съемок.</p>\r\n<p>Любая видеосъемка подразумевает съемку в наилучшем качестве FullHD и при заказе от 100 тысяч видеопродукт отдается помимо дисков еще и на флешке для комфортного просмотра в максимальном качестве на больших телевизорах. Доверьте, профессионалам запечатлеть ваши счастливые моменты!</p>', '0', 0, 2, 14, 2, 609, 6, NULL, '2017-04-13 09:14:16', '2017-04-20 07:11:29'),
(719, 'Дуэт Ануар и Султан', '<p>С первого дня совместной нашей работы образовалось высокая слаженность. Наши мероприятия проходят легко и естественно, как правильный макияж. И если визажисты следят за внешним видом девушек, мы следим за &laquo;внешним видом&raquo; праздника. Концерты, телевизионные проекты осилим в качестве ведущих, если предложите. Опыт есть. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 611, 3, NULL, '2017-04-13 09:15:45', '2017-04-20 04:12:24'),
(720, 'Арман Николаевич', '<p>При знакомстве с этим активным и обаятельным человеком, первое, что Вы услышите, будет &mdash; &laquo;Здравствуйте, меня зовут Арман Николаевич, и это не псевдоним&raquo;. Отличное чувство юмора, масса позитива, жизнелюбие и готовность работать 24 часа в сутки &mdash; это то, что у Армана не отнять. Приятное знакомство, всегда приподнятое настроение, и масса позитива &mdash; это основные личностные характеристики Армана. Что же касается работы, то к ней он относится с большой ответственностью. Индивидуальный подход, двуязычная авторская программа, сбалансированное соотношение развлекательной и официальной частей, импровизация и тактичность &mdash; вот что оставит любого заказчика довольным. Неудивительно, что многие обращаются к Арману Николаевичу, и в последующие разы для проведения торжеств, ведь каждый заказ выполняется на высшем уровне. Арман Николаевич &mdash; настоящий казах, который сделает Ваш праздник по-настоящему веселым, интересным и запоминающимся! Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 613, 3, NULL, '2017-04-13 09:17:46', '2017-04-20 04:12:32'),
(721, 'АЗИЯ Классик', 'Классический струнный квартет «АЗИЯ Классик» .\r\nМузыкальные инструменты, на которых играют его участники: две скрипки, альт и виолончель. Наш квартет назывался «АЛАУ» и несколько лет успешно выступал на разных мероприятиях — благотворительных концертах, презентациях компаний и магазинов, свадьбах, юбилеях и т.п.\r\nВ октябре 2014 года состав был обновлен и переименован в «АЗИЯ Классик». Репертуар струнного квартета разнообразен, в него входит музыка различных стилей и жанров: шедевры барочной и классической эпох, музыка из известных кинофильмов, джазовые композиции, казахские народные песни и песни известных казахских композиторов в обработке для квартета.\r\nВ данное время основной состав квартета составляют выпускники Казахской Национальной консерватории им.Курмангазы, лауреаты республиканских и международных конкурсов, участники фестивалей, проходившие стажировку в Англии.\r\n«АЗИЯ Классик» один из лучших камерных квартетов, который существует на протяжении многих лет, все участники квартета имеют высшее музыкальное образование. «Живая» камерная музыка в исполнении нашего квартета украсит любое Ваше мероприятие и станет незабываемым воспоминанием для всех приглашенных.\r\n«АЗИЯ Классик» — мы внесем в Ваш праздник ноты прекрасного!', '0', 0, 2, 6, 2, 612, 6, NULL, '2017-04-13 09:17:55', '2017-04-13 09:17:55'),
(722, 'Шыңғыс Қуанышханов', '<p>Ведущий, шоумен, тамада, актер-квн, автор. Европейский стиль не отходя от традиций! Жанр: интерактивынй, развлекательный, юмористический. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 614, 3, NULL, '2017-04-13 09:20:42', '2017-04-20 04:12:50'),
(723, 'Х.А.Н. Трио', '<p>Необычное и приятное на слух сочетание Домбры и Перкуссии. Состав: Архат Куаншалиев (домбра), Назарбек Оразбеков (домбра), Хасан Мацаев (кахон, перкуссия). Трио Х.А.Н. исполняет всемирно известные композиции, в собственной аранжировке. Репертуар: народная казахская музыка, популярные композиции разных времен и народов (репертуар постоянно пополняется новыми композициями).</p>', '0', 0, 2, 6, 2, 615, 6, NULL, '2017-04-13 09:20:53', '2017-04-20 07:28:47'),
(724, 'Тима Нурдаулетович', '<p>Тима Нурдаулетович &ndash; веселый, креативный молодой ведущий, обладающий отличным чувством юмора. Он точно знает как превратить любое застолье в настоящий праздник, а праздник наполнить теплом и весельем. Качественное звуковое сопровождение и живой вокал дополняют программы шоумена. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 616, 3, NULL, '2017-04-13 09:22:16', '2017-04-20 04:13:11'),
(725, 'Drumattack', 'Drumattack — безбашенный mash-up проект барабанщика и K.O. ( Khasan Omar) и DJ-я Dmitriy Zeman. В фееричном интерактивном шоу используется только живой звук барабанов и винил. Стоит отметить что Drumattack не имеет аналогов на территории Центральной Азии.\r\n\r\n  K.O. — продюсер проекта, совместно является директором и барабанщиком группы с мировым именем — Some Toir  ( прод. Дильназ Ахмадиева), а так же директором и продюсером проекта Beatrate Band .\r\n\r\n  За плечами DJ Dmitriy Zeman  3 года работы с Universal Music в качестве саунд продюсера и битмейкера. Dmitriy — победитель Red Bull ThreeStyle National Final World DJ Championship 2014 . Это мировой чемпионат, в котором Zeman имел опыт совместного выступления с величайшим скретчером планеты DJ Qbert . Также в копилке у артиста выступление на разогреве у Xzibit, DJ Magnum ( официальный диджей P. Diddy, Jay-Z, Pharrell Williams и.т.д.) и back to back с Alex Payne ( Cicada).\r\n\r\n  Drumattack — новый подход и видение музыки. Их сэты — это нечто совершенно новое, грандиозное и взрывное. В этом вы можете убедиться, пригласив проект на свое мероприятие любого масштаба и формата. ', '0', 0, 2, 6, 2, 617, 6, NULL, '2017-04-13 09:23:06', '2017-04-13 09:23:06'),
(726, 'Станислав Выговский', '<p>Весёлый ведущий, безупречный конферансье, харизматичный юморист. Начиная от ведения небольшого дня рождения, завершая организацией больших выступлений и уникальных шоу программ. Опыт Станислава позволяет ему с лёгкостью манипулировать любым масштабом и владеть совершенно разными сценарными поворотами.</p>', '0', 0, 2, 4, 2, 618, 3, NULL, '2017-04-13 09:23:38', '2017-04-20 04:13:34'),
(727, 'Сабит Дуйсенбиев', '', '0', 0, 2, 4, 2, 619, 3, NULL, '2017-04-13 09:26:33', '2017-04-13 09:26:33'),
(728, 'Dream lights show', '<p>Огненное, светодиодное, ультрафиолетовое, пиротехническое шоу. Участие на: свадьбах, корпоративах, open-air мероприятиях и любых торжествах. Наше шоу проводится на профессиональном уровне и именно благодаря нам, гости не могут отвести восхищенных глаз от завораживающего танца с огнем и светом, который показывает почти неограниченную свободу и ловкость человеческого тела. Наши выступления не имеют аналогов в Казахстане, что обусловлено использованием эксклюзивных светодиодных костюмов и реквизита. Для каждой аудитории мы подберём подходящую шоу программу из большого многообразия наших номеров.</p>', '0', 0, 2, 7, 2, 620, 6, NULL, '2017-04-13 09:27:57', '2017-04-20 07:19:42'),
(729, 'Оралхан и Айгуль', '<p>Язык ведения: русский, казахский</p>', '0', 0, 2, 4, 2, 621, 3, NULL, '2017-04-13 09:28:12', '2017-04-20 04:13:53'),
(730, 'Нурзат Кумисбеков', '<p>Ведущий, шоумен. С увлечением и огромной любовью к своему делу занимается проведением свадебных торжеств. Он сделает ваш праздник добрым, ярким, незабываемым событием, наполненным позитивными эмоциями. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 623, 3, NULL, '2017-04-13 09:29:49', '2017-04-20 04:14:05'),
(731, 'Majestic Magic show', '<p>Вы любите красивое шоу? Вы хотите сделать свое событие особенным? Вам нужно заинтересовать и удивить ваших гостей? Многие заказывают шоу чтобы сделать свой праздник интересным, веселым и запоминающимся. Хороший ведущий и шоу программа сделают свое дело. Но мы предлагаем добавить вашему мероприятию настоящего эксклюзива!!! Вы и ваши гости увидят не только красивое шоу, но будут кричать &laquo;как они это делают?&raquo;, более того, сами станут &laquo;жертвами&raquo; нашей магии. Люди будут долго говорить о том что произошло на Вашем празднике. 200% магии, довольные и удивленные гости &mdash; наша забота!</p>', '0', 0, 2, 7, 2, 622, 6, NULL, '2017-04-13 09:30:23', '2017-04-20 07:19:17'),
(732, 'Казбек Сыдыков', '<p>Молодой, яркий, энергичный, харизматичный и грамотный, нереально красивый, в том числе голос, и скромный, а так же: воспитанный, веселый, высокий, волшебный и это только на &laquo;в&raquo;. Креативный, интересный, живой ВЕ-ДУ-ЩИЙ.Проведение мероприятий любой сложности. Всегда рад знакомству!!!</p>', '0', 0, 2, 4, 2, 624, 3, NULL, '2017-04-13 09:30:53', '2017-04-20 04:16:04'),
(733, 'Арт Студия БоТа', '<p>Арт Студия БоТа представляет: песочное шоу, шоу на воде, шоу золотая пыль, мозаика шоу.</p>\r\n<p>Уникальное Шоу Рисование на воде!</p>\r\n<p>Завораживающее Шоу Рисование Светом!</p>\r\n<p>Волшебное Шоу Рисование Блестками!</p>\r\n<p>Удивительное БАТИК Шоу!</p>\r\n<p>Потрясающее Воображение Виртуальное Граффити!</p>\r\n<p>Яркое Шоу- Портрет или картина в стиле POP ART!</p>\r\n<p>Splash show!</p>\r\n<p>Картина Мозаика!</p>\r\n<p>Картина Пазл!</p>', '0', 0, 2, 7, 2, 625, 6, NULL, '2017-04-13 09:32:30', '2017-04-20 07:18:25'),
(734, 'Tesla Art Lab', '<p>Поиск подходящих артистов для выступления на мероприятии &mdash; непростая задача. Хочется найти что-то яркое и запоминающееся, но при этом быть застрахованным от неприятных неожиданностей. &laquo;Art laboratory Tesla&raquo; на протяжении четырех лет разрабатывает уникальные световые и огненные представления. Коллектив гарантирует Вам работу без срывов, опозданий и технических неполадок. За 4 года коллектив &laquo;Tesla Art Lab&raquo; дал сотни успешных и впечатляющих выступлений на корпоративах, свадьбах, праздничных мероприятиях. В чем отличие &laquo;Tesla art lab&raquo; от других коллективов? Мы осуществляем профессиональный подход к созданию шоу-программ.</p>\r\n<p>-Продуманный сюжет;</p>\r\n<p>- Поставленная режиссура и хореография;</p>\r\n<p>- Завершенные образы благодаря работе костюмера и стилиста;</p>\r\n<p>- Применение цирковых и акробатических элементов;</p>\r\n<p>- Месяцы репетиций.</p>\r\n<p>Почему работы &laquo;Tesla art lab&raquo; поражают воображение?</p>\r\n<p>&middot; Захватывающий сюжет;</p>\r\n<p>&middot; Подбор яркого музыкального сопровождения;</p>\r\n<p>&middot; Неожиданные эффекты, вызывающие удивление;</p>\r\n<p>&middot; Эффектные костюмы и декорации.</p>\r\n<p>Почему Вы можете быть уверены в безопасности, работая с &laquo;Tesla art lab&raquo;?</p>\r\n<p>&middot; Артисты и технические специалисты проходят обязательную сертификацию по пожарной безопасности;</p>\r\n<p>&middot; Tesla art lab имеет большой опыт выступлений с огнем;</p>\r\n<p>&middot; На каждом мероприятии с командой всегда работает технические специалисты, ответственные за безопасность.</p>\r\n<p>Также Tesla art lab представляет такие услуги, как:</p>\r\n<p>&middot; разработка и реализация оригинальных шоу-проектов огненное шоу, световое шоу, светодиодное шоу, ультрафиолетовое шоу, школа огненного мастерства, анимация, PJ поддержка, шоколадные фонтаны, создание костюмов и бутафории.</p>', '0', 0, 2, 7, 2, 627, 6, NULL, '2017-04-13 09:34:52', '2017-04-20 07:17:32'),
(735, 'Иван Эрнст', '<p>Иван &ndash; яркий, общительный и милый ведущий. Он умудряется совмещать традиции с оригинальностью. Ему подвластен любой формат ведения праздника &ndash; от классического до самого экстраординарного. Если вы хотите, чтобы на мероприятии уголки вашего рта были направлены вверх, то обратитесь к Ивану.</p>', '0', 0, 2, 4, 2, 626, 3, NULL, '2017-04-13 09:36:07', '2017-04-20 04:16:10'),
(736, 'Мирас', '<p>Дворец торжеств &laquo;Мирас&raquo; &ndash; это один из лучших банкетных залов в Алматы. Он открылся осенью 2015 года, но уже успел приобрести невероятную популярность в столице. И это не удивительно, ведь &laquo;Мирас&raquo; &ndash; ресторан для проведения свадьбы, юбилея, и других праздников, достойных того, чтобы пройти на высшем уровне.</p>\r\n<p>Мы предусмотрели каждую деталь, чтобы превзойти все ожидания Наших гостей:</p>\r\n<p>&bull; отдельные изысканные холлы для встречи гостей с гардеробами;</p>\r\n<p>&bull; мягкое покрытие полов в залах для дополнительного уюта и комфорта;</p>\r\n<p>&bull; танцевальная зона в центре залов, покрытая паркетом для выступлений и зажигательных танцев;</p>\r\n<p>&bull; плазменные панели на стенах зала для демонстрации видео-материала, подготовленного специально для торжества;</p>\r\n<p>&bull; гримерные комнаты для артистов, выступающих на Вашем празднике;</p>\r\n<p>&bull; выходы на балконы из залов;</p>\r\n<p>Подарки: При заказе любого торжества в наших банкетных залах &mdash; Фотозона и торт в подарок;</p>\r\n<p>При заказе свадебного банкета &ndash; Номер для новобрачных в подарок.</p>\r\n<p>Вместимость &ndash; до 300 человек.</p>\r\n<p>Кухня: казахская, европейская.</p>\r\n<p>Разрешены свои: алкоголь.</p>\r\n<p>Время работы: с 10:00 до последнего клиента, без выходных.</p>\r\n<p>Парковка: охраняемая, бесплатная.</p>', '0', 0, 2, 8, 2, 628, 6, NULL, '2017-04-13 09:37:28', '2017-04-20 06:48:47'),
(737, 'Жасын Канбаев', '<p>Жанр проведения: разговорный,юмористический. Молодой, харизматичный, профессиональный и популярный телеведущий телеканалов &laquo;7&raquo; и Астана. Ведущий передач &laquo;Айна-online&raquo;, &laquo;Айна-сөздік&raquo;, &laquo;Сорок миллионов тенге&raquo;, &laquo;СвиДЕТИли&raquo;. Автор и ведущий интернет-передачи &laquo;Online&raquo;. Настоящий профессионал своего дела. Проводит мероприятия любого формата и уровня. Все мероприятия, проведенные Жасыном, отличаются своей энергетикой и настроением. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 629, 3, NULL, '2017-04-13 09:38:11', '2017-04-20 04:16:20'),
(738, 'Ақ жол', '<p>Это прекрасное место для проведения любого мероприятия и торжества. Вас приятно удивит наш большой и вместительный зал без колонн. Изумительная национальная и европейская кухня. Обслуживание в нашем банкетном зале на высоком уровне, ведь мы желаем, чтобы Ваш праздник запомнился Вам надолго и Вы захотели посетить нас вновь! У нас имеется в наличии комната отдыха для ВИНОВНИКОВ ТОРЖЕСТВА, комната для артистов и музыкантов,а так же охраняемая парковочная зона вместимостью до 50 машин.</p>', '0', 0, 2, 8, 2, 630, 6, NULL, '2017-04-13 09:39:11', '2017-04-20 06:46:59'),
(739, 'Жансеит', '<p>Профессиональный ведущий, шоумен, актер, оригинальный сценарий, словесный импровизатор и искусный той-модератор. Проведение мероприятий любой сложности. Свадьбы, Корпоративы, Тимбилдинги, Концерты, Юбилеи, Узату, Бесик той, Сундет той.При проведении любого торжества Жансеит виртуозно сочетает такие качества профессионального ведущего, как креативность, непринужденность, тактичность и стиль, присущий только ему. Его визитная карточка &mdash; это искрометное сочетание юмора, интерактивных и оригинальных конкурсов и игр, которые Жансеит проводит в форматах зрелищных шоу и постановок.</p>\r\n<p>Преимущества:</p>\r\n<p>☑ Индивидуальная работа с каждым клиентом</p>\r\n<p>☑ Максимальный учет интересов и пожеланий заказчика</p>\r\n<p>☑ Неповторимый стиль</p>\r\n<p>☑ Бархатный тембр голоса и четкая дикция</p>\r\n<p>☑ 100% энергетика</p>\r\n<p>Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 631, 3, NULL, '2017-04-13 09:40:48', '2017-04-20 04:17:09'),
(740, 'Manar palace', '<p>Наш ресторан построен специально для того, чтобы Вы могли отметить вместе с близкими любое праздничное событие вашей жизни. Мы предусмотрели все для удобства хозяина и хозяйки банкета &ndash; просторные и уютные Залы, отличная кухня, место для парковки. Услуги Банкетного Зала премиум-класса доступны для каждого! Банкетный ресторан Манар Палас &ndash; просторное и красивое здание с тремя Банкетными Залами на трех этажах, рассчитанное для приема 700 гостей, для проведения семейных и корпоративных мероприятий. При строительстве были использованы современные высококачественные экологичные материалы, с соблюдением высших стандартов. Система кондиционирования и вентилирования здания осуществляется оборудованием немецкой фирмы &laquo;KORF&raquo;. За 1 час проходит обмен 24 000 кубических метров воздуха, залы оснащены качественной звуковой системой &laquo;CVR&raquo; мощностью 10 квт.</p>', '0', 0, 2, 8, 2, 632, 6, NULL, '2017-04-13 09:42:36', '2017-04-20 06:46:16'),
(741, 'Ерландо', '<p>ДРАЙВ ОТ и ДО РАЗВЛЕЧЕНИЯ ALL INCLUSIVE СЦЕНАРИЙ &mdash; БОМБА! ТОСТЫ &mdash; УРАГАН КОНКУРСЫ ЭКСКЛЮЗИВ Кроме того Вы должны знать: Вашим Друзьям будет ВЕСЕЛО, Родственникам &ndash; ДУШЕВНО, Детям &ndash; ИНТЕРЕСНО. А главное, Ерландо учтёт любую мелочь. Так, чтобы в этот самый важный день хорошо было ВАМ. В команде работают:отличный звукорежиссер (DJ) на профессиональной аппаратуре. Будьте спокойны, на Вашем танцполе не будет свободного места! Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 633, 3, NULL, '2017-04-13 09:44:13', '2017-04-20 04:18:48'),
(742, 'Gold Казына', '<p>Всего мест: 250.</p>\r\n<p>Разрешены: свои алкоголь, мясо, фрукты, десерты, безалкогольные напитки.</p>\r\n<p>Кухня: восточно-европейская, казахская.</p>\r\n<p>Дополнительные услуги: звуковая аппаратура, световая аппаратура, музыкальное сопровождение, ведущий (тамада), фотосъёмка, видеосъёмка, оформление зала.</p>\r\n<p>Принимаемые к оплате карты: Visa, Visa Electron, MasterCard/Eurocard, Maestro, Cirrus, American Express, Diners Club, China UnionPay, Altyn, Go!Card, JCB.</p>\r\n<p>Парковка: охраняемая, бесплатная, на 55 мест.</p>', '0', 0, 2, 8, 2, 634, 6, NULL, '2017-04-13 11:22:31', '2017-04-20 06:45:28'),
(743, 'AlmaAtaHall', '<p>Прекрасное место для проведения Вашего торжества. Здесь Вас ждут разнообразие дизайна интерьеров и вместимости залов класса \"Премиум\", изысканность кухни и превосходный сервис. Знаменитая &laquo;Алматушка&raquo; радушно встретит Вас в новом облике! Это заведение, расположенное в самом центре города, не теряет своей актуальности вот уже более 50 лет. &laquo;AlmaAtaHall&raquo; включает в себя: VIP-комната на 35 персон, проводим детские банкеты, банкетный зал на 800 мест, банкетный зал на 120 мест, банкетный зал на 50 мест, детский зал на 80 мест. Имеется национальная кухня.</p>', '0', 0, 2, 8, 2, 635, 6, NULL, '2017-04-13 11:26:54', '2017-04-20 06:38:30');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(744, 'Алтын Гасыр', '<p>Всего мест: 320.</p>\r\n<p>Разрешены свои: алкоголь, мясо, фрукты, десерты, безалкогольные напитки.</p>\r\n<p>Время работы с 10:00 до последнего клиента, без выходных.</p>\r\n<p>Кухня: восточная, европейская, казахская.</p>\r\n<p>Особенности сцена, танцпол, зона для курящих, гримёрная.</p>\r\n<p>Описание залов: Маленький дворец с высокими потолками и мраморными полами, имеется система кондиционирования и вентиляции, гардеробная, балконы для курения, зона для ожидания, пандус, уборная и лифты для маломобильных людей.</p>\r\n<p>Дополнительные услуги звуковая аппаратура, световая аппаратура, музыкальное сопровождение, ведущий (тамада), фотосъёмка, видеосъёмка, оформление зала.</p>\r\n<p>Парковка: охраняемая, бесплатная, на 50 мест.</p>', '0', 0, 2, 8, 2, 636, 6, NULL, '2017-04-13 11:28:39', '2017-04-20 06:25:58'),
(745, 'Дом торжеств BAROCСО', '<p>Всего посадочных мест: 20, 35 , 70, 170.</p>\r\n<p>Разрешены свои: алкоголь, мясо, фрукты, безалкогольные напитки и любые другие виды готовой продукции. (по желанию).</p>\r\n<p>Кухня: национальная, европейская, оригинальное детское меню.</p>\r\n<p>Особенности: Зал регистрации с фонтаном шампанского, детская комната, комната для хранения напитков, подарков и личных вещей, зал для отдыха гостей с фуршетом.</p>\r\n<p>Описание залов: 4 зала в стиле BAROCCO , эксклюзивный дизайн.</p>\r\n<p>Дополнительные услуги: От заведения &mdash; оформление залов, свадебный торт, фуршетный стол, предоставление зала для регистрации бракосочетания. Принимаемые к оплате карты.</p>\r\n<p>Парковка: бесплатная.</p>', '0', 0, 2, 8, 2, 637, 6, NULL, '2017-04-13 11:30:26', '2017-04-18 06:44:20'),
(746, 'Студия Ко-Ко', 'Модный маникюр – залог здоровья Ваших ручек! Хотите предать Вашим ногтям красивый и ухоженный вид, сделать маникюр или педикюр недорого и качественно?  Мастера Студии «Ко-Ко» с удовольствием помогут вам в этом! Оставаясь верными своему кредо «Делать роскошь и красоту доступной», мы первыми делаем цены на маникюр и педикюр сенсационно привлекательными! Сочетание «доступная стоимость наших услуг и отличное качество» — наша гордость и отличие от всех!  Работаем по предварительной записи, в праздничные и выходные дни!', '0', 0, 2, 9, 2, 638, 6, NULL, '2017-04-13 11:32:53', '2017-04-13 11:32:53'),
(747, 'Студия красоты ИНФИНИТИ', '<p>&mdash; Маникюр гель покрытием</p>\r\n<p>&mdash; Маникюр обычный</p>\r\n<p>&mdash; Педикюр гель покрытием</p>\r\n<p>&mdash; Педикюр обычный</p>\r\n<p>&mdash; Гель покрытие</p>\r\n<p>&mdash; Коррекция бровей+покраска</p>\r\n<p>&mdash; Коррекция нарощенных НОГТЕЙ</p>\r\n<p>&mdash; НАРАЩИВАНИЕ НОГТЕЙ ПОД ГЕЛЬ</p>\r\n<p>&mdash; НАРАЩИВАНИЕ ФРЕНЧ</p>\r\n<p>&mdash; ДИЗАЙН ЛЮБОЙ сложности</p>\r\n<p>&mdash; НАРАЩИВАНИЕ ресниц классический</p>\r\n<p>&mdash; НАРАЩИВАНИЕ ресниц объем</p>', '0', 0, 2, 9, 2, 639, 6, NULL, '2017-04-13 11:34:21', '2017-04-20 06:52:38'),
(748, 'Диана Кадиева', '<p>Опыт работы:</p>\r\n<p>- 2012-2016 модельное агентство ProFashion &mdash; визажист</p>\r\n<p>- официальный стилист Mercedes-Benz Fashion Week Almaty юбилей телеканала MuzZone работа с артистами (Роза Рымбаева, Нагима Ескалиева, Нурлан Абдуллин) Выезд в город Шымкент на презентацию ТЦ &laquo;Шымкент Плаза&raquo; подготовка артистов( Майя Веронская, Азамат Мусагалиев, Данияр Макашев)</p>\r\n<p>- стилист проекта &laquo;Я Казахстанец&raquo;</p>\r\n<p>- подготовка Моделей к открытию Porshe Center Almaty</p>\r\n<p>- подготовка Моделей к показу дебютной коллекции Алии Назарбаевой 2017</p>\r\n<p>- участник выставки &laquo;Свадебная феерия 2017&raquo;</p>\r\n<p>Знания и навыки:</p>\r\n<p>&mdash; Владение всеми основными видами макияжа: дневной, вечерний, деловой, свадебный, а также подиумный, праздничный, глянцевый, ретро</p>\r\n<p>&mdash; Коррекция формы брови, покраска бровей и ресниц</p>\r\n<p>&mdash; Укладки и причёски любой сложности</p>\r\n<p>&mdash; Сотрудничество с профессиональными фотографами в качестве визажиста-стилиста, студийные и выездные съемки</p>', '0', 0, 2, 9, 2, 640, 6, NULL, '2017-04-13 11:36:00', '2017-04-20 06:52:00'),
(749, 'Gulnura makeup', 'MakeUpArtist\r\nSaniya makeup school\r\nЦены не фиксированные, так как зависит от дизайна и сложности работ…', '0', 0, 2, 9, 2, 641, 6, NULL, '2017-04-13 11:38:48', '2017-04-13 11:38:48'),
(750, 'Азамат Сергалиев', '<p>Сергалиев Азамат &mdash; make-up artist международного уровня, участник конкурсов красоты &laquo;Мисс Казахстан&raquo;, &laquo;Мисс Алматы&raquo;! Многократный участник международной выставки &laquo;KazInterBeauty&raquo; , Участник фестиваля &laquo;EurasianBeautyFest&raquo;. Преподаватель компаний Karaja.</p>\r\n<p>Профессиональная косметика: Atelier &mdash; Франция, Karaja &mdash; Италия, L&rsquo;ocean &mdash; Ю. Корея.</p>', '0', 0, 2, 9, 2, 642, 6, NULL, '2017-04-13 11:42:26', '2017-04-20 06:49:57'),
(751, 'Мирадж', 'В свадебном салоне «Мирадж», расположенном в центральной части города Алматы, созданы все условия для того, чтобы каждая невеста нашего прекрасного города нашла свой свадебный наряд. Наши коллекции свадебных платьев представлены в классическом белом цвете и модном цвете айвори (ivory), и мы с удовольствием поможем Вам подобрать цвет свадебного платья, наиболее удачно подходящий к Вашему свадебному образу.\r\n\r\nУ нас также представлен широкий ассортимент самых разнообразных силуэтов свадебных платьев — пышные свадебные платья со шлейфами, украшенные кристаллами и кружевом, платья силуэта «рыбка», так подчеркивающие достоинства Вашей фигуры, свадебные платья классического А-силуэта, платья стиля Ампир и многие другие. Если Вы — невеста, ожидающая малыша, мы с удовольствием подберем Вам комфортное и красивое свадебное платье, которое не доставит Вам лишних хлопот в самый важный свадебный день!\r\n\r\nМы подберем для Вас свадебное платье мечты!', '0', 0, 2, 10, 2, 643, 6, NULL, '2017-04-13 11:44:30', '2017-04-13 11:44:30'),
(752, 'Шоу-балет La-Fiesta', 'Шоу-балет La-Fiesta предлагает вам эксклюзивное выступление, которое не имеет аналогов в Казахстане и будет самым красивым украшением Вашего мероприятия. В наших изысканных танцах заложен глубокий смысл в сочетании с высоким профессиональным уровнем подачи… наслаждайтесь!', '0', 0, 2, 11, 2, 644, 6, NULL, '2017-04-13 11:46:09', '2017-04-13 11:46:09'),
(753, 'Шоу балет «Versal»', 'Шоу балет «Versal»- это яркое, зажигательное, неповторимое, полное эмоций и чувств танцевальное шоу! Шикарные костюмы, профессиональное исполнение, авторская хореография, красивые танцовщицы! Что еще нужно для фееричной атмосферы Вашего вечера?! В репертуаре коллектива около 20 оригинальных и неповторимых номеров!\r\n\r\nНаши возможности:\r\n*танцевальное сопровождение артистов\r\n*танцевальное оформление мероприятия любого масштаба\r\n*индивидуальная постановка номера с учетом Вашего мероприятия и Ваших пожеланий\r\n*организация флеш-мобов\r\n*проведение танцевальных конкурсов\r\n*постановка свадебного танца\r\n*встреча гостей', '0', 0, 2, 11, 2, 645, 6, NULL, '2017-04-13 11:47:54', '2017-04-13 11:47:54'),
(754, 'Шоу-балет «Эйфория»', 'Шоу-балет «Эйфория»\r\n\r\nМы предлагаем вам очень красивые танцы с различными постановками с шикарными костюмами и конечно же с очень талантливыми танцорами балета. Эйфория предлагает Вам театрализованное шоу на ҚЫЗ ҰЗАТУ с необычным сюжетом красивыми танцами с профессиональными ведущими, театрализованное шоу на свадьбы, а также ТҰСАУ КЕСУ.\r\n\r\nВ нашем репертуаре есть танцы как:\r\n\r\n-Казахский танец\r\n\r\n-Казахский танец в стиле Модерн\r\n\r\n-Хорезм\r\n\r\n-Индия\r\n\r\n-Восточный павлин\r\n\r\n-Испания\r\n\r\n-Рок-н-ролл\r\n\r\n-Антре\r\n\r\n—Танец молодоженов', '0', 0, 2, 11, 2, 646, 6, NULL, '2017-04-13 11:49:24', '2017-04-13 11:49:24'),
(755, 'Шоу-балет SULU', 'Приоритетным танцевальным направлением шоу-балета SULU являются танцы народов мира. В состав группы входят лауреаты международных  конкурсов народных и современных танцев.\r\nВысокий профессиональный уровень исполнения отличает любые номера нашего коллектива. Шоу-балет SULU будет достойным украшением Вашего торжества.\r\nОсновной состав 5 девушек.\r\nСольная группа состоит из 5-ти человек. Формирование группы для выступления по пожеланию заказчика. могут быть организованны в любом регионе Казахстана.\r\nВ репертуаре — 18 танцевальных номеров различного направления (народные танцы, карнавальные танцы, танцевальные миниатюры для тематических мероприятий). Специальные номера для мусульманских торжеств. Подтанцовка для артистов эстрады.\r\nУслуги хореографа, постановка танцев, разработка специальных номеров по пожеланию клиента. Антуражные услуги: встреча и проводы невесты, приветствие жениха/невесты, приветствие, вывод юбиляров, живой коридор и прочее. Рекламные и промо акции. Специальные предложения для проведения кыз узаты, той бастар, беташар, шанырак, шымылдык.', '0', 0, 2, 11, 2, 647, 6, NULL, '2017-04-13 11:50:58', '2017-04-13 11:50:58'),
(756, 'Crystal', 'Шоу-балет «Crystal» был создан в мае 2014 года. За короткий срок он стал одним из самых востребованных шоу-балетов, отвечающим духу и запросам даже самой искушенной публики. Идеей образования коллектива являлось:\r\n\r\nсоздание фееричного шоу с уникальными танцевальными постановками и костюмами;\r\nсинтез различных танцевальных стилей и направлений;\r\nзавоевание высокого культурного имиджа Республики Казахстан в странах ближнего и дальнего зарубежья.\r\n«Crystal» — это симбиоз качественной хореографии, танцевального мастерства, профессионального исполнения и великолепных костюмов. Залогом успеха является ежедневная и слаженная работа коллектива под бессменным руководством талантливого хореографа-постановщика. Без сомнений, «Crystal» можно назвать самым красивым танцевальным коллективом страны, ведь изюминкой шоу-балета является тщательно отобранный состав из 8 талантливых и профессиональных артисток, очаровывающих своей утонченностью и грациозностью с первого взгляда.\r\n\r\nСовместные выступления со звездами казахстанской эстрады: виа Assyl, Мадина Садвакасова, Али Окапов, Акылбек Жеменей, группа «Жигиттер». В презентациях и юбилеях компаний «Tiens», «GakkuTV», «Казахтелеком» телевизионные шоу-программы: «TойBestStar», «Ұлттық шоу», «Ән Дария», «Кызык Times», «Биздин концерт», «Айел сыры».\r\n\r\n', '0', 0, 2, 11, 2, 648, 6, NULL, '2017-04-13 11:52:54', '2017-04-13 11:52:54'),
(757, 'Шоу-балет Лира', '<p>Шоу-балет Лира &ndash; это сочетание красоты, женственности, стиля и профессионализма. Репертуар: казахский танец &laquo;Домбра&raquo;, казахский танец &laquo;АККУ&raquo;, танец &laquo;Казахский&raquo;, &nbsp;Казахский танец &laquo;Наурыз&raquo;, белое Антре, бразильский танец \"РИО\", кубинский танец (интерактив с гостями), персидский танец, индийский танец (интерактив с гостями), латина, чикаго, \"Мистер ИКС\", \"Гэтсби\" (интерактив с гостями), \"Орхидея\" вальс цветов, новогодний танец, встреча жениха и невесты (национальный и европейский стиль), проводы невесты &ldquo;Акжол&rdquo;. Мы украсим Ваш праздник!</p>', '0', 0, 2, 11, 2, 649, 6, NULL, '2017-04-13 11:55:10', '2017-04-20 06:23:22'),
(758, 'Шоу-балет «Vivat»', 'Стильные костюмы и номера, экспрессивные танцы, массовость, техничность, универсальность, эмоциональное исполнение, профессионализм  — это стиль «Vivata».\r\n\r\nНа данный момент шоу-балет  «Vivat» является самым востребованным танцевальным коллективом. Участие в крупных концертах во многих городах Казахстана и далеко за его пределами. Презентации и юбилеи  крупных компаний, открытие  торговых и развлекательных центров. Работа со  звёздами казахстанской и зарубежной эстрады.\r\nРазработка  и проведение праздничных мероприятий.\r\nСтиль, Экспрессия, Мастерство — девиз шоу-балета «Vivat».', '0', 0, 2, 11, 2, 650, 6, NULL, '2017-04-13 11:57:36', '2017-04-13 11:57:36'),
(759, 'Шоу балет «Rise»', 'Великолепные костюмы, оригинальный подход и профессиональное исполнение дали повод заговорить о нас.\r\n\r\nВсе наши прекрасные и утонченные танцовщицы являются профессиональными артистками балета и всегда вызывают восхищение и интерес публики.\r\nОсобое внимание в создании шоу балета уделялось костюмам, которые сегодня являются одними из самых впечатляющих в городе Алматы.\r\n\r\nВ нашем разнообразном репертуаре вы сможете найти эксклюзивные номера под любое мероприятие: трогательный классический балет в пуантах, кипящее танго, незабываемый танец эльфиек, озорные коломбины, завораживающий венецианский карнавал и конечно же визитная карточка балета — Райские птицы гипнотизирующие своей грациозностью.\r\nОсновной состав коллектива включает 7 балерин и на сегодняшний день мы успешно работаем двумя равнозначными составами.\r\n\r\nПо желанию клиента мы делаем постановки на заказ, работаем хостес, ставим танцы молодоженам, делаем подтанцовки и можем увеличивать состав до желаемого.\r\nЗа короткий период существования наш коллектив стал довольно востребован среди ценителей красоты, роскоши и утонченности.\r\n\r\nМы выступаем исключительно на мероприятиях высокого уровня не только в Казахстане но и за рубежом.', '0', 0, 2, 11, 2, 651, 6, NULL, '2017-04-13 12:00:19', '2017-04-17 23:13:10'),
(760, 'Мастерская праздников Виктории Духно', 'Мы рады предложить нашим клиентам:\r\n— пригласительные (от простых до самых сложных)\r\n— бонбоньерки\r\n— книги пожеланий\r\n— списки рассадки гостей и номерки\r\n— пресс стены\r\n— декорирование бокалов и бутылок, столовых приборов\r\n— все для свадебной регистрации.\r\n\r\n7 ПРИЧИН ОБРАТИТЬСЯ ИМЕННО К НАМ\r\n\r\nВЫСОКОЕ КАЧЕСТВО. Мы работаем с 2010 года, наше качество подтверждают тысячи довольных клиентов.\r\nРУЧНАЯ РАБОТА. Только ручная работа позволяет добиться эффекта WOW! Убедитесь в этом сами!\r\nОПТИМАЛЬНЫЕ ЦЕНЫ. Лучшее соотношение цена/качество в Алматы. Оцените наше портфолио.\r\nСОБСТВЕННОЕ ПРОИЗВОДСТВО позволяет нам полностью контролировать процесс исполнения заказа на всех этапах.\r\nБОЛЬШОЙ ВЫБОР. Мы производим более трехсот наименований продукции для взыскательных клиентов.\r\nГРАМОТНЫЕ СПЕЦИАЛИСТЫ. Мы постоянно проходим курсы повышения квалификации и работаем с лучшими профессионалами.\r\nИНДИВИДУАЛЬНОСТЬ. Каждый заказ мы делаем под определенного клиента, у нас нет готовых шаблонных работ.', '0', 0, 2, 13, 2, 652, 6, NULL, '2017-04-13 12:04:24', '2017-04-13 12:04:24'),
(761, 'Дизайн студия Асель Алимхан', 'Первая деталь предстоящего торжества — свадебные приглашения. Именно они задают стиль долгожданного события, дарят гостям чувство радостного предвкушения и ожидания романтичной даты.\r\n\r\nВы сможете заказать пригласительные на свадьбу ручной работы, выполненные из дизайнерской бумаги и изысканно украшенные лентами, кружевом и кристаллами. Можно выбрать одинаковые открытки для всех гостей или несколько видов для разных групп приглашенных. Основой для эксклюзивных приглашений на свадьбу является высококачественная дизайнерская бумага и картон. Они имеют очень красивую текстуру, и их просто приятно держать в руках!\r\n\r\nМы готовы создать пригласительные на заказ для любого события:\r\n\r\n день рождения\r\n детский праздник\r\n Новый год\r\n тематическая вечеринка\r\n корпоратив\r\n бизнес-мероприятие\r\nПригласительные на свадьбу и другие праздники на заказ от дизайн студии Асель Алимхан – отличный способ запомнить важный день надолго!', '0', 0, 2, 13, 2, 653, 6, NULL, '2017-04-13 12:06:02', '2017-04-13 12:06:02'),
(762, 'Еркебулан Тлеулин', '<p>Только от профессионализма и опыта ведущего зависит успех любого события, поэтому подбор ведущего на праздник &ndash; это то, с чего необходимо начинать писать сценарий всего мероприятия. Именно Еркебулан задаёт настрой и привносит тот самый незабываемый шарм и колорит торжественному вечеру, используя свои собственные авторские наработки, профессиональные тайны мастерства проведения мероприятий с незнакомой публикой и многолетний опыт интерактивного ведения прямых эфиров. Язык ведения: казахский, русский, английский. География ведения: Казахстан, Россия, ОАЭ.</p>', '0', 0, 2, 4, 2, 654, 3, NULL, '2017-04-13 12:08:35', '2017-04-20 04:19:27'),
(763, 'Wikiprint', 'Wikiprint – это коллектив специалистов разных профессий с высокой квалификацией и большим опытом. Все наши сотрудники по-настоящему любят свое дело, а к выполнению поставленных задач подходят творчески, зачастую принимая нестандартные решения, чтобы иметь на выходе не только качественную, но и уникальную продукцию.\r\nМы можем предложить своим клиентам высококачественное производство по стабильно недорогим ценам:\r\nполиграфической продукции\r\nсувенирной продукции\r\nнаружная реклама\r\n\r\nИмеем колоссальный опыт работы в свадебной индустрии, изготавливаем все начиная от открыток, бонбоньерок, баннеров, пригласительных, и заканчивая различными стендами, объемными буквами и многим другим.\r\nЦены не фиксированные, так как зависит от дизайна и сложности работ…\r\n\r\n', '0', 0, 2, 13, 2, 655, 6, NULL, '2017-04-13 12:09:06', '2017-04-13 12:09:06'),
(764, 'Exclusive', '<p>Эксклюзивные парни города Шымкент вновь приехали в свой город. Если хотите научится хорошо двигать телом, тогда приходите к нам!!! Современная школа танцев &laquo;Exclusive&raquo; все виды современных танцев как: BreakDance, Hip-Hop, Popping, Locking, Waacking, Современная хореография, Аэробика. Если хотите что бы ваш банкет, корпоратив, юбилей, день рождения прокачал на все 100%! Современный танцевальный проект &laquo;Бесбармак&raquo; ждет вашего звонка!!!</p>\r\n<p>Мы можем предоставить вам:</p>\r\n<p>1. Танцевальное шоу</p>\r\n<p>2. Различные флэшмобы</p>\r\n<p>3. Зажигающие танцевально интерактивные номера</p>\r\n<p>4. Постановки танцев</p>\r\n<p>5. Вынос торта или вынос горячего в танцевальном виде и конечно подарим Вам самое замечательное настроение этого вечера!!!</p>', '0', 0, 2, 11, 2, 656, 4, NULL, '2017-04-13 12:09:57', '2017-04-19 06:02:51'),
(765, 'NARA WEDDINGS', 'NARA WEDDINGS / NARA PRINT\r\nКреативная свадебная полиграфия, типография в Алматы\r\nПРИГЛАСИТЕЛЬНЫЕ – ЭТО ОЧЕНЬ ВАЖНЫЙ АТРИБУТ ЛЮБОГО КРУПНОГО ТОРЖЕСТВА: СВАДЬБЫ, ЮБИЛЕЯ, КОРПОРАТИВНОГО ПРАЗДНИКА. ТАКЖЕ ПРИГЛАСИТЕЛЬНЫЕ БИЛЕТЫ ЧАСТО ВРУЧАЮТСЯ ПОЧЕТНЫМ ГОСТЯМ ВЫСТАВОК, СОРЕВНОВАНИЙ, ТЕАТРАЛЬНЫХ И КИНОПРЕМЬЕР. ПО СУТИ, ПРИГЛАШЕНИЯ ЯВЛЯЮТСЯ ЛИЦОМ БУДУЩЕГО СОБЫТИЯ. ТАМ ПРИНЯТО УКАЗЫВАТЬ ТЕМАТИКУ ПРОВОДИМОГО МЕРОПРИЯТИЯ, ДРЕСС-КОД, МЕСТО И ВРЕМЯ ПРОВЕДЕНИЯ. В СЛУЧАЕ НЕОБХОДИМОСТИ, ТАМ МОЖЕТ УКАЗЫВАТЬСЯ И ИНАЯ ДОПОЛНИТЕЛЬНАЯ ИНФОРМАЦИЯ.\r\nЦены не фиксированные, так как зависит от дизайна и сложности работ…', '0', 0, 2, 13, 2, 658, 6, NULL, '2017-04-13 12:11:17', '2017-04-13 12:11:17'),
(766, 'Офарин', 'Танцевальная группа из Ташкента!\r\nШирокий ассортимент танцев в Восточном направлении.', '0', 0, 2, 11, 2, 659, 4, NULL, '2017-04-13 12:11:23', '2017-04-13 12:11:23'),
(767, 'Дуэт Санат и Мейрам', '<p>Гармоничное ведение двух респектабельных шоуменов, подкованных абсолютным знанием и соблюдением традиций, в сочетании хорошего ориентира современных тенденций сделает мероприятие не только незабываемым и эксклюзивным, так же оставит приятное послевкусие гостей, которые еще несколько недель будут с восхищением говорить об отлично проведенном праздничном вечере. Помните, ведущие вашего торжества &mdash; это ваше лицо! Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 657, 3, NULL, '2017-04-13 12:11:40', '2017-04-20 04:19:40'),
(768, 'Найсмун', 'Загадочный Казахский танец, Зажигательный Испанский танец и просто Обворожительный Узбекский танец от танцевального коллектива «Меруерт» не оставит равнодушным Вас и Ваших Гостей!', '0', 0, 2, 11, 2, 660, 4, NULL, '2017-04-13 12:13:03', '2017-04-13 12:13:03'),
(769, 'Думан Аким', '<p>Думан Аким отличный ведущий, которому под силу мероприятия любого уровня. Молодой, яркий, стильный, позитивный, современный. Его стиль ведения мероприятия оставит неизгладимое впечатление у Вас и Ваших гостей. Думан является лауреатом областных и международных конкурсов театрального искусства. Лауреат молодежной премии &laquo;Дарын&raquo; акима г.Караганды. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 661, 3, NULL, '2017-04-13 12:13:06', '2017-04-20 04:19:49'),
(770, 'Темірқазық', 'Более 20 лет компания «Темірқазық» является единственным официальным дистрибьютором турецкой компании «Koza» и сирийской компании «TBZ international» в странах Средней Азии и Республики Казахстан (имеются соответствующие сертификаты).\r\nКоллекция содержит более 1000 моделей пригласительных и поздравительных открыток. Открытки отличаются оригинальными дизайнерскими находками, утонченностью вкуса, роскошной торжественностью, безупречной стилевой выдержанностью. В ассортименте есть бонбоньерки, брендирование шоколада.\r\nПодбор пригласительных открыток – первоначальный и самый важный акт Вашего праздника.\r\nЦены не фиксированные, так как зависит от дизайна и сложности работ…', '0', 0, 2, 13, 2, 662, 6, NULL, '2017-04-13 12:13:55', '2017-04-13 12:13:55'),
(771, 'Меруерт', 'Загадочный Казахский танец, Зажигательный Испанский танец и просто Обворожительный Узбекский танец от танцевального коллектива «Меруерт» не оставит равнодушным Вас и Ваших Гостей!', '0', 0, 2, 11, 2, 663, 4, NULL, '2017-04-13 12:14:35', '2017-04-13 12:14:35'),
(772, 'Дархан Жусупов', '<p>Дархан отличный ведущий на любое мероприятие: проведение свадеб, корпоративов, юбилеев, торжеств, узату, тусау кесеров, выпускных, новогодних вечеров, концертов, презентаций, промо-акций и других праздничных событий.Если вы услышите, как он говорит на казахском, то сами захотите так же красноречиво выражать себя. Язык ведения: казахский, русский.</p>', '0', 0, 2, 4, 2, 664, 3, NULL, '2017-04-13 12:14:40', '2017-04-20 04:19:59'),
(773, 'Карагоз', 'Феерическое шоу от танцевальной группы «Карагоз».', '0', 0, 2, 11, 2, 667, 4, NULL, '2017-04-13 12:15:44', '2017-04-13 12:15:44'),
(774, '1 Момент Сервис', 'Типография «1 Момент Сервис» – одна из немногих типографий Алматы, предлагающих своим клиентам полный цикл услуг: от разработки дизайна до воплощения в жизнь.\r\nМы рады предложить своим клиентам следующие виды услуг:\r\n—  Цифровая печать. Обычно используется для оперативного издания небольших тиражей практически любой печатной продукции.\r\n— Офсетная печать. Оптимальный вариант для печати больших тиражей любой полиграфии.\r\n— Послепечатная обработка. На данном этапе выполняется сборка изделия и придание ему визуальных эффектов в соответствии с требованиями заказчика либо ранее разработанной концепцией дизайна.\r\n\r\nЦены не фиксированные, так как зависит от дизайна и сложности работ…', '0', 0, 2, 13, 2, 665, 6, NULL, '2017-04-13 12:16:00', '2017-04-18 03:53:21'),
(775, 'Аскар Сулейманов', '<p>Язык ведения: русский</p>', '0', 0, 2, 3, 2, 666, 3, NULL, '2017-04-13 12:16:06', '2017-04-20 04:20:32'),
(776, 'Казына', 'Высокая сложенность в хореографии , качество костюмов, и музыкальных подборок, удивляющие элементы акробатических исполнений возносят ансамбль «Казына» в разряд высококвалифицированных танцоров. Ансамбль «Казына» является лауреатом республиканских и международных конкурсов.', '0', 0, 2, 11, 2, 670, 4, NULL, '2017-04-13 12:17:19', '2017-04-13 12:17:19'),
(777, 'Бахтияр Абильхаир', '<p>Язык ведения: казахский, русский</p>', '0', 0, 2, 4, 2, 668, 3, NULL, '2017-04-13 12:17:42', '2017-04-20 04:22:07'),
(778, 'Nikita Bassov', '', '0', 0, 2, 14, 2, 669, 6, NULL, '2017-04-13 12:17:49', '2017-04-13 12:17:49'),
(779, 'Гаухартас', 'За время своего существования «Гаухартас» создал уникальную программу выступлений, не имеющую аналогов. Мы смогли собрать самые яркие и зрелищные номера, которые превращают любое мероприятие в феерический праздник, который надолго остается в памяти как яркое зрелище, удивительное путешествие в мир танца. Наше шоу проводится на профессиональном уровне и именно благодаря нам, гости не могут отвести восхищенных глаз от завораживающего танца , который показывает почти неограниченную свободу и ловкость человеческого тела. Красивые костюмы, зажигательная хореография, эмоциональная отдача танцовщиц, интерактив со зрителем. Особенностью наших танцев является неповторимость стиля, и этому пример прекрасных и завораживающих танцев «Прекрасных белоснежных лебедей», «Национального танца», «Танец Египетских Цариц» и многое другое! Приходите к нам, мы всегда вам рады!', '0', 0, 2, 11, 2, 671, 4, NULL, '2017-04-13 12:18:50', '2017-04-13 12:18:50'),
(782, 'Айдар Каримбаев', '<p>Веселый, тактичный, преисполненный профессиональной харизмы и неиссякаемого оптимизма. Обладает достаточным багажом положительного телевизионного опыта. Умеет интересно шутить и беседовать с публикой, и что не менее важно отчётливо понимает, где и как употребить свои импровизационные таланты. Айдар располагает удобными для столицы плюсами: качественно двуязычный шоумен это во первых и абсолютно новый а значит и интересный для клиентов свадебный шоумен! Язык ведения: русский, казахский.</p>', '0', 0, 2, 4, 2, 672, 3, NULL, '2017-04-13 12:20:28', '2017-04-20 04:22:24'),
(783, 'Альер', 'Танцевальный коллектив «Альер» — широкий ассортимент танцов по самым доступным ценам!', '0', 0, 2, 11, 2, 675, 4, NULL, '2017-04-13 12:21:11', '2017-04-13 12:21:11'),
(784, 'АЙСАНА', '<p>Танцевальная шоу-группа &laquo;АЙСАНА&raquo; рада будет украсить Вашу свадьбу и торжество своими зажигательными танцами, с участием красавиц танцовщиц, в ярких эксклюзивных нарядах, сшитых Узбекскими мастерами. В репертуаре шоу-группы танцы разных народов мира. Танцы с огнем, змеей, голубями.</p>', '0', 0, 2, 11, 2, 676, 4, NULL, '2017-04-13 12:22:17', '2017-04-19 06:05:14'),
(785, 'Айнур', '<p>Cольное исполнение Танцев: Восток, Хорезм, Индийский, Испанский. Певица, Актриса театра &laquo;Шымкент Шоу&raquo; Постановка Флэш мобов и танца &laquo;Жениха и Невесты&raquo;.</p>', '0', 0, 2, 11, 2, 677, 4, NULL, '2017-04-13 12:23:28', '2017-04-19 06:05:37'),
(786, 'Айдай', 'Какое же мероприятие без ярких костюмов и изящных танцовщиц и танцоров! Танцевальная группа «Айдай» удивит Вас и Ваших гостей национальными, восточными танцами!', '0', 0, 2, 11, 2, 679, 4, NULL, '2017-04-13 12:24:37', '2017-04-13 12:24:37'),
(787, 'Ирина Курц', '<p>Привет! Меня зовут Ирина Курц, я &mdash; свадебный фотограф. В фотографии предпочитаю репортажный стиль съемки, так как, на мой взгляд, фотограф &mdash; это человек, который не &laquo;пишет&raquo;, а &laquo;рассказывает&raquo; историю. Фотография для меня нечто большее, чем работа &mdash; способность увидеть живые эмоции, красоту и уникальность каждого человека. Буду искренне рада, если Вам понравятся мои фотографии, и, конечно же, видеть Вас среди моих клиентов!</p>', '0', 0, 2, 14, 2, 678, 6, NULL, '2017-04-13 12:25:24', '2017-04-20 07:10:25'),
(788, 'Step by step', '<p>Если Вы хотите окунуться в мир фееричных эмоций, небывалого буйства красок костюмов, оригинальных постановок танцев &mdash; все это может продемонстрировать танцевальная Группа Стэп бай стэп. Танцевальное группа Стэп бай стэп украсит Ваше торжество поистине запоминающееся шоу &ndash; программой. В репертуаре коллектива собран уникальный танцевальный материал, поставлен на мелодии разных стран.</p>\r\n<p>Участники группы: 3 девушек, 3 парня</p>\r\n<p>Виды танцев: бальные</p>', '0', 0, 2, 11, 2, 680, 4, NULL, '2017-04-13 12:25:48', '2017-04-19 06:06:17'),
(789, 'Сабо би', '<p>Зажигательное шоу!</p>\r\n<p>Виды танцев: народные, современные</p>\r\n<p>Танцевальная группа из Ташкента.</p>', '0', 0, 2, 11, 2, 682, 4, NULL, '2017-04-13 12:27:07', '2017-04-19 06:06:41'),
(790, 'Жаканов Таир', '<p>Меня зовут Жаканов Таир. Свадебная фотография &mdash; моя стихия. В каждом кадре &mdash; память Вашей истории! Работаю с душой, для людей в любых точках мира.</p>', '0', 0, 2, 14, 2, 681, 6, NULL, '2017-04-13 12:27:15', '2017-04-20 07:29:56'),
(791, 'Акимова Лариса', '<p>Снимаю с 2000г. Работаю с фотокамерами Canon EOS5D Mark2 Mark3, с набором профессиональной оптики Canon серии L. Со мной работает ассистент. Все фотографии проходят пакетную обработку, лучшие цветокоррекцию, коррекцию кожи, художественную обработку. Изготовление фотокниг, музыкальных слайд шоу.&nbsp;</p>', '0', 0, 2, 14, 2, 684, 6, NULL, '2017-04-13 12:28:37', '2017-04-20 07:09:21'),
(792, '7 Континент', 'Танцевальная компания «Седьмой континент» — это сборная, из ведущих танцоров Республики Казахстан, которая сформировала свой собственный стиль, основанный на синтезе бальных, современных и народных танцев.\r\n\r\nСпортивные танцы — это микс грации и силы, легкости и в то же время выносливости, красоты, яркости и изнуряющих тренировок. Наши профессиональные хореографы создают эксклюзивные постановки свадебных танцев, флэшмобов и всевозможных тематических постановок. Танцевальная шоу программа постоянно пополняется свежими номерами и неповторимыми костюмами. Мы надеемся, что наше творчество будет радовать Вас всегда!!!', '0', 0, 2, 11, 2, 683, 4, NULL, '2017-04-13 12:28:53', '2017-04-13 12:28:53'),
(793, 'Monarch photo', 'Мы команда профессиональных фотографов. Любим свою работу. Ценим своих клиентов!', '0', 0, 2, 14, 2, 685, 6, NULL, '2017-04-13 12:30:20', '2017-04-13 12:30:20'),
(794, 'Toibastar', 'Мы будем рады сделать ваш праздник эксклюзивным!', '0', 0, 2, 13, 2, 686, 4, NULL, '2017-04-13 12:30:40', '2017-04-13 12:30:40'),
(795, 'Temirkazyk', 'Подбор пригласительных открыток – первоначальный и самый важный акт Вашего праздника.\r\n\r\nЗаблаговременная рассылка приглашения издавна считается правилом хорошего тона. Пригласительная открытка не только содержит информацию о месте, времени проведения Вашего мероприятия, прежде всего она несет смысловую нагрузку о Вашем социальном статусе, о ваших стилевых предпочтениях и вкусах, о настроении, и какой тон Вы собираетесь задать предстоящему празднику.\r\n\r\nУдачный выбор – залог Вашего успеха. Если выразиться шахматным языком, «белые» начинают и выигрывают!', '0', 0, 2, 13, 2, 688, 4, NULL, '2017-04-13 12:32:00', '2017-04-13 12:32:00'),
(796, 'Julia Senko', 'Привет, меня зовут Юлия и мне нравится создавать фотографии с настроением! Если вам близко мое творчество, нам будет интересно сотрудничать и получить замечательный результат!', '0', 0, 2, 14, 2, 687, 6, NULL, '2017-04-13 12:32:24', '2017-04-13 12:32:24'),
(797, 'Liza Design', '<p>Новый Год, Свадьбы, Дни Рождения, 8 марта, Защита диплома, Рождение ребенка &mdash; в нашей жизни что ни день, то праздник. А какой же праздник без приятных мелочей в виде пригласительных и поздравительных открыток? Эти приятные мелочи наполняют эмоциями нашу повседневную жизнь. Каждое яркое событие мы оформляем в виде подарков, но и подарки надо уметь подать в презентабельном виде. Что мы вам и можем предложить. Ручная дизайнерская работа в виде альбомов или книг. Коробки или дизайнерская упаковка&hellip; Комплименты гостям мероприятия или рассадочные карточки&hellip; и все это ручной работы! Ваши любимые и близкие заслуживают такого внимания!</p>', '0', 0, 2, 13, 2, 689, 4, NULL, '2017-04-13 12:33:32', '2017-04-21 01:56:40'),
(798, 'BV STUDIO', 'Мы занимаемся профессиональной фото и видеосъемкой и с удовольствием разделим с Вами Ваш праздник. Мы сделаем все, чтобы воспоминания о нем остались красивыми. Наша команда посетила множество мастер-классов, включая таких известных видеографов как Вадим Карнель и WEDSTARS.\r\n\r\nОчень надеемся, что наши работы произведут на Вас неизгладимое впечатление и не оставят никого равнодушным!', '0', 0, 2, 14, 2, 690, 6, NULL, '2017-04-13 12:33:55', '2017-04-13 12:33:55'),
(799, 'ATMOSFERA', '', '0', 0, 2, 13, 2, 691, 4, NULL, '2017-04-13 12:35:00', '2017-04-13 12:35:00'),
(800, 'Кирилл Федоров', 'Фотография — это моя страсть. Она дает мне возможность знакомится с новыми людьми, воплощать творческие замыслы и просто познавать мир.\r\nРазговор. Да, да, именно он. Фотография это мое средство общения с Вами и Вашими желаниями, о которых вы, наверное, даже не догадываетесь. Почему я выбрал фотографию для общения? Фотография уникальна, здесь есть и тайна и вымысел. Вы смотрите на себя, на историю о Вас, но только эту историю рассказал Вам я. Всегда же интересно узнать мнение о себе, не правда ли?\r\nЯ люблю легкость общения, улыбки, светлые взгляды — это мои слова в рассказе. Я люблю вручать альбом невестам после свадьбы, смотреть на их эмоции о дне, который пролетел как вспышка. Это многого стоит.\r\n\r\n', '0', 0, 2, 14, 2, 692, 6, NULL, '2017-04-13 12:35:33', '2017-04-13 12:35:33'),
(801, 'Наталья Силантьева', '', '0', 0, 2, 13, 2, 693, 4, NULL, '2017-04-13 12:36:49', '2017-04-13 12:36:49'),
(802, 'Жаркын Шынболатов', 'Я — Жаркын Шынболатов!\r\nЗанимаюсь фотографией с 2013 года.\r\nСпециализируюсь на свадебной фотографии, love story, банкет, фотосессии.\r\nЕсли мне необходимо описать мой подход к работе как фотограф, то я бы описал его, как естественный, весёлый, честный и романтичный.\r\nМоя работа – ловить теплоту Ваших чувств, чтобы пересматривая свадебные фото, Вы впоследствии не просто вспоминали это событие, а заново проживали его.', '0', 0, 2, 14, 2, 694, 6, NULL, '2017-04-13 12:38:13', '2017-04-13 12:38:13'),
(803, 'Карандаш', 'Мы распечатываем, копируем, сканируем, фальцуем, переплетаем, проекты, чертежи (строительные, электрические сети, газопроводы, водопроводы, профиля, ген.планы,  и т. д.), а так же карты, топосъемки, сметы, технические паспорта (без расшивки).\r\n\r\nРаботаем с любыми форматами от А4 до А0+\r\n\r\nПомимо этого, наш дизайнер изготовит для Вас любую полиграфическую  продукцию, в том числе визитки, буклеты, фирменные бланки, каталоги, календари, меню, дисконтные карты, необходимые для достижения Ваших коммерческих и личных целей. Наши возможности в полиграфии очень обширны.\r\n\r\nТак же у нас есть услуга срочного заказа, Вам достаточно  предупредить нас о планируемом срочном заказе, в свою очередь мы приложим все необходимые усилия для выполнения работы  в максимально короткие сроки.', '0', 0, 2, 13, 2, 695, 4, NULL, '2017-04-13 12:38:14', '2017-04-13 12:38:14'),
(804, 'Григорий Борисов', 'Привет друзья, меня зовут Борисов Григорий, я живу в Казахстане город Алматы. Больше всего в жизни я люблю фотографировать счастливых людей и путешествовать!\r\n\r\nМои фотографии именно такие, какими вы хотите их видеть сегодня, через год, через пять, десять лет – они самые честные, теплые и живые. На них влюбленные не принимают неестественных и странных поз, не занимаются непонятными глупостями, не делают непривычных для себя вещей. На них люди счастливы и влюблены, по их лицам растекаются улыбки, а глаза наполняются слезами радости.\r\n\r\nЯ верю, что именно такими должны быть свадебные и семейные фотографии, ими должен быть наполнен альбом,который вы будете рассматривать с вашими детьми!', '0', 0, 2, 14, 2, 696, 6, NULL, '2017-04-13 12:39:54', '2017-04-13 12:39:54'),
(805, 'Альсар', '<p>Салон пригласительных открыток &laquo;Альсар&raquo;. Пригласительные открытки и бонбоньерки на все виды торжеств: Свадьба, Кыз узату, Сундет той, Мерей той и др.</p>', '0', 0, 2, 13, 2, 697, 4, NULL, '2017-04-13 12:39:55', '2017-04-21 01:58:36'),
(806, 'Максим Гарифуллин', 'Фотография сама по себе меня не интересует. Я просто хочу захватить кусочек реальности. Я не хочу ничего доказывать, ничего подчеркивать. Вещи и люди говорят сами за себя. Я не занимаюсь «кухней». Работа в лаборатории или в студии у меня вызывает тошноту. Ненавижу манипулировать — ни во время съемки, ни после, в темной комнате. Хороший глаз всегда заметит такие манипуляции…\r\nЕдинственный момент творчества — это одна двадцать пятая доля секунды, когда щелкает затвор, в камере мелькает свет и движение останавливается.', '0', 0, 2, 14, 2, 698, 4, NULL, '2017-04-13 12:41:57', '2017-04-13 12:41:57'),
(807, 'Колесникова Татьяна', 'Меня зовут Татьяна, я профессиональный фотограф.\r\nОсновные направления моего творчества: семейная, студийная, свадебная и портретная фотография.\r\nФотография — это в первую очередь моя жизнь и мое увлечение, а уж потом работа!\r\nВедь когда твое увлечение совпадает с твоей работой это приносит радость и удовольствие не только мне но и тем для кого ты работаешь. Прежде, чем приступить к фото сессии, я обязательно узнаю Ваши пожелания и отношусь к этому серьезно, я понимаю насколько будут Вам дороги фотографии спустя прожитые годы.\r\nЯ люблю работать с людьми, люблю снимать веселые и счастливые лица, ловить незабываемые и неповторимые моменты Вашей жизни.', '0', 0, 2, 14, 2, 699, 4, NULL, '2017-04-13 12:43:38', '2017-04-13 12:43:38'),
(808, 'Клёшев Михаил', '<p>Профессиональный фотограф в Шымкенте Клёшев Михаил.</p>\r\n<p>&bull; Все виды фотосъемки</p>\r\n<p>&bull; Профессиональная техника Nikon</p>\r\n<p>&bull; Предоставление официальных документов для организаций</p>\r\n<p>Свадьба, События, Портфолио, Студия, Love Story, Семья, Дети, Прогулка, Репортаж, Реклама, Предметная съемка, Съемка архитектуры и интерьеров.</p>', '0', 0, 2, 14, 2, 700, 4, NULL, '2017-04-13 12:45:12', '2017-04-21 01:59:33'),
(809, 'Илья Яшкин', '', '0', 0, 2, 14, 2, 701, 4, NULL, '2017-04-13 12:47:08', '2017-04-13 12:47:08'),
(810, 'Иззат Ташов', 'Меня зовут Иззат, я профессиональный свадебный и студийный фотограф.\r\nЯ сторонник классической «незафотошопленной» фотографии, мне нравится снимать жизнь, я уверен, что вы способны быть достаточно яркими и если захотите, удивить всех вокруг, так что нам не потребуется приукрашивать действительность. Все фотографии конечно же обрабатываются, но так, что обработка не бросается в глаза. Если вам нравится мое портфолио, можете быть уверены, что весь материал со съёмки будет выглядеть также хорошо.\r\nОбрабатываю ВСЕ фотографии со съемки, то есть Вы получаете на руки ВЕСЬ материал в обработанном виде. Для свадебных фотосессий с полного дня это около 1000 обработанных и отобранных фотографий.', '0', 0, 2, 14, 2, 702, 4, NULL, '2017-04-13 12:48:53', '2017-04-13 12:48:53'),
(811, 'Indigo Rental', 'Компания «Indigo Rental» предлагает услуги по техническому обеспечению мероприятий любого формата и масштаба. Обладая большим наличием собственного оборудования, мы предлагаем в аренду:\r\n\r\n— Led экраны Dicolor P4\r\n\r\n— Акустические системы KV2 Audio\r\n\r\n— Световое оборудование Pr Lighting\r\n\r\n— Сценические конструкции, фермы', '0', 0, 2, 17, 2, 703, 6, NULL, '2017-04-13 12:51:33', '2017-04-13 12:57:17'),
(813, 'SMART RENTAL Company', 'Компания Smart Rental специализируется на аренде профессионального оборудования мировых производителей.\r\nSmart Rental предлагает световое, звуковое и сценическое оборудование на прокат, а также полное сервисное обслуживание, включающее в себя первичную консультацию и предложение наиболее приемлемой по цене и качеству техники для каждого конкретного случая, а также доставку, подключение и настройку.\r\nОсновные критерии работы нашей компании – надежность, качество, гибкость и оперативность. Компания Smart Rental работает 24 часа в сутки, 7 дней в неделю, решая любые поставленные задачи своих клиентов.', '0', 0, 2, 17, 2, 705, 6, NULL, '2017-04-13 12:55:02', '2017-04-13 12:56:25'),
(814, 'Family Art', '<p>Компания &laquo;Family Art&raquo; находится на мировом флористическом рынке с 2000 года. Мы специализируемся на оформлении и организации мероприятий любого уровня и масштаба. Украшение банкетных залов, офисов, домов и квартир. Эскизная разработка дизайна к мероприятию, дизайн и изготовление фото зон, пригласительных, списков гостей, аренда свадебной атрибутики. Изготовление декораций любой сложности. Оформление сладкого стола Candy bar, аренда посуды. Творческая мастерская HAND MADE, букеты и бутоньерки из декоративных цветов; украшения для невест: серьги, диадемы, короны, ободки, украшения ручной работы, подушки для колец.</p>', '0', 0, 2, 15, 2, 706, 6, NULL, '2017-04-13 12:59:10', '2017-04-20 07:06:26'),
(815, 'Beze group', 'Мы гордимся созданием роскошных свадеб, дизайн которых не устареет и не потеряет актуальности и спустя десятки лет, так как стиль каждой свадьбы создается исходя из каждой пары и их истории любви. Профессиональный подход в создании дизайнов любого важного события, безусловная любовь к своему делу и требовательность к себе — три кита, на которых стоит студия свадебного и ивент дизайна Beze и благодаря которым наш стиль легко проглядывается в нашей работе. Мы не копируем чужие работы, мы не копируем свои работы, нашим вдохновением являетесь Вы – наши клиенты и Ваши истории любви и жизни, благодаря Вам каждый наш проект уникален.\r\n\r\nНаша компания предлагает Вам следующие услуги: организация, проведение и оформление свадеб, кыз-узату, свадьба за границей, выездных регистраций, юбилеев и дней рождений, корпоративов и тимбилдингов, детских праздников, частных событий, таких как романтическое свидание, романтический ужин для двоих в прекрасном месте, оригинальное  предложение руки и сердца, 14 февраля, встреча из роддома, розыгрыш друзей или любимого директора, девичник, мальчишник.', '0', 0, 2, 15, 2, 707, 6, NULL, '2017-04-13 13:00:42', '2017-04-13 13:00:42'),
(816, 'Көрпе Art', '<p>Разнообразие форм и расцветок, зарождающаяся в мастерской колоритные орнаменты. Изделия Авторского Дома Дизайна \"Көрпе Art\" выполнено в исконно-казахских традициях с нотками современности. В ассортименте корпе, декоративные подушки, сумки, покрывала и постельное белье, занавески и скатерти, все для &laquo;Қыз жасауы&raquo; и &laquo;Бесік жасауы&raquo;.</p>', '0', 0, 2, 18, 2, 708, 6, NULL, '2017-04-13 13:02:15', '2017-05-06 05:03:56'),
(817, 'Perfecto', '<p>Наша студия декора &laquo;Perfecto&raquo; занимается оформлением частных и корпоративных мероприятий: праздников, торжеств и свадеб. В декоре свадеб используются исключительно дизайнерские ткани, эксклюзивная посуда, шикарная флористика, необычные конструкции и инсталляции. Это позволяет создавать не просто красивый декор, а настоящие произведения искусства. Студия не копирует свои и тем более чужие работы, даже в случае, когда тематика свадьбы повторяется, мы всегда можем предложить ее новую интерпретацию, которой еще не было ни у кого. На сегодняшний день основная цель нашей работы является привлечение клиентов с целью показать и воплотить в реальность новые направления в оформлении торжества. Декораторы студии имеют в арсенале массу идей, отличных от существующих на рынке услуг декора мероприятий.</p>', '0', 0, 2, 15, 2, 709, 6, NULL, '2017-04-13 13:03:58', '2017-04-20 07:03:59'),
(818, 'Томирис', 'МЕЧТАЕТЕ О ВОЛШЕБНОЙ СВАДЬБЕ?\r\nПровести весело детский праздник, либо другое торжество?\r\nНеважно скромное торжество или свадьба на всю страну, Tomirys Wedding Decoration осуществит ваши мечты!\r\nНе думайте о том, как мы это сделаем и какова цена. Мы внимательно выслушаем вас и поймем, какую свадьбу вы видите, а затем предложим лучшие варианты.\r\nНаша любимая работа – офорление свадьбы во всех мелочах, ведь именно вы источник вдохновения для нас!', '0', 0, 2, 15, 2, 710, 6, NULL, '2017-04-13 13:06:08', '2017-04-13 13:06:08'),
(819, 'ASPAN MEDIA GROUP', '<p>Оформление мероприятий в Алматы без вашей &laquo;головной боли&raquo; по самым современным технологиям декора!</p>\r\n<p>2 хороших выгоды для Вас:</p>\r\n<p>1. Значительная экономия на оформление до 18%. Прямые контракты с поставщиками цветов и фурнитуры позволяют снижать стоимость оформления в среднем на 15 %-18%, а также множество уже готовых декораций.</p>\r\n<p>2. Не тратите свое драгоценное время на поиски&hellip;&hellip;.действительно достойного и ответственного исполнителя.</p>\r\n<p>Вы уже пришли по адресу &mdash; просто ДОВЕРЬТЕСЬ НАМ!</p>', '0', 0, 2, 15, 2, 711, 6, NULL, '2017-04-13 13:09:09', '2017-04-20 07:02:51'),
(820, 'Vivify decor studio', 'На сегодняшний день проведение разного рода мероприятий требует дополнительного оформления, ведь каждый хочет, чтоб этот праздник был особенным, неповторимым и запоминающимся. С помощью правильного подбора тканей, цветовой гаммы, профессиональной подачи идей эскизов, так же подборки стиля или тематики предаст эмоциональную окраску предстоящему событию.', '0', 0, 2, 15, 2, 712, 6, NULL, '2017-04-13 13:11:05', '2017-04-13 13:11:05'),
(821, 'TerraFiori искусственные цветы', 'TerraFiori предлагает революционное решение в сфере интерьерной флористики – абсолютную имитацию цветов и растений. Продукция TerraFiori отличается высокой степенью ботанического сходства с живыми цветами и растениями, при этом более экономична и практична в применении. Цветы и растения TerraFiori изготовлены из силикона, они долговечны, устойчивы ко внешним воздействиям и удобны в уходе, транспортировке и хранении.', '0', 0, 2, 15, 2, 713, 6, NULL, '2017-04-13 13:12:56', '2017-04-13 13:12:56'),
(822, 'Real touch Almaty искусственные цветы', '<p>Real Touch это искусственные цветы, изготовленные из полимеров (латекс, силикон и т.п.), ткани и пластика, максимально приближенные к реальным как внешним видом, так и ощущениями при прикосновении к ним. Цветы Real Touch &mdash; цветы, которые по своим внешним свойствам не уступают живым цветам!</p>', '0', 0, 2, 15, 2, 714, 6, NULL, '2017-04-13 13:14:36', '2017-04-20 06:59:13'),
(823, 'Real Touch', '<p>Цветы Real Touch - цветы, которые по своим внешним свойствам не уступают живым цветам.</p>\r\n<p>Настоящее открытие в сфере декора.</p>\r\n<p>- Ноу-хау №1 в Европе для оформления свадеб</p>\r\n<p>- Возможность аренды (краткосрочной и долгосрочной) цветов и/или композиций из цветов</p>\r\n<p>- Для дома, офиса и витрин магазинов</p>\r\n<p>- Великолепный декор для фотосессий (даже в самых суровых условиях)</p>\r\n<p>- Отличный подарок</p>\r\n<p>- Не требуют ухода, никогда не завянут</p>\r\n<p>- Оптовые поставки</p>', '0', 0, 2, 15, 2, 715, 6, NULL, '2017-04-13 13:16:13', '2017-04-20 07:34:40'),
(824, 'One day design', '<p>Творческая команда &laquo;ONE DAY design&raquo;, имеющая многолетний опыт в сфере декор-индустрии, превратит Ваше торжество в самое яркое и запоминающееся событие! Мы не только профессионально украшаем, декорируем и продумываем все до мелочей, но и по-настоящему создаем эмоции для всех гостей о мероприятие, чтобы Ваш особенный день оставил в памяти каждого &ndash; миллион самых чудесных воспоминаний! Индивидуально подходим к каждому торжеству и прорабатываем все до мелочей. Прислушиваясь ко всем пожеланиям, даже самых требовательным клиентам. Именно за этим к нам возвращаются!</p>', '0', 0, 2, 15, 2, 716, 6, NULL, '2017-04-13 13:18:40', '2017-04-20 06:24:27'),
(825, 'JN', 'Особенных событий в жизни бывает много — и сделать, так что бы они запомнились наша задача. Именно декор, все эти мелочи вроде цветовых сочетаний и гармонии тарелочек со свечками и создают ту неповторимую атмосферу настоящего праздника, без которой сложно себе представить торжество. Креативность и настоящее творчество вот те принципы, которыми мы руководствуемся. Мы создаем уникальный и авторский декор. Уникальный, вашей личной историей!', '0', 0, 2, 15, 2, 717, 6, NULL, '2017-04-13 13:20:10', '2017-04-13 13:20:10'),
(826, 'Hellawes', 'Наши флористы предложат Вам авторские букеты из необычных экзотических цветов и зелени, креативные ароматные коробки с цветами сочных оттенков, воздушные шары, наполненные гелием и много других интересностей.\r\nКоманда профессиональных декораторов поможет выбрать Вам индивидуальное оформление свадебного дня, создадут эскиз исходя из Ваших пожеланий, соединив их с модными тенденциями.\r\n\r\n', '0', 0, 2, 15, 2, 718, 6, NULL, '2017-04-13 13:22:26', '2017-04-13 13:22:26'),
(827, 'Florservis', 'Сюрреалистичный декор в оформлении — концептуальное решение от самой природы!\r\nЭксклюзивно – индивидуальный дизайн вашего мероприятия!\r\nМы создаем изысканный декор исключительно для Вас!', '0', 0, 2, 15, 2, 719, 6, NULL, '2017-04-13 13:24:22', '2017-04-13 13:24:22'),
(828, 'DY art', 'Оформление торжеств цветами шарами тканью, более 11 лет на рынке, более 1000 торжеств с нашим декором. Множество идей, большой опыт, доступные цены, всегда свежие цветы.', '0', 0, 2, 15, 2, 720, 6, NULL, '2017-04-13 13:25:49', '2017-04-13 13:25:49'),
(829, 'Crocus studio', 'Crocus-studio — это молодая, но динамично развивающаяся компания. На рынке мы не так давно, но уже добились признания наших клиентов.\r\nМы занимаемся, создаем стильные оформления любой сложности, опираясь на модные тенденции в современном декоре. Мы любим свою работу, это наша жизнь и поэтому мы всегда стараемся сделать все на 110%, чтобы Вы остались не просто довольны, а стали нашим постоянным клиентом.\r\nУ нас работают только квалифицированные специалисты, участники международных конкурсов, которые всегда помогут Вам в выборе! Мы постоянно растем и развиваемся! Учимся только у лучших декораторов, таких как Legi Artis, Александры Мехедовой, Lacy Bird.', '0', 0, 2, 15, 2, 721, 6, NULL, '2017-04-13 13:27:49', '2017-04-13 13:27:49'),
(830, 'Ajour decor', 'Студия стильного оформления «Ажур Декор» предлагает Вам полный комплекс услуг по оформлению праздничных мероприятий и свадеб в городе Алматы. Мы специализируемся на подборе всех компонентов декора: оформление тканью, оформление живыми цветами, организация торжественных выездных регистраций — все для Вашего уникального события! Яркое, элегантное, стильное и главное, оформленное с любовью — именно таким мы хотим видеть Ваше торжественное мероприятие! Наш индивидуальный подход и широкая палитра идей сделают Ваше торжество незабываемым!', '0', 0, 2, 15, 2, 722, 6, NULL, '2017-04-13 13:29:37', '2017-04-13 13:29:37');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(831, 'КарамеЛь', 'ТОРТ — прекрасное дополнение к любому торжеству: эксклюзивный, традиционный, классический на каждый день —  превосходное украшение стола. Кондитерский цех «КарамеЛь» представляет большой ассортимент тортов и пирожных —  более 40 наименований. Традиционные, такие как «Королевский», «Грильяжный», «Медовый»; легкие на взбитых сливках, йогуртовые, творожные, тирамису;  торты с добавлением кусочков различных фруктов  и многое другое.\r\nНам всего 12 лет. Мы молоды, и в этом наше достоинство. Наши мастера, делая торт на заказ, или выпуская праздничный торт или предлагая продукцию на каждый день, шагают в ногу со временем, но и не расстаются с уже полюбившимися традициями. Мы можем сделать любой торт от 1-го до 10-ти ярусов. Вы можете заказать у нас от 1-го кг. до 100 кг. Соответственно мы можем обслужить любые слои населения, поэтому можем изготовить заказ от недорогого до эксклюзивного!\r\nЛюбое оформление по желанию клиента, в том числе и эксклюзивное — живыми цветами. Наши пирожные, каравай, любая выпечка, кондитерские изделия так же украсят Ваш праздничный стол.\r\nМы не перестаем работать над новинками. Вся работа компании направлена на удовлетворение всех пожеланий наших клиентов.\r\nКаждый Ваш праздник — это и наш праздник, к которому мы подходим со всей заботой и ответственностью. Мы ценим каждого нашего клиента, каждый из Вас для нас уникален. А потому исполним любой ваш индивидуальный заказ тортов на все праздники.\r\nМы всегда сможем предложить Вам услуги, соответствующие Вашим запросам и финансовым возможностям.\r\nОсновные преимущества нашей компании:\r\nШирокий ассортимент кондитерских изделий\r\nУдобная схема оплаты\r\nНизкие цены\r\nИндивидуальный подход к каждому клиенту.\r\nНаша цель — не останавливаться на достигнутом результате, своевременно отслеживать новые тенденции в направлении нашей деятельности для полного удовлетворения потребностей наших клиентов.', '0', 0, 2, 16, 2, 723, 6, NULL, '2017-04-13 13:31:24', '2017-04-13 13:31:24'),
(832, 'La Tartine', 'В нескольких словах …\r\nLa Tartine — это уютная и гостеприимная пекарня, в которой можно подкрепиться в течение всего дня. Мы Вам предлагаем традиционные французские продукты высокого качества, сочетающие в себе изысканный вкус и питательные свойства, которые можно испробовать на месте или взять с собой.\r\n\r\nФранцузская пекарня La Tartine это Ваш уголок Франции в Казахстане. Здесь Вы всегда найдете свежую ароматную выпечку на любой вкус, хрустящие багеты, настоящие французские круасаны на сливочном масле, воздушные десерты, аппетитные сэндвичи, горячие пинини и многое многое другое.\r\n«Eда является и должна всегда оставаться удовольствием! Приятного аппетита!»\r\nНаша концепция\r\nЕжедневно в La Tartine Вам представлен большой выбор французских фирменных выпечек. В течение года мы также вводим несколько новинок в свой ассортимент для того, чтобы приспособиться к ожиданиям клиентов. Мы рады предложить Вам более 70 разнообразных рецептов, гарантирующих неповторимый вкус. Наш хлеб и выпечка изготавливаются с утра до вечера прямо на месте, что дает этот неподражаемый запах масла и шоколада во всей пекарне\r\n\r\n… Bon Appétit!', '0', 0, 2, 16, 2, 724, 6, NULL, '2017-04-13 13:32:55', '2017-04-13 13:32:55'),
(833, 'Зияд Курбантаев', 'Я свадебный фотограф. Съемка свадеб — мое любимое и основное направление в фотографии, но также я провожу фотосессии в студии, на пленере и в других местах. С особым удовольствием я фотографирую детей и их счастливых родителей.\r\nВ фотографии я стремлюсь ловить живые эмоции, передавать настоящие чувства, избегать застывших, неудобных поз, запечатлевать каждую историю, как отдельную сказку, каждого человека — таким, какой он есть, не принуждая ни к чему, а напротив — как бы подсматривая издали.', '0', 0, 2, 14, 2, 725, 4, NULL, '2017-04-14 02:31:41', '2017-04-14 02:31:41'),
(834, 'Гюльаназ Алиева', 'Для меня фотография — это любимое дело! Я люблю передавать эмоции чувства, учитываю все пожелания невесты/жениха, люблю дарить радость и получать удовольствие от проделанной работы.', '0', 0, 2, 14, 2, 726, 4, NULL, '2017-04-14 02:34:19', '2017-04-14 02:34:19'),
(835, 'Богдан Руденко', '', '0', 0, 2, 14, 2, 727, 4, NULL, '2017-04-14 02:36:41', '2017-04-14 02:36:41'),
(836, 'Артем Орлянский', '', '0', 0, 2, 14, 2, 728, 4, NULL, '2017-04-14 02:39:12', '2017-04-14 02:39:12'),
(837, 'Абай Татубаев', '<p>Свадебный фотограф г. Астана, Алматы, Шымкент! Love story, Семейные и детские фотографии. Снимаю по всему Казахстану и за его пределами.</p>', '0', 0, 2, 14, 2, 729, 4, NULL, '2017-04-14 02:42:09', '2017-04-21 02:00:50'),
(838, 'Махмуд Мирзаев', '<p>Свадебный фотограф! Love story, семейные и детские фотографии, снимаю по всему Казахстану и за его пределами.</p>', '0', 0, 2, 14, 2, 730, 4, NULL, '2017-04-14 02:44:27', '2017-04-21 02:01:07'),
(839, 'Орынбасар Жунисбеков', 'Меня зовут Орынбасар, я профессиональный свадебный фотограф и видеограф специализируюсь на свадебной фотографии. Помимо свадебной фотосессии, моя фотостудия предоставляет комплексные услуги по художественной обработке готовых фотографий, изготовлению свадебных фотокниг и фотоальбомов. Я выполняю от съёмки Love Story, предсвадебной фотосессии и свадебных обрядов, в том числе и венчания, до съёмки свадебной церемонии, свадебной прогулки и самого торжества.', '0', 0, 2, 14, 2, 731, 4, NULL, '2017-04-14 02:46:57', '2017-04-14 02:46:57'),
(840, 'Сергей Ким', 'С огромным удовольствием напишу историю вашей семьи. Ваш семейный архив украсят снимки, которые будут храниться в Вашем доме долгие годы.', '0', 0, 2, 14, 2, 732, 4, NULL, '2017-04-14 02:49:10', '2017-04-14 02:49:10'),
(841, 'Сергей', 'Предлагаю услуги фотографа. Снимаю свадьбы, торжественные мероприятия, портфолио, студийная съемка, модельная съемка, делаю предметную фотографию для меню и интернет магазинов и т.д. А также делаю 3D рекламу для баров, кафе, ресторанов и тех мест которые нуждаются в режиме виртуального посещения не выходя из дому, новый тренд интернет рекламы.', '0', 0, 2, 14, 2, 733, 4, NULL, '2017-04-14 02:50:24', '2017-04-14 02:50:24'),
(842, 'Станислав Прайм', 'Всем привет, меня зовут Станислав Прайм. Хочу вам рассказать коротко о себе и своей работе.\r\nЛюбовь к фотографии появилась еще когда учился в школе. Снимал всё что видел, по началу это было просто хобби, сейчас это перешло во что то большее. Можно сказать так: работа которая приносит удовольствие.\r\n\r\nБольше всего люблю не постоновочные репортажные снимки с эмоциями и открытыми чувствами людей. Если мы с человеком на одной волне то фотосесси проходят очень открыто, весело и непринужденно.\r\n\r\nВ основном специализируюсь на свадебных фотографиях, но так же, люблю снимать интересные фотосеты и лав стори.\r\n\r\nБуду рад быть Вашим фотографом, и оставлю Вам на память, яркие и теплые фотографии которые вам будет приятно пересматривать снова и снова.', '0', 0, 2, 14, 2, 734, 4, NULL, '2017-04-14 02:53:28', '2017-04-14 02:53:28'),
(843, 'Султан Ахметов', 'Цель нашей работы — подарить Вам красивые, яркие и качественные фотографии; такие снимки, которые будут радовать Вас при каждом просмотре. Смысл моей деятельности в том, чтобы сохранить Ваши эмоции на долгую память.', '0', 0, 2, 14, 2, 735, 4, NULL, '2017-04-14 02:56:01', '2017-04-14 02:56:01'),
(844, 'Фотостудия Сергея Ермишкина', 'Фотографии всегда хранят память о светлых днях нашей жизни, важно увидеть какие моменты нужно запечатлеть, чтобы передать атмосферу и настроение события. Фотограф дает людям возможность сберечь важные воспоминания, передать эмоции в ярком, живом снимке. Фотосессия — это не только новые фотографии, но и заряд отличного настроения, шанс увидеть себя с нового ракурса и возможно, открыть в себе фотомодель. Будьте готовы раскрыться и довериться мне! Показав характер, настроение и взгляд…', '0', 0, 2, 14, 2, 736, 4, NULL, '2017-04-14 02:58:03', '2017-04-14 02:58:03'),
(845, 'AS-studio', 'AS-studio — это студия фотографии и дизайна. К вашим услугам полный спектр фото и прочих услуг: модельное портфолио, свадебная фотосъемка, разработка и изготовление фотокниг, виньеток и коллажей, написание сценариев и съемка love story. Лучшие фотографы обеспечат профессиональную фотосъемку любой сложности.\r\nAS-studio – это креативный подход, современные технологические средства и аппаратура самого передового качества.', '0', 0, 2, 14, 2, 737, 4, NULL, '2017-04-14 02:59:44', '2017-04-14 02:59:44'),
(846, 'Murat Decor', 'Мы занимаемся свадебным декором и флористикой уже более 2 лет. Помимо свадеб, мы оформляем Дни Рождения, корпоративные мероприятия и другие праздники.\r\nС помощью декора мы стараемся выразить вашу индивидуальность и неповторимость.\r\nВ MURAT DECOR трудятся очень талантливые флористы, дизайнеры и художники, которые по-настоящему влюблены в людей и свою работу. Эта увлеченность любимым делом и позволяет нам полностью отдаваться процессу подготовки к вашей свадьбе, чтобы вы остались довольны не только результатом, но и процессом общения с нами)))', '0', 0, 2, 15, 2, 738, 4, NULL, '2017-04-14 03:01:17', '2017-04-14 03:01:17'),
(847, 'ЮГ Декор', 'Роскошное свадебное оформление Вашей свадьбы «под ключ» от студии «Юг Декор»!\r\nСвадебное торжество – одно из самых главных событий в жизни любого человека! Несомненно, что день свадьбы останется в памяти на всю жизнь. Мы хотим, чтобы спустя много лет вы с удовольствием вспомнили этот день и вновь пережили все те эмоции, которые были связаны с ним. Поэтому доверьте ОФОРМЛЕНИЕ вашего праздника профессионалам! Безупречное свадебное оформление, создание атмосферы уюта, праздника и волшебства – наша работа.', '0', 0, 2, 15, 2, 739, 4, NULL, '2017-04-14 03:02:46', '2017-04-14 03:02:46'),
(848, 'Элита флора ', '<p>Элита флора &mdash; лучший салон цветов в городе! Именно этим профессионалам доверяют оформление торжественных залов приема при визите официальных делегаций, а если вас потрясло шикарное и безупречное оформление свадьбы или иного торжества, можете быть уверены &mdash; Элита флора приложила сюда свои умелые руки.</p>', '0', 0, 2, 15, 2, 740, 4, NULL, '2017-04-14 03:04:46', '2017-05-15 00:12:16'),
(849, 'Счастье', 'Безудержная фантазия и креативное мышление!\r\nСотни придуманных и воплощенных композиций, огромное количество роскошных декораций и благодарных клиентов.\r\nВысокий уровень сервиса.\r\nОптимальное соотношение цены и качества\r\nВсе наши клиенты — это большой круг друзей,имеющих привилегии и скидки! Присоединяйтесь!', '0', 0, 2, 15, 2, 741, 4, NULL, '2017-04-14 03:06:37', '2017-04-14 03:06:37'),
(850, 'Shalimar', 'Арт-студия Shalimar помогает покорять сердца, радовать и удивлять любимых и близких, дарить им красоту и радость. Наши профессиональные флористы оформляют как лаконичные букеты  и цветочные корзины, так и осуществляют тематическое флористическое  оформление различных  свадеб ,  корпоративных и PR мероприятий, выставочных стендов, включая оформление пресс-стен из живых цветов.', '0', 0, 2, 15, 2, 742, 4, NULL, '2017-04-14 03:08:06', '2017-04-14 03:08:06'),
(851, 'Orange', 'Студия флористики и декора «Оранж» в Шымкенте на протяжении 12 лет занимается декором мероприятий разного плана. Мы искренне любим то, что делаем и вкладываем частичку себя в каждую нашу работу, постоянно совершенствуя опыт и знания, и с искренностью можем заявить, что наш труд и постоянное движение вперёд непременно поможет вашим мечтам стать реальностью! Студия флористики и декора «Оранж» – там, где сбываются мечты!', '0', 0, 2, 15, 2, 743, 4, NULL, '2017-04-14 03:09:27', '2017-04-14 03:09:27'),
(852, 'LIKAT', '«Likat» — резные свечи ручной работы!\r\nКомпания «Likat» производит резные свечи высокого, европейского качества из экологически чистого сырья с применением ручной росписи, разнообразных методов и приемов декорирования.', '0', 0, 2, 15, 2, 744, 4, NULL, '2017-04-14 03:11:02', '2017-04-14 03:11:02'),
(853, 'LA ROSE', '<p>Дизайн студия LA ROSE. Широкий ассортимент живых цветов по самым доступным ценам! Украшение пресс стены любого дизайна и формата.</p>', '0', 0, 2, 15, 2, 745, 4, NULL, '2017-04-14 03:12:32', '2017-04-21 02:07:15'),
(854, 'Karamel', 'Оформление различных мероприятий, свадеб, дни рождений, девичников.\r\nСтудия счастливых событий!', '0', 0, 2, 15, 2, 746, 4, NULL, '2017-04-14 03:13:58', '2017-04-14 03:13:58'),
(855, 'Erjankizi Botagoz', '<p>Кез-келген мейрамыңызды: үйлену той, бесік той,тұсау кесер, құдалық, сүндет той, туылған күн, корпоративті кештер, концерттер, презентацияларды жоғарғы деңгейде өткізу.</p>\r\n<p>&mdash; Жемісті Карвинг;</p>\r\n<p>&mdash; Ерекше жемістібезендіру;</p>\r\n<p>&mdash; Жемісті микс фуршет үстелдері;</p>\r\n<p>&mdash; CАNDY BAR;</p>\r\n<p>&mdash; Баннерлер ерекше дизайнда!</p>', '0', 0, 2, 15, 2, 747, 4, NULL, '2017-04-14 03:17:46', '2017-04-21 02:07:54'),
(856, 'Decoflora', 'Красиво декорировать открытки, альбомы или блокноты можно при помощи элементов из полимерной глины: листья, бабочки, цветы и др. А самое главное, что такие элементы будут уникальными, неповторимыми и только для тебя одной!', '0', 0, 2, 15, 2, 748, 4, NULL, '2017-04-14 03:19:32', '2017-04-14 03:19:32'),
(857, 'АКВАРЕЛЬКА', '<p>Стильное оформление праздников! Выездная регистрация! Оформление свадеб и тематических вечеринок! Свадебные аксессуары и сувениры ручной работы!</p>', '0', 0, 2, 15, 2, 749, 4, NULL, '2017-04-14 03:20:57', '2017-04-21 02:08:30'),
(859, 'MUSTAFIN PRODUCTION FILM', '<p>Команда предоставляет новую услугу &laquo;wedding live&raquo;, что в переводе свадьба в прямом эфире. Благодаря новым технологиям появилась возможность транслировать online многокамерную видео съемку на большей LED экран в зале ресторана и на удаленный компьютер вашего дома. Теперь появилась возможность, если по каким то причинам ваши родственники не смогли приехать на той, они могут видеть ее в прямом эфире у себя дома и также установить обратную связь для поздравления. готовое видео получаете по завершению мероприятия.</p>', '0', 0, 2, 5, 2, 751, 3, NULL, '2017-04-14 04:05:58', '2017-04-20 04:22:33'),
(860, 'Диас Жуманов', '', '0', 0, 2, 5, 2, 752, 3, NULL, '2017-04-14 04:07:28', '2017-04-14 04:07:28'),
(861, 'Азамат Булатов', '<p>Я люблю работать с людьми, люблю снимать веселые и счастливые лица, ловить незабываемые и неповторимые моменты Вашей жизни.</p>', '0', 0, 2, 5, 2, 754, 3, NULL, '2017-04-14 04:08:33', '2017-04-20 04:22:44'),
(862, 'Бахытжан Бейсембаев', '<p>Основатель студии \"Bigmedia\". Студия открылась в 2013 году. Участвовали в различных проектах и конкурсах. Снимаем свадебные ролики, имиджевые и рекламные ролики, проморолики.</p>', '0', 0, 2, 5, 2, 755, 3, NULL, '2017-04-14 04:11:01', '2017-04-20 04:23:09'),
(863, 'NEW TONE', 'Яркие,  ребята с особым дерзким стилем и качовым звучанием разожгут огонь Вашего праздника! Своим талантом и харизмой они добились широкой известности среди публики не только в Усть-Каменогорске, но и по всему Восточному Казахстану, и это не предел! Live Band NEW TONE ― это проверенный состав профессионалов Усть-Каменогорск - Москва - Алматы, которые умеют работать с залом и подстраиваться под музыкальные предпочтения своих слушателей. Все участники имеют музыкальное образование и шикарный опыт работы на различных мероприятиях. Это группа, которая может исполнить для Вас и Ваших гостей любимые песни на самом высшем уровне. И на ЛЮБОМ языке! В репертуаре коллектива композиции на английском, русском, казахском, испанском, итальянском, французском, болгарском языках.\r\nLive Band NEW TONE ― это то, что Вам нужно, чтобы Ваше мероприятие было поистине незабываемым.', '0', 0, 2, 1, 2, 753, 4, NULL, '2017-04-14 04:12:06', '2017-04-14 04:12:06'),
(864, 'Студия «JJ»', '<p>Мы предоставляем вам фото и видео услуги. Наша команда в этой индустрии более 3-х лет. Несмотря на это мы уже снимали клипы различных жанров; запечатлели самые яркие моменты, душевные, нежные, гармоничные чувства; создавали живые, естественные образы. &laquo;JJ&raquo; studio подарит вам теплую, непринуждённую атмосферу, море позитивных эмоций и сделает вашу волшебную историю незабываемой. Будем рады поучаствовать в создании вашей сказки.</p>', '0', 0, 2, 5, 2, 756, 3, NULL, '2017-04-14 04:14:12', '2017-04-20 04:23:20'),
(865, 'Даулет Аманов', '<p>Свадьба &ndash; слишком короткий миг, чтоб успеть насладиться им! Я помогу Вам продлить ваше торжество, и, пересматривая фильм, вы будете заново проживать самый счастливый день Вашей жизни! Услуги: свадебная съемка, love story, а также производство рекламного видео.</p>', '0', 0, 2, 5, 2, 758, 3, NULL, '2017-04-14 04:16:01', '2017-04-20 04:23:35'),
(866, 'Кавер группа DIANA', '<p>Кавер группа DIANA &mdash; это живая музыка, которая не оставит вас равнодушными!&nbsp; Хиты, проверенные временем, а так же популярная музыка современных стилей и направлений, не дадут вам скучать.&nbsp;С нами танцуют все поколения!</p>', '0', 0, 2, 1, 2, 757, 4, NULL, '2017-04-14 04:16:31', '2017-04-27 06:46:31'),
(867, 'Аэросъемка', '<p>АЭРОСЪЁМКА &mdash; съёмка с высоты птичьего полёта только украсит любое видео.</p>\r\n<p>Аэросъемка торжеств (свадьбы, церемония выездной регистрации, дни рождения, юбилеи);</p>\r\n<p>Аэросъемка рекламных и имиджевых видеороликов;</p>\r\n<p>Аэросъемка массовых мероприятий;</p>\r\n<p>Аэросъемка строительных объектов (труднодоступные участки, этапы строительства, ландшафт местности).</p>', '0', 0, 2, 5, 2, 759, 3, NULL, '2017-04-14 04:17:20', '2017-04-20 04:23:58'),
(868, 'Студия «Аstana_Photo_Video»', '<p>Студия &laquo;Аstana Photo Video&raquo; &mdash; это команда профессиональных видеографов, фотографов, режиссеров и сценаристов. На рынке фото-видеопроизводства с 2008 года. Постоянное совершенство на различных мастер классах и тренингах помогают нам создавать фильмы в Европейском стиле. Перечень услуг Студии &laquo;Аstana_Photo_Video&raquo;: свадебный фильм, love story, презентационные клипы, рекламные ролики.</p>', '0', 0, 2, 5, 2, 761, 3, NULL, '2017-04-14 04:18:43', '2017-04-20 04:24:05'),
(869, '4К PRODUCTION', '<p>&laquo;4К PRODUCTION&raquo; &mdash; компания, занимающая на сегодняшний день одну из лидирующих позиций в сфере профессиональной видеосъемки в Астане. Мы предоставляем услуги видеосъемки мероприятий (корпоративы, торжества, детские праздники, конференции, концерты), а также услуги видеомаркетинга (видеореклама для бизнеса, продвижение рекламы в интернете).</p>', '0', 0, 2, 5, 2, 762, 3, NULL, '2017-04-14 04:20:33', '2017-04-20 04:24:59'),
(870, 'Группа \"Manhattan\"', 'Живая музыка на Свадьбы, Дни Рождения и другие Праздничные Мероприятия.\r\n\r\nВ репертуаре группы как уже ставшие классическими, так и современные песни популярных исполнителей на русском, английском и казахском языках.', '0', 0, 2, 1, 2, 760, 4, NULL, '2017-04-14 04:20:48', '2017-04-14 04:20:48'),
(872, 'Студия «Astana Senator»', '<p>Студия &laquo;Astana Senator&raquo; &mdash; это команда опытных операторов и фотографов. Наша студия существует на рынке более 10 лет. За это время мы участвовали в различных телевизионных проектах, таких, как ұлттык шоу, қазақ қызы, моя страна. Студия &laquo;Astana Senator&raquo; снимет для Вас: свадебный фильм, lovestory, babystory, обучающие ролики, рекламные ролики. Студия &laquo;Astana Senator&raquo; сохраняет самые счастливые моменты в вашей жизни!</p>', '0', 0, 2, 5, 2, 765, 3, NULL, '2017-04-14 04:24:28', '2017-04-20 04:25:08'),
(873, 'Сергей Пономаренко', 'Привет! Меня зовут Сергей Пономаренко. Много лет назад судьба\r\n\r\nдала мне шанс, и я стал обладателем интереснейшей профессии – фотограф.\r\n\r\nКрасивые качественные фотографии напомнят вам о бесценных моментах,\r\n\r\nкоторые никогда больше не смогут повториться, будь то ваш день рождения,\r\n\r\nсвадьба или первые шаги вашего малыша.\r\n\r\nФотографии — это вся наша жизнь. Они несут в себе море радости и\r\n\r\nприятных воспоминаний, связанных с прошлым. Глядя на них, мы переносим\r\n\r\nсебя в те моменты, когда мы были счастливы, грустны или просто\r\n\r\nвспоминаем дорогих нам людей.\r\n\r\nЯ буду рад применить все свое мастерство, работая с вами командой\r\n\r\nпо разные стороны объектива. Вместе мы создадим кадры, которые позволят\r\n\r\nпереживать моменты счастья и радости такое количество раз, как часто вы\r\n\r\nбудете перелистывать свой, семейный фотоальбом.', '0', 0, 2, 14, 2, 764, 4, NULL, '2017-04-14 04:26:03', '2017-04-14 04:26:03'),
(874, 'Korkem Studio', '<p>Фото-видеостудия &laquo;KorkemStudio&raquo; работает в столице Казахстана уже более 5 лет и уже зарекомендовала себя как наиболее профессиональная в своей сфере. Работа операторов и монтажеров &laquo;KorkemStudio&raquo; отличается индивидуальным подходом к заказу. Они не работают по накатанному сценарию от свадьбы к свадьбе, от юбилея к юбилею.</p>\r\n<p>&laquo;KorkemStudio&raquo;предлагает следующие услуги:</p>\r\n<p>1.Фото и видеосъемка торжеств, свадеб, love story, юбилеев, дней рождения, семейных праздников и корпоративных вечеринок;</p>\r\n<p>2.Создание слайд-шоу и короткометражных фильмов для показа перед торжеством;</p>\r\n<p>3. Съемка рекламных роликов, документальных фильмов о людях, предприятиях и событиях;</p>\r\n<p>4.Многокамерная съемка до 5 камер;</p>\r\n<p>5.Компьютерный монтаж съёмок;</p>', '0', 0, 2, 5, 2, 766, 3, NULL, '2017-04-14 04:26:40', '2017-04-20 04:25:44'),
(875, 'BAKS STUDIO', '<p>Студия &laquo;BAKS STUDIO&raquo; &mdash; это новый современный взгляд на жизнь через объектив. За 10 лет работы, мы зарекомендовали себя как профессионалы своего дела, работая над такими проектами как Сәлем Қазақстан, Астана жұлдызы, Қазақ Аруы, концерт гр.Улытау в г.Берлин, концерт гр.Улытау и звездного дуета Қыдырали &ndash; Қарақат в г.Москва, День города Астаны и многие частные меропритии по всему Казахстану.</p>\r\n<p>Поэтому мы с уверенностью смотрим на реализацию любых проектов и мероприятий любого уровня и рады предложить вам наш спектр услуг :</p>\r\n<p>&mdash; портретная фотосъёмка (art, fashion, glamour)</p>\r\n<p>&mdash; детская и семейная фотосъемка</p>\r\n<p>&mdash; love-story &mdash; свадьба (видео и фото)</p>\r\n<p>&mdash; мероприятия &mdash; реклама (модели, предметы)</p>\r\n<p>&mdash; обнаженная натура (ню-арт, М/Ж)</p>\r\n<p>&mdash; съемка и изготовление виньеток.</p>\r\n<p>Обратившись к нам, вы можете быть уверены, что мы с удовольствием превратим ваше торжество в шедевр индустрии фото и видео искусства!</p>', '0', 0, 2, 5, 2, 767, 3, NULL, '2017-04-14 04:28:13', '2017-04-20 04:27:38'),
(876, 'Владимир Колесников', '', '0', 0, 2, 14, 2, 768, 4, NULL, '2017-04-14 04:29:26', '2017-04-14 04:29:26'),
(877, 'Zayats photography', '<p>Обработка всех удачных кадров, стаж работы более 7 лет! В нашей команде работают профессионалы которые знают свое дело и выполняют свою работу на высшем уровне. Быстрые сроки, заключение договора с каждым клиентом, видеосъемка до 9 камер одновременно что улучшает качество и масштабность видеосъемки. Индивидуальное оформление, готовый материал предоставляется в индивидуально оформленный коробочках ручной работы! В штате 3 фотографа, 6 операторов.</p>', '0', 0, 2, 5, 2, 769, 3, NULL, '2017-04-14 04:30:36', '2017-04-20 04:28:10'),
(878, 'Виктор Седых', 'Профессиональная видеосъемка. фотосъемка. Стаж работы 18 лет. Съемка на профессиональную видеокамеру или профессиональный фотоаппарат DSLR. Видео-в формате высокой четкости FullHD. Свадьбы, юбилеи, утренники, выпускные, выписки из роддома, любые события и торжества. Съемка свадебных и семейных фильмов. Фильмы о Вас, Вашем ребенке в детском саду, в школе. Слайд-шоу из ваших фотографий. Оцифровка ваших съемок со старых кассет на ДВД диски. На заказ заранее (более чем за 3 месяца)-поощрительный приятный бонус - хорошая ценовая скидка. Выслушаю все пожелания, предложу свои идеи. Молодожены, всегда помогу советом на съемках свадебного дня.', '0', 0, 2, 14, 2, 770, 4, NULL, '2017-04-14 04:32:46', '2017-04-14 04:32:46'),
(879, 'Арман Букаев', '<p>Профессиональная многокамерная видеосъемка свадеб,конференций,различных мероприятий. Аэросъемка квадрокоптером. Операторский кран. Услуги профессионального фотографа. Используемое оборудование Canon 6D, Canon 5D mark3, Nikon 600D.</p>', '0', 0, 2, 5, 2, 772, 3, NULL, '2017-04-14 04:35:55', '2017-04-20 04:28:21'),
(880, 'Танцевальная шоу-группа «Ардис»', '<p>Танцевальная шоу-группа &laquo;Ардис&raquo; рада украсить Ваше торжество своими зажигательными танцами в ярких эксклюзивных костюмах. Выступления на: свадьбах, юбилеях, новогодних корпоративах, выпускных вечерах и других торжествах. В репертуаре коллектива имеется широкий ассортимент танцевальных номеров: Казахский танец, Русский танец, Мексиканский танец, Гавайский танец, Испанский танец &laquo;Фламенко&raquo;, Венецианский карнавал, Бразильский карнавал, Кубинская сальса, Оранжевый свинг, Диско 80х, Шоу &laquo;Трансформация&raquo;, Вывод невесты.</p>', '0', 0, 2, 11, 2, 771, 4, NULL, '2017-04-14 04:40:21', '2017-04-21 02:11:39'),
(881, 'Айткенов Сакен', '<p>Желаете качественных, красивых и атмосферных снимков в день Вашей свадьбы? С радостью помогу вам и найду подход к любой паре.</p>', '0', 0, 2, 14, 2, 774, 3, NULL, '2017-04-14 04:45:45', '2017-04-20 04:28:29'),
(882, 'Руслан Мустафин', '', '0', 0, 2, 14, 2, 775, 3, NULL, '2017-04-14 04:48:05', '2017-04-14 04:48:05'),
(883, 'Кужумов Дамир', '<p>Профессиональный свадебный фотограф. Кроме свадеб, с большой радостью снимает LoveStory и детей. Главная цель, которую преследует в своей работе &mdash; это максимально точно передать всю гамму эмоций, которую вы испытываете, будь это веселая свадьба или романтичная вечерняя прогулка. Обязательным является индивидуальный подход к каждому клиенту! Не ставит свою работу на поток. Как говорится &laquo;лучше меньше, да лучше&raquo;.</p>', '0', 0, 2, 14, 2, 776, 3, NULL, '2017-04-14 04:49:40', '2017-04-20 04:28:41'),
(884, 'Даулет Сейдагалиев', '<p>Профессиональный фотограф в Астане, дизайнер редакции &laquo;National Geographic&raquo;, предлагает свои фото услуги всем жителям нашей столицы. Большой опыт фотографа, а также постоянная работа над новыми творческими проектами гарантируют высокое качество съемки. С радостью сделает фото и видеозапись самых важных событий: свадьбы и венчания, крещения и выписки из роддома, юбилеев и детских дней рождении.</p>', '0', 0, 2, 14, 2, 777, 3, NULL, '2017-04-14 04:50:48', '2017-04-20 04:28:46'),
(885, 'Максат Капсалямов', '', '0', 0, 2, 14, 2, 778, 3, NULL, '2017-04-14 04:57:26', '2017-04-14 04:57:26'),
(886, 'Мади Жетибаев', '<p>Свадебный фотограф премиум класса. Съемка свадеб в Европейском стиле. Индивидуальный подход к каждому клиенту. Перечень услуг : love story(с выездом), съемка свадеб, прогулочные фотосессии, рекламные фотосессии.</p>', '0', 0, 2, 14, 2, 779, 3, NULL, '2017-04-14 04:59:36', '2017-04-20 04:31:07'),
(887, 'Казбек', '', '0', 0, 2, 14, 2, 780, 3, NULL, '2017-04-14 05:00:52', '2017-04-14 05:00:52'),
(888, 'Диас Жуманов', '', '0', 0, 2, 14, 2, 781, 3, NULL, '2017-04-14 05:02:21', '2017-04-14 05:02:21'),
(890, 'Никита Жарков', '<p>Хотелось бы познакомить Вас с фотографом Никитой Жарковым и его творчеством, так как, возможно, Вы доверите ему стать фотографом Вашей истории. Да, любую съемку он называет именно историей, потому что только история остается в памяти у человека на долгие времена и передается от предков к потомкам. Фотография всецело вошла в его жизнь и сопровождает его с 2011 года. Он очень любит путешествовать, поэтому снимает не только в Казахстане, но и за рубежом.</p>', '0', 0, 2, 14, 2, 783, 3, NULL, '2017-04-15 00:07:04', '2017-04-20 04:31:27'),
(891, 'Маулен Мукатаев', '', '0', 0, 2, 14, 2, 784, 3, NULL, '2017-04-15 00:09:24', '2017-04-15 00:09:24'),
(893, 'Кайсанов Адлет', '<p>Прежде, чем приступить к фотосессии, я обязательно узнаю Ваши пожелания и отношусь к этому серьезно, я понимаю насколько будут Вам дороги фотографии спустя прожитые годы.</p>', '0', 0, 2, 14, 2, 785, 3, NULL, '2017-04-15 00:27:42', '2017-04-20 04:31:54'),
(894, 'Азамат Булатов', '<p>Я люблю работать с людьми, люблю снимать веселые и счастливые лица, ловить незабываемые и неповторимые моменты Вашей жизни.</p>', '0', 0, 2, 14, 2, 754, 3, NULL, '2017-04-15 00:31:58', '2017-04-20 04:22:54'),
(895, 'Нарбек Раис', '<p>Если для Вас фотография не пустой звук и не просто необходимая часть свадебного процесса, звоните мне как можно быстрее, иначе может оказаться так, что интересующая Вас дата окажется уже занята.</p>', '0', 0, 2, 14, 2, 786, 3, NULL, '2017-04-15 00:35:09', '2017-04-20 04:32:00'),
(896, 'Максим Жусупов', '<p>Пакет Light &mdash; съемка сборов, прогулки (художественные фото), сбор гостей перед банкетом, предварительная консультация, съемка до 7 часов (не менее 300 фотографий), цветокоррекция, авторская обработка, запись фотографий на электронный носитель.</p>\r\n<p>Пакет Standart &mdash; съемка полного свадебного дня, предварительная консультация, съемка сборов, прогулки (художественные фото), банкет (не менее 800 фотографий), цветокоррекция, авторская обработка, запись фотографий на электронный носитель, фотокнига 20х20 10 разворотов с обложкой из кожи или велюра,шелковой бумагой.</p>\r\n<p>Пакет Premium &mdash; съемка полного свадебного дня ФОТО и ВИДЕО (командой из 3 человек), предварительная консультация, съемка видео сборов и прогулочной части 1 камера с системой стабилизации изображения Ronin, съемка банкета видео 2 камеры, съемка фото сборов, прогулки (художественные фото), банкет (не менее 800 фотографий), цветокоррекция, авторская обработка, демонстрация ролика в конце банкета о проведенном торжестве, запись фотографий и видео на электронный носитель, фотокнига 25х25 10 разворотов с обложкой из кожи или велюра, шелковой бумагой.</p>', '0', 0, 2, 14, 2, 787, 3, NULL, '2017-04-15 00:37:19', '2017-04-20 04:32:27'),
(897, 'Студия «JJ»', '<p>Мы предоставляем вам фото и видео услуги. Наша команда в этой индустрии более 3-х лет. Несмотря на это мы уже снимали клипы различных жанров; запечатлели самые яркие моменты, душевные, нежные, гармоничные чувства; создавали живые, естественные образы. &laquo;JJ&raquo; studio подарит вам теплую, непринуждённую атмосферу, море позитивных эмоций и сделает вашу волшебную историю незабываемой. Будем рады поучаствовать в создании вашей сказки.</p>', '0', 0, 2, 14, 2, 756, 3, NULL, '2017-04-15 00:42:57', '2017-04-20 04:23:25'),
(898, 'Ануар Сагынтаев', '<p>Я люблю работать с людьми, люблю снимать веселые и счастливые лица, ловить незабываемые и неповторимые моменты Вашей жизни.</p>', '0', 0, 2, 14, 2, 788, 3, NULL, '2017-04-15 00:44:53', '2017-04-20 04:32:32'),
(899, 'Студия «Astana Senator»', '<p>Студия &laquo;Astana Senator&raquo; &mdash; это команда опытных операторов и фотографов. Наша студия существует на рынке более 10 лет. За это время мы участвовали в различных телевизионных проектах, таких, как ұлттык шоу, қазақ қызы, моя страна. Студия &laquo;Astana Senator&raquo; снимет для Вас: свадебный фильм, lovestory, babystory, обучающие ролики, рекламные ролики. Студия &laquo;Astana Senator&raquo; сохраняет самые счастливые моменты в вашей жизни!</p>', '0', 0, 2, 14, 2, 765, 3, NULL, '2017-04-15 00:48:03', '2017-04-20 04:25:17'),
(900, 'Korkem Studio', '<p>Фото-видеостудия &laquo;KorkemStudio&raquo; работает в столице Казахстана уже более 5 лет и уже зарекомендовала себя как наиболее профессиональная в своей сфере. За плечами команды &laquo;Коркем&raquo; мероприятия различного уровня, вплоть до концертов городского и республиканского масштаба. Каждое мероприятие ребята прорабатывают отдельно, учитывая пожелания заказчика, стилистику и все особенности предстоящего мероприятия.</p>\r\n<p>&laquo;Korkem Studio&raquo; предлагает следующие услуги:</p>\r\n<p>1.Фото и видеосъемка торжеств, свадеб, love story, юбилеев, дней рождения, семейных праздников и корпоративных вечеринок;</p>\r\n<p>2. Создание 3D анимационного меню;</p>\r\n<p>3. Выездная и студийная фотосъемка с использованием профессионального света;</p>\r\n<p>4. Компьютерная пост обработка фото, ретуширование, составление фотоколлажей;</p>\r\n<p>5. Реставрация старых фотографий;</p>', '0', 0, 2, 14, 2, 766, 3, NULL, '2017-04-15 00:51:51', '2017-04-20 04:26:17'),
(901, 'Бижигит Каиржанов', '<p>Фотографирую более 5 ти лет, провожу съемки по всему Казахстану и за рубежом. Работу свою люблю, и фотографирую с любовью.</p>', '0', 0, 2, 14, 2, 789, 3, NULL, '2017-04-15 00:54:35', '2017-04-20 04:33:15'),
(902, 'Искаков Адильбек', '<p>Профессиональный свадебный и семейный фотограф, работаю в Казахстане, буду рад запечатлить ваши самые яркие моменты жизни на долгую память! Делаю свою работу с душой , люблю ловить моменты и позитивные эмоции. Свадебная и семейная съемка со вкусом! Модель и марка фотоаппарата: Canon EOS 6D, объективы: canon 24-105mm f4, canon 85mm f1.8, canon 17-40mm f4.</p>', '0', 0, 2, 14, 2, 790, 3, NULL, '2017-04-15 00:59:24', '2017-04-20 04:33:27'),
(903, 'BAKS STUDIO', '<p>Студия &laquo;BAKS STUDIO&raquo; &mdash; это новый современный взгляд на жизнь через объектив, ведь в нашей команде работают молодые, креативные и самые талантливые мастера своего дела, которые со всем энтузиазмом подходят к своей работе, и помогают Вам не только запечатлеть прекрасные моменты, но и сделать их незабываемыми и эксклюзивными.</p>\r\n<p>Наш спектр услуг :</p>\r\n<p>&mdash; портретная фотосъёмка (art, fashion, glamour)</p>\r\n<p>&mdash; детская и семейная фотосъемка</p>\r\n<p>&mdash; love-story</p>\r\n<p>&mdash; свадьба (видео и фото)</p>\r\n<p>&mdash; мероприятия</p>\r\n<p>&mdash; реклама (модели, предметы)</p>\r\n<p>&mdash; обнаженная натура (ню-арт, М/Ж)</p>\r\n<p>&mdash; съемка и изготовление виньеток.</p>', '0', 0, 2, 14, 2, 767, 3, NULL, '2017-04-15 01:03:05', '2017-04-20 04:28:03'),
(904, 'Тимур Баймурзин', '<p>Репертуар разный более 50 песен; Предпочитаю солидные и серьезные банкеты; Золотой саксофон от Самрук-Казына, лауреат разных конкурсов.</p>', '0', 0, 2, 6, 2, 791, 3, NULL, '2017-04-15 01:21:04', '2017-04-20 04:33:39'),
(905, 'Евгений Ботников', '<p>Евгений по праву считается одним из первопроходцев на ниве столичного шоу бизнеса. Обширный и разнообразный репертуар позволяет Евгению гармонично вписаться в мероприятие практически любого формата. Имеется своя звукоусиливающая аппаратура ( от 100W до 800W ).</p>', '0', 0, 2, 6, 2, 792, 3, NULL, '2017-04-15 01:23:04', '2017-04-20 04:33:45'),
(906, 'Саксофонист Максим', '<p>Все давно уже оценили звучание саксофона. Оно не может не нравиться &ndash; грустные мелодии с легкостью сменяются заводными, зовущими танцевать. Сейчас саксофон набирает все большую популярность. Красивый и струящийся альт-саксофон, безукоризненное качество исполнения подарят вам незабываемые минуты Макс &ndash; один из самых интересных саксофонистов северной столицы. Его репертуар всем придется по душе &mdash; он исполняет всемирно известные шедевры &mdash; от казахских народных песен до зажигательных латиноамериканских композиций. Его игрой можно насладиться на семейных торжествах, свадьбах, юбилеях, корпоративах, романтических вечерах.</p>', '0', 0, 2, 6, 2, 793, 3, NULL, '2017-04-15 01:25:51', '2017-04-20 04:33:54'),
(907, 'Дуэт Асу', '<p>Дуэт Асу это новый уникальный проект который не имеет аналогов в Казахстане. Дуэт состоит из двух профессиональных музыкантов:</p>\r\n<p>Сенбай Аманжол молодой композитор, певец и музыкант, исполняющий на гавайской гитаре (укулеле)</p>\r\n<p>Саттаров Абай лауреат международных конкурсов, исполняет от классики до современной музыки.</p>\r\n<p>Дуэт Асу сделает ваш праздник максимально красочным и неповторимым.</p>', '0', 0, 2, 6, 2, 794, 3, NULL, '2017-04-15 01:29:24', '2017-04-20 04:34:28'),
(908, 'Аскар Султан', '<p>Домбрист &mdash; виртуоз. Жанры : от креатива до классики. Танцевальная программа. Исполнение традиционных жанров. украсим ваш праздник традиционным колоритом, бархатными звуками домбры.</p>', '0', 0, 2, 6, 2, 795, 3, NULL, '2017-04-15 01:30:43', '2017-04-20 04:34:35'),
(909, 'Алмат Сайжан', '<p>Виртуозный мастер инструментального искусства. Любовь к музыке Алмату привили ещё в раннем возрасте, с каждым новым инструментом в Алмате пробуждались всё новые чувства, которыми он проникался с истиной страстью. На сегодня этот уникальный мульти-инструментальный проект в лице Алмата Сайжан получил высокую оценку и рекомендации от арт-студии Жанны Аубакировой. Несомненно, Алмат Сайжан украсит Ваш сценарий ярким выступлением. Инструменты: Сыбызгы и Кобыз</p>', '0', 0, 2, 6, 2, 796, 3, NULL, '2017-04-15 01:32:27', '2017-04-20 04:34:45'),
(910, 'Этнос', '<p>Новая инструментальная группа в Астане &laquo;ETHNOS&raquo; украсит ваше мероприятие на высшем уровне. Профессиональная и современная игра на народных инструментах Домбра и Кобыз удивит самого привредливого заказщика!!!</p>', '0', 0, 2, 6, 2, 797, 3, NULL, '2017-04-15 01:33:51', '2017-04-20 04:35:00'),
(911, 'Шарижан Кезбай', '<p>Скрипачка (Sheree King)-Шарижан Кезбай. Привыкла только шокировать своими выступлениями. Лаурет международных конкурсов.</p>\r\n<p>2008 год &mdash; Надежды ,Таланты ,Мастера &mdash; 1 Место</p>\r\n<p>2011 год &mdash; Астана Мерей &mdash; 2 Место</p>\r\n<p>2013 год-Конкурс имени Ахмета Жубанова</p>\r\n<p>Яркость костимов Шарижан не оставит вас равнодушными. Играю восточную,армянскую,казахскую музыку.Имею свое шоу со скрипкой. Играю на свадьбах,в ресторанах,на различных корпаративах а так же на большой сцене.</p>', '0', 0, 2, 6, 2, 798, 3, NULL, '2017-04-15 01:35:03', '2017-04-20 05:04:35'),
(912, 'Алдаспан', '<p>Уникальнейшая, не имеющая аналогов в мире этно рок группа, играющая на единственных в мире электро домбрах, созданных продюсером, участником группы, идеологом и лидером группы Нуржаном Тойшы. Группа играет в разных стилях рока, создает сейчас над новым направлением в музыке (heavy metal club music). Идея инструментов пришла к Нуржану еще в далеком 1988 году, но реализовать ее получилось только в 2011 году. Группа в полном составе собралась в апреле 2011 года, записали первый студийный альбом в Москве на студии Мосфильм в сотрудничестве с Владимиром Овчинниковым, звукоинженером группы Мумий Троль и Земфиры. На трех языках-английский, русский, казахский.</p>', '0', 0, 2, 6, 2, 799, 3, NULL, '2017-04-15 01:37:43', '2017-04-20 05:05:32'),
(913, 'Дуэт Лаула', '<p>Красивый инструментальный проект Лаула. Выступление в традиционном жанре так же и в эстрадном жанре. Лауреаты многих конкурсов. Группа ЛауЛа украсит ваше мероприятие.</p>', '0', 0, 2, 6, 2, 800, 3, NULL, '2017-04-15 03:17:06', '2017-04-20 05:05:45'),
(914, 'Дуэт баянистов БИС', '<p>Дуэт &laquo;БиС&raquo; &mdash; это совместный проект двух профессионалов своего дела. <br />Дуэт &laquo;БиС&raquo; &mdash; это любимые песни и мелодии на новый лад в современной, качественной обработке на концертных инструментах по приемлимым ценам .<br />Дуэт &laquo;БиС&raquo; &mdash; это баянисты на мероприятия любых масштабов. <br />Дуэт &laquo;БиС&raquo; &mdash; это лауреаты республиканских международных конкурсов (Испания, Российская Федерация). <br />Дуэт &laquo;БиС&raquo; наполнит позитивом любой праздник в Вашем доме.</p>', '0', 0, 2, 6, 2, 801, 3, NULL, '2017-04-15 03:43:51', '2017-04-18 23:06:54'),
(915, 'Арт домбра бенд', '<p>ТРИО &laquo;АРТ ДОМБЫРА&raquo; Инструментальное трио, предлагающее новинку в исполнении и подходе, безупречно играя на национальных инструментах, значительно расширяют диапазон и общее представление об оригинальности инструментального звучания. Коллектив выступает, играя на многих национальных инструментах. Домбыра, шанкобыз, арабская дарбука, пианика и горловое пение.</p>', '0', 0, 2, 6, 2, 802, 3, NULL, '2017-04-15 03:46:06', '2017-04-20 05:06:07'),
(916, 'Дуэт Барыс', '<p>Группа &laquo;Барыс&raquo;- одни из первых в столице, кто исполняет беташар в эстрадном стиле. Так же беташар живьем. Так же зажигательные номера в исполнении этих ребят, не оставят вас равнодушными. Белая, светящая, лазерная домбыра с логотипом &laquo;барыс&raquo; дополнит ваш праздник яркими красками и сделает его еще интереснее.</p>', '0', 0, 2, 6, 2, 803, 3, NULL, '2017-04-15 03:47:24', '2017-04-20 05:06:34'),
(917, 'Дуэт Жан', '<p>&laquo;Дуэт из домбры и саксофона&raquo; &mdash; когда слышишь подобное, сложно представить, чего ожидать. В истории еще не было примеров сочетания столь далеких друг от друга инструментов. Домбра &ndash; исконно тюркское изобретение, прототип ее был изображен на наскальном рисунке более четырех тысяч лет назад. Саксофон &ndash; исконно европейское изобретение, изготовленное бельгийцем Адольфом Саксом в 1842 году. Казахский колорит плюс европейский лоск&ndash; такой выбор сделали Нуржан и Бауыржан, создавая свой дуэт, и нужно сказать, что выбор был столь же удивителен, сколь и великолепен. Дуэту &laquo;Жан&raquo; шесть лет, пять из которых они провели в Караганде. Изначально, Нуржан и Бауыржан выступали сольно, а решение о совмещении домбры и саксофона в одно, они приняли спонтанно, встретившись в гримерке одного ресторана. В итоге, они начали удивлять. Название &mdash; &laquo;Жан&raquo; &mdash; они придумали сразу, как узнали имена друг друга</p>', '0', 0, 2, 6, 2, 804, 3, NULL, '2017-04-15 03:48:38', '2017-04-20 05:06:47'),
(918, 'Фольклорный ансамбль «Сырлы саз»', '<p>Фольклорный инструментальный ансамбль &laquo;Сырлы саз&raquo; уже более года дарит своим зрителям профессиональный звук, качественную музыку. В репертуаре ансамбля помимо казахской национальной музыки, вы сможете услышать классические и зарубежные произведения. В течении 2015-16 гг. ансамбль посетил такие города как: Анкара, Стамбул, Вена, Белград, Марибор, также с успехом прошли выступления в 6 эмиратах Дубая.</p>', '0', 0, 2, 6, 2, 805, 3, NULL, '2017-04-15 03:50:10', '2017-04-20 05:06:59'),
(919, 'Темирлан Олжабай', '<p>Лауреат республиканских и международных конкурсов. Широкий репертуар: начиная от кюйев до современных зарубежных произведений.</p>', '0', 0, 2, 6, 2, 806, 3, NULL, '2017-04-15 03:52:28', '2017-04-20 05:07:37'),
(920, 'Syrnay mix', '<p>Этот проект очень не обычный своим MIXовым составом инструментов и участников. Взрывная, позитивная красотка Аяжан и добрый, улыбчивый Жаркын. Ребята лауреаты различных республиканских и международных конкурсов, профессионалы своего дела. Очень большой ассортимент репертуара. Французский шансон, американский джаз, старое доброе ретро, хиты 80 &mdash; 90, мировые хиты, мелодии из кинофильмов. Постоянно совершенствуясь и развиваясь ребята стремятся сделать так, чтобы благодаря звукам аккордеона и баяна слушатели могли получить удовольствие, радость и вдохновение.</p>', '0', 0, 2, 6, 2, 807, 3, NULL, '2017-04-15 03:53:53', '2017-04-20 05:07:47'),
(921, 'Ансамбль «Серпер»', '<p>Ансамбль домбристов &laquo;Серпер&raquo; проект сохранивший традицию исполнения казахских кюйев, и в то же время ребята преподносят все мастерски виртуозно. &laquo;Серпер&raquo; часто выступает на больших мероприятиях и президентских концертах. Репертуар &laquo;Серпер&raquo; богат разнохарактерными кюями, демонстрирующие красивый тембр домбры и виртуозное исполнения ребят. Сам В. Спиваков наградил на международном фестивале &laquo;Москва встречает друзей&raquo; дипломом &laquo;Виртуозы Астаны&raquo;. Каждый из членов ансамбля лауреаты республиканских и международных конкурсов.</p>', '0', 0, 2, 6, 2, 808, 3, NULL, '2017-04-15 03:56:22', '2017-04-20 05:08:09'),
(922, 'Илья Цибульский', '<p>Илья Цибульский &mdash; это необычный саксофонист, который играет на саксофоне без пальцев. Илья не только играет, но и поет свои авторские песни, музыку и слова, к которым он пишет сам. Илья может приукрасить как и казахское мероприятие с казахскими композициями, так и русские банкеты свадьбы и.т.д</p>', '0', 0, 2, 6, 2, 809, 3, NULL, '2017-04-15 03:59:32', '2017-04-20 05:08:50'),
(923, 'Арт Домбыра', '<p>Группа &laquo;Арт домбыра&raquo; весьма интересный проект звучания домбры в современных обработках традиционных и эстрадных композиции. Группа создана 3 года назад, и успели полюбиться слушателям своей новизной и харизмой этих молодых парней. В составе инструментов домбыра, гитара, ударные инструменты, пианино и синтезатор, в будущем хотят увеличить круг инструментов с традиционным колоритом.</p>', '0', 0, 2, 6, 2, 810, 3, NULL, '2017-04-15 04:02:02', '2017-04-20 05:08:57'),
(924, 'Kalipa.Sax', '<p>Чарующие нежные звуки саксофона украсят ваш праздник.</p>', '0', 0, 2, 6, 2, 811, 3, NULL, '2017-04-15 04:04:16', '2017-04-20 05:09:04'),
(925, 'Тұмар тобы', '<p>Вокально &mdash; инструментальное трио. Исполнение традиционных казахских песен в современной обработке, с сопровождением домбры!</p>', '0', 0, 2, 6, 2, 812, 3, NULL, '2017-04-15 04:06:09', '2017-04-20 05:09:13'),
(926, 'Струнный квартет «Prima Vista»', '', '0', 0, 2, 6, 2, 813, 3, NULL, '2017-04-15 04:07:18', '2017-04-15 04:07:18'),
(927, 'Струнный квартет \"Nomad\"', '<p>Струнный квартет &laquo;Nomad&raquo;- это незаменимый атрибут престижного мероприятия. Различные решения музыкального оформления выездной свадебной регистрации брака, предсвадебных аперитивов, банкетов, юбилеев и т.д. Музыкальные инструменты классического струнного квартета, а именно: 2 скрипки, альт и виолончель, не требуют специального оборудования и прекрасно звучат как в помещении, так и на улице. Репертуар коллектива разнообразен и включает в себя как произведения классического жанра, так и популярную музыку из кинофильмов, эстраду, легкий джаз. Классическая музыка уже давно стала символом утонченности и хорошего вкуса. Вам нужен амбициозный, молодой, классический струнный квартет, состоящий из профессионалов? &mdash; Без сомнения квартет &laquo;Nomad&raquo; абсолютно идеально подходит под все Ваши требования!</p>', '0', 0, 2, 6, 2, 814, 3, NULL, '2017-04-15 04:10:06', '2017-04-20 05:10:16'),
(928, 'De La Corde', '<p>Инструментальный скрипичный проект De La Corde. Теплов Илья лауреат международных конкурсов. Качественный неповторимый звук, форма подачи. Владеет скрипкой и электроскрипкой в разных музыкальных жанрах.( house,pop , rock, jazz, dubstep, импровизация) исполняет каверы современных хитовых песен в интересных обработках, классика. Также имею большой опыт выступлений разных форматов ( концерты, шоу программа, яркое сольное выступление, тематические мероприятия, танцевальный блок, клуб, романтические поздравления, встреча гостей, фоновая музыка).</p>', '0', 0, 2, 6, 2, 815, 3, NULL, '2017-04-15 04:11:14', '2017-04-20 05:10:26'),
(929, 'Сандыбек Абуов', '', '0', 0, 2, 6, 2, 816, 3, NULL, '2017-04-15 04:12:19', '2017-04-15 04:12:19'),
(930, 'Наталья Бейсенова', '<p>Бейсенова Наталья &mdash; заслуженный деятель РК, лауреат республиканских и международных конкурсов, мультиинструменталист (кларнет, саксофон-альт, сопрано, клавиши). Репертуар насчитывает более 100 композиций различных жанров и эпох (классика, джаз, поп, этно).</p>', '0', 0, 2, 6, 2, 817, 3, NULL, '2017-04-15 04:13:53', '2017-04-20 05:10:40'),
(931, 'Art Fiesta Astana', '<p>Струнный квартет Art Fiesta Astana это профессионалы своего дела, программа состоит из классики и так же обработками современной музыки, костюмы под тематику вашего мероприятия. Подарят вашему мероприятию нотку аристократизма и хорошего настроения! Ведь живая музыка всегда приносит удовольствие!</p>', '0', 0, 2, 6, 2, 818, 3, NULL, '2017-04-15 04:15:42', '2017-04-20 05:11:01'),
(932, 'Саксофонист Игорь Нартов', '', '0', 0, 2, 6, 2, 819, 3, NULL, '2017-04-15 04:17:05', '2017-04-15 04:17:05'),
(933, 'Саксофонист Жумагали', '', '0', 0, 2, 6, 2, 820, 3, NULL, '2017-04-15 04:18:43', '2017-04-15 04:18:43'),
(934, 'Саксофонист Тимур Баймурзин', '<p>Золотой саксофон от Самрук-Казына, лауреат разных конкурсов.</p>', '0', 0, 2, 6, 2, 821, 3, NULL, '2017-04-15 04:20:17', '2017-04-20 05:11:47'),
(935, 'Саксофонист Бахтияр', '', '0', 0, 2, 6, 2, 822, 3, NULL, '2017-04-15 04:21:50', '2017-04-15 04:21:50'),
(936, 'Шоу-балет «Алем Шанырак»', 'Шоу-балет «Алем Шанырак»  основан в 2009 году на базе ВКГУ им.С. Аманжолова. Свою популярность обрел с 2014 года после появления в репертуаре неоновых танцев, что до сих пор является фишкой коллектива. За это время мы принимали участие в различных проектах, сотрудничали с известными компаниями, а так же работали со звездами эстрады. \r\nРаботаем на различных мероприятиях, выступления на свадьбах, корпоративах, вечеринках, официальных приёмах, организуем флэш-мобы, занимаемся постановкой свадебных, корпоративных танцев.\r\nВ шоу-балете на данный момент танцует 8 танцоров, 4 из них из основного и 4 из младшего составов.\r\nВ арсенале шоу-балета более 15 ярких постановок, которые не оставят Вас равнодушными. Есть программа со светодиодными костюмами, которая зажигает не только свет в темноте, но и души очевидцев; \"Стиляжная\" программа в стиле рок-н-ролл с нереальной динамикой и полетами над танц-полом; и много постановок в различных танцевальных направлениях джаз, бродвей, чарльстон, вальс, танго, латина, гавайские, украинские, выходы невесты на любой вкус и стиль и любые танцевальные направления на ваш вкус, индивидуально под ваше событие. При этом программа постоянно обновляется и мы с радостью будем удивлять Вас новыми, незабываемыми танцевальными сюрпризами.\r\n', '0', 0, 2, 11, 2, 773, 4, NULL, '2017-04-16 11:14:28', '2017-04-16 11:14:28');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(937, 'EVENTHALL', 'Название «EVENTHALL» можно перевести как «Зал событий», и он действительно стал одним из самых популярных мест для проведения самых различных торжеств: свадеб, юбилеев, корпоративов, концертов, нестандартных фуршетов и приемов, конференций, фэшн-мероприятий и прочих крупных событий.\r\nЗал оформлен в одном из самых молодых и современных стилей – loft, который отражает идею преображения заброшенных фабрик, складов, мастерских. \r\nОсновной зал «EVENTHALL» с объемным открытым пространством, высокими потолками, широкими арочными окнами от пола до потолка и ярким секторальным освещением рассчитан на 220 человек, максимальная вместимость 240 человек. Также имеется уютный светлый чайный зал на 50 персон.\r\nВ интерьере свободно совмещены разные дизайнерские решения, гармонично сочетаются старые кирпичные стены, натуральное дерево, современные материалы, открытые коммуникации и ультрасовременная техника последнего поколения. Мебель и предметы декора привлекут к себе внимание гостей очень оригинальными решениями и эстетическим внешним видом. Весь интерьер «EVENTHALL» будто наполнен светом и воздухом.\r\n', '0', 0, 2, 8, 2, 823, 4, NULL, '2017-04-16 11:16:41', '2017-04-16 11:16:41'),
(938, 'Царица Тамара', '<p>Потрясающий грузинский ресторан! Традиционная грузинская и европейская кухни. Уютный интерьер, создающий полное ощущения того, что ты находишься в удивительной стране с богатой историей, древними традициями и прекрасной культурой.</p>\r\n<p>Наш ресторан может предоставить:</p>\r\n<p>&bull; Большой зал на 100 пос.мест</p>\r\n<p>&bull; VIP зал на 30 пос.мест</p>\r\n<p>&bull; Торт на заказ</p>\r\n<p>&bull; Живая музыка</p>\r\n<p>&bull; Регистрация на летней площадке</p>', '0', 0, 2, 8, 2, 824, 4, NULL, '2017-04-16 11:21:27', '2017-04-21 02:12:30'),
(939, 'Той-Думан', '', '0', 0, 2, 8, 2, 825, 4, NULL, '2017-04-16 11:23:16', '2017-04-16 11:23:16'),
(940, 'Резиденция Остров', '<p>\"РЕЗИДЕНЦИЯ ОСТРОВ\" - это комплекс, настоящий РАЙСКИЙ УГОЛОК, расположен в самом сердце Усть-Каменогорска, окружен невероятным пейзажем и с видом на воду. Наши гости всегда подмечают: стоит только войти в ворота и... попадаешь в совершенно другой мир! Это поистине волшебный уголок в нашем городе... Заказывая мероприятие в шатре, вы получаете в свое распоряжение ЦЕЛЫЙ ОСТРОВ! С трех сторон окруженный водой Остров географически находится в 10-ти минутной езды от центра города Усть-Каменогорск, но ГЛАВНОЙ особенностью является его окружение: Остров наделен неповторимой красотой природы. &ldquo;Уникальным местом&rdquo; назвали Резиденцию Остров благодаря его обширностью: территория включает в себя сразу 4 объекта! Главной достопримечательностью этого комплекса стал большой свадебный шатер (первый объект), вмещающий до 380 человек на банкетах и до 600-700 на фуршетах.</p>', '0', 0, 2, 8, 2, 826, 4, NULL, '2017-04-16 11:26:10', '2017-04-21 02:12:58'),
(941, 'Роман Сметанин', '<p>Мы рады предложить вам творческий подход, компьютерные спецэффекты, современное оборудование и желание создавать красивые вещи. Видеосъемка в две-три камеры форматах высокой четкости Full HD кинематографического качества.</p>', '0', 0, 2, 5, 2, 827, 4, NULL, '2017-04-16 11:29:09', '2017-05-05 04:36:43'),
(942, 'Олег Колесников', '<p>Здравствуйте, я видеограф Олег Колесников, основной вид деятельности свадебная видеосъемка, клубные видеоотчеты, музыкальные клипы, рекламное видео.</p>', '0', 0, 2, 5, 2, 828, 4, NULL, '2017-04-16 11:31:52', '2017-05-05 04:30:55'),
(943, 'Есбол Каламханов', '', '0', 0, 2, 5, 2, 829, 4, NULL, '2017-04-16 11:37:02', '2017-04-16 11:37:02'),
(944, 'Егор Черкашин', '', '0', 0, 2, 5, 2, 830, 4, NULL, '2017-04-16 11:40:38', '2017-04-16 11:40:38'),
(945, 'Виктор Седых', '<p>Видеограф, фотограф, режиссер съемок и монтажа свадебных и семейных фильмов. Стаж работы в свадебной индустрии 18 лет. Снимаю на видео и фото, монтирую свадебные фильмы, ролики, предсвадебные истории любви (лав стори), предсвадебное и свадебное слайд-шоу. Творческий подход с учетом всех пожеланий молодых. Семейные фильмы-история рождения и первые годы жизни вашего ребенка. Эти счастливые моменты никогда не повторятся. Видео и фото съемка на профессиональном оборудовании с использованием видеокамеры или фотоаппарата DSLR, видео в формате высокого разрешения FullHD, что позволяет смотреть фильмы на компьютерах или ЖК телевизорах с изумительной цветопередачей и высокой четкостью. Обязательная предварительная встреча с молодыми до съемок с обсуждением всех деталей.</p>', '0', 0, 2, 5, 2, 831, 4, NULL, '2017-04-16 11:43:46', '2017-05-03 06:48:47'),
(946, 'Юлия Шандуро', '<p>Ведущая-тамада, вокалистка Свадьбы, дни рождения, детский праздник, корпоративы!!! Современно, энергично, весело, креативно! Интерактивные, танцевальные, артистичные, музыкальные конкурсы, флешмоб + несколько композиций-живой вокал ведущей.</p>', '0', 0, 2, 4, 2, 832, 4, NULL, '2017-04-16 11:46:22', '2017-04-21 02:14:31'),
(947, 'Юлия Нечаева', 'Здравствуйте! Меня зовут Юлия Нечаева и я - профессиональная ведущая праздников.\r\n\r\n 10 причин, чтобы доверить мне одно из самых важных событий в вашей жизни:\r\n1) Имею Высшее театральное и психологическое образование.\r\n2) Опыт работы в качестве организатора и ведущей свадебных торжеств - 6 лет.\r\n3) Разрабатываю индивидуальный сценарий для каждой пары, будь это классический или тематический банкет.\r\n4) Профессионально веду выездные регистрации брака.\r\n5) Моя программа современна, и наполнена авторскими интерактивами, развлечениями.\r\n6) Я никогда не проведу на вашей свадьбе пошлый или алкогольный конкурс.\r\n7) В программе НЕТ переодевания гостей в костюмы.\r\n8) Со мной в паре работает талантливый ди-джей, с качественной аппаратурой. Мы используем проектор и мультимедийные фишки.\r\n9) Являюсь соорганизатором и ведущей масштабных проектов- семинаров \"Школа невест 2016\" и \"Счастливая Невеста\" 2017 год.\r\n10) Я искренне ценю людей и мне интересна ваша история любви.\r\n\r\n Люблю то, что делаю и делаю это качественно! \r\n', '0', 0, 2, 4, 2, 833, 4, NULL, '2017-04-16 11:49:06', '2017-04-16 11:49:06'),
(948, 'Аслан Ахмадиев', 'Ведущий на казахском языке. Аппаратура, певцы, танцы и шоу программы включается !!! ', '0', 0, 2, 4, 2, 834, 4, NULL, '2017-04-16 11:50:55', '2017-04-16 11:50:55'),
(949, 'Ансамбль Ладушки', 'Народный ансамбль русской песни «Ладушки» был организован при Восточно-Казахстанском Государственном университете в 1986 году. Коллектив сразу после создания снискал известность и любовь в университете, городе, области.  В 1989 году – гастроли по Чехословакии, Германии, 1990 год – участие в телевизионной программе « Споемте друзья» (Москва). Коллектив поет народные песни на  русском, казахском, украинском языках, русский фольклор и стилизованные фольклорные песни. Участники коллектива не просто поют, но и танцуют,  и каждая песня становится мини-спектаклем. По приглашению Анастасии  Заволокиной принимали участие в  юбилейном концерте в Кремле программы «Играй, гармонь». В 2011 году коллектив занял 1 место в Международном фестивале « Коста Барселона» в Испании. В этом же году коллектив был награжден Премией  акима области в номинации «Музыка». \r\n        Ансамбль «Ладушки» неоднократно принимал участие в президентских концертах,  за что был награжден благодарственными письмами министра культуры  Казахстана. В 2014 «Ладушки» заняли 1 место в международном конкурсе «Fiestalonia Kazakhstan» (Астана). В 2015 г. ансамбль завоевал Гран-при в Санкт-Петербурге, на международном конкурсе народного творчества « Малахитовая шкатулка». В 2016 г. ансамбль « Ладушки» принимали участие в Дне независимости республики Беларусь и выступали на концертных площадках города Бобруйска (Беларусь). Коллектив участвует не только в сборных концертах, но и дает свои творческие концерты. Ансамбль «Ладушки» состоит из 5 человек, все имеют музыкальное образование. Коллектив стабильный, творческий, ищущий.\r\nАнсамбль «Ладушки» устроят незабываемое и музыкальное оформление свадеб, юбилеев, профессиональных праздников.\r\n', '0', 0, 2, 3, 2, 835, 4, NULL, '2017-04-16 11:53:42', '2017-04-16 11:53:42'),
(950, 'Айнура Елеусизова', 'Репертуар на 13-ти языках: индийский, арабский, узбекский, французский, молдавский и т.д. Зажигательные песни, под которые невозможно просто так сидеть. Яркие выступления певицы не оставят равнодушными ваших гостей и запомнятся надолго.', '0', 0, 2, 3, 2, 836, 4, NULL, '2017-04-16 11:56:43', '2017-04-16 11:56:43'),
(951, 'Закиржан Мамлютов', '<p>Закиржан Мамлютов &ndash; ведущий переступивший устаревший формат ведения.<br />Он противник устоявшихся конкурсов, курсирующих по банкетам. <br />Каждый его выход &ndash; это уникальное действие, не важно &ndash; будь то игра или предоставление поздравительных слов. <br />Его упор на юмор и креативный подход, дает свой результат, и вместо скучных застольных посиделок, вы получаете динамичный вечер, где не останется в стороне ни один гость.</p>\r\n<p>Пригласив его, вы сделаете правильный выбор, а об остальном уже позаботится Закиржан.</p>', '0', 0, 2, 4, 2, 837, 4, NULL, '2017-04-16 11:59:52', '2017-04-21 02:15:48'),
(952, 'Ильдар Сисанбаев', 'Уже 20 лет Ильдар участвует во всех подобных мероприятиях не только в родном Петропавловске, но и по всей республике и за ее пределами. После школы он получил высшее музыкальное образование в Северо-Казахстанском государственном университете им. М. Козыбаева, активно участвует в работе молодежного крыла татаро-башкирского центра «Дуслык» г. Петропавловск. С 2010 года Ильдар Сисанбаев самостоятельно организует свои концерты. Ныне он является заместителем председателя татаро-башкирского центра «Дуслык» г. Петропавловск, организует татарские дискотеки, тематические вечера, концерты с участием звезд татарской эстрады, сабантуи. Работа идет в тесном сотрудничестве с представителями татарских центров из других городов Казахстана.', '0', 0, 2, 4, 2, 838, 4, NULL, '2017-04-16 12:02:52', '2017-04-16 12:02:52'),
(953, 'Черный бриллиант', '<p>Вокальное трио \"Чёрный бриллиант\"! Это успешный кавер-проект Северного региона,который является одним из самых востребованных коллективов в городах Казахстана и России! Три обаятельные, эффектные девушки, которые обладают несомненным талантом \"зажгут\" ваших гостей своими хитами! Яркие образы, дорогие костюмы, профессиональный уровень, разноплановый репертуар от лихих 90 х до хитов 2015-все это вам предлагает наша группа!</p>', '0', 0, 2, 3, 2, 839, 4, NULL, '2017-04-16 12:04:44', '2017-04-21 02:16:48'),
(954, 'Виталий Фоминых', 'Фотограф с хорошим стажем, сделает профессиональные фото с качественной обработкой.\r\nОдин из лучших фотографов города.\r\n', '0', 0, 2, 14, 2, 840, 4, NULL, '2017-04-16 12:06:56', '2017-04-16 12:06:56'),
(955, 'Олег Баранов', 'Снимаю свадьбы, лав-стори, портретную индивидуальную съёмку.\r\nГарантирую профессиональные фото и отличное настроение!\r\n', '0', 0, 2, 14, 2, 842, 4, NULL, '2017-04-16 12:09:05', '2017-04-16 12:09:05'),
(956, 'Валерия Пекарева', '<p>Привет! Меня зовут Лера. Я люблю снимать видео и фотографировать, особенно людей и их улыбки. Всегда открыта для интересных предложений и проектов.</p>\r\n<p>Виды съемок:</p>\r\n<p>- индивидуальные фотосессии</p>\r\n<p>- love story</p>\r\n<p>- детские, семейные фотосессии</p>\r\n<p>- мероприятия</p>\r\n<p>- свадьбы</p>\r\n<p>- репортаж</p>\r\n<p>- видео любой сложности</p>', '0', 0, 2, 14, 2, 843, 4, NULL, '2017-04-16 12:10:54', '2017-04-21 02:17:46'),
(957, 'Анатолий Романов-', 'Свадебная фотосъемка и семейная. Банкеты.\r\nСчастливы сопровождать Ваши самые важные моменты в жизни!\r\n', '0', 0, 2, 14, 2, 844, 4, NULL, '2017-04-16 12:13:11', '2017-04-16 12:13:11'),
(958, 'Алексей Усов', '<p>Фотохудожник, свадебный фотограф, видеограф. В фотобизнесе, как свадебный фотограф, работает с начала нулевых. Имеет собственную студию фото и видео. Работает в разных городах Казахстана и России.</p>', '0', 0, 2, 14, 2, 845, 4, NULL, '2017-04-16 12:19:41', '2017-04-21 02:18:17'),
(959, 'Адлет Кайсанов', '<p>Для меня свадьба - это не просто приехать/отснять/уехать/отдать. Свадебная съемка - это и творческий процесс, и ответственное событие. И для меня очень важно использовать обе грани фотографии в своей работе!</p>', '0', 0, 2, 14, 2, 846, 4, NULL, '2017-04-16 12:21:10', '2017-04-21 02:18:40'),
(960, 'Rich Films', 'Создание презентационных и имиджевых фильмов, рекламных роликов и музыкальных клипов.', '0', 0, 2, 5, 2, 847, 4, NULL, '2017-04-16 12:23:20', '2017-04-16 12:23:20'),
(961, 'Image-studio', '<p>Хотите сделать ваш праздник лучше? Тогда вам к нам. Image-studio предоставляет следующие виды услуг: профессиональная фото и видео съёмка всех видов торжеств с использованием стедикама, слайдера, и аэросьемки. Съёмка ваших мероприятий на несколько камер с качественным звуком. Изготовления рекламных роликов и презентаций. Разработка сценариев по желанию заказчика. Съмка LOVE STORY и показ на большом экране. Современный и креативный монтаж. Стаж работы 15 лет.</p>', '0', 0, 2, 5, 2, 848, 4, NULL, '2017-04-16 12:24:55', '2017-04-21 02:19:23'),
(962, 'Аян Сулеев', 'Ведущий, который сделает Ваше мероприятие незабываемым!\r\nПрофессионал, юмор, драйв в одном флаконе!\r\n', '0', 0, 2, 4, 2, 849, 4, NULL, '2017-04-16 12:28:23', '2017-04-16 12:28:23'),
(963, 'Серик Кинаятов', '<p>Шоумэн, конферансье, ведущий, тамада, КВНщик. Язык ведения: казахский, русский, английский. Веселый, интересный и просто незабываемый вечер - главная цель мероприятия!</p>', '0', 0, 2, 4, 2, 850, 4, NULL, '2017-04-16 12:30:07', '2017-04-21 02:20:10'),
(964, 'Нариман Мундуинов', 'Ведущий на ваше торжество.\r\nИндивидуальный подход к каждому клиенту.\r\n', '0', 0, 2, 4, 2, 851, 4, NULL, '2017-04-16 12:31:39', '2017-04-16 12:31:39'),
(965, 'Мухамеджан Базарбай', 'Каждый той начинается с обряда беташар, именно там во время обряда закладывается дальнейшее настроение всей свадьбы. Важно понимать значимость, как традиций его проведения, так и манеру подхода каждого тамады к нему. В случае с Мухамеджаном всё от начала уже начинает проходить безукоризненно. Прекрасное владение казахским языком, чуткое ведение тоя, проведение позволительных игр, делает его свадебный сценарий насыщенным только полезными и интересными моментами. ', '0', 0, 2, 4, 2, 852, 4, NULL, '2017-04-16 12:33:21', '2017-04-16 12:33:21'),
(966, 'Курумбаев Айдар', 'Профессиональный, двуязычный шоумен покорит ваших гостей свежестью подхода, тактичностью сценария, оригинальностью ведения. Айдар работает в составе творческой группы актёров. В своей программе он предлагает полный цикл: беташар, вокал, двуязычное ведение, предоставление тостов, проведение игр. Айдар Курумбаев является самым востребованным шоуменом в Павлодаре и обязательно понравится вам и вашим гостям. ', '0', 0, 2, 4, 2, 853, 4, NULL, '2017-04-16 12:36:26', '2017-04-16 12:36:26'),
(967, 'Даниял Сыздыков', '<p>Асаба-шоумен қызметін ұсынамын. Мерекелік кештің кез келген түрі болмасын, мәнді де сәнді өткізу - менің мақсатым. Үйлену, қыз ұзату, мерейтой, тұсаукесер т.б. Шоу-бағдарлама, муз. аппаратура, КВН, түрлі сайыстар мен ойындар.</p>\r\n<p>Молодой и энергичный тамада-шоумен проведет все виды мероприятии. Свадьбы, корпоративы, юбилеи, дни рожденья и т.д. Шоу программа, муз. аппаратура, КВН, различные новые викторины и игры.</p>', '0', 0, 2, 4, 2, 854, 4, NULL, '2017-04-16 12:38:32', '2017-04-21 02:21:07'),
(968, 'Габит Хафиз', 'Веселый, актуальный, креативный ведущий, проведет свадебное торжество на высоком уровне!', '0', 0, 2, 4, 2, 855, 4, NULL, '2017-04-16 12:40:23', '2017-04-16 12:40:23'),
(969, 'Аслан Темиржанов', '<p>Он и тамада, и вокалист, и беташар проводить умеет. Владеет собой, владеет речью и всегда держится уверенно на мероприятии, чем и внушает уверенность заказчикам &ndash; ведь ни для кого не секрет, что заказывая, допустим свадьбу для сына, родители так сильно волнуются на самом празднике, что это перестает быть для них праздником в полной мере, а иногда даже становится головной и большим волнением. На мероприятиях Аслана Темиржанова отдыхают все &ndash; и родители в первую очередь, т.к. уже с момента знакомства понятно, что все пройдет так как и задумывалось.</p>', '0', 0, 2, 4, 2, 856, 4, NULL, '2017-04-16 12:50:16', '2017-04-21 02:21:41'),
(970, 'Артем и Алексей Власенко', 'Алексей и Артем – родные братья, стильные джентельмены, заядлые интервьюеры, праздничные интриганты, креативные извилины творческих проектов! Падение метеорита в раойне озера Чебаркуль в 2013 году сыграло главную роль в становлении дуэта ведущих «SV SHOW»! Каждый открыл в себе невероятные способности к мгновенной импровизации, колкому юмору и неисчерпаемой энергии! Нам доверяют самые важные события в жизни! С максимальной вовлеченностью и неподдельной оригинальностью выстраиваем успешные проекты, которыми гордимся!', '0', 0, 2, 4, 2, 857, 4, NULL, '2017-04-16 12:52:11', '2017-04-16 12:52:11'),
(971, 'Данияр Кульмаганов', '<p>Весьма популярный ведущий в Кокшетау. Вел, ведет и будет весьти праздники по всему северному региону, в каждом городе которого иего рады приветствовать сотню раз отработавшие с ним рестораны и бары. Отточенные манеры, увлекающая речь, а также &ndash; великолепный голос, который позволит Данияру выступить стационарным вокалистом вашего вечера.</p>', '0', 0, 2, 4, 2, 859, 4, NULL, '2017-04-16 12:56:51', '2017-04-21 02:22:11'),
(972, 'Адильхан Бельгибаев', 'Является одним из востребованных ведущих города Кокшетау. Всегда оправдывает возложенное на него доверие клиентов и старается свадебный план перевыполнить. Составляет сценарий вплоть до финального дня вашего тоя и постоянно ищет какие-нибудь яркие дополнения. Адильхан не только ведет, но даже режиссирует свадьбу.', '0', 0, 2, 4, 2, 860, 4, NULL, '2017-04-16 12:59:58', '2017-04-16 12:59:58'),
(973, 'Кенжибаев Асылбек', 'Внушительный список тёплых рекомендаций свадебных клиентов города Кокшетау. На рынке проведения казахских торжеств Асылбек работает уже давно. От свадьбы к свадьбе меняется и его развлекательная программа, оставляя неизменным в его сценарии самые важные традиции казахского застолья. Легко и очень незатейливо переходит тамада Асылбек от официальной части к развлекательной программе гостей. Обширный запас игр, викторин и веселых конкурсов. В команде своя музыкальная аппаратура и певец.', '0', 0, 2, 4, 2, 861, 4, NULL, '2017-04-16 13:02:10', '2017-04-16 13:02:10'),
(974, 'Жанболат Батырбеков', 'Жанболат Батырбеков – голосистый кокшетаусец, сочетающий в себе умение петь и артистично смотреться на сцене. Вокальное выступление – это то, без чего никак нельзя обойтись на свадьбе: разве можете ли вы представить свою свадьбу исключительно под цифровые аудиозаписи? Жанболат Батырбеков в этом плане замечательный вариант – в том числе и размером гонорара. ', '0', 0, 2, 3, 2, 862, 4, NULL, '2017-04-16 13:04:55', '2017-04-16 13:04:55'),
(975, 'ВИА «Джарайд»', 'ВИА «Джарайд», вопреки названию выступает не «ладно», а безупречно. В составе этой кокшетауской группы семь человек: три гитариста, барабанщик, саксофонист и два исполнителя. В их лице – одни из лучших талантов-выходцев из Кокшетау. Яркое живое выступление всегда поднмает уровень проводимого мероприятия, и ВИА «Джарайд» - один из самых демократичных вариантов из всех инструментальных коллективов, если говорить о стоимости одного выступления.  Группа востребована во многих городах Казахстана, но трансфер и проживание оговариваются отдельно.', '0', 0, 2, 3, 2, 863, 4, NULL, '2017-04-16 13:12:40', '2017-04-16 13:12:40'),
(976, 'Mosaic Band', '<p>Музыкальная группа города Караганда.</p>\r\n<p>&bull;Только живой звук</p>\r\n<p>&bull;Только живые эмоции</p>\r\n<p>&bull;Только эксклюзивные выступления</p>', '0', 0, 2, 1, 2, 864, 4, NULL, '2017-04-16 13:19:22', '2017-04-21 02:23:21'),
(977, 'Ерканат Бикеев', '<p>ФОТОУСЛУГИ:</p>\r\n<p>-Фотосъемка мероприятия. Репортажная и постановочная съемка</p>\r\n<p>-Цветовая коррекция всех фотографий</p>\r\n<p>-Авторская обработка снимков</p>\r\n<p>-Запись всех Ваших фотографий на индивидуально оформленный диск</p>\r\n<p>-Ссылка на архив для скачивания из интернет облака</p>\r\n<p>-Монтаж и изготовление свадебного слайд-шоу</p>', '0', 0, 2, 14, 2, 865, 4, NULL, '2017-04-16 13:21:20', '2017-04-21 02:24:04'),
(978, 'Хабиба', '', '0', 0, 2, 11, 2, 866, 4, NULL, '2017-04-16 13:24:14', '2017-04-16 13:24:14'),
(979, 'KORONA', '', '0', 0, 2, 10, 2, 867, 4, NULL, '2017-04-16 13:26:37', '2017-04-16 13:26:37'),
(980, 'Ксения Комчугова ', '<p>&bull; Макияж любой сложности</p>\r\n<p>&bull; Наращивание ресниц</p>\r\n<p>&bull; Коррекция бровей</p>\r\n<p>&bull; Прически</p>', '0', 0, 2, 9, 2, 868, 4, NULL, '2017-04-16 13:28:42', '2017-04-21 02:24:27'),
(981, 'ATON fire show', 'Проект, образовавшийся в Караганде в 2014 году. Каждый из нас, выступая с огнем ранее, хотел сделать что-то уникальное и «свое». Именно тогда мы поняли, какое огненное шоу мы хотим воплощать в жизнь. Наша задача - делать максимально яркое и живое шоу. Основа - постоянный контакт со зрителем, его непосредственное участие. Мы по- настоящему горим тем, что мы делаем.\r\nВ каждую шоу-программу включена работа с огненными факелами и выдувание огня. Любую шоу-программу можно дополнить элементами из другой шоу-программы, а также любым количеством артистов. Изготовление огненных имен, надписей, логотипов бронируется за месяц до проведения шоу.\r\n', '0', 0, 2, 7, 2, 869, 4, NULL, '2017-04-16 13:34:02', '2017-04-16 13:34:02'),
(982, 'BEKZHAN ESENOV ', '<p>Наши услуги для свадебных торжеств:</p>\r\n<p>- Предсвадебная консультация</p>\r\n<p>- Видео сьемка на DSLR</p>\r\n<p>- Запись видео в формате Full HD (1920*1080)</p>\r\n<p>- Одна копия на USB-Flash</p>\r\n<p>- Запись с пульта (чистый звук)</p>\r\n<p>- Художественная цветокоррекция</p>', '0', 0, 2, 5, 2, 870, 4, NULL, '2017-04-16 13:43:35', '2017-04-21 02:24:58'),
(983, 'Татьяна Калинина', '<p>Желаю людям я добра ,тепла и вдохновенья! Я верю в чудеса и предлагаю молодым поверить в меня и сделать их праздник ОБЫКНОВЕННЫМ ЧУДОМ!!! Опыт работы -7 лет. Праздники для взрослых и детей.</p>', '0', 0, 2, 4, 2, 871, 4, NULL, '2017-04-16 13:45:32', '2017-04-21 02:25:17'),
(984, 'Ерлан Муканов', 'Ведущий-Шоумен Ерлан Муканов. В индустрии развлечений работаю 5 лет. Язык ведения: русский.\r\nСегодня банкеты, свадьбы, юбилеи, корпоративы и выпускные вечера принято организовывать при помощи профессионалов. Современный подход к составлению сценария проведения праздника сделает ваше торжество интересным, креативным и незабываемым. \r\n- Я стараюсь всё делать с хорошим настроением, с легкой динамикой и с тонким чувством юмора.\r\n', '0', 0, 2, 4, 2, 872, 4, NULL, '2017-04-16 13:47:06', '2017-04-16 13:47:06'),
(985, 'Дар Оспанов', 'Отличный ведущий, которому под силу мероприятия любого уровня. Молодой, яркий, стильный, позитивный. Его стиль ведения мероприятия оставит неизгладимое впечатление у Вас и Ваших гостей.', '0', 0, 2, 4, 2, 873, 4, NULL, '2017-04-16 13:49:58', '2017-04-16 13:49:58'),
(986, 'Жайна ан-би тобы', '<p>2005 жылы топтың алғашқы құрамы жанұялық үштiк (трио) болып құрылды. Қазіргі &laquo;Жайна ән-би ансамблi&raquo; 25 бишi 2 әншiден құралған үлкен топқа айналды.</p>', '0', 0, 2, 11, 2, 874, 4, NULL, '2017-04-16 13:52:10', '2017-04-19 03:33:19'),
(988, 'Сержан Баймухан', '<p>Позитивпен мəдениеттілікті ұштастырып əдемі тоймен айшықтап жүрміз ойдың барлық түрін басқарамын.</p>', '0', 0, 2, 4, 2, 878, 4, NULL, '2017-04-16 14:08:12', '2017-04-18 07:23:26'),
(989, 'Дуэт Азалия', '<p>Дуэт Азалия украсит Ваше мероприятие. Репертуар охватывает более 100 мелодий, от классики до современной музыки.</p>', '0', 0, 2, 6, 2, 880, 3, NULL, '2017-04-17 01:48:18', '2017-04-20 05:11:55'),
(990, 'Дуэт EU&RO MUSIC', '<p>ДУЭТ EU&amp;RO MUSIC &mdash; это творческий альянс двух высокопрофессиональных музыкантов &mdash; инструменталистов. Евгений Ботников (саксофоны, кларнет) &mdash; золотой саксофон столицы. Роза Солтыханова (флейта) &mdash; лауреат международных конкурсов. Выступление дуэта прекрасно подходит для мероприятий практически любого формата,будь то концерт, выступление на банкете или фоновая музыка для фуршета. В репертуаре дуэта: популярные мировые хиты, известные казахские мелодии, джазовые композиции, зажигательная танцевальная музыка и т.д.</p>', '0', 0, 2, 6, 2, 881, 3, NULL, '2017-04-17 01:51:11', '2017-04-20 05:12:08'),
(991, 'Барабанный ансамбль \"Dream Line\"', '', '0', 0, 2, 6, 2, 882, 3, NULL, '2017-04-17 01:52:55', '2017-04-20 05:12:33'),
(992, 'Барабанное шоу Royal Beats', '<p>Барабанное шоу &laquo;RoYaL Beats&raquo; была создана 1 января 2017 года! В копилке коллектива уже две качественные шоу &mdash; программы. Гарантируют качественный звук, профессиональный подход к делу и неподдельные зрительские эмоции!</p>', '0', 0, 2, 6, 2, 883, 3, NULL, '2017-04-17 01:54:50', '2017-04-20 05:12:42'),
(993, 'Аббас Аппазов', '<p>Профессиональный саксофонист &mdash; с солидным репертуаром и опытом работы предлагает свои услуги для музыкального оформления любых праздничных мероприятий. Новогодние корпоративы. Той. Свадьбы. Фуршет (фоновая музыка).Юбилей. Корпоративы. Концерты. Репертуар-популярные романтические мелодии, обработки зарубежных хитов, фоновые джазовые композиции и лирические мелодии. Украсьте свое мероприятие чарующими звуками Саксофона.</p>', '0', 0, 2, 6, 2, 884, 3, NULL, '2017-04-17 01:56:03', '2017-04-20 05:13:09'),
(994, 'Ru-Me', '', '0', 0, 2, 6, 2, 885, 3, NULL, '2017-04-17 01:57:36', '2017-04-17 01:57:36'),
(995, 'Jan Sax', '', '0', 0, 2, 6, 2, 886, 3, NULL, '2017-04-17 01:58:42', '2017-04-17 01:58:42'),
(996, 'Di Art Style', '<p>Стиль Латино, Восток и современный жанр. Профессиональные музыканты, виртуозная игра на народных инструментах и Вокал. Группа Представляла Казахстан в Милане, Москве, Израиль и.т.д. Богатый репертуар группы позволяет украсить любое мероприятие.</p>', '0', 0, 2, 6, 2, 887, 3, NULL, '2017-04-17 01:59:47', '2017-04-20 05:13:56'),
(997, 'Лазерное шоу', '', '0', 0, 2, 7, 2, 888, 3, NULL, '2017-04-17 02:01:10', '2017-04-17 02:01:10'),
(998, 'Трансформация и фокусы', '', '0', 0, 2, 7, 2, 889, 3, NULL, '2017-04-17 02:03:17', '2017-04-17 02:03:17'),
(999, 'Фокусник Иванченков Руслан', '<p>Иванченков Руслан более известный как Манкарди! В его послужном списке более 1000 выступлений по Казахстану и ближнему зарубежью! Так же Манкарди является единственным в Казахстане рекордсменом книги Гиннеса поставивший рекорд в сфере фокусов! Ведь в его программе есть как сценические номера рассчитанные на большие залы, так и фокусы которые можно показывать на расстоянии вытянутой руки, которые подойдут на встречу ваших гостей до начала мероприятия (будь то свадьба, юбилей или же какая то презентация). Приглашая на ваше мероприятие Манкарди, абсолютно каждый прикоснется и оставит у себя в памяти частичку волшебства! Ведь именно Манкарди &mdash; ваш личный курьер Волшебства!</p>', '0', 0, 2, 7, 2, 890, 3, NULL, '2017-04-17 02:04:35', '2017-04-20 05:14:07'),
(1000, 'Художник — шаржист', '', '0', 0, 2, 7, 2, 891, 3, NULL, '2017-04-17 02:06:03', '2017-04-17 02:06:03'),
(1001, 'Ростовые куклы Алладин', '<p>В репертуаре веселые, эстрадные, с необычными персонажами Ростовые куклы. Их выступления непредсказуемо и энергично, вызовут живой, неподдельный интерес и улыбки гостей. Оригинальные номера украсят любое шоу, корпоративный вечер, праздник, торжество, юбилей или свадьбу!</p>', '0', 0, 2, 7, 2, 892, 3, NULL, '2017-04-17 02:07:13', '2017-04-20 05:14:27'),
(1002, ' Чингиз Ибрагимов', '<p>Иллюзионист Чингиз Ибрагимов создает невероятное магическое шоу, которое поражает воображения каждого зрителя. Виды программ: микромагия, сценическое шоу, детская программа, ментализм (чтение мыслей), визуальность (только яркие номера), интерактивность, концертные номера.</p>', '0', 0, 2, 7, 2, 893, 3, NULL, '2017-04-17 02:08:35', '2017-04-20 05:14:38'),
(1003, 'Иллюзионист, фокусник Александр Дикс', '<p>Александр Дикс:</p>\r\n<p>&mdash; профессиональный иллюзионист, фокусник</p>\r\n<p>&mdash; мистификатор</p>\r\n<p>&mdash; Почетный член клуба фокусников Казахстана</p>\r\n<p>&mdash; Участник ежегодного международного фестиваля иллюзионистов MagicAstana</p>\r\n<p>&mdash; Один из самых востребованных иллюзионистов в северном регионe</p>\r\n<p>&mdash; Победитель конкурса &laquo;Символ Успеха&raquo; от компании SAMSUNG</p>\r\n<p>&mdash; Ведущий шоу &laquo;Уличная Магия в Кокшетау&raquo;.</p>\r\n<p>Виды программ: микромагия, шоу, интерактив, детская программа.</p>', '0', 0, 2, 7, 2, 894, 3, NULL, '2017-04-17 02:13:34', '2017-04-20 05:15:49'),
(1004, 'Brown при гостинице Ак Булак', '<p>Кухня: европейская, казахская, русская</p>\r\n<p>Количество мест: 180</p>\r\n<p>Время работы: круглосуточно, без выходных</p>\r\n<p>Парковка: бесплатная, на 150 мест</p>\r\n<p>Разрешены свои: алкоголь, мясо, фрукты, десерты, безалкогольные напитки</p>', '0', 0, 2, 8, 2, 895, 3, NULL, '2017-04-17 02:16:18', '2017-04-20 05:16:24'),
(1005, 'Abay при Ramada Plaza Astana', '<p>Вместимость: 300 мест</p>\r\n<p>Разрешены свои: алкоголь, мясо, фрукты, десерты</p>', '0', 0, 2, 8, 2, 896, 3, NULL, '2017-04-17 02:56:52', '2017-04-20 05:17:10'),
(1006, 'Рахат Лукум', '<p>Кухня: европейская, казахская</p>\r\n<p>Количество мест: 200</p>\r\n<p>Время работы: 10:00&ndash;01:00, без выходных</p>\r\n<p>Парковка: охраняемая, бесплатная</p>', '0', 0, 2, 8, 2, 897, 3, NULL, '2017-04-17 03:06:40', '2017-04-20 05:17:24'),
(1008, 'Орман', '<p>Кухня: восточная, восточно &mdash; европейская, европейская</p>\r\n<p>Количество мест: 300</p>\r\n<p>Время работы: 12:00&ndash;01:00, без выходных</p>\r\n<p>Парковка: бесплатная</p>', '0', 0, 2, 8, 2, 899, 3, NULL, '2017-04-17 03:21:58', '2017-04-20 05:17:37'),
