(1011, 'Бакыт', '<p>Кухня: восточная, европейская, казахская</p>\r\n<p>Количество мест: 180</p>\r\n<p>Время работы: 10:00&ndash;02:00, без выходных</p>\r\n<p>Парковка: бесплатная</p>', '0', 0, 2, 8, 2, 904, 3, NULL, '2017-04-17 03:27:59', '2017-04-18 23:01:45'),
(1012, 'Байтерек', '<p>&laquo;Байтерек&raquo; &mdash; изысканный банкетный зал для свадьбы или любого другого торжества, оформленный в роскошном классическом стиле. Большой банкетный зал вместимостью до 250 человек, разнообразное меню национальной и европейской кухни, профессиональная звуковая и световая аппаратура, танцпол, сцена, фуршетная зона и отличный сервис не оставит гостей равнодушным! Время работы: с 12:00 до последнего гостя, без выходных.</p>', '0', 0, 2, 8, 2, 905, 3, NULL, '2017-04-17 03:30:52', '2017-04-20 05:18:09'),
(1013, 'Айгерим', '<p>Количество мест: 250</p>\r\n<p>Время работы: круглосуточно, без выходных</p>\r\n<p>Парковка: охраняемая, бесплатная</p>', '0', 0, 2, 8, 2, 906, 3, NULL, '2017-04-17 03:33:09', '2017-04-20 05:18:19'),
