(1015, 'Shatush', '<p>Кухня: европейская, казахская, русская</p>\r\n<p>Количество мест: 220</p>\r\n<p>Время работы: 12:00&ndash;01:00, без выходных</p>\r\n<p>Парковка: бесплатная, на 150 мест</p>', '0', 0, 2, 8, 2, 909, 3, NULL, '2017-04-17 03:37:04', '2017-04-20 05:18:47'),
(1016, 'Банкетный зал Ралина ', 'Ресторан \"Ралина\" вобрал в себя лучшие традиции азербайджанской и казахской кухни.Уютная,доброжелательная атмосфера,приятная музыка и достойный сервис - это основные преимущества ресторана.Вс\r\nе вышеперечисленное и плюс доступный уровень цен позволили заведению оказаться в списке лучших ресторанов Костаная. Секрет популярности прост - побывав здесь однажды и ощутив радушие и гостеприимство, теплый прием и заботливое обслуживание, гости непременно возвращаются вновь и советуют \"Ралина\" своим друзьям. Мы всегда рады встретить Вас в нашем заведении и дорожим каждым нашим клиентом!\r\n', '0', 0, 2, 8, 2, 907, 4, NULL, '2017-04-17 03:38:18', '2017-04-17 03:38:18'),
(1017, 'Monte Bianco', '<p>Количество мест: 180</p>\r\n<p>Время работы: 11:00&ndash;02:00, без выходных</p>\r\n<p>Парковка: охраняемая, бесплатная, на 70 мест</p>', '0', 0, 2, 8, 2, 910, 3, NULL, '2017-04-17 03:39:01', '2017-04-20 05:19:35'),
(1018, 'Поместье', 'Банкетный зал «Поместье» - это сочетание атмосферы уюта и комфорта, хорошего настроения, вежливого персонала, вкусной кухни, красивого интерьера, демократичных цен и индивидуального подхода к каждому гостю.\r\nБанкетный зал «Поместье» - это проведение банкетов, свадеб, торжеств, корпоративных мероприятий и других Ваших праздников.\r\nБанкетный зал «Поместье» может разметить до 150 человек.\r\nНадеемся, Вам понравится у нас, и знакомство продлится на долгие годы.\r\n', '0', 0, 2, 8, 2, 911, 4, NULL, '2017-04-17 03:57:05', '2017-04-17 03:57:05'),
(1019, 'ELLE', '<p>САЛОН КРАСОТЫ Elle работает на рынке Астаны уже не один год. Наши операторы постоянно работают над расширением ассортимента продукции &mdash; мы предлагаем клиентам разнообразные товары и услуги и гарантируем их качество.</p>', '0', 0, 2, 9, 2, 912, 3, NULL, '2017-04-17 03:57:37', '2017-04-20 05:19:43'),
(1020, 'Make Up Espresso', '', '0', 0, 2, 9, 2, 913, 3, NULL, '2017-04-17 03:58:57', '2017-04-17 04:00:17'),
(1021, 'Тамара Коломецкая', 'Если вы хотите, чтобы лучший день в вашей жизни запомнился и вам и гостям, без заказа тамады вам не обойтись. Профессиональный ведущий — это человек, который знает как развлечь целый банкетный зал приглашённых, даже если они не знакомы между собой. От его богатого опыта, профессионализма, правильного отношения во многом зависит настроение гостей, ожидавшие получить на празднике много веселья и массу приятных моментов!!! Мне можно доверить самое ценное — эмоции всех присутствующих на празднике, Отличительная особенность моей работы — импровизация! Несомненно я делаю акцент на красоту и чистоту речи, утончённое чувство юмора, душевный настрой, уровень культуры, профессиональные навыки. Мой гонорар колеблется от мини… до макси… Звоните договоримся!!!\r\n', '0', 0, 2, 4, 2, 914, 4, NULL, '2017-04-17 03:59:55', '2017-04-17 03:59:55'),
(1022, 'Lady Di', '', '0', 0, 2, 9, 2, 915, 3, NULL, '2017-04-17 04:00:01', '2017-04-17 04:00:01'),
(1023, 'Рай', '', '0', 0, 2, 10, 2, 917, 3, NULL, '2017-04-17 04:01:45', '2017-04-17 04:01:45'),
(1024, 'Татьяна Стрельцова ', 'Меня зовут Татьяна Стрельцова. Занимаюсь проведением праздников более 10 лет. Давно поняла, что тот, кто не смотрит вперед, оказывается позади. Именно поэтому регулярно повышаю свой профессиональный уровень. Посещаю различные семинары, международные встречи и вебинары для ведущих. В связи с этим, в моей программе много клёвых и оригинальных фишек!\r\nНаши праздники отличаются динамичностью, отсутствием нудных речей и длинных стихов.\r\n', '0', 0, 2, 4, 2, 916, 4, NULL, '2017-04-17 04:02:07', '2017-04-17 04:02:07'),
(1025, 'Камелия', '', '0', 0, 2, 10, 2, 918, 3, NULL, '2017-04-17 04:02:47', '2017-04-17 04:02:47'),
(1026, 'Show-Ballet «ARNAU»', '<p>В репертуаре &mdash; большое количество номеров различного направления (народные, бальные, классические танцы и для тематических мероприятий).Имеем шикарную костюмную базу. Выступления могут быть организованны в любом регионе Казахстана и за рубежом. Услуги хореографа- постановщика танцев, разработка специальных номеров по пожеланию клиента. Лучшая танцевальная программа для празднования юбилеев фирм, корпоративных вечеров, Дня рождения, свадеб и встречи Нового года! Совершите путешествие в мир танца, вместе с &laquo;ARNAU&raquo;!</p>', '0', 0, 2, 11, 2, 919, 3, NULL, '2017-04-17 04:04:55', '2017-04-20 05:19:59'),
(1027, 'Шоу балет Вояж', '', '0', 0, 2, 11, 2, 921, 3, NULL, '2017-04-17 04:06:10', '2017-04-17 04:06:10'),
(1028, 'ВИА Mama Jama', 'ВИА Mama Jama предлагает музыкальное сопровождение всего вечера длительностью до 3-х блоков по 40 минут. Группа работает с 2013 года. В составе группы три вокалиста, ударные, гитара, клавишные и перкуссия. \r\n\r\nРепертуар разнообразный на разные аудитории. Группа поет на казахском, русском, английском, итальянском, испанском языках. В программе есть отдельный костюмированный латиноамериканский блок. \r\n', '0', 0, 2, 1, 2, 920, 4, NULL, '2017-04-17 04:07:22', '2017-04-17 04:07:22'),
(1029, 'Ризанна Аутлеева', '<p>Наверное, не сохранилось на земле более древнего танца, чем orient dance (танец живота или Belly dance). Пройдя через тысячелетия, этот хвалебный гимн Женщине возрождается вновь, напоминая о ее истинной природе, ее мистической роли в сотворении Жизни и продолжении Рода. Искусство этого танца берет свое начало из глубины веков, отражая в себе древнейшие культы изобилия, плодородия и любви. Профессиональный, яркий и неповторимый танец живота от исполнительницы Ризаны погрузит вас и вашу компанию в таинственный мир Востока. Ризана прекрасно работают с публикой, а также восхищает ее мастерство.</p>\r\n<p>*Чемпионка Азии по арабским танцам, 2013</p>\r\n<p>*Мисс Бэллидэнс Казахстан, 2013.</p>\r\n<p>*Серебрянный призер международного конкурса по арабским танцам г. Сеул, Южная Корея, 2013</p>\r\n<p>*Победитель международного фестиваля Oriental Astana ,2014,2015</p>\r\n<p>*Призер в номинации &laquo;Корона Mercedes Nieto&raquo; г.Будапешт , Варшава, 2014 *Победитель конкурса по арабским танцам по версии Лиги Профессионалов ,г. Москва, 2014</p>\r\n<p>*Бронзовый призер международного конкурса по арабским танца \"MAZAGAT\" г. Бари, Италия, 2014. *Победитель CairoFestival г.Будапешт , Варшава, 2015</p>', '0', 0, 2, 11, 2, 922, 3, NULL, '2017-04-17 04:10:21', '2017-04-20 05:20:53'),
(1030, 'Dream Maker', '<p>Мы Dream Maker- ателье готовых пригласительных. Мы помогаем делать праздники ярче, памятные моменты счастливее, а хлопоты о мероприятии приятнее. В нашей студии рисуют, иллюстрируют, Печатают и тиснят необычные и яркие открытки, Бонбоньерки и пресс-стены. Создают дизайн праздничной полиграфии и правильное настроение для торжеств. В нашем магазинчике - сотни готовых пригласительных и наборов, которые ждут яркого торжества. Приходите и выбирайте. Мы поможем сделать праздник идеальным. С вдохновением ваш Dream Maker.</p>', '0', 0, 2, 13, 2, 923, 4, NULL, '2017-04-17 04:11:08', '2017-04-21 02:30:49'),
(1031, 'Star Dance Show', '<p>Небольшой современный шоу-балет с качественными костюмами. Экспрессивные и яркие постановки выделяют шоу-балет из числа стандартных коллективов.</p>', '0', 0, 2, 11, 2, 924, 3, NULL, '2017-04-17 04:13:16', '2017-04-20 05:21:00'),
(1032, 'КВН «Спарта»', 'На протяжении двух лет команда КВН «Спарта» выступает на корпоративных праздниках, частных мероприятиях - свадьбы, юбилеи, дни рождения. Остроумные и находчивые, прекрасно выглядят, отлично говорят, умеют привлечь внимание, узнаваемые на улицах - они порадуют гостей своим незабываемым выступлением. Язык ведения: русский, казахский.\r\n', '0', 0, 2, 4, 2, 926, 4, NULL, '2017-04-17 04:14:21', '2017-04-17 04:14:21'),
(1033, 'Театр танца Шалкыма', '', '0', 0, 2, 11, 2, 925, 3, NULL, '2017-04-17 04:15:39', '2017-04-17 04:15:39'),
(1034, 'Эстрадный дуэт «Самал»', 'Эстрадный дуэт «Самал» - это уверенно покоряющий пока столичную эстраду тандем обаятельных исполнителей. Первое что привлекает внимание в дуэте «Самал» - это изысканность с которой ребята подошли к репертуару. Каждый вокальный блок это настоящая кладезь золотых шедевров казахской, советской, казахстанской, российской и зарубежной эстрады. Каждая песня в их исполнении обретает новую жизнь в сценарии вашего торжества и неизбежно вызывает наплыв добрых и положительных эмоций. Данный дуэт предлагает два эстрадных блока только признанных шедевров мировой музыки.  \r\n', '0', 0, 2, 3, 2, 928, 4, NULL, '2017-04-17 04:20:10', '2017-04-17 04:20:10'),
(1035, 'Шоу балет Терра', '', '0', 0, 2, 11, 2, 927, 3, NULL, '2017-04-17 04:24:24', '2017-04-17 04:24:24'),
(1037, 'Шоу балет Блеск', '<p>Изюминка шоу-балета &ndash; это яркие танцевальные номера, красочные костюмы, профессиональная хореография и большой заряд позитива и радости, которые мы дарим людям!</p>', '0', 0, 2, 11, 2, 931, 3, NULL, '2017-04-17 04:40:32', '2017-04-20 05:24:30'),
(1038, 'Нурсултан Карабалиев', 'Нурсултан Карабалиев- Лауреат 2 премии Рспубликанского конкурса молодых исполнителей «Жас канат» (2014г), обладатель Гран при Республиканского песенного конкурса «Ән жүрегім-Астана» (2014г).\r\nВ репертуаре более 60-ти песен: мировые хиты, песни казахстанских композиторов, авторские произведения. Предпочитает работать в живую, в редких случаях, под фонограмму.\r\n', '0', 0, 2, 3, 2, 929, 4, NULL, '2017-04-17 04:43:10', '2017-04-17 04:43:10'),
(1039, 'Танцевальный ансамбль «Есiл Еркесi»', '<p>Есiл Еркесi - танцевальный ансамбль народного направления! Яркие костюмы, красивые девушки, а также зрелищные постановки украсят любой Ваш праздник!</p>', '0', 0, 2, 11, 2, 932, 3, NULL, '2017-04-17 04:45:50', '2017-04-20 05:24:40'),
(1040, 'Іңкәрім', '<p>Танцевальный коллектив &laquo;Іңкәрім&raquo; существует 7 лет и этим уже многое сказано. Коллектив не стоит на месте, всегда в поиске, а танцевальные костюмы всегда соответствуют времени и моде. В репертуаре очень много народных танцев, латиноамериканских, а также шуточных и тематических композиций. Мы рады предложить Вам наши разнообразные танцевальные номера и индивидуальные постановки по Вашему заказу. Для Вас &mdash; выступление, для нас &mdash; шанс доказать, на что мы способны! В нашей биографии участие в десятках разнообразнейших шоу-проектах, а также работа с известными исполнителями казахстанской эстрады. У нас есть свой неповторимый стиль, своё оригинальное творческое лицо.</p>', '0', 0, 2, 11, 2, 933, 3, NULL, '2017-04-17 04:47:55', '2017-04-20 05:24:49'),
(1041, 'Ерке-Cылқым', '<p>Все виды танцев, вывод невесты.</p>', '0', 0, 2, 11, 2, 935, 3, NULL, '2017-04-17 04:49:07', '2017-04-20 05:24:53'),
(1042, 'Вокально-инструментальная группа  «ОК»', 'В составе группы профессиональные музыканты с высшим музыкальным образованием, лауреаты Международных и Республиканских конкурсов. \r\nВ состав группы входят : \r\nГитарист - предающий музыке насыщенную гармонию и драйв жизни.\r\nВосточный ударный инструмент – который дает музыке темперамент и четкий ритм для зажигательной музыки.\r\nВокалист – поющий в разнообразных жанрах и стилях на разных языках.\r\nМузыкальная шоу программа!!! Живои звук, казахские, русские, английские, восточные, латиноамериканские зажигательные песни.\r\n', '0', 0, 2, 3, 2, 934, 4, NULL, '2017-04-17 04:49:42', '2017-04-17 04:49:42'),
(1043, 'Вокально-хореографический ансамбль «Айкөркем»', '<p>Все виды танцев, выход невесты.</p>', '0', 0, 2, 11, 2, 936, 3, NULL, '2017-04-17 04:50:55', '2017-04-20 05:25:00'),
(1044, 'Royal Dance Show', '<p>Устали от одинаковых вечеров? &laquo;Royal dance show&raquo; удивит Вас свежими и оригинальными постановками. Стандартных выступлений? Тогда Вам необходимо увидеть их! Несмотря на &laquo;молодость&raquo; коллектива, у них весьма впечатлительный опыт работы. Плюс в том, что &laquo;Royal&raquo; выступал на различных площадках и конкурсах, поэтому об атмосфере праздника можно не волноваться. Со столь смелым королевским названием, шоу-балет &laquo;Royal&raquo; наполнит Ваше мероприятие благородным шармом!</p>', '0', 0, 2, 11, 2, 937, 3, NULL, '2017-04-17 04:52:39', '2017-04-20 05:25:07'),
(1045, 'PRIME Dance company', '<p>PRIME Dance Company- совершенно новый шоу-проект на рынке танцевальных услуг. В составе коллектива только профессиональные артистки балета, которые поразят вас не только своей грацией и красотой, но и новизной исполнения в любом танцевальном жанре. В репертуаре балета разноплановые номера, которые феерично откроют любое Ваше торжество, и достойно украсят его в течении всего вечера. Со вкусом встретим и проводим прекрасную невесту в разных стилях, величественно представим жениха, презентуем юбиляра и волшебно оформим свадебный танец молодых. Авторские интерактивные шоу с участием ваших гостей и эксклюзивные постановки!</p>', '0', 0, 2, 11, 2, 938, 3, NULL, '2017-04-17 04:54:08', '2017-04-20 05:25:17'),
(1046, 'Шоу-балет «Индиго»', '<p>Уважаемые дамы и господа, мы рады представить вам шоу &mdash; балет &laquo;Индиго&raquo;! Наш коллектив существует уже более 7 лет, и за этот срок успел заслуженно полюбиться десяткам юбиляров и именинников, молодоженам и просто благодарным зрителям нашей страны. Изюминка нашего шоу &mdash; балета &mdash; это яркие и интересные танцы, оригинальные костюмы, профессиональная хореография и заряд отличного настроения, которым мы будем рады украсить ваш праздник! У нас в репертуаре более 30 танцев и их количество постоянно растет. Мы будем рады подарить вам все: от встречи гостей, леди-фуршета, вывода невесты, жениха или ребенка до широкого выбора танцев и номеров оригинального жанра!</p>', '0', 0, 2, 11, 2, 939, 3, NULL, '2017-04-17 04:55:41', '2017-04-20 05:25:25'),
(1047, 'Шоу-балет «Imperial»', '<p>Яркий танцевальный коллектив украсит ваш любой праздник зажигательными энергичными танцами разных жанров (cаржайлау, акку, цыганка, узбекский, русский, испания, павлины, бразилия, антре, латина, гусары, танго). Также предоставляем вывод невесты под полотном, вывод невесты под шаныраком, дорога жизни.</p>', '0', 0, 2, 11, 2, 940, 3, NULL, '2017-04-17 04:56:55', '2017-04-20 05:26:14'),
(1048, 'Цыганский Ансамбль «Ромэн»', '<p>Молодежный цыганский ансамбль &laquo;Ромэн&raquo;- это приятный сюрприз для Ваших гостей. Мы приедем на любой Ваш праздник: на свадьбу, юбилей, день рождения, выкуп невесты, сватовство, корпоративный вечер, встреча гостей. Столько удивления и положительных эмоций появляются у гостей, когда неожиданно появляются артисты цыганского ансамбля. Все песни из любимых известных кинофильмов .</p>', '0', 0, 2, 11, 2, 941, 3, NULL, '2017-04-17 04:57:54', '2017-04-20 05:26:22'),
(1049, 'КАБАРЕ — ШОУ «VIVA»', '<p>В репертуаре собраны разноплановые и оригинальные номера, которые несут зрителю позитив, душевность, восторг, креативный подход и удовольствие от созерцания красоты и грациозности движений! Самые красивые выводы невесты на беташар и узату той, большой выбор казахских национальных танцев, латино &mdash; американская шоу &mdash; программа, инструментальный квартет VIVALDI, инструментально &mdash; танцевальное шоу VIOLIN, шоу на ходулях, самые забавные мимы, хостес, леди-фуршеты, живые статуи и многое другое. Самое лучшее для Вашего торжества!</p>', '0', 0, 2, 11, 2, 942, 3, NULL, '2017-04-17 04:59:06', '2017-04-20 05:26:32'),
(1050, 'Танцевальный Коллектив «Империя»', '<p>Танцевальный коллектив, который внес в себя только профессиональных танцоров спортивных бальных танцев, участников и победителей различных соревнований. Вашему вниманию представлена стилизованная европейская программа и латиноамериканская танцевальная шоу-программа, которая не даст скучать вашим гостям. Качество, красоту и профессионализм гарантируем!</p>', '0', 0, 2, 11, 2, 943, 3, NULL, '2017-04-17 05:00:12', '2017-04-20 05:26:37'),
(1051, 'Show Ballet Azure', '<p>Эксклюзивное танцевальное шоу с шикарными костюмами и интересными хореографическими постановками! В шоу программу входят: вывод невесты под изящной короной ( или сәукеле) в окружении 4-х очаровательных девушек в национальных казахских костюмах с красивой хореографической постановкой казахского танца; постановка &laquo;Дружба народов&raquo; (уйгурский танец, испанский танец и китайский танец). Основа постановки заключается в объединении танцевальной культуры народов мира. Танцоры, обратившись в национальные костюмы разных народов, выступают в конструкциях, освещённых светодиодами; ЗАЖИГАТЕЛЬНЫЙ Цыганский танец под веселую музыку и отличное настроение с участием гостей мероприятия; восточный танец.</p>', '0', 0, 2, 11, 2, 944, 3, NULL, '2017-04-17 05:01:21', '2017-04-20 05:26:43'),
(1052, 'Арт-балет «NAELLE»', '<p>Арт-балет &laquo;NAELLE&raquo; &mdash; коллектив, собравший в себе профессиональных танцоров и хореографов. Новая звезда на небосклоне шоу-бизнеса Астаны, несомненно запомнится своей безупречной хореографией и неповторимыми образами, оставляя только положительные впечатления! Наши услуги: вывод невесты,танцевальное шоу, интерактивные проекты, встреча гостей, эксклюзивные постановки, пошив костюмов, подтанцовка для звезд эстрады, постановка свадебного танца, постановка флешмоба, живые статуи, пошив акжолов и тулаков, и многое другое. Мы там, где начинается праздник!</p>', '0', 0, 2, 11, 2, 945, 3, NULL, '2017-04-17 05:02:54', '2017-04-20 05:26:53'),
(1053, 'Prime Print', '', '0', 0, 2, 13, 2, 946, 3, NULL, '2017-04-17 05:04:47', '2017-04-17 05:04:47'),
