(1056, 'Артпринт', '', '0', 0, 2, 13, 2, 949, 3, NULL, '2017-04-17 05:07:49', '2017-04-17 05:07:49'),
(1057, 'Апринт', '<p>Спектр Услуг: Крышные и наземные конструкции, объемные буквы, оформление бутиков и витражей, оформление зданий и помещений для праздников, стеллы, указатели на столбах, видеовитрины, аренда конструкции для праздников, вращающиеся рекламные конструкции, фирменные световые короба, мобильные стенды, выставочные стенды, декорации для шоу, сцены для телепередач, согласование наружной рекламы в гос. органах, широкоформатная печать, интерьерная печать, плоттерная резка, фигурная резка (фрезерная резка), лазерная резка, покрасочная камера, вывески, таблички, номерки, штендеры, стенды, накладные буквы, неоновые буквы, светодиодные буквы, видеобуквы, видеомодули и многое другое. Полиграфия, Визитки, Листовки, Блокноты, Ламинирование, Биговка, Брошюры.</p>', '0', 0, 2, 13, 2, 950, 3, NULL, '2017-04-17 05:09:08', '2017-04-20 05:29:05');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1059, 'INSIDE MEDIA', '<p>INSIDE MEDIA &ndash; это рекламное агентство полного цикла в Казахстане. <br />Мы открываем новые возможности для развития Вашего бизнеса и рынка рекламных услуг в целом. <br />Воплощая творческие идеи в жизнь, мы не забываем о том, что реклама должна продавать. <br />Наша цель &ndash; быть ближе к мечте каждого из Вас, мы хотим больше чем Вы &ndash; для Вас же. <br />Если Вы нацелены на успех &ndash; нам по пути.</p>\r\n<p>Стремитесь к лучшему вместе с нами:</p>\r\n<p>Дизайн (логотип, фирменный стиль, брендбук, имиджевая и сувенирная продукция);</p>\r\n<p>WEB (разработка сайта, продвижение сайта, сопровождение сайта, SMM);</p>\r\n<p>Наружная реклама (билборды, лайтбокс, баннер, видеоэкраны);</p>\r\n<p>Полиграфия (визитки, листовки, буклеты, пакеты).</p>', '0', 0, 2, 13, 2, 951, 3, NULL, '2017-04-17 05:13:18', '2017-04-20 05:29:55'),
(1060, 'Hit Color', '<p>Широкий спектр полиграфических услуг. Вся фотосувенирная продукция, пригласительные и открытки по индивидуальным заказам на казахском, русском и английском языках! Визитки, флаеры, сертификаты, буклеты и многое другое. Современное оборудование, лучшие дизайнеры, разумные цены!</p>', '0', 0, 2, 13, 2, 952, 3, NULL, '2017-04-17 05:14:20', '2017-04-20 05:30:02'),
(1061, 'Каршыга Ильанов', '', '0', 0, 2, 3, 2, 953, 3, NULL, '2017-04-17 05:20:59', '2017-04-17 05:20:59'),
(1062, 'Кенес Сейтхан', '<p>МОЛОДОЙ ПЕВЕЦ, МУЗЫКАНТ, КОМПОЗИТОР И АРТИСТ КАЗАХСТАНСКОЙ ЭСТРАДЫ!</p>', '0', 0, 2, 3, 2, 954, 3, NULL, '2017-04-17 05:23:12', '2017-04-20 05:30:12'),
(1063, 'РУСТАМ ҚОЖАҒҰЛ ', '<p>Қазақстан эстрадасының жас жұлдызы!</p>', '0', 0, 2, 3, 2, 955, 3, NULL, '2017-04-17 05:24:34', '2017-04-20 05:30:17'),
(1064, 'Салон красоты ART', '', '0', 0, 2, 9, 2, 956, 3, NULL, '2017-04-17 05:52:14', '2017-04-17 05:52:14'),
(1065, 'Арина и Валентин', '<p>ПРЕДЛАГАЕМ СЛЕДУЮЩИЙ СПЕКТР ФОТОУСЛУГ:</p>\r\n<p>- Свадебная фото съемка</p>\r\n<p>- Love Story</p>\r\n<p>- Фотосъемка Дней рождения</p>\r\n<p>- Корпоративная фотосъемка праздников</p>\r\n<p>- Фотосъемка детей</p>\r\n<p>- Разработка фотокниг</p>', '0', 0, 2, 14, 2, 957, 3, NULL, '2017-04-17 06:35:18', '2017-04-20 05:30:55'),
(1066, 'Даурен Кошербаев', '', '0', 0, 2, 14, 2, 958, 3, NULL, '2017-04-17 06:36:47', '2017-04-17 06:36:47'),
(1067, 'Ерлан Кенжегалиев', '', '0', 0, 2, 14, 2, 959, 3, NULL, '2017-04-17 06:38:47', '2017-04-17 06:38:47'),
(1068, 'Ернар Газизбеков', '<p>Красивые и креативные фотографии.</p>', '0', 0, 2, 14, 2, 960, 3, NULL, '2017-04-17 06:40:18', '2017-04-20 05:32:21'),
(1069, 'Закиров Ерболат', 'Имел опыт работы на «Love Radio», телевизионные проекты,  диктор, участник проекта на 1 канале «Евразия» — «Лучший город KZ 2», участник проекта «X-factor», резидент лучших развлекательных заведений города.  Опыт работы в индустрии развлечений 5 лет! 3 подхода к мероприятию, прочитав которые вам будет легче осуществить свой выбор: 1. Демократичный. Задача задействовать большую часть гостей, никого при том, не вытягивая за руку на конкурсы. Для этого проводятся, интерактивные и визуальные игры, в которых задействованы не только участники, но и зрители конкурса. 2. Инновационный. Задача заинтересовать гостей мероприятия пробовать новые развлечения. Для этого используются проекционное оборудование, программные приложения, измерительные приборы и современные гаджеты. 3. Развлекательный. Импровизация и легкий юмор, который не выходит из рамки приличия делают программу мероприятия живой и естественной. Прямое общение с залом и постоянная обратная связь гостей позволяют ведущему чувствовать и контролировать мероприятие. Примечания: осуществляю работу с личным звукооператором.', '0', 0, 2, 4, 2, 961, 4, NULL, '2017-04-18 03:10:08', '2017-04-18 03:10:08'),
(1070, 'Инга Тайлер', 'Инга Тайлер — свадьбы, юбилеи, дни рождения. Проведение свадьбы с музыкальным сопровождением.', '0', 0, 2, 4, 2, 962, 4, NULL, '2017-04-18 03:12:57', '2017-04-18 03:12:57'),
(1071, 'Роман Абсалямов', 'Мой опыт работы заключает в себя огромный опыт работы. Свои сильные стороны я охарактеризовал бы с сильной стороны!', '0', 0, 2, 4, 2, 963, 4, NULL, '2017-04-18 03:21:08', '2017-04-18 03:21:08'),
(1072, 'МММSTUDIO', '<p>МММSTUDIO Нурдаулета Абикеева</p>\r\n<p>Услуги:</p>\r\n<p>&diams; съемка по сценарию;</p>\r\n<p>&diams; съемки свадеб, корпоративов, мероприятий;</p>\r\n<p>&diams; Love Story (История Любви)</p>\r\n<p>&diams; изготовление постановочных роликов;</p>\r\n<p>&diams; видеосъемка рекламы;</p>', '0', 0, 2, 5, 2, 964, 4, NULL, '2017-04-18 03:44:17', '2017-04-18 23:02:30'),
(1073, 'Gabit Kyraubaev', '', '0', 0, 2, 14, 2, 965, 4, NULL, '2017-04-18 03:46:42', '2017-04-18 03:46:42'),
(1074, 'Александр Дорохов', '', '0', 0, 2, 14, 2, 966, 4, NULL, '2017-04-18 03:48:15', '2017-04-18 03:48:15'),
(1075, 'Артем Цыганов', 'Привет! Меня зовут Артём и я фотограф любящий естественный свет, искренние эмоции.\r\nЯ живу в центральном Казахстане, в основном в Караганде, но это не мешает мне выезжать так же и в другие города, страны снимать свадьбы.\r\nЯ люблю естественный свет, атмосферные живые и в тоже время простые, воздушные и лёгкие картины. И в моих работах, я придерживаюсь этих правил.\r\nСнимаю портреты и свадьбы в стиле Fine Art и работаю как с плёнкой, так и с цифрой.\r\nЯ отдаю предпочтение свадьбам европейского образца с уютными сборами невесты в гостинице, красивыми трогательными выездными регистрациями, флористикой и изысканным декором, подчёркивающим индивидуальность каждой пары.\r\nДля меня очень важно, чтобы наше видение красивой свадьбы совпадало и вы могли полностью довериться мне в создании снимков. Для меня честь видеть свои работы в российских и зарубежных свадебных изданиях, таких как: Wedding, Wedding Vibes,\r\nMagnolia Rouge, Wedding Sparrow, Belle Lumiere, Belles & Bubbles, Bridal Musings, Wedding Chicks, Burnetts Boards, Trendy Bride, Weddywood.', '0', 0, 2, 14, 2, 967, 4, NULL, '2017-04-18 03:50:28', '2017-04-18 03:50:28'),
(1076, 'Вадим Константинов', 'Здравствуйте! Меня зовут Вадим. Снимаю свадьбы и кыз узату. Работаю один, либо в паре с женой. Буду рад стать человеком, от которого зависит качественная история Вашего самого главного дня.', '0', 0, 2, 14, 2, 968, 4, NULL, '2017-04-18 03:52:39', '2017-04-18 03:52:39'),
(1077, 'Ильмира Баратова', 'Съемка свадебного дня, съемка Love Story, фотосессии в интерьерной студии,  изготовление фотокниг. Срок сдачи готового материала 3 недели. Я помогу Вам сохранить воспоминания об этом чудесном дне!', '0', 0, 2, 14, 2, 969, 4, NULL, '2017-04-18 03:55:01', '2017-04-18 03:55:01'),
(1078, 'Азамат Кенжегулов', '', '0', 0, 2, 14, 2, 970, 4, NULL, '2017-04-18 03:56:38', '2017-04-18 03:56:38'),
(1079, 'Марина Дёмина', '', '0', 0, 2, 14, 2, 971, 4, NULL, '2017-04-18 04:04:59', '2017-04-18 04:04:59'),
(1080, 'Татьяна Баринова', 'Свадьба – это, пожалуй, самое красочное событие в жизни любой супружеской пары, а свадебные фото становятся воспоминаниями о самом ярком, самом торжественном дне в жизни молодых людей, который останется позади и уже никогда не вернется, и по этой причине профессиональный свадебный фотограф будет очень кстати! Love Story – это история ваших взаимоотношений до свадьбы, которую вы, если хотите, можете продемонстрировать на свадьбе гостям (при наличии экрана). Жених и невеста выбирают место для фотосъёмки, это может быть парк, дом отдыха, красивые архитектурные сооружения, словом всё, на фоне чего вы хотели бы себя видеть. Воспринимать фотосессию лучше как прогулку, чтобы легче было свободно выражать свои чувства и позировать перед камерой.\r\nОбычно на LOVE STORY уходит 1,5-2 часа.\r\nМолодожёны получают DVD диск с фотографиями после обработки и коррекции всего материала.', '0', 0, 2, 14, 2, 972, 4, NULL, '2017-04-18 04:06:57', '2017-04-18 04:06:57'),
(1081, 'Юлия Королева', '', '0', 0, 2, 14, 2, 973, 4, NULL, '2017-04-18 04:08:24', '2017-04-18 04:08:24'),
(1082, 'Гүлнар Жолдасбаева', '', '0', 0, 2, 3, 2, 974, 4, NULL, '2017-04-18 04:26:01', '2017-04-18 04:26:01'),
(1083, 'Дегдар  Жолдасбай', '', '0', 0, 2, 3, 2, 975, 4, NULL, '2017-04-18 04:29:34', '2017-04-18 04:29:34'),
(1084, 'Ерасыл  Абдуалиев', 'Эстрадалық әнші, \"Бастау\" тобының мүшесі.', '0', 0, 2, 3, 2, 976, 4, NULL, '2017-04-18 04:33:55', '2017-04-18 04:33:55'),
(1085, 'Асканбай Уливхан', '<p>В жизни нельзя ошибаться в трёх случаях: при выборе профессий, при выборе спутника жизни и при выборе ведущего на свадьбу!</p>\r\n<p>Прошло время скучных и нудных тамадистов, пришло время креативных и молодых ведущих.</p>\r\n<p>Наша команда делает торжество необычным, оригинальным, полным позитива и в то же время красивым в рамках наших традиций.</p>\r\n<p>Мы относимся к каждому торжеству с максимальной ответственностью, расписывая сценарий на весь возрастной контингент.</p>', '0', 0, 2, 4, 2, 978, 3, NULL, '2017-04-18 05:13:55', '2017-04-18 08:11:59'),
(1086, 'Ерғали  Махинұр  Талғатқызы', 'Ерғали Махинұр Талғатқызы- мұнай саласының қызметкері. Ән айтуды 9 жасымнан бастадым. Тыңдаушының талғамына сай әуеленген әндерді әрқашан халыққа жолдауға дайынмын. Мерекені ашатын қазақ тіліндегі қазіргі заманға сай әндер мен 80-жылдардың әндері сіздерге жол тартады.', '0', 0, 2, 3, 2, 977, 4, NULL, '2017-04-18 05:14:55', '2017-04-18 05:14:55'),
(1087, 'Image-studio ', '<p>Хотите сделать ваш праздник лучше! Тогда вам к нам. Image-studio предоставляет следующие виды услуг: профессиональная фото и видео съёмка всех видов торжеств с использованием стедикама, слайдера, и аэросьемки. Съёмка ваших мероприятий на несколько камер с качественным звуком. Изготовления рекламных роликов и презентаций. Разработка сценариев по желанию заказчика. Съмка LOVE STORY и показ на большом экране. Современный и креативный монтаж. Стаж работы 15 лет.</p>', '0', 0, 2, 5, 2, 979, 3, NULL, '2017-04-18 05:17:43', '2017-04-18 05:17:43'),
(1088, 'Rich Films', '<p>Создание презентационных и имиджевых фильмов, рекламных роликов и музыкальных клипов.</p>', '0', 0, 2, 5, 2, 980, 3, NULL, '2017-04-18 05:19:44', '2017-04-18 05:19:44'),
