(1090, 'Жазира Фариза  Ретбайқыздары', '<p>Жанры: Эстрада</p>\r\n<p>Ән шырқайтындарына 5 жылдан астам уақыт болды, Маңғыстау обл. филармония әншілері.</p>', '0', 0, 2, 3, 2, 982, 4, NULL, '2017-04-18 05:59:58', '2017-04-21 02:34:31'),
