(1095, 'Мануель  Каллучи', '<p>Вокальные данные</p>\r\n<p>Диапазон: 3.5 октавы&nbsp;</p>\r\n<p>Тембр голоса: Тенор-баритон</p>\r\n<p>Музыкальное направление: Эстрадно-Джазовое, Соул, Блюз, Ритм-блюз, Поп, Хип-хоп</p>\r\n<p>Участник и лауреат международных конкурсов.</p>', '0', 0, 2, 3, 2, 986, 4, NULL, '2017-04-18 06:14:34', '2017-04-21 02:35:02'),
