(1099, 'Сұңғат  Баймұратұлы', '<p>Маңғыстау өнер колледжінде білім алған, Филармонияда қызмет етеді.</p>', '0', 0, 2, 3, 2, 991, 4, NULL, '2017-04-18 06:25:18', '2017-04-21 02:35:18'),
(1100, 'Азамат  Демисинов', '<p>Асаба, шоумен (қазақша)7</p>\r\n<p>5 жылдық тәжірибесі бар асаба.</p>\r\n<p>Жоғары деңгейде өтуіне 100% кепілдік беремін.</p>\r\n<p>Шоу программа, жаңа ойындар, жаңа сценариймен жүргіземін.</p>', '0', 0, 2, 4, 2, 992, 4, NULL, '2017-04-18 06:28:13', '2017-04-21 02:35:44'),
(1101, 'Айдар  Каримбаев', '<p>Работает 15 лет в сфере эвента, ведет на двух языках, имеются авторские игры и конкурсы. Прошел тренинги в Москве.</p>\r\n<p>Если проведенное мною торжество вам не понравится, Вы можете не оплачивать мои услуги!!!</p>', '0', 0, 2, 4, 2, 993, 4, NULL, '2017-04-18 06:30:56', '2017-04-18 06:30:56'),
(1102, 'Айладыр  Ораз', '<p>Шоумэн, тоймэн, қазақи асаба тойларыңызды керемет қылып өткізуге дайын.</p>', '0', 0, 2, 4, 2, 994, 4, NULL, '2017-04-18 06:33:17', '2017-04-18 06:33:17'),
(1103, 'Алқуат  Насихаұлы', '<p>Знакомьтесь, Насухаулы Алькуат.</p>\r\n<p>Тип: Азиатский</p>\r\n<p>Характер: Веселый и энергичный</p>\r\n<p>Языки: Казахский и русский</p>\r\n<p>Специализация: Актер,сценарист, шоумэн, игрок команды КВН \"Мартини с бешбармаком\", участник телевизионного проекта \"Наша Казаша\" на телеканале КТК.</p>\r\n<p>Опыт: 587 проведенных мероприятий. из них 70 юбилеев, 258 свадеб, 135 корпоративных вечеров, 45 тимбилдингов и 79 клубных вечеринок.</p>\r\n<p>Обладает методом гипноза, может подчинить себе толпу людей. Знает что такое корпоративная культура, как работать в компании и создавать комфортный климат, а так же как работать с людьми.</p>\r\n<p>Всегда при себе: табельный микрофон и позитивное настроение.</p>\r\n<p>Однажды он придет и сделает ваш праздник лучшим.</p>\r\n<p>Осторожнее! Он вооружен и особо позитивен!</p>', '0', 0, 2, 4, 2, 995, 4, NULL, '2017-04-18 06:37:42', '2017-04-18 06:37:42'),
(1104, 'Амандык Алипбай', '<p>15 жылдық тәжірибесі бар, авторлық ойындары мен әзілдері бар қазақи асаба.</p>', '0', 0, 2, 4, 2, 996, 4, NULL, '2017-04-18 06:40:55', '2017-04-21 02:36:52'),
(1105, 'Асанали', '<p>Маңғыстау менің киелі мекен тұрағым,</p>\r\n<p>Арқауы болған Кашаған,</p>\r\n<p>Сүгір жыр әннің.</p>\r\n<p>Мойныңа алқа тағып алғыстардан,</p>\r\n<p>Жүлде алып Өнер атты сайыстардан.</p>\r\n<p>Шығады талай ғылым өнерпаздар,</p>\r\n<p>Киелі шежірелі Маңғыстаудан.</p>\r\n<p>Каспийдің толқын атқан жағасында,</p>\r\n<p>Сыланған ақ мармардай АҚТАУ атты қаласында,</p>\r\n<p>Тойлар болса шабыттанып шырқалатын,</p>\r\n<p>Шақырсаңыз тойларыңа Асаба боп баратұғын,</p>\r\n<p>Көзі сығырайған, Ақтаулық Асаба Асанәлi ұлдарың мен болам!!!</p>', '0', 0, 2, 4, 2, 997, 4, NULL, '2017-04-18 06:44:22', '2017-04-18 06:44:22'),
(1106, 'Ғалымжан  Жолдасбай', '<p>Дәстүрлі әнші. Құрманғызы атындағы батыс жыр мектебін бітірген. Жігітке жеті өнер аз дегендей, асабалық та қызметі бар.</p>', '0', 0, 2, 4, 2, 998, 4, NULL, '2017-04-18 06:46:51', '2017-04-21 02:37:17'),
(1107, 'Даулет  Сағынтаев', '<p>Тойыңызды мəнді, сəнді əзілмен жүргізетін 5 жылдық тәжірибесі бар асаба. \"Барыстар\" КВН командасының капитаны.</p>', '0', 0, 2, 4, 2, 999, 4, NULL, '2017-04-18 06:48:56', '2017-04-21 02:37:34'),
(1108, 'Дүйсенов  Сәуіржан', '<p>Өнер жолы еңбегіміз атқаратын!</p>\r\n<p>Өнеріміз елге айтып мақтанатын!</p>\r\n<p>Өнеріміз жаныңызга жатталатын,</p>\r\n<p>Өнеріміз өшпей мәңгі сақталатын!</p>\r\n<p>Өнеріміз тойды тойға жалғап тұрар,</p>\r\n<p>Асаба боп барлық тойды басқаратын!</p>', '0', 0, 2, 4, 2, 1000, 4, NULL, '2017-04-18 06:51:11', '2017-04-18 06:51:11'),
(1109, 'Ержан  Бектұрған', '<p>Дәстүрлі асаба!</p>', '0', 0, 2, 4, 2, 1001, 4, NULL, '2017-04-18 06:58:53', '2017-04-18 06:58:53'),
(1110, 'Кайыржан -  Диляра', '<p>Сiздердiң кұрметтерiңiзге отбасылық жұп - Қайыржан мен Диляра барлық той түрлерiн ұйымдастырып, жоғарғы деңгейде өтуiне ат салысады. Қазақ, орыс керек десеңiз ағылшын тiлдерiнде мерекелiк ic шараларды жүргiзедi. Әу демейтiн қазақ жок демекшi, ән шырқайтындары тағы бар. Ал ең басты мақсатымыз қазақтың салт-дәстүрiн дәрiптеп, жаңаша үлгi де жаңғыртып, халыққа, жас ұрпаққа үлгі болу.</p>', '0', 0, 2, 4, 2, 1002, 4, NULL, '2017-04-18 07:02:19', '2017-04-18 07:02:19'),
(1111, 'Мереке  Жантілеуов', '<p>Асаба, домбырашы.</p>', '0', 0, 2, 4, 2, 1003, 4, NULL, '2017-04-18 07:15:00', '2017-04-18 07:15:00'),
(1114, 'ELITE VIDEO PRO', '<p>Elite video pro: Мы занимаемся производством видео-фотосъемки премиум-класса. Наша сплоченная дружная команда является лучшей в Казахстане. 22 года на рынке услуг.</p>\r\n<p>Elite video pro: Используем самое последнее оборудование такие как, кинокамеры Canon c100, фотокамера Canon 5Ds, аэросъемка (Dji Phantom 4) , операторский кран (от 3-х до 12 метров), системы стабилизации Dji Ronin. Все операторы профессионалы прошедшие обучение в главном офисе в Алматы.</p>', '0', 0, 2, 14, 2, 1006, 4, NULL, '2017-04-19 03:45:04', '2017-04-21 02:38:43'),
(1115, 'Ангелина Недюжина', '<p>Проводит мероприятия любой сложности, стаж более 20 лет.</p>', '0', 0, 2, 4, 2, 1007, 3, NULL, '2017-04-19 04:05:10', '2017-04-19 04:05:10'),
(1116, 'Ануар Абуталип', '<p>Ведущий с многолетним опытом. Проведение любого мероприятия на казахском языке.</p>', '0', 0, 2, 4, 2, 1008, 3, NULL, '2017-04-19 04:09:16', '2017-04-19 04:09:16'),
(1117, 'Асланбек Иманалин', '<p>Ведет на казахском языке, певец, пианист.</p>', '0', 0, 2, 4, 2, 1009, 3, NULL, '2017-04-19 04:15:08', '2017-04-19 04:15:08'),
(1118, 'Гульнара Сактаганкызы', '<p>В сфере проведения торжеств 12 лет. Профессиональная ведущая и вокалистка.</p>', '0', 0, 2, 4, 2, 1010, 3, NULL, '2017-04-19 04:18:08', '2017-04-19 04:18:08'),
(1119, 'Дархан Рахымжан', '<p>Тележүргізуші, облыстық деңгейдегі салтанатты жиындар мен мерекелік кештер жүргізушісі, той асабасы. Әдептілік пен мәдениеттілікті сақтай отырып, түрлі қызықты ойын-конкурстармен той-қуанышыңызды жоғары деңгейде жүргізеді. Той-мерекені қазақ тілінде немесе қуаныш иесінің қалауына қарай әріптесімен бірге орыс тілдерінде жүргізеді.</p>\r\n<p>Телеведущий, ведущий различных мероприятий, корпоративов и частных вечеринок. Лицо телеканала &laquo;Казахстан &mdash; Актобе&raquo;, в прошлом &mdash; редактор тематических программ на республиканских каналах &laquo;Таң ТВ&raquo; и &laquo;НТК&raquo;. Языки проведения: казахский, русский ( с очаровательной соведущей&nbsp;). Его программа включает в себя веселые игры, интересные конкурсы и массу положительных эмоций. Дархан и его очаровательная соведущая создадут атмосферу праздника и превратят ваш вечер в яркое шоу.</p>', '0', 0, 2, 4, 2, 1011, 3, NULL, '2017-04-19 04:21:07', '2017-04-19 04:21:07'),
(1120, 'Даурен Жубаназар', '<p>Ведет мероприятия на казахском языке.</p>', '0', 0, 2, 4, 2, 1012, 3, NULL, '2017-04-19 04:23:10', '2017-04-19 04:23:10'),
(1121, 'Ержан Байкараев ', '<p>Қазақ өнеріндегі сөз өнерінің майталманы ақын, сазгер Шынберген Сулейменовтың ұлы&nbsp;асаба.</p>\r\n<p>Музыкант + аппаратура + асаба .</p>', '0', 0, 2, 4, 2, 1013, 3, NULL, '2017-04-19 04:25:57', '2017-04-19 04:25:57'),
(1122, 'Ербол Есендосов ', '<p>Актер театра и кино, заслуженный деятель РК, тамада, шоумен из города Уральск.</p>', '0', 0, 2, 4, 2, 1014, 3, NULL, '2017-04-19 04:27:51', '2017-04-19 04:27:51'),
(1123, 'Есет Каниев', '<p>Сіздің той &mdash; қуанышыңыздың шырайын шығарып, көркін келтіретін асаба.</p>', '0', 0, 2, 4, 2, 1015, 3, NULL, '2017-04-19 04:29:42', '2017-04-19 04:29:42'),
(1124, 'Исмаилов Мустахим', '<p>Жас буын асаба.<br />Музыкант + видео + фото + аппаратура.</p>', '0', 0, 2, 4, 2, 1016, 3, NULL, '2017-04-19 04:31:38', '2017-04-19 04:31:38'),
(1125, 'Рамазан Джалбиров', '<p>Парень в сияющих доспехах позитива. Если бы Рамазан Джалбиров жил в средневековье, то однозначно сумел бы расмешить любую Царевну-Несмеяну. А все потому что, Рамазан с рождения практикует юмор везде, где бы ни оказался &ndash; и в Астане он как раз представляет ту группу ведущих, что заставят вас смеяться до слез и радоваться как ребенок. Ведущий, который проводит мероприятия как на государственном языке, таки на международном русском. Так же является резидентом школы Ведущих в г.Челябинск , г.Москва.</p>', '0', 0, 2, 4, 2, 586, 3, NULL, '2017-04-20 03:30:14', '2017-04-20 03:30:14'),
(1126, 'RIO limusine.kz', '<p>Алматинская компания &laquo;РиО&raquo; предоставляет на прокат любые VIP автомобили: свадебные лимузины,&nbsp; микроавтобусы повышенной комфортности, автомобили представительского класса с&nbsp; водителем.&nbsp;</p>\r\n<p>Наши авто сопровождают&nbsp; торжественные, праздничные и романтические события: свадьбы, юбилеи, дни рождения, встречи: деловые, из родильного дома, в аэропорту, частные и корпоративные праздники и просто прогулки по нашему прекрасному городу.</p>\r\n<p>&laquo;РиО&raquo; работает на рынке VIP услуг с 1999 года. Многолетний опыт позволяет работать с самыми притязательными клиентами. Девиз менеджеров компании &ndash; &laquo;безупречный сервис&raquo;. Каждый клиент получает максимум внимания.</p>\r\n<p>Мы примем заказ на прокат лимузина и поможем выбрать автомобиль, опираясь на Ваши предпочтения марки, цвета и конечно бюджет.</p>\r\n<p>Наши преимущества:</p>\r\n<ul>\r\n<li>все автомобили компании &laquo;РиО&raquo; - модели последних годов выпуска</li>\r\n<li>превосходная отделка автомобилей, безупречная чистота салонов</li>\r\n<li>забота о техническом состоянии парка - все автомобили и лимузины проходят ежедневный технический осмотр</li>\r\n<li>водители компании &ndash; профессионалы высшего класса, имеют многолетний опыт работы в сфере VIP-перевозок, прекрасно ориентируются в Алмате и Алматинской области</li>\r\n<li>единая униформа водителей кортежа&nbsp; формирует солидный и презентабельный образ</li>\r\n<li>автомобили комплектуются качественным шампанским и напитками, красивой посудой</li>\r\n</ul>\r\n<p>Мы готовы обсудить любые Ваши пожелания.</p>\r\n<p>Парк лимузинов:&nbsp; Lexus LX 570, Mercedes S 550 AMG, Hummer H2, Lexus LX 470 и Mercedes Benz&nbsp; Gelendewagen, Chrysler 300C, Porsche Cayenne, Range Rover, Lincoln Town Car, Rolls Royce и Bentley.</p>\r\n<p>Автомобили представительского класса: Mercedes Benz: S-класс, G- класс, E-класс, Lexus LX 570, Toyota LC 200, Lexus 470</p>\r\n<p>Микроавтобусы: Mercedes Benz Sprinter, Toyota Hiace</p>\r\n<p>Автобусы: Neoplan, Mercedes', '0', 0, 2, 2, 2, 1018, 3, NULL, '2017-04-20 23:03:07', '2017-04-20 23:07:06'),
(1127, 'Кыдырали Болманов және Каракат Абильдина', '<p>Еще в детстве Каракат проявила музыкальный и вокальный талант, благодаря чему получила приглашение в музыкальную школу для одаренных детей имени Куляш Байсеитовой. После школы Каракат отучилась в консерватории имени Курмангазы по классу народного пения, там же овладела домброй и гитарой. Кроме того, Каракат владеет многими народными инструментами.</p>\r\n<p>Қыдырәлі Нұртайұлы Болманов - қазақ тілді әнші, продюсер, бизнесмен, философия ғылымдарының докторы.</p>\r\n<p><a href=\"https://kk.wikipedia.org/w/index.php?title=%D0%90%D0%BB%D0%BC%D0%B0%D1%82%D1%8B_%D1%82%D0%B5%D0%B0%D1%82%D1%80-%D0%BA%D3%A9%D1%80%D0%BA%D0%B5%D0%BC%D3%A9%D0%BD%D0%B5%D1%80_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82%D1%8B&amp;action=edit&amp;redlink=1\">Алматы театр-көркемөнер институтын</a>&nbsp;бітірген (1991).</p>\r\n<p>1995 жылы &laquo;Айналайын&raquo; деп аталатын алғашқы жеке альбомын шығарған.</p>\r\n<p>1996 жылдан - &laquo;АБК&raquo; тобының негізін қалаушы, мүшесі және бас продюсері.</p>\r\n<p>2001 жылдан - &laquo;Гүлдер&raquo; ансамблінің көркемдік жетекшісі.</p>\r\n<p>2005 жылдың қаңтарынан 2007 жылдың қаңтарына дейін -&nbsp;<a href=\"https://kk.wikipedia.org/wiki/%D0%90%D0%BB%D0%BC%D0%B0%D1%82%D1%8B\">Алматы</a>&nbsp;қаласы Мәдениет департаментінің директоры.</p>\r\n<p>2008 жылдың сәуірінен -&nbsp;<a href=\"https://kk.wikipedia.org/wiki/%D0%90%D1%81%D1%82%D0%B0%D0%BD%D0%B0\">Астана</a>&nbsp;қаласы Мәдениет департаментінің директоры.</p>', '0', 0, 2, 3, 2, 1019, 3, NULL, '2017-04-20 23:28:45', '2017-04-20 23:28:45'),
(1128, 'Азамат Сатыбалды', '<p><strong>Азамат Сатыбалды&nbsp;</strong>- актер театра и кино, шоумен.</p>\r\n<p>Родился в 1977 году на станции Луговое&nbsp;Рыскуловского района Джамбульской области.&nbsp;</p>\r\n<p>Учился в Карагандинском суворовском училище.&nbsp;</p>\r\n<p>В 2005 году окончил КазНАИ им.&nbsp;Жургенова.&nbsp;</p>\r\n<p>Актер казахского академического театра им. Ауэзова.</p>\r\n<p>Работает на&nbsp;телевидении, ведет концерты и шоу-программы.</p>\r\n<p><strong>Роли в кино:</strong></p>\r\n<p>2013 - Парыз&nbsp;(Казахстан) -&nbsp;Нартай&nbsp;-&nbsp;главная роль.</p>\r\n<p>2012 - Одноклассники&nbsp;(сериал, Казахстан) -&nbsp;Даулет Егоров&nbsp;-&nbsp;главная роль.</p>\r\n<p>2011 - К вам едет доктор Ахметова&nbsp;|&nbsp;Дәрігер Ахметова&nbsp;(сериал, Казахстан) -&nbsp;врач Ринат.</p>\r\n<p>2001-2003 - Саранча&nbsp;(сериал, Казахстан) -&nbsp;Ерлан.</p>', '0', 0, 2, 4, 2, 1020, 3, NULL, '2017-04-20 23:36:39', '2017-04-21 00:09:39'),
(1129, 'Аккенже Алимжан', '<p>Родилась в Алматы.&nbsp;Имеет музыкальное образование. Получила высшее образование по специальности актриса театра и кино и степень магистра искусств (M.A. in Performing Arts) в Казахской Национальной Академии Искусств им. Т. Жургенова.&nbsp;<br /> Прошла обучение в США, где получила степень магистра наук в управлении коммуникативными системами (M.S. in Communications), а также прошла практику в США, Hollywood Studios, ABC TV (Лос Анжелес).&nbsp;<br /> В совершенстве владеет родным казахским, русским и английским языками. Также говорит на испанском и турецком. Увлекается - кунг фу, плаванием, фигурным катанием. С детства занимается вокалом и танцами.&nbsp;<br /> Лауреат нескольких республиканских и международных театральных фестивалей, конкурса исполнительского искусства.&nbsp;<br /> Ведет утреннее шоу \"Іске сәт\" на телеканале \"Хабар\".&nbsp;<br /> В 2011 году выпустила свой дебютный музыкальный клип на песню \"Лаула\".</p>', '0', 0, 2, 4, 2, 1021, 3, NULL, '2017-04-21 00:05:32', '2017-04-21 00:09:51'),
(1130, 'Нурлан Албан', '<p>Казахстанский певец, общественный деятель, преподаватель. Родился в селе Сарыбастау Райымбекского района Алматинской области. Учился в школе-интернате для одаренных детей города Алматы. В 1993 году поступил в театральный институт имени Т. Жургенова. Будучи студентом работал в ТЮЗ-е имени Г.Мусурепова. В 1999 году стал дипломантом конкурса молодых исполнителей &laquo;Жас канат&raquo;. Свой первый сольный концерт организовал в 2000 году во Дворце студентов в Алматы. В 2001 году стал солистом этногруппы &laquo;Уркер&raquo; и в этом коллективе проработал ровно 10 лет. В 2010 году выпустил два альбома и снял два видеоклипа на песни &laquo;Қарттарым, аман саумысың&raquo; и &laquo;Сәлем, Қазақстан&raquo;.</p>\r\n<p>Нурлан хочет поддержать и других исполнителей.. Поэтому в 2006 году создал продюсерский центр &laquo;Нурсай&raquo;. Благодаря новому центру такие проекты как &laquo;Ару-Ана&raquo; группа из пенсионерок, этногруппа &laquo;АРТ-Дала&raquo;, Шәбә Әденқұлқызы, Лашын Мұратқызы, группа &laquo;Аршын&raquo; стали более узнаваемыми и стали чаще выступать по телевидению. Кроме этого, Нурлан активный участник всяких благотворительных мероприятий. Каждый год выступает в детских домах города Алматы.</p>\r\n<p>Сейчас Нурлан Албан преподает в эстрадно-цирковом колледже имени Ж.Елебекова по специальности актерское мастерство и заведует кафедрой Казахского национального аграрного университета.</p>', '0', 0, 2, 4, 2, 1022, 3, NULL, '2017-04-21 00:09:07', '2017-04-21 00:10:47'),
(1131, 'Rainbow studio', '<p>Наша компания предлагает вам не только запечатлеть момент созидания вашей любви, мы хотим стать частью истории семьи. Свадьба, выписка с роддома, первые шаги и первые слова. Мы создаем серию эпизодов о вашей семье, запечатлеем все радостные моменты и волнения.</p>\r\n<p>Мы не стоим на месте, перенимаем опыт коллег как с ближнего так из дальнего зарубежья, находим что-то современное и креативное: новые технологии, новые тенденции.</p>', '0', 0, 2, 5, 2, 1023, 3, NULL, '2017-04-21 00:23:18', '2017-04-21 00:23:18'),
(1132, 'Ерасыл Адильбеков', '<p>Талантливый домбрист и истинный виртуоз. Ерасыл станет изюминкой вашего мероприятия, и оставит вас надолго с хорошими впечатлениями! Вы ещё не полностью оценили возможности домбры, так что Ерасыл поможет ознакомиться со всеми секретами этого уникального инструмента! Секрет в том, что он умеет работать с публикой и у него сильный эмоциональный заряд, что очень важно и главное для любого артиста!</p>\r\n<p>Регалии:</p>\r\n<ul>\r\n<li>Обладатель Гран-при на международном конкурсе Magia Italiana (Италия),</li>\r\n<li>Обладатель премии \"самый лучший исполнитель\" на международном фестивале Buen Viage(Испания),</li>\r\n<li>Обладатель 1-го место в республиканском конкурсе профессиональных домбристов имени Мурата Ускенбаева,</li>\r\n<li>Лауреат международного фестиваля Өз-елім имени Нургиссы Тлендиева,</li>\r\n<li>Обладатель золотого медаля на республиканском конкурсе \"Дельфийские игры\".</li>\r\n</ul>\r\n<p>Репертуар:</p>\r\n<p>В сопровождении аранжировки.</p>\r\n<p>1.Белес(стиль deep house)</p>\r\n<p>2.Той куй( стиль club, electro hous)</p>\r\n<p>3.Интернациональное попурри(казахская, таджикская, узбекская, сербская, русская пляска)</p>\r\n<p>5.Фламенко(испанская)</p>\r\n<p>6.Казаские песни(танцевальная)</p>\r\n<p>В живую:</p>\r\n<ol>\r\n<li>Курмангазы - Адай, Балбырауын, Сарыарка, Байжума, терискакпайи.т.д.</li>\r\n<li>Даулеткерей - Короглы</li>\r\n<li>Нургисса Тлендиев - Алкисса, Баламишка, Акку, Арман, Ата-толгауы</li>\r\n<li>Дина - Байжума, Науыскы, Бул-бул</li>\r\n<li>Туркеш - Конил Ашар, Байжума</li>\r\n<li>Сейтек - торы ат</li>\r\n<li>Есбай - богелек, терискакпай</li>\r\n<li>Кулшар - кербез керик, жанылтпаш</li>\r\n</ol>', '0', 0, 2, 6, 2, 1024, 3, NULL, '2017-04-21 01:04:59', '2017-04-21 01:28:23'),
(1133, 'Фольклорный ансамбль \"ƏЛҚИССА\"', '<p>Фольклорно-инструментальный ансамбль \"ƏЛҚИССА\" основан более 15 лет на базе Казахконцерта. Ансамбль является лауреатом международных конкурсов и фестивалей, мы имели честь выступать на сценах таких стран как: Япония, Корея, Китай, Испания, Египет, Турция и Франция. Наш богатый и интересный репертуар оставит вас и ваших гостей довольными.</p>', '0', 0, 2, 6, 2, 1025, 3, NULL, '2017-04-21 01:54:00', '2017-04-21 01:54:00'),
(1134, 'Sweets Almaty', '<p><strong>Кондитерская \"Sweets Almaty\".&nbsp;</strong></p>\r\n<p>Торты, десерты, шоколад, candy bar\'s.&nbsp;</p>', '0', 0, 2, 16, 2, 1026, 3, NULL, '2017-04-21 07:14:33', '2017-04-21 07:14:33'),
(1135, 'FARABI HALL', '<p>1 зал &ndash; 200 мест</p>', '0', 0, 2, 8, 2, 1027, 3, NULL, '2017-04-22 02:17:15', '2017-04-22 02:24:18'),
(1136, 'Holiday Inn', '<p style=\"background: white;\"><span style=\"font-family: \'Calibri\',\'sans-serif\'; color: black;\">Прошу принять во внимание, что так же имеется спец пакеты которые дают возможность нашим гостям дополнять меню.</span></p>\r\n<p style=\"background: white;\"><span style=\"font-family: \'Calibri\',\'sans-serif\'; color: black;\">Наш Отель будет рад найти индивидуальный подход к каждому гостю от создания меню до подбора цветов и дизайна.</span></p>\r\n<p style=\"background: white;\"><span style=\"font-family: \'Calibri\',\'sans-serif\'; color: black;\">Так же проведя Свадьбу, Кыз Узату в нашем отеле вы можете планировать свой вечер в Бесплатно предоставленном номере Полу Люкс. Фруктовая нарезка и бутылка шампанского украсят праздничный вечер молодоженов.</span></p>', '0', 0, 2, 8, 2, 1028, 3, NULL, '2017-04-22 02:21:59', '2017-04-22 02:21:59'),
(1137, 'Абай Бегей', '<p>Певец эстрады Казахстана. Самая знаменитая песня, под которую все с радостью танцуют - Аспанга қараймын.</p>\r\n<p>&nbsp;</p>', '0', 0, 2, 3, 2, 1029, 4, NULL, '2017-04-22 02:27:33', '2017-04-22 02:28:46'),
(1138, 'Абдулкарим Каримов', '<p>Казахстанский эстрадный певец, финалист музыкального проекта &laquo;<span style=\"color: #000000;\"><a style=\"color: #000000;\" href=\"https://ru.wikipedia.org/wiki/X_Factor_(%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD)\">X Factor</a></span>&raquo;.</p>', '0', 0, 2, 3, 2, 1031, 4, NULL, '2017-04-22 02:33:36', '2017-04-22 02:33:36'),
(1139, 'Адлет Женис', '<p>Веселые и необычные выступления Адлета подарят Вам взрыв эмоций: Вы &nbsp;окунетесь в атмосферу романтики и безудержного веселья.</p>\r\n<p>Его красивый тембр голоса, &nbsp;оригинальная манера исполнения, разнообразный репертуар и высокий профессионализм не оставит Вас и Ваших гостей равнодушными.<br /> </p>\r\n<p><br />&nbsp;</p>\r\n<p><br />&nbsp;</p>', '0', 0, 2, 3, 2, 1032, 4, NULL, '2017-04-22 02:39:51', '2017-04-22 02:39:51'),
(1140, 'Айгуль Иманбаева', '<p>Айгуль Иманбаева&nbsp;- актриса, певица, журналистка, телеведущая.</p>\r\n<p>Карьеру в эстраде начала в 1999 году.&nbsp;Сняла 8 видеоклипов. В 2006 году провела первый сольный отчетный концерт под названием &laquo;Таңғы елес&raquo;. Снялись видеоклипы на песни: &laquo;Жаным&raquo;, &laquo;Махаббат мұңы&raquo;, &laquo;Таңғы елес 1&raquo;, &laquo;Мен ғашық өмір&raquo;, &laquo;Үмітім менің&raquo;, &laquo;Шарайна&raquo;, &laquo;Әдемі қыз&raquo;, &laquo;Таңғы елес 2&raquo;.</p>', '0', 0, 2, 3, 2, 1033, 4, NULL, '2017-04-22 02:42:46', '2017-04-22 02:42:46'),
(1141, 'Айқын', '<p><strong>Айкын</strong>&nbsp;- молодой исполнитель. Впервые он засветился на экранах в качестве финалиста первого мегапроекта &laquo;Superstar.kz&raquo;. Когда он по итогам голосования выбыл из числа претендентов на победу, жюри было в недоумении, а поклонницы певца устроили настоящий митинг в его защиту. Айкын Толепберген представлял Казахстан на конкурсе молодых исполнителей<strong>&nbsp;</strong><strong>&laquo;Новая волна 2006&raquo;</strong>. Из пяти тысяч претендентов на право представлять свою страну в Москве на полуфинале конкурса выбрали только 80 человек, 6 из них &ndash; казахстанцы.&nbsp;</p>', '0', 0, 2, 3, 2, 1034, 4, NULL, '2017-04-22 02:46:19', '2017-04-22 02:46:19'),
(1142, 'Акылбек Жеменей', '<p>Объявлять песни Акылбека Жеменея как потенциальные хиты не логично, так как каждая его песня становится ярким и абсолютным хитом практический сразу после выхода из студии. На ивент рынке страны Акылбек уже давно пользуется стабильным спросом и постоянно поддерживает интерес к своему творчеству со стороны многочисленных клиентов и поклонников. Появление Акылбека на вашем мероприятии однозначно станет приятным и запоминающимся сюрпризом для всех гостей.<br /> </p>', '0', 0, 2, 3, 2, 1035, 4, NULL, '2017-04-22 02:48:56', '2017-04-22 02:48:56'),
(1143, 'Салон \"London\"', '<p>В салоне красоты \"London\" предоставляют первоклассное обслуживание для своих клиентов. В салоне вас ждет большой выбор услуг для красоты волос и тела. Опытные косметологи помогут вам вновь засветиться от счастья.</p>\r\n<p>У мастера маникюра вам смогут сделать красивый маникюр. А если вы хотите нанести легкий макияж, главные специалисты по красоте всегда готовы помочь вам в создании образа.</p>\r\n<p>Часы работы с ежедневно: 10:00 - 20:00.</p>', '0', 0, 2, 9, 2, 1030, 3, NULL, '2017-04-22 02:49:09', '2017-04-22 02:49:09'),
(1144, 'Али Окапов', '<p>Казахский певец, сын народной артистки Советского Союза и Республики Казахстан Розы Рымбаевой и Таскына Окапова, знаменитого композитора, дирижера, художественного руководителя ансамбля &laquo;Гульдер&raquo;.</p>\r\n<p>Впервые Али появился на сцене в роли пианиста. До сих пор певец вспоминает концерт в летнем лагере, где ему пришлось надеть костюм шамана. В раннем возрасте Али не привлекала сцена или написание и исполнение песен и музыки. Но тот концерт дал толчок музыкальному развитию Окапова, после чего он пересмотрел свои взгляды на карьеру певца.&nbsp;</p>\r\n<p>Несколько раз Али Окапов занимал второе место на конкурсах (\"Дельфийские игры\" в Алматы и \"Алматы журегiмде\"). Одержал победу на конкурсе \"Актобе jazz\", пробился в финал \"Фабрики звезд KZ\". В его кармане уже лежат такие номинации как \"Дебют года\" по версии \"Саз алемi 2012\", \"Лучший дебют\" по версии \"EMA muzzone awards\", а еще его называют \"Самым завидным женихом\" по версии HIT TV.<br /> </p>', '0', 0, 2, 3, 2, 1036, 4, NULL, '2017-04-22 02:52:12', '2017-04-22 02:52:12'),
(1145, 'Алишер Каримов', '<p>В первый раз Алишер Каримов появился на сцене в возрасте пяти лет, исполнив композицию &laquo;Чайхана&raquo; на Республиканском конкурсе &laquo;Эншi балапан&raquo;, за что его наградили &laquo;Призом зрительских симпатий&raquo;.&nbsp;</p>\r\n<p>Алишер Каримов участвовал во многих интернациональных конкурсах и фестивалях за рубежом, в Турции, Болгарии, Франции.</p>\r\n<p>В 2005 году двери для Каримова открыл проект &laquo;Superstar.Kz&raquo;, по итогам которого молодой исполнитель занял второе место. Этот проект сделал Каримова звездой, и он быстро завоевал популярность зрителей.</p>', '0', 0, 2, 3, 2, 1037, 4, NULL, '2017-04-22 02:58:45', '2017-04-22 02:58:45'),
(1146, 'Алмас Кишкенбаев', '<p>Самая стабильная звезда на казахстанском небосклоне шоу бизнеса. Не было ещё ни одного выступления, где бы Алмас не исполнял совершенно новые песни. Неутомимый, постоянно развивающийся, и стабильно востребованный.<br /> </p>', '0', 0, 2, 3, 2, 1038, 4, NULL, '2017-04-22 03:01:52', '2017-04-22 03:01:52'),
(1147, 'Асхат Таргынов', '<p>Исполнитель прославленного хита &laquo;Мария - Магдалена&raquo; готов предстать перед Вашими гостями во всей своей эстрадной красе. Покорит не только своим громким синглом, но и всей широтой своего великолепного репертуара<br /> </p>', '0', 0, 2, 3, 2, 1039, 4, NULL, '2017-04-22 03:03:51', '2017-04-22 03:03:51'),
(1148, 'Беркут и Аиша', '<p>Ещё никогда на отечественной сцене не было дуэта чувственней и прекрасней чем Беркут и Аиша. Каждая трогательная песня, каждый их выход на сцену, пропитанная нежностью и любовью манера исполнения не просто привлекает, а по-настоящему приковывает внимание зрителей. Ведь те эмоции, которые проявляют Беркут и Аиша во время своих выступлений, это не безупречная актёрская игра, это безупречные семейные отношения, выстроенные на абсолютной идиллии и творческой гармонии.</p>', '0', 0, 2, 3, 2, 1041, 4, NULL, '2017-04-22 03:05:25', '2017-04-22 03:05:25'),
(1149, 'Novia feliz', '', '0', 0, 2, 10, 2, 1040, 3, NULL, '2017-04-22 03:07:42', '2017-04-22 03:07:42'),
(1150, 'Братья Жугунусовы', '<p>Сегодня мало кто не слышал о Жугунусовых, в чьем доме витает дух творчества. Трое сыновей этой талантливой семьи выбрали путь своих родителей &ndash; сцену. Ерболат и Айнур всячески поддерживают начинания своих детей, ведь когда-то именно сцена связала их судьбы вместе. Группа состоит из 3&ndash;х человек. Это 3 родных братьев: Рустем, Мирас, Мухаммед&ndash;Али Жугунусовы.</p>\r\n<p>На сегодняшний день &laquo;Братья Жугунусовы&raquo; очень успешный проект, они часто гастролируют, участвуют в съемках различных передач. Их песня &laquo;Астана&raquo; особо полюбилась поклонникам и слушателям братьев. Был снят дебютный клип, так же на песню &laquo;Астана&raquo;.<br /> </p>', '0', 0, 2, 3, 2, 1042, 4, NULL, '2017-04-22 03:08:38', '2017-04-22 03:08:38'),
(1151, 'Галымжан Молданазар', '<p>&nbsp;Галымжан Маханбетулы Молданазар&nbsp;&mdash; казахстанский певец и музыкант, солист группы Moldanazar.</p>\r\n<p>Начал творческую деятельность в 2011 году. Широко стал известен публике в 2013 году, после клипа &laquo;Ақпен бірге&raquo;. Новый всплеск популярности исполнителя связан с клипом &laquo;Өзің ғана&raquo;, имеющим социальное звучание.</p>', '0', 0, 2, 3, 2, 1043, 4, NULL, '2017-04-22 03:11:25', '2017-04-22 03:11:25'),
(1152, 'Группа Ал Давай', '<p>О том, как парням из группы &laquo;Ал Давай&raquo; удается раскачивать любые концертные площадки и любой закрытый танцпол, в стране уже знает далеко не первое поколение. Если уж по-хорошему, то их давно следовало бы соотнести к мэтрам нашей эстрады, но этот неиссякаемый запас творческого оптимизма и впечатляющей энергетики постоянно привлекает неугасаемый интерес к их песням.&nbsp;</p>', '0', 0, 2, 3, 2, 1044, 4, NULL, '2017-04-22 03:15:22', '2017-04-22 03:15:22'),
(1153, 'Группа Орда', '<p>Когда на вечер нужна звезда то каждый, разумеется, действует на свое усмотрение, ну а когда сценарий нужно усилить действительно звездным шоу, то только группа Орда повысит статус всего праздника и расшевелит абсолютно всех! Группа Орда это гарант&nbsp;абсолютного триумфа.</p>', '0', 0, 2, 3, 2, 1045, 4, NULL, '2017-04-22 03:17:59', '2017-04-22 03:17:59'),
(1154, 'Группа Ринго', '<p>Группа Ринго &ndash; это показатель казахстанского шоу-бизнеса.<em>&nbsp;</em>Их приглашают практический на львиную долю концертных площадок страны, так как спустя далеко не один год после их появления, ни один другой альтернативный состав так и не появился. На частных мероприятиях и банкетах они выступают, как яркое сценарное дополнение к тем пробелам, где зажечь нужно всех гостей, и удаётся подчас это только им!</p>', '0', 0, 2, 3, 2, 1046, 4, NULL, '2017-04-22 03:20:01', '2017-04-22 03:20:01'),
(1155, 'Группа AMOuAGE', '<p>Музыкальный стиль группы AMOuAGE революционно свеж и характерно специфичен: клубный восток, поп, великолепные каверы и лирические композиции. Кроме того, репертуар дополняют 15 авторских&nbsp; композиций, которые длительное время возглавляли хит парады радиостанций и музыкальных телеканалов.&nbsp;<br /> </p>', '0', 0, 2, 3, 2, 1047, 4, NULL, '2017-04-22 03:22:04', '2017-04-22 03:22:04'),
(1156, 'Группа Ninety One', '<p>Ninety One&nbsp;или&nbsp;91&mdash; казахстанский бойзбенд, дебютировавший 1 сентября 2015 года&nbsp;под лейблом JUZ Entertainment, в состав которого входят: A.Z.&nbsp;(Азамат Зенкаев), ALEM (Батырхан Маликов), ACE (Азамат Ашмакын), ZAQ (Дулат Мухаметкалиев) и BALA (Данияр Кулумшин). Продюсер группы&nbsp;&mdash; участник казахстанской музыкальной группы ORDA - Ерболат Беделхан. А также они основоположники первого фандома в Казахстане \"EagleZ\".&nbsp;</p>', '0', 0, 2, 3, 2, 1048, 4, NULL, '2017-04-22 03:29:14', '2017-04-22 03:29:14'),
(1157, 'Даурен Байназаров', '<p>Почерк известного композитора и автора можно узнать в Гимнах дорожной полиции, Налогового комитета, а также в нашумевших хитах &laquo;Айымай&raquo;, &laquo;Для тебя&raquo;, &laquo;Капелька яда&raquo;, &laquo;Благодарю&raquo; и &laquo;Кыздарики&raquo; для группы &laquo;DOMINO&raquo;. &nbsp;Он являлся продюсером команды КВН &laquo;Казахи&raquo; и автором песен таких признанных исполнителей, как Metiss, Ринат Малцагов,&nbsp; Кайрат Тунтеков, FM, Shiko, Айкын, Роза Рымбаева, Нагима Ескалиева, Жанар Орынбасарова, гр. Орда, Алмас Кишкенбаев, Ринго, гр. Азия, Ерлан Кокеев, Энхар Эмир, INDIGO, Sergiu, Diana Shik и Dance project Blockbuster. Стоит отметить награды эклектичного служителя творческой сферы: обладатель 2 премий Muz Fishka 2007, 2-ое место на конкурсе \"Best new talent\" в Лос-Анджелесе, а композиция &laquo;Биле жастар&raquo;, которую исполняет Diana Shik, более месяца занимала 1-ое место на радио Europa+ в хит-параде ТОП-20!<br /> </p>', '0', 0, 2, 3, 2, 1049, 4, NULL, '2017-04-22 03:30:56', '2017-04-22 03:30:56'),
(1158, 'Димаш Кудайбергенов', '<p>Димаш исполняет вокальные произведения различных жанров на разных языках (казахский, русский, английский, французский, китайский&nbsp;и&nbsp;т.&nbsp;д.) Принимает активное участие в культурно-массовых мероприятиях.</p>', '0', 0, 2, 3, 2, 1050, 4, NULL, '2017-04-22 03:33:24', '2017-04-22 03:33:24'),
(1159, 'Досымжан Танатаров', '<p>Қазақ еліне өзінің қоңыр дауысымен, мәртебелі марапатымен танымал.</p>', '0', 0, 2, 3, 2, 1051, 4, NULL, '2017-04-22 03:36:00', '2017-04-22 03:36:00'),
(1160, 'дуэт Арнау', '<p>Эстрадный дуэт, исполняющий песни на казахском языке быстро набрал популярность и что логично впоследствии повысил к себе интерес. Сегодня являясь признанными звездами казахстанского шоу бизнеса, Нуржан и Салтанат по-прежнему активно работают, упоённо сочиняют и всегда стремятся создавать что-то новое!&nbsp;<br /> </p>', '0', 0, 2, 3, 2, 1052, 4, NULL, '2017-04-22 03:38:46', '2017-04-22 03:38:46'),
(1161, 'Ерболат Кудайбергенов', '<p><em>Д</em>остойный сын своего народа Ерболат Кудайбергенов, в раннем детстве его привозят Алма-Ату, где он чует запах культурной столицы. Победитель всех возможных Әншi-Балапан и т.п. Но вскоре он переезжает в Талдыкорган и закрывшись от мира пишет музыку.</p>\r\n<p>Поворотный же период в жизни YERBolatа наступает летом 2007, когда на презентации альбома группы KZ, он выступает в качестве гостя. Его замечает известный клипмейкер Аскар Узабаев. Аскарик предлагает ему контракт и YERBolat, недолго думая, соглашается. Осенью снимается первый клип YERBolatа на песню &laquo;Бойжеткен&raquo;. В результате союза YERBolatа и Аскара пишется ряд новых песен. Таких как &ndash; &laquo;Мен Казакпын&raquo;, &laquo;Лязат Алауы&raquo;, &laquo;Уш Жуз&raquo; и &laquo;Жигиттер&raquo;.</p>\r\n<p>Летом 2008 снимается клип на песнью &laquo;Мен Казакпын&raquo; Осенью 2009 снимается клип на песню &laquo;Жигиттер&raquo; и на саундтрек к фильму &laquo;Кайрат - Чемпион, девственник &sup1;1&raquo;.&nbsp;<br /> В планах съемки клипов на песни &laquo;Ляззат Алауы&raquo;, &laquo;Уш Жуз&raquo;, новые и новые хиты, и конечное первый сольный альбом&hellip;</p>', '0', 0, 2, 3, 2, 1053, 4, NULL, '2017-04-22 03:40:37', '2017-04-22 03:40:37'),
(1162, 'Ерке Есмахан', '<p>Репертуар Ерке Есмахан авторский, только казахские песни. Публика любит ее за приверженность отечественной эстраде, отечественному стилю. Именно поэтому все ее выступления проходят на ура и заканчиваются аплодисментами.</p>', '0', 0, 2, 3, 2, 1054, 4, NULL, '2017-04-22 03:43:03', '2017-04-22 03:43:03'),
(1163, 'Ерлан Кокеев', '<p>Певец, музыкант, шоумен. Лауреат международных конкурсов, лауреат премии Союза молодежи Казахстана, Заслуженный артист Казахстана.</p>', '0', 0, 2, 3, 2, 1055, 4, NULL, '2017-04-22 03:44:46', '2017-04-22 03:44:46'),
(1164, 'Ернар Айдар', '<p>Сегодня за плечами молодого исполнителя несколько музыкальных альбомов, около тысячи сольных концертов и 7 видеоклипов. За три года на сцене Ернар Айдар объездил все города и селы Казахстана, даря свое творчество слушателям.&nbsp;</p>', '0', 0, 2, 3, 2, 1056, 4, NULL, '2017-04-22 03:46:12', '2017-04-22 03:46:12'),
(1165, 'Жанболат пен Жазира', '<p>Өнерімен елді тәнті еткен Жанболат пен Жазира есімі көпшілікке жақсы таныс. Сахнада жұбы жазылмаған қос әнші өмірде де көпке үлгі болардай берекелі отбасы.<br /> </p>', '0', 0, 2, 3, 2, 1057, 4, NULL, '2017-04-22 03:47:38', '2017-04-22 03:47:38'),
(1166, 'Жигиттер тобы', '<p>2003 жылы Шымкент қаласында төрт жігіттен құралған квартет.</p>\r\n<p>Өнердегі ұстаздары Әбдіхан Нұрмағанбетовтың жетекшілігімен республикалық Арай-2003 байқауына қатысып, бас жүлдеге ие болды. Ел жүрегінен кең орын алған \"Ерке қыз\" әніне бейнебаян түсіріліп, оңтүстіктің шымыр жігіттері өнер ордасы - Алматы&nbsp;қаласына келді. Продюсері - Ерғали Әбдірайымовтың көмегімен үлкен жетістіктерге қол жеткізіп, өз өнерлерін Алматы қаласында әлі күнге дейін жалғастырып келуде.</p>\r\n<p>Топ құрамы: Айдар Байжанов, Бағлан Әбдірайымов, Ердос Қанаев және Мырзахан Маханов.&nbsp;</p>\r\n<p>&nbsp;</p>', '0', 0, 2, 3, 2, 1058, 4, NULL, '2017-04-22 03:49:23', '2017-04-22 03:49:23'),
(1167, 'Кайрат Баекенов и группа Формат', '<p>Лучший вокально-инструментальный ансамбль страны. Победители в номинации лучшая песня года по версии ежегодной премии &laquo;Астана Жулдызы 2014&raquo;. Состав образован в ранних двухтысячных, за период своего формирования не так часто менялся в составе. Неизменными участниками коллектива считается солист и идейный вдохновитель группы Кайрат Баекенов и ударник Андрей. Коллектив отличает исключительная слаженность в работе, обострённое музыкальное чутье, великолепная подача и успешный менеджмент.</p>', '0', 0, 2, 3, 2, 1059, 4, NULL, '2017-04-22 03:51:07', '2017-04-22 03:51:07'),
(1168, 'Қайрат Нұртас', '<p>Известный эстрадный певец Казахстана.&nbsp;Популярность творчества&nbsp;Кайрата Нуртаса&nbsp;объясняют его необыкновенным обаянием и очарованием, душевностью исполнения. На всех концертах он поёт исключительно вживую, и это притом, что песни его довольно сложные как эмоционально, так и в исполнении. Его одинаково любит и старшее казахское поколение, и молодая публика. Кстати, со своими зрителями Кайрат никогда не забывает общаться!</p>', '0', 0, 2, 3, 2, 1060, 4, NULL, '2017-04-22 03:53:11', '2017-04-22 03:53:11'),
(1169, 'Қайрат Түнтеков', '<p>Он может спеть все. Органично воспроизводит талант известных певцов, таких как Майкл Джексон, Джастин Тимберлейк, Грегори ЛеМаршал. В 2000 году в возрасте 14 лет Кайрат впервые заявил о себе, приняв участие в международном конкурсе молодых исполнителей &laquo;Бозторгай&raquo;, где получил Гран-при. Неоднократно становился победителем республиканских музыкальных конкурсов. Известность к нему пришла в 2005 году после победы во втором проекте SuperStar KZ. Он получил главный приз &mdash; контракт на запись сольного альбома. И стал любимчиком всей страны!</p>', '0', 0, 2, 3, 2, 1061, 4, NULL, '2017-04-22 03:55:06', '2017-04-22 03:55:06'),
(1170, 'Кентал', '<p>Kомпозитор и автор текстов &mdash; исполняет песни на казахском, русском, английском языках и играет на саксофоне. Занявшись самостоятельно организацией своих сольных концертов в начале своего творческого пути, певец открыл в себе талант MC (мастера церемоний) и шоумена. Финалист&nbsp;&laquo;Суперстар.КЗ-2007&raquo;,&nbsp;&laquo;Х-фактор&raquo;. Победитетель&nbsp;&laquo;Фактор эстрима-2011&raquo;,&nbsp;&laquo;Жұлдызды дода-2014&raquo;,&nbsp;&laquo;Тюрквижн-2013&raquo;.</p>', '0', 0, 2, 3, 2, 1062, 4, NULL, '2017-04-22 03:56:44', '2017-04-22 03:56:44'),
(1171, 'Кыдырали и Каракат', '<p>Еще в детстве Каракат проявила музыкальный и вокальный талант, благодаря чему получила приглашение в музыкальную школу для одаренных детей имени Куляш Байсеитовой. После школы Каракат отучилась в консерватории имени Курмангазы по классу народного пения, там же овладела домброй и гитарой. Кроме того, Каракат владеет многими народными инструментами. Со свои будущим мужем Кыдырали Болмановым Каракат познакомилась еще будучи студенткой, в 1996 году в ресторане &laquo;Жулдыз&raquo;. Кыдырали был тогда известным продюсером и участником группы &laquo;АБК&raquo;.&nbsp;</p>', '0', 0, 2, 3, 2, 1063, 4, NULL, '2017-04-22 03:58:01', '2017-04-22 03:58:01');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1172, 'Луина', '<p>Её популярность в постоянной прогрессии выделяется поистине поразительным постоянством. Сложно встретить человека незнакомого с творчеством Луины. Ещё сложнее отыскать того кто хоть когда то имел возможность личной беседы с этой красавицей. Для многих поклонников она остается недосягаемой как Луна и такой же путеводной как вечно сияющая в бездонном небе звезда.&nbsp;<br /> </p>', '0', 0, 2, 3, 2, 1064, 4, NULL, '2017-04-22 03:59:34', '2017-04-22 03:59:34'),
(1173, 'Мадина Садвакасова', '<p>Казахстанская поп-певица, победительница молодёжного конкурса &laquo;Жас Канат&raquo;, &laquo;Человек года&raquo; Кызылординской области, была солисткой Президентского оркестра и ансамбля &laquo;Гульдер&raquo;, телеведущая. Кроме того, является дипломированным психологом. Заслуженный деятель Республики Казахстана.</p>', '0', 0, 2, 3, 2, 1065, 4, NULL, '2017-04-22 04:02:06', '2017-04-22 04:02:06'),
(1174, 'Макпал Исабекова', '<p>Kазахстанская эстрадная певица. Обрела популярность как участница проекта &laquo;SuperStar KZ&raquo;, &nbsp;актриса, телеведущая.</p>', '0', 0, 2, 3, 2, 1066, 4, NULL, '2017-04-22 04:06:10', '2017-04-24 01:48:53'),
(1175, 'Маржан Арапбаева', '<p>Маржан Арапбаеву можно назвать образцом стремительного восхождения на эстраду. На творчестве этой талантливой девушки воспитывается третье поколение начинающих исполнительниц.</p>', '0', 0, 2, 3, 2, 1067, 4, NULL, '2017-04-22 04:07:14', '2017-04-22 04:07:14'),
(1176, 'МузАРТ тобы', '<p>Kазахстанский вокально-инструментальный ансамбль. Название группы расшифровывается так: &laquo;М&raquo; означает музыку, &laquo;УЗ&raquo;(в переводе с древнетюркского)&nbsp;&mdash; скромность, а &laquo;АРТ&raquo;&nbsp;&mdash; вершина горы. Песни вокально-инструментальной группы в основном относятся к жанру поп-музыки. А также можно найти в репертуаре ансамбля народные и ретро песни. За 10 лет у группы имеется 46 песен. Например&nbsp;: &laquo;Өз елім&raquo;, &laquo;Шынарым&raquo;, &laquo;Шашбаулым&raquo;, &laquo;Қазақтай ел қайда&raquo;, &laquo;Сағындым Алматымды&raquo;, &laquo;Үшқоңыр&raquo;, &laquo;Анаға сәлем&raquo;, &laquo;Қайран көңіл&raquo; . Вышли 3 альбома: &laquo;Сенің көзің&raquo;, &laquo;Әттең-ай&raquo; и &laquo;Есіңе ал&raquo;.</p>', '0', 0, 2, 3, 2, 1068, 4, NULL, '2017-04-22 04:08:51', '2017-04-22 04:08:51'),
(1177, 'Нұржан Керменбаев', '<p>Ән айтуды кішкентай кезінен бастаған. Жезқазған музыкалық колледжін тәмәмдаған. 2006 жылғы &laquo;<span style=\"color: #000000;\"><a style=\"color: #000000;\" href=\"https://kk.wikipedia.org/w/index.php?title=Super_Star.Kz&amp;action=edit&amp;redlink=1\">Super Star.Kz&raquo;</a>&nbsp;</span>мегажобасының жеңімпазы. 2009 жылы Юрмала қаласында өткен халықаралық &laquo;Жаңа толқын&raquo; байқауына қатысқан. Қазір \"Арнау\"&nbsp;дуэтінің әншісі.</p>', '0', 0, 2, 3, 2, 1069, 4, NULL, '2017-04-22 04:11:23', '2017-04-22 04:11:23'),
(1178, 'Ринат Мальцагов', '<p>Финалист проекта SuperStar Kz, выступал в составе группы &laquo;Перцы&raquo;, музыкант с богатым опытом выступлений на крупных площадках. Выступления Рината всегда сопровождаются громкими овациями и восхищением аудитории. Во время его выступления гости не будут скучно зевать. Репертуар артиста интересен как взрослой аудитории, так и молодому поколению.</p>', '0', 0, 2, 3, 2, 1070, 4, NULL, '2017-04-22 04:12:59', '2017-04-22 04:12:59'),
(1179, 'Роза Әлқожа', '<p>Әншінің алғашқы альбомы \"Мен сыйға тартқан орамал\" деген атпен 2008 жылы жарық көрген. Орындауындағы әндердің бірқатарының әнін өзі жазатын Розаның \"Мен сыйға тартқан орамал\", \"Жылатқаның неткенің\", \"Қара күз\", \"Мына өмір ғажап қандай\" әндерін халық жылы қабылдап, елінің сүйіспеншілігіне бөленді. Оған қоса композитор&nbsp;Ажар Түзелбекқызының&nbsp; орындауындағы&nbsp; \"Сағындым сені\",&nbsp; \"Бақыттымын\",&nbsp;Баян Нұрмышеваның орындауындағы&nbsp;\"Жібектің елі\", Еркін Нұржановтың орындауындағы \"Қаңтарда жауған жаңбыр\", Ақбота Керімбекованың орындауындағы&nbsp;\"Орындалмас тілегім\", Ләззат Жоламанованың орындауындағы&nbsp;\"Сағынғаным болмаса\" сынды әндерді жазған.&nbsp;</p>', '0', 0, 2, 3, 2, 1071, 4, NULL, '2017-04-22 04:14:11', '2017-04-22 04:14:11'),
(1180, 'Роза Рымбаева', '<p>Советская и казахстанская&nbsp;эстрадная&nbsp;певица, киноактриса&nbsp;и педагог-профессор. Народная артистка Казахской ССР&nbsp;(1986). Лауреат Государственной премии Казахстана&nbsp;(2004). Двукратный лауреат премии Ленинского комсомола&nbsp;(1976, 1981). Почетный гражданин Астаны (2016).</p>\r\n<p>Единственная уроженка Казахстанская, представлявшая Советский Союз&nbsp;на международной вокальной арене.</p>', '0', 0, 2, 3, 2, 1072, 4, NULL, '2017-04-22 04:18:04', '2017-04-22 04:18:04'),
(1181, 'Сәкен Майғазиев', '<p>Қазақстандық әнші, МузАРТ&nbsp;ансамбльінің солисті. Қазақстанның еңбек сіңірген қайраткері&nbsp;(2013). \"Дарын\" мемлекеттік жастар сыйлығының иегері. 2001 ж. бастап МузАРТ тобының мүшесі болып тағайындалды.</p>', '0', 0, 2, 3, 2, 1073, 4, NULL, '2017-04-22 04:22:06', '2017-04-22 04:22:06'),
(1182, 'Тамара Асар', '<p>Қазақстандық эстрада әншісі. Өмірде де, өнерде де өжеттілігімен көзге түскен дарынды дарабоз әнші. ҚРның \"Құрмет орденінің\" иегері. Қазақстан жастар одағының \"Серпер\" жастар сыйлығының лауреаты.</p>', '0', 0, 2, 3, 2, 1074, 4, NULL, '2017-04-22 04:24:47', '2017-04-22 04:24:47'),
(1183, 'Төреғали Төреәлі', '<p>Это действительно профи своего дела, яркий артист. Народ любит и уважает его и его творчество, с радостью приходят на его концерты и на концертах же танцуют под его великолепные песни. Так он завоевал любовь народа!&nbsp;<br /> </p>', '0', 0, 2, 3, 2, 1075, 4, NULL, '2017-04-22 04:27:03', '2017-04-22 04:27:03'),
(1184, 'Ханзада тобы', '<p>Энергичные и талантливые ребята из группы Ханзада &ndash; Мухтар и Мухан. Каждая песня из их репертуара является воистину хитом. Неповторимое чувство ритма и головокружительное исполнение оживит любую аудиторию.</p>', '0', 0, 2, 3, 2, 1076, 4, NULL, '2017-04-22 04:28:10', '2017-04-22 04:28:10'),
(1185, 'Mysterions', '<p>В 2009г. группа &laquo;Мистэрионс&raquo; получила премию &laquo;Дебют года&raquo; по версии телеканала &laquo;МuzZonе&raquo;. 2013 году на премии &laquo;ЕМА&raquo; (Евразийская Музыкальная Премия) телеканала &laquo;Муззон&raquo; парни победили в номинации &laquo;Лучшая песня о любви&raquo; (Асыл Аним) и получили денежный приз от Love radio в размере 10 000 долларов, а также ротацию на телеканале &laquo;Муззон&raquo;.В этом же году сняли видео на песню &laquo;Неге ундемедiн&raquo;, режиссером также стал Ернар Нургалиев. Все лето парни гастролировали по Казахстану, в рамках промотура &laquo;ACTIV FEST&raquo; . По итогам которого Mysterions дали концерты в 45 городах и районных центрах Казахстана. И это еще не все достижения группы. По словам парней, все самые главные награды впереди.<br /> <br /> </p>', '0', 0, 2, 3, 2, 1077, 4, NULL, '2017-04-22 04:29:18', '2017-04-22 04:29:18'),
(1186, 'Son Pascal', '<p>Сон Паскаль &ndash; 27-летний итальянский музыкант, живущий в Астане, Казахстан. Он родился и вырос в городе Пестум на юге Италии и переехал в Рим, когда ему было восемнадцать. В 2008 году Паскаль выпустил свой первый альбом \"Wasted time\", записанный компанией Universal Music. Страсть к британской музыке привела его в Лондон, где он провел 3 года, работая и выступая на самых разных площадках.</p>\r\n<p>В сентябре 2011 года, встретив девушку из Казахстана, он решил переехать в Алматы, где провел первые трудные месяцы, работая для небольшого количества слушателей. Его друг и продюсер Ануар Нурпеисов никогда не терял веры в Паскаля, и когда в феврале 2012-го он разместил на YouTube их сингл \"Englishman in Shymkent\", пародию на песню Стинга \"Englishman in New-York\", надежды начали оправдываться.&nbsp;</p>\r\n<p>В его новых песнях звучат традиционные казахские инструменты и казахский язык &ndash; не ради национального колорита, это процесс музыкального обогащения. Сейчас он чувствует себя частью народа той страны, в которой живет, звуки Казахстана &ndash; материал для изучения, поиска и работы, и это главное для Паскаля.</p>', '0', 0, 2, 3, 2, 1078, 4, NULL, '2017-04-22 04:30:58', '2017-04-22 04:30:58'),
(1187, 'Алла Пугачёва', '<p class=\"p1\"><span class=\"s2\">Советская и российская&nbsp;эстрадная&nbsp;певица, композитор-песенник, эстрадный режисёр</span><span class=\"s2\">, продюсер, киноактриса&nbsp;и телеведущая. Народная артистка СССР&nbsp;(1991). Лауреат Государственной премии Российской Федерации&nbsp;(1995). Кавалер ордена \"За заслуги перед Отечеством\"&nbsp;II, III и IV степени.</span></p>\r\n<p class=\"p1\"><span class=\"s2\">В её репертуар входит более 500 песен на русском, английском, французском, иврите, немецком, финском, украинском языках; а дискография насчитывает более 100 сольных пластинок, CD и DVD дисков (включая 17 номерных альбомов, 34 сингла и 25 &laquo;компиляций&raquo; и сборников). Помимо России&nbsp;и стран бывшего СССР альбомы Пугачевой издавались в Японии, Корее, Швеции, Финляндии, Германии, Польше, Чехословакии и Болгарии. Общий тираж дисков превысил 250 миллионов экземпляров.</span></p>', '0', 0, 2, 3, 2, 1079, 4, NULL, '2017-04-22 04:37:44', '2017-05-04 02:00:19'),
(1188, 'Валерия', '<p class=\"p1\"><span class=\"s1\">Российская эстрадная певица, известная мононимно как Вале́рия. Народная артистка России. Народная артистка Приднестровской Молдавской Республики. Член Совета при Президенте Российской Федерации по культуре и искусству с 2012 года.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">в 2008 году артистка выпустила альбом &laquo;Out of Control&raquo;. Создавать его помогал Рэй Сент-Джон (автор песни &laquo;Smooth Operator&raquo; Шаде), Дэвид Ричардс (продюсер ряда альбомов легендарных Queen), Шанталь Кревязук, Джордж де Анджелис, Франческа Эшлиманн, Сергей Галоян Сводил альбом Саймон Горджерли, тот самый, который получил Грэмми за альбом &laquo;How to dismantle an atomic bomb&raquo; U2. Ну а осенью того же года прошла премьера видеоклипа на композицию &laquo;Боль! (Счастье на части)&raquo; или &laquo;Wild&raquo; - это англоязычный вариант. Режиссер ролика &ndash; Алан Бадоев. Два месяца 2009 году Валерия посвятила гастролям по Британии вместе с легендами &laquo;Simply Red&raquo;. Позже в том же составе музыканты выступили в Москве. А в Великобритании в то время артистка выпустила релиз альбома &laquo;Out of Control&raquo;. Стоит отметить, что тогда же, на протяжении пары месяцев сингл &laquo;Wild!&raquo; поднялся на верхние строки хит-парадов клубной музыки. Этот факт отметил американский &laquo;Billboard&raquo;. <br /><br /><br /></span></p>', '0', 0, 2, 3, 2, 1080, 4, NULL, '2017-04-22 04:52:04', '2017-05-04 01:56:35'),
(1189, 'Леонид Агутин', '<p class=\"p1\"><span class=\"s1\">Cоветский и российский певец</span><span class=\"s1\">, музыкант, аранжировщик, поэт-песенник и композитор, режиссёр. Заслуженный артист Российской Федерации.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">В 1994 году московский музыкант представил публике свой дебютный альбом &laquo;Босоногий мальчик&raquo;, который сразу после выхода стал настоящим хитом. Успех первой пластинки поднял Леонида Агутина на невиданные высоты и моментально сделал его одним из самых популярных исполнителей на российской поп-сцене. В том же 1994-м году наш сегодняшний герой получил награду &laquo;Песня года&raquo;, &laquo;Певец года&raquo; и &laquo;Альбом года&raquo;. В этот же период на всех радиостанциях СНГ вовсю звучал его главный хит того времени &ndash; композиций &laquo;Хоп хей ла-ла-лей&raquo;. <br /><br /></span></p>', '0', 0, 2, 3, 2, 1081, 4, NULL, '2017-04-22 05:13:05', '2017-05-04 01:54:38'),
(1190, 'Александр Буйнов', '<p>Советский и российский певец, актёр, музыкант, композитор, шоумен. Народный артист Российской Федерации, Народный артист Ингушетии. Народный артист республики Северная Осетия - Алания. Наиболее известные песни: &laquo;Две жизни&raquo;, &laquo;Падают листья&raquo;, &laquo;Пустой бамбук&raquo;, &laquo;Горький мёд&raquo;, &laquo;Пусть&raquo;, &laquo;Оранжевые сны&raquo;, &laquo;Эй, друг&raquo;, &laquo;Любовь на двоих&raquo;, &laquo;ВДВ - С неба привет&raquo;, &laquo;Спецназ&raquo;, &laquo;Не перебивай&raquo;, &laquo;Капитан Каталкин&raquo;, &laquo;Мои финансы поют романсы&raquo;, &laquo;Тост&raquo;, &laquo;В Париже ночь&raquo; и многие другие.</p>', '0', 0, 2, 3, 2, 1082, 4, NULL, '2017-04-24 02:22:00', '2017-04-24 02:31:22'),
(1194, 'Группа Меломен', '<p>В декабре 2008 года на музыкальном фестивале \"Шабыт\", продюсер Жанна Абуова среди участников заметила новые, молодые таланты. Ребята исполняют песни исключительно на своем родном казахском языке. Ребята отличились артистизмом, шикарным голосом, очарованием и уверенностью в себе.</p>\r\n<p>Да и хотели бы напомнить Вам, что у ребят в репертуаре есть песни, которые носят религиозный характер. Эти песни не оставляют равнодушными никого! Участвовали в таких конкурсах как, международный фестиваль \"Шабыт\"- 2008 год, где их сразу же заметили, затем \"Абай Элемі\" - 2009 год, республиканский \"Жас Жанат\" - 2009 год, где они стали лауреатами.</p>\r\n<p>Ребята большое внимание уделяют своему вокалу, хореографии, созданию имиджа, актерскому мастерству.</p>', '0', 0, 2, 3, 2, 1084, 4, NULL, '2017-04-24 02:37:38', '2017-04-24 03:24:13'),
(1203, '«Catrin»', '', '0', 0, 2, 10, 2, 1086, 3, NULL, '2017-04-25 03:54:47', '2017-04-25 03:54:47'),
(1204, 'MIEN SULU', '', '0', 0, 2, 10, 2, 1087, 3, NULL, '2017-04-25 04:04:29', '2017-04-25 04:04:29'),
(1205, 'Caviar', '<p>Представляем Вашему вниманию новый проект &ldquo;Caviar Fashion Dance Show&rdquo;.</p>\r\n<p>Профессиональное исполнение, эффектные костюмы, незабываемые номера, fashion показы.</p>\r\n<p>В составе 5 танцовщиц.</p>\r\n<p>- Танцевальное шоу</p>\r\n<p>- Тематические вечеринки</p>\r\n<p>- Торжественные приёмы</p>\r\n<p>- Fashion показы</p>\r\n<p>- Перфоманс</p>\r\n<p>- Анимация</p>', '0', 0, 2, 11, 2, 1088, 3, NULL, '2017-04-25 04:09:21', '2017-04-25 04:22:36'),
(1206, 'Макс Галаев', '<p>Фотография для меня настоящее кино, где каждый кадр - частичка вашей реальной жизни, отражение вашего времени и пространства. Мне нравится видеть как человек открывается перед камерой, оказываясь на время фотосессии на некой невидимой сцене и возможно открывает в себе новые грани. Люблю фотографировать детей, снимать свадьбы и истории любви. Настоящие эмоции и чувства; у кого то они яркие и несдерживаемые, другие глубоко чувственны - я фотографирую это.<br /> <br /> Все фотографии которые вы получаете будут обработаны. Ретушь, которую я делаю, направлена на то чтобы сохранить красоту и естественность</p>', '0', 0, 2, 14, 2, 1089, 3, NULL, '2017-04-25 04:21:47', '2017-04-25 04:21:47'),
(1207, 'Rainbow studio', '<p>Наша компания предлагает вам не только запечатлеть момент созидания вашей любви, мы хотим стать частью истории семьи. Свадьба, выписка с роддома, первые шаги и первые слова. Мы создаем серию эпизодов о вашей семье, запечатлеем все радостные моменты и волнения.</p>\r\n<p>Мы не стоим на месте, перенимаем опыт коллег как с ближнего так из дальнего зарубежья, находим что-то современное и креативное: новые технологии, новые тенденции.</p>', '0', 0, 2, 14, 2, 1023, 3, NULL, '2017-04-25 04:26:27', '2017-04-25 04:26:27'),
(1208, 'Quest Pistols', '<p>Ребята из группы &laquo;Quest Pistols&raquo; начинали, как танцевальный шоу-балет &laquo;Quest&raquo;, который, просуществовав три года, наделал много шума в Украине. Они поражали неординарностью и безумной эпатажностью своих выступлений, но одних танцев им оказалось маловато. И они запели. Основатель балета и продюсер Юрий Бардаш отправил Никиту и Антона на уроки вокального мастерства, а Константину отвели роль репера. Их вокальный дебют состоялся 1 апреля 2007-го года в эфире популярного украинского телешоу &laquo;ШАНС&raquo;. Эта первоапрельская выходка пришлась по вкусу телезрителям, подарившим новым кумирам шесть тысяч голосов.</p>\r\n<p>Дебютный клип группы &laquo;Quest Pistols&raquo; - &laquo;Я устал&raquo; вышел в июне 2007-го года и сразу оказался в ротации телеканала MTV, став впоследствии настоящим хитом. Другие известные композиции группы - &laquo;Дни гламура&raquo;, &laquo;Белая стрекоза любви&raquo;, &laquo;Он рядом&raquo;, &laquo;Клетка&raquo;, &laquo;Я твой наркотик&raquo;, &laquo;Революция&raquo; и &laquo;Ты так красива&raquo;. Дебютный альбом &laquo;Для тебя&raquo; вышел в ноябре 2007-го в Украине и получил золотой статус. В России диск поступил в продажу в конце весны 2008-го года. В российский релиз в качестве бонуса было добавлено несколько композиций в стиле панк-рок.</p>', '0', 0, 2, 3, 2, 1091, 4, NULL, '2017-04-25 04:44:48', '2017-04-25 04:44:48'),
(1209, 'Алена Алина', '<p>Российская эстрадная певица, композитор и поэтесса, заслуженная артистка России наиболее известные хиты &laquo;Узелки&raquo;, &laquo;Электричка&raquo;, &laquo;Ксюша&raquo;, &laquo;American Boy&raquo;, &laquo;Бухгалтер&raquo;, &laquo;Лёха&raquo;, &laquo;Лунные ночи&raquo;, &laquo;Грешный миг&raquo;.&nbsp;</p>', '0', 0, 2, 3, 2, 1092, 4, NULL, '2017-04-25 04:46:39', '2017-04-25 04:46:39'),
(1210, 'Алсу', '<p>Алсу Ралифовна Абрамова&nbsp;&mdash; российская певица, телеведущая, Заслуженная артистка Республики Татарстан, известная мононимно, как&nbsp;<strong>Алсу</strong>.&nbsp;Представитель России на Евровидении 2000, где заняла 2 место.</p>\r\n<p>Музыкой девочка начала заниматься в раннем детстве. 5-летней Алсу купили фортепиано, но при условии, что она не забросит инструмент. Девочка выполнила обещание и прилежно посещала музыкальную школу на другом конце города. В 1992 году Алсу переехала в Москву и продолжила обучение в одной из столичных музыкальных школ. Через год девушка отправилась жить в США, еще через полгода &ndash; в Копенгаген, где провела следующие полтора года.&nbsp;Все ту же &laquo;I Will Always Love You&raquo; Алсу исполнила через 5 лет на свадьбе у брата, после чего подруга мамы посоветовала показать девушку знакомому продюсеру Валерию Белоцерковскому. После прослушивания мужчина понял &ndash; перед ним настоящий талант! Именно он познакомил певицу с опытными композиторами Александром Шевченко и Вадимом Байковым, ранее писавшими песни для Алены Апиной, Жасмин, Ирины Аллерговой и других популярных эстрадных исполнительниц.<br /><br /><br /><br /><br /></p>', '0', 0, 2, 3, 2, 1093, 4, NULL, '2017-04-25 04:52:30', '2017-05-04 01:53:05'),
(1211, 'HAN Trio', '<p>Тех райдер:</p>\r\n<p>1) два входа для джэк джэк&nbsp;</p>\r\n<p>2) два dbox</p>\r\n<p>3) два микрофона shure 57 &nbsp;со стойками</p>\r\n<p>4) один монитор</p>\r\n<p>5) два стула</p>', '0', 0, 2, 1, 2, 1090, 3, NULL, '2017-04-25 04:56:04', '2017-04-25 04:57:05'),
(1212, 'Анжелика Варум', '<p>Советская и российская&nbsp;эстрадная певица, автор песен актриса, заслуженная артистка Российской Федерации, трёхкратная обладательница Национальной российской премии \"Овация\".</p>\r\n<p>Первый альбом певицы \"Good Bye, мой мальчик\" был представлен в 1991 году, с тех пор вышло 14 номерных альбомов.</p>', '0', 0, 2, 3, 2, 1094, 4, NULL, '2017-04-25 04:56:19', '2017-04-25 04:56:19'),
(1213, 'Анна Семенович', '<p>Российская фигуристка, актриса, телеведущая и эстрадная певица; бывшая солистка группы &laquo;Блестящие&raquo;.</p>\r\n<p>В группе &laquo;Блестящие&raquo; Анна Семенович блистала не долго.&nbsp;В 2007 году Семенович покидает девичий коллектив и полностью погружается в сольную музыкальную карьеру, кино и телевидение. В 2008 году последовали первые видео с участием пышногрудой девушки: &laquo;На моря&raquo; и &laquo;Тирольская песня&raquo;, спустя год выходит клипа на песню &laquo;Боже мой&raquo;, а в 2011 году сразу два ролика &laquo;Не Мадонна&raquo; и &laquo;Обманутые люди&raquo;. </p>', '0', 0, 2, 3, 2, 1095, 4, NULL, '2017-04-25 04:57:43', '2017-05-04 01:50:12'),
(1214, 'Александр Буйнов ', '<p>Александр Николаевич Буйнов&nbsp;&mdash; советский и российский певец, актёр, музыкант, композитор, шоумен. Народный артист Российской Федерации&nbsp;,&nbsp;Народный артист Ингушетии. Народный артист республики Северная Осетия&nbsp;&mdash; Алания. Наиболее известные песни: &laquo;Две жизни&raquo;, &laquo;Падают листья&raquo;, &laquo;Пустой бамбук&raquo;, &laquo;Горький мёд&raquo;, &laquo;Пусть&raquo;, &laquo;Оранжевые сны&raquo;, &laquo;Эй, друг&raquo;, &laquo;Любовь на двоих&raquo;, &laquo;ВДВ - С неба привет&raquo;, &laquo;Спецназ&raquo;, &laquo;Не перебивай&raquo;, &laquo;Капитан Каталкин&raquo;, &laquo;Мои финансы поют романсы&raquo;, &laquo;Тост&raquo;, &laquo;В Париже ночь&raquo; и многие другие.</p>\r\n<p>В 1966 году Буйнов познакомился с Александром Градским, в то время молодым композитором. Эта встреча кардинально поменяла судьбу певца. Он ушел из школы и поехал на первые гастроли с группой Градского. Буйнов играл на фортепиано. Группа получила название &laquo;Скоморохи&raquo;.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1096, 4, NULL, '2017-04-25 05:02:09', '2017-05-04 01:48:31'),
(1215, 'Валерий Леонтьев', '<p>Советский и российский певец, автор песен, актёр. Народный артист России, Лауреат премии Ленинского комсомола, Кавалер ордена &laquo;За заслуги перед Отечеством&raquo; 4-й степени, ордена Почёта и ордена Дружбы. Обладатель премий &laquo;World Music Awards&raquo;, ZD Awards,&nbsp;Овация, Золотой Граммофон, практически бессменный победитель номинаций &laquo;Певец года&raquo; и &laquo;Шоу года&raquo; за 1980-2001 годы в российских музыкальных рейтингах того времени.&nbsp;</p>', '0', 0, 2, 3, 2, 1097, 4, NULL, '2017-04-25 05:03:41', '2017-04-25 05:03:41'),
(1216, 'Валерий Меладзе', '<p>Советский, российский и украинский поп-певец, продюсер и телеведущий грузинского происхождения. Член правления Международного союза деятелей эстрадного искусства, Заслуженный артист Российской Федерации, Народный артист Чеченской Республики. Трёхкратный обладатель Национальной российской премии \"Овация\", многократный обладатель премий &laquo;Песня года&raquo;, &laquo;Золотой граммофон&raquo;, семикратный обладатель премии &laquo;Муз-ТВ&raquo;.</p>\r\n<p>Параллельно со своей певческой деятельностью Валерий учился в аспирантуре и даже написал диссертацию на тему &laquo;Интенсификация обменных процессов в иоидном фильтре с псевдовиброожиженном слоем катионита&raquo;. Однако, карьера певца интересовала молодого человека больше и, после того, как самодельный альбом &laquo;Апреля&raquo; попал к руководителю популярной в то время группы &laquo;Диалог&raquo;, коллективу предложили принять участие в записи их пластинки. Причем в Германии, а не на Украине, для немецкой серии &laquo;Музыка для интеллекта&raquo;. Вместе с &laquo;Диалогом&raquo; Валерий и Константин выпустили два альбома. Первый под названием &laquo;Посредине мира&raquo; вышел в 1991 году, а второй &laquo;Осенний крик ястреба&raquo; увидел свет в Германии в 1993 году. А между выходами пластинок Валерий Меладзе стал призером телеконкурса &laquo;Ступень к Парнасу&raquo;. Певец ушел из группы &laquo;Диалог&raquo; в 1993 году и занялся сольной программой. Музыкант начал исполнять только песни, написанные его братом Константином Меладзе. В 1993 году состоялся и сольный дебют Валерия &ndash; на сцене фестиваля цветом &laquo;Роксолана&raquo; в Киеве. Здесь же Меладзе познакомился с продюсером Евгением Фриляндом. С ним был подписан контракт о сотрудничестве.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1098, 4, NULL, '2017-04-25 05:20:00', '2017-05-04 01:46:24'),
(1217, 'Вера Брежнева', '<p>Украинская и российская поп-певица, актриса, телеведущая, бывшая участница поп-группы &laquo;ВИА Гра&raquo;.</p>\r\n<p>Впервые Вера Брежнева выступила с &laquo;ВИА Грой&raquo; летом 2002 года, во время украинских гастролей коллектива, &ndash; она была обычной зрительницей, изъявившей желание подняться на сцену во время исполнения &laquo;Попытки №5&raquo;. Видимо, продюсерам понравилось то, что они увидели, и уже в ноябре Веру пригласили на кастинг на место покинувшей группу Алены Винницкой.&nbsp;Певица успешно прошла прослушивание и переехала из провинциального украинского городка в Москву. <br /><br /><br /><br /></p>', '0', 0, 2, 3, 2, 1099, 4, NULL, '2017-04-25 05:22:08', '2017-05-04 01:43:52'),
(1218, 'ВИА Гра', '<p>Популярная российско-украинская женская поп-группа, которая на сегодняшний день считается, пожалуй, одной из самых успешных русскоязычных музыкальных групп современности. В своем активе коллектив имеет более пяти студийных альбомов, многочисленные съемки в телевизионных мюзиклах, а так же свыше тридцати выпущенных видеоклипов. Группа &laquo;Виагра&raquo; является лауреатом многочисленных премий, среди которых: &laquo;Золотой граммофон&raquo;, &laquo;Золотой диск&raquo; и другие. Прежде всего группа является коммерческим продюсерским проектом одной из характерных особенностей является частая смена солисток и участниц группы. На сегодняшний день продюсерами группы &laquo;ВИА Гра&raquo; являются небезизвестные люди в современном российском шоу-бизнесе Дмитрий Костюк и Константин Меладзе. Название группы - по сути, некая аллюзия на препарат Виагра, по другой версии &laquo;ВИА&raquo; это сокращение от вокально-инструментального ансамбля, &laquo;Гра&raquo; в переводе с украинского языка - Игра.</p>', '0', 0, 2, 3, 2, 1100, 4, NULL, '2017-04-25 05:24:05', '2017-04-25 05:24:05'),
(1219, 'Виктория Дайнеко', '<p>Российская певица и актриса. Победительница &laquo;Фабрики звёзд-5&raquo;.</p>\r\n<p>Настоящую славу Виктории принесло участие в проекте &laquo;Фабрика Звезд&raquo;. Впрочем, на шоу &laquo;Первого канала&raquo; девушка попала не с первого раза. Помогло попасть на проект целеустремленность Вики. После школы девушка поехала в Москву получать образование. Будущая звезда в 2004 году без труда поступила в МАИ на факультет иностранных языков. Вика жила недалеко от &laquo;Останкино&raquo;. И когда узнала о кастинге на шоу &laquo;Фабрика звезд&raquo;, решила попытать на нем удачу. Через три месяца участия в шоу Вика стала победительницей &laquo;Фабрики звёзд Аллы Пугачёвой&raquo;. После шоу девушка начала сотрудничать с известным российским продюсером и композитором Игорем Матвиенко. После громкой победы певица отправилась в тур по городам России вместе со всеми участниками музыкального проекта &laquo;Фабрика звезд-5&raquo;. Сразу после выпуска девушка записала песню под названием &laquo;Лейла&raquo;, которая тут же стала хитом. А съемки видео на композицию оставили в памяти Вики неизгладимые впечатления: &laquo;Я была в шоке, когда мне сказали, что ролик будет сниматься в Таиланде. Первый раз была за границей, где росли пальмы!&raquo;, - вспоминает Виктория. <br /><br /></p>', '0', 0, 2, 3, 2, 1101, 4, NULL, '2017-04-25 05:25:15', '2017-05-04 01:40:53'),
(1220, 'Винтаж', '<p>В 2006-ом году экс-солистка известной в свое время группы &laquo;Лицей&raquo; Анна Плетнёва и бывший солист популярной группы &laquo;А-мега&raquo; Алексей Романов создали новый поп-проект - группу &laquo;Винтаж&raquo;. Идея создания группы пришла в голову упомянутым артистам во время ожидания сотрудников ГАИ. Тогда они и познакомились автомобиль Анны столкнулся с авто Алексея. Первоначально группу решили назвать &laquo;Челси&raquo;, однако позже название было изменено на &laquo;Винтаж&raquo;.</p>', '0', 0, 2, 3, 2, 1102, 4, NULL, '2017-04-25 05:26:41', '2017-04-25 05:26:41'),
(1221, 'Градусы', '<p>Группа &laquo;Градусы&raquo; была образована в 2008-ом году Романом Пашковым, Русланом Тагиевыми и Дмитрием Бахтиновым. Два старых друга Роман и Руслан сочинили несколько композиций: &laquo;Режисер&raquo;, &laquo;7:00&raquo;, &laquo;Время мое&raquo;, &laquo;Бродяга&raquo;, а Дмитрий оценил плоды творчества своих друзей и подтолкнул ребят к созданию собственного бойз-бенда &laquo;градус 100&raquo;. Так же с его подачи в группу пришел его старый знакомый и товарищ по работе в проекте &laquo;Саранча&raquo; - барабанщик Виктор Голованов. Первый концерт &laquo;Градус 100&raquo; отыграли через полтора месяца активных репетиций 29 мая 2008 года. Несколько позже к группе присоединяется пятый участник гитарист Арсен Бегляров а группу переименовали в &laquo;Градусы&raquo;.</p>', '0', 0, 2, 3, 2, 1103, 4, NULL, '2017-04-25 05:27:59', '2017-04-25 05:27:59'),
(1222, 'Григорий Лепс', '<p>Советский и российский певец грузинского происхождения, композитор, продюсер, член Международного союза деятелей эстрадного искусства. Заслуженный артист Республики Ингушетия, Заслуженный артист Российской Федерации, Народный артист Карачаево-Черкеси. Обладатель премий &laquo;World Music Awards&raquo;, &laquo;Песня года&raquo;, &laquo;Золотой грамофон&raquo;, Лауреат премии &laquo;Шансон года&raquo; и т.&nbsp;д.</p>\r\n<p>Творческий рост Григория Лепса начался в 1995 года. За год до этого он начал записывать свой первый альбом под названием &laquo;Храни Вас Бог&raquo;. Туда и вошла известная песня &laquo;Натали&raquo;. На композицию сняли видеоряд. В 1997 году свет увидел второй альбом Лепса &laquo;Целая жизнь&raquo;. И тогда же артист спел на промежуточном концерте &laquo;Песня года - 97&raquo; с композицией &laquo;Раздумья мои&raquo;. Спустя год Григорий выступает уже у Аллы Пугачевой на &laquo;Рождественских встречах&raquo;. Там он исполнил песню &laquo;Все равно увижу&raquo;.<br /><br /><br /><br /><br /></p>', '0', 0, 2, 3, 2, 1104, 4, NULL, '2017-04-25 05:31:50', '2017-05-04 01:38:59'),
(1223, 'Группа 5sta Family', '<p style=\"background: #FCFCFC;\"><span style=\"font-size: 8.5pt; font-family: \'Tahoma\',\'sans-serif\'; color: black;\">Группа &laquo;5ivesta Family&raquo; была создана в 2003-ем путем слияния двух коллективов &laquo;NB&raquo; и &laquo;AzonE&raquo; и поначалу в группе было пятеро участников, благодаря чему новый проект и получил такое название. Первым синглом группы &laquo;5ivesta Family&raquo; стала композиция &laquo;Ночной город&raquo;. В июле 2009-го года вышел новый сингл и бесспорный хит, исполненный совместно с группой &laquo;23:45&raquo; - композиция &laquo;Я буду&raquo;. Песня в мгновение стала одной из самых ротируемых композиций на радио, продержавшись в течении десяти недель на вершине российского радиочарта. Следующий сингл группы &laquo;Зачем?&raquo; также поднялся на лидирующие позиции российских чартов. В 2010-ом году в свет вышла композиция &laquo;на расстоянии звонка&raquo;, а так же песня &laquo;Любовь без обмана&raquo; так же исполненная в дуэте с группой &laquo;23:45&raquo;.</span></p>', '0', 0, 2, 3, 2, 1105, 4, NULL, '2017-04-25 05:33:52', '2017-04-25 05:33:52'),
(1224, 'Группа A-Studio', '<p>История группы &laquo;А-Студио&raquo; началась в 1982-ом году в Алма-Ате. Тогда Байгали Серкебаев играл в группе &laquo;Арай&raquo;, работавшей с певицей Розе Рымбаевой. После распада группы, Байгали собрал новый состав, названный &laquo;New-Арай&raquo;, который прославился в дальнейшем своими джаз-рок композициями и продолжал сотрудничать с Розе Рымбаевой. С 1987-го года коллектив расстался с Розе, и стал называться &laquo;Алмата&raquo;. После выпуска первого винилового альбома в 1987-ом году группа вновь меняет название и становится &laquo;Алмата Студио&raquo;. Тогда они экспериментировали с казахскими народным фольклором и обращались к музыке в стиле &laquo;New Wave&raquo; и &laquo;Funk&raquo;.</p>', '0', 0, 2, 3, 2, 1107, 4, NULL, '2017-04-25 05:35:09', '2017-04-25 05:35:09'),
(1225, 'Каршыга Ильанов', '', '0', 0, 2, 3, 2, 1106, 3, NULL, '2017-04-25 05:37:16', '2017-04-25 05:37:16'),
(1226, 'Дима Билан', '<p>Российский певец и киноактёр. В июне 2008 года принял данный псевдоним в качестве настоящего имени и фамилии. Заслуженный артист Кабардино-Балкарии, Заслуженный артист Чечни, Заслуженный артист Ингушетии&nbsp;и Народный артист Кабардино-Балкарии.</p>\r\n<p>В 2000 году в эфир MTV Russia попало первое видео Димы Билана. Его на собственные деньги сняла первый продюсер певца Елена Кан. Это была песня &laquo;Осень&raquo;, клип на которую был снят на берегу Финского залива. Еще студентом Дима Билан познакомился со своим будущим продюсером Юрием Айзеншписом. Последний сразу разглядел талант в кабардинском мальчике и начал с ним работать. Дебютировал на сцене Билан в 2002 году. Он выступил на фестивале &laquo;Новая волна&raquo; в Юрмале. Там он представил песню &laquo;Бум&raquo; и занял четвертое место. А после конкурса начали снимать клип на эту композицию, а затем на песни &laquo;Я ночной хулиган&raquo;, &laquo;Я ошибся, я попал&raquo; и &laquo;Ты, только ты&raquo;. Кстати, в клипе &laquo;Я так люблю тебя&raquo; снялась дочка Игоря Крутого.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1108, 4, NULL, '2017-04-25 05:37:29', '2017-05-04 01:36:13'),
(1227, 'Кенес Сейтхан', '<p>МОЛОДОЙ ПЕВЕЦ, МУЗЫКАНТ, КОМПОЗИТОР И АРТИСТ КАЗАХСТАНСКОЙ ЭСТРАДЫ.</p>', '0', 0, 2, 3, 2, 1109, 3, NULL, '2017-04-25 05:42:40', '2017-04-25 05:42:40'),
(1228, 'Рустам Кожагул', '<p>РУСТАМ ҚОЖАҒҰЛ - Қазақстан эстрадасының жас жұлдызы!</p>', '0', 0, 2, 3, 2, 1110, 3, NULL, '2017-04-25 05:45:26', '2017-04-25 05:45:26'),
(1229, 'Азамат  Демисинов', '<p>Ведущий любого формата мероприятия. Опыт работы 5 лет. Сценарии и конкурсы исключительно авторские. Даю гарантию того, что ваш праздник будет на высшем уровне и вы никогда его не забудете!!!&nbsp;</p>', '0', 0, 2, 4, 2, 1111, 3, NULL, '2017-04-25 05:47:56', '2017-04-25 05:47:56'),
(1230, 'Дмитрий Фомин', '<p>Российский певец и автор песен, режиссёр, телеведущий, продюсер. Лауреат премии &laquo;Золотой граммофон&raquo; и фестиваля &laquo;Песня Года&raquo;, неоднократный номинант и лауреат премий МУЗ-ТВ и RU.TV. В 1998-2008 гг. солист музыкальной поп-группы Hi-Fi.</p>', '0', 0, 2, 3, 2, 1113, 4, NULL, '2017-04-25 05:51:44', '2017-04-25 05:51:44'),
(1231, 'Елена Терлеева', '<p>Российская эстрадная певица, автор песен и композитор, финалистка проекта &laquo;Фабрика звёзд-2&raquo;, победитель телевизионного фестиваля песни Песня года, музыкальной премии Золотой граммофон.&nbsp;</p>\r\n<p>В 2002 году Терлеева поступила на эстрадно-джазовое отделение Института Современного Искусства, на класс вокала. Учителя по достоинству оценили ее уровень подготовки и зачислили девушку сразу на второй курс. Через год Елена прошла кастинг на &laquo;Фабрику звезд-2&raquo; . Фабрика звёзд. По итогам финального концерта Елена Терлеева попала в число финалисток. Она заняла второе место, уступив лишь Полине Гагариной. Знаменитый проект Макса Фадеева стал для молодой певицы начальной точкой карьерного роста. Девушке посчастливилось работать с настоящими профессионалами, а также объездить с гастролями всю страну вместе с друзьями-фабрикантами &ndash; Ираклием Пирцхалава, Пьером Нарциссом, Юлей Савичевой и другими.&nbsp;<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1114, 4, NULL, '2017-04-25 05:52:52', '2017-05-04 01:34:00'),
(1232, 'Жандос Жылқыбаев ', '<p>Той думандарыңызды қазақтың салт-дәстүрi бойынша өткiзу.</p>\r\n<p>Шоу Програма бiздiң қызметтерiмiз:</p>\r\n<ul>\r\n<li>Асаба (тамада)</li>\r\n<li>Музыка (дуэт,трио,дастурлi ан)</li>\r\n<li>Бишiлер (коптеген би турлерi)</li>\r\n<li>Сандык тусiрiлiм</li>\r\n</ul>\r\n<p>Мерекелi, ажарлы, берекелi, базарлы күндерiңіз коп болсын!</p>', '0', 0, 2, 4, 2, 1112, 3, NULL, '2017-04-25 05:54:18', '2017-04-25 05:54:18'),
(1233, 'Иосиф Кобзон', '<p>Советский и российский эстрадный певец (баритон), музыкально-общественный деятель, педагог.</p>\r\n<p>Лирический баритон ясной окраски &ndash; это голос Кобзона. Специфический и благородный тембр узнаваем с первых звуков. К тому же Иосифа отличает прекрасная дикция. Голос певца окончательно сформировался к 70-х годам. В самом начале карьеры артист пел другим звуком, нежели, к примеру, в 70-е. Кстати, начинал карьеру Иосиф Кобзон вместе с Виктором Кохно, дуэт пел гражданские и лирические песни Аркадия Островского. Композитор, зачастую, сам аккомпанировал артистам на аккордеоне. После смерти Островского в 1968 года Кобзон начал сольную карьеру. Самый первый фестиваль &laquo;Песня года&raquo; в 1971 году как раз открылся песней Иосифа Кобзона &laquo;Баллада о красках&raquo;. <br /><br /></p>', '0', 0, 2, 3, 2, 1115, 4, NULL, '2017-04-25 05:54:37', '2017-05-04 01:31:48'),
(1234, 'Ирина Аллегрова', '<p>Советская и Российская&nbsp;эстрадная певица, актриса. Народная артистка России.</p>\r\n<p>В 1985 году Ирина Аллегрова впервые вышла на большую песню. Оскар Фельцман специально для певицы написал композицию &laquo;Голос ребенка&raquo;. С песней артистка выступает на творческом вечере композитора, впервые попадает на &laquo;Песню года 1985&raquo; и становится солисткой ансамбля &laquo;Огни Москвы&raquo;. Вскоре Фелцман передает руководство группой Давиду Тухманову. Так образовывается рок-группа &laquo;Электроклуб&raquo;, главными солистами которой стали Ирина Аллегрова и Игорь Тальков. Самыми известными песнями коллектива стали &laquo;Старое зеркало&raquo;, &laquo;Чистые пруды&raquo;, &laquo;Три письма&raquo;.&nbsp;Ирина Аллегрова покинула группу &laquo;Электроклуб&raquo; в 1990 году и уходит, по словам самой певицы &laquo;в никуда, держа в руке как флаг песню Игоря Николаева &laquo;Странник&raquo;. Менее чем через месяц певица уже была названа лучшей певицей года по итогам зрительского голосования. В этого момента началась сольная карьера артистки. Далее в репертуаре Аллегровой появляются песни &laquo;Фотография&raquo;, &laquo;Не улетай, любовь!&raquo;, &laquo;Не было печали&raquo; и другие. Будущая народная артистка появляется на телевидении и начинает гастролировать. <br /><br /><br /></p>', '0', 0, 2, 3, 2, 1117, 4, NULL, '2017-04-25 05:56:18', '2017-05-04 01:30:21'),
(1235, 'Саян Бегелдинов', '<p>Ведущий, который может вести совершенно по-разному, в разных стилях. Дарю море позитива и эмоций. Опыт 7 лет.</p>', '0', 0, 2, 4, 2, 1116, 3, NULL, '2017-04-25 05:58:26', '2017-04-25 05:58:26'),
(1236, 'Кристина Орбакайте', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"font-size: 10.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">Советская и российская эстрадная певица, актриса. Заслуженная артистка России</span><span style=\"font-size: 10.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">.&nbsp;</span></p>\r\n<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"font-size: 10.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">На счету актрисы Кристины Орбакайте&nbsp;&mdash; около трёх десятков работ в телевизионных и художественных фильмах и мюзиклах. Репертуар певицы насчитывает более ста пятидесяти песен.</span></p>\r\n<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"font-size: 10.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">В возрасте семи лет Кристина Орбакайте впервые появилась на телевидении. Девочка спела песню &laquo;Солнышко смеется&raquo; в передаче &laquo;Веселые нотки&raquo;.&nbsp;Сольную певческую карьеру Кристина Орбакайте начинает в 1992 году. Певица дебютирует на &laquo;Рождественских встречах&raquo; Аллы Пугачевой. Первая песня, которая прозвучала из уст Орбакайте для широкой публики, стала &laquo;Поговорим&raquo; на слова и музыку Игоря Николаева. Дальше появляются песни и клипы &laquo;Позови меня&raquo; и &laquo;Горькое похмелье&raquo;. Эти композиции и вошли в дебютный альбом певицы &laquo;Верность&raquo;, который вышел в 1993 году.<br /><br /></span></p>', '0', 0, 2, 3, 2, 1118, 4, NULL, '2017-04-25 05:58:34', '2017-05-04 01:28:58'),
(1237, 'Лариса Долина', '<p>Советская и российская&nbsp;эстрадная джазовая певица, актриса. Народная артистка России. Трёхкратная обладательница Национальной российской премии \"Овация\".</p>\r\n<p>Впервые Долина вышла на сцену в возрасте 12-ти лет. Это было в пионерском лагере &laquo;Юный романтик&raquo;. Руководитель вокально-инструментального ансамбля &laquo;Магелланы&raquo; захотел, чтобы с ним спела именно Долина. Выступление, которое прошло на &laquo;ура!&raquo;, предрешило дальнейшую судьбу артистки. <br /><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0', 0, 2, 3, 2, 1119, 4, NULL, '2017-04-25 06:00:16', '2017-05-04 01:27:11'),
(1238, 'Салон красоты \"ART\"', '', '0', 0, 2, 9, 2, 1120, 3, NULL, '2017-04-25 06:00:24', '2017-04-25 06:00:24'),
(1239, 'Валерий Леонтьев', '<p>Советский и российский певец, автор песен, актер. Народный артист России, Лауреат премии Ленинского комсомола, Кавалер ордена &laquo;За заслуги перед Отечеством&raquo; 4-й степени, ордена Почета&nbsp;и ордена Дружбы. Обладатель премий \"World Music Awards\", \"ZD Awards\", Овация, Золотой Граммофон, практически бессменный победитель номинаций &laquo;Певец года&raquo; и &laquo;Шоу года&raquo; за 1980&mdash;2001 годы в российских музыкальных рейтингах того времени.</p>\r\n<p>Записал более 20 альбомов, многие из которых расходились миллионными тиражами. В прессе Валерия Леонтьева называют &laquo;мегазвездой&raquo; и &laquo;легендой&raquo; российской эстрады<span style=\"font-size: 11.6667px;\">.</span></p>', '0', 0, 2, 3, 2, 1122, 4, NULL, '2017-04-25 06:05:35', '2017-04-25 06:05:35'),
(1240, 'Арина и Валентин', '<p>ПРЕДЛАГАЕМ СЛЕДУЮЩИЙ СПЕКТР ФОТОУСЛУГ:<br /> - Свадебная фото съемка<br /> - Love Story<br /> - Фотосъемка Дней рождения<br /> - Корпоративная фотосъемка праздников<br /> - Фотосъемка детей<br /> - Разработка фотокниг</p>', '0', 0, 2, 14, 2, 1121, 3, NULL, '2017-04-25 06:05:48', '2017-04-25 06:05:48'),
(1241, 'Даурен Кошербаев', '', '0', 0, 2, 14, 2, 1124, 3, NULL, '2017-04-25 06:07:09', '2017-04-25 06:07:09'),
(1242, 'Лолита Милявская', '<p>Советская и российская&nbsp;эстрадная певица, актриса, телеведущая, режиссер. Лауреат национальной телевизионной премии &laquo;ТЭФИ 2007&raquo; в номинации &laquo;Ведущий ток-шоу&raquo; за ток-шоу &laquo;Лолита. Без комплексов&raquo; на Первом канале.</p>\r\n<p>В 1995 году появляется альбом &laquo;Хочешь, но молчишь&raquo;, а спустя два года записывается пластинка &laquo;Свадьба&raquo;. По итогам года концертные версии получили премии. В это время на канале РТР и украинском &laquo;1+1&raquo; появляется передача &laquo;Доброе утро, страна!&raquo;. Она побила все возможные рейтинги. А наибольшей популярностью пользовалась работы Лолы в телепроекте &laquo;Старые песни о главном&raquo;. Между работой в студии и на съемочных площадках Лолита Милявская успевала гастролировать. Причем не только в городах России, но и Израиля, США, Канады, Германии.&nbsp;</p>\r\n<p>В 1999 году был выпущен альбом &laquo;ТУ-Ту-Ту На-На-На&raquo;. Зрители и звукозаписывающая компания назвали его лучшей пластинкой кабаре-дуэта &laquo;Академия&raquo;. И в том же году вышел так называемый &laquo;блатной&raquo; альбом &laquo;Отпечатки пальцев&raquo;.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1123, 4, NULL, '2017-04-25 06:07:50', '2017-05-03 13:13:16'),
(1243, 'Ерлан Кенжегалиев', '', '0', 0, 2, 14, 2, 1125, 3, NULL, '2017-04-25 06:09:37', '2017-04-25 06:09:37'),
(1244, 'Максим', '<p>Российская певица, автор, исполнительница и музыкальный продюсер, Заслуженная артистка Карачаево-Черкесской Республики, Заслуженная артистка Республики Татарстан. Успех пришёл к певице с выпуском 28 марта 2006 года альбома &laquo;Трудный возраст&raquo;, который разошёлся тиражом более 1,5 миллиона копий, и в 2007 году МакSим стала&nbsp;самой коммерчески успешной певицей в России.</p>', '0', 0, 2, 3, 2, 1126, 4, NULL, '2017-04-25 06:10:14', '2017-04-25 06:10:14'),
(1245, 'Ернар Газизбеков', '<p>Красивые и креативные фотографии.</p>', '0', 0, 2, 14, 2, 1127, 3, NULL, '2017-04-25 06:10:54', '2017-04-25 06:10:54'),
(1246, 'Наташа Королева', '<p>Советская и российская&nbsp;эстрадная певица&nbsp;и актриса украинского происхождения. Заслуженная артистка России.</p>\r\n<p>После выхода альбома популярность Наташи Королевой начала буквально зашкаливать. &laquo;Желтые тюльпаны&raquo; вывели девушку в финал главного музыкального конкурса страны &ndash; &laquo;Песни года&raquo;. Стадионы и концертные площадки были переполнены, поклонники охапками несли любимой артистке желтые тюльпаны, а когда сломавшая ногу Наташа взяла небольшой тайм-аут, почитатели ее творчества просили вынести загипсованную девушку на сцену.<br /><br />В 1995 году вышел второй исключительно сольный альбом Королёвой, &laquo;Конфетти&raquo;, состоявший из одиннадцати песен. Среди них была и композиция &laquo;Маленькая страна&raquo;, вскоре покорившая федеральный теле- и радиоэфир, превратившись в бессмертный шлягер для детей и взрослых, продолжающих верить в сказку.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1128, 4, NULL, '2017-04-25 06:12:18', '2017-05-03 13:10:53'),
(1247, 'Николай Басков', '<p>Российский эстрадный и оперный певец.</p>\r\n<p>Известен также как телеведущий, киноактёр, педагог, профессор кафедры вокала. Народный артист Украины, Мастер искусств Молдавии. Народный артист России. Десятикратный обладатель премии &laquo;Золотой граммофон&raquo;.</p>\r\n<p>Премии начинают сыпаться в копилку Николая Баскова как из рога изобилия. В 1999 году артист стал лауреатом Второй премии на испанском конкурсе Grande Voce. Ну а спустя год певец уже начинает снимать видеоклипы. Последовал ролик на песню &laquo;Памяти Карузо&raquo;. И именно он помог быстро покорить музыкальный олимп России. Видео заняло первые места в российских хит-парадах на телевидении и радио. Тут карьера Николая начала выходить за рамки академических залов, количество его поклонников начало стремительно расти. Диски с его песнями расходились миллионными тиражами. В итоге он стал первым и пока единственным певцом в России, который поет и в стиле Crossover и в стиле Pop. Каждая композиция становится хитом и штурмует строчки хит-парадов, клипы же котируются на престижных музыкальных каналах. Артист много раз получал Национальные премии &laquo;Овация&raquo;, &laquo;МУЗ-ТВ&raquo;, &laquo;Золотой Граммофон&raquo;, &laquo;Стиль года&raquo; и &laquo;Певец года&raquo;.<br /><br /></p>', '0', 0, 2, 3, 2, 1129, 4, NULL, '2017-04-25 06:15:15', '2017-05-03 13:08:26'),
(1248, 'Пицца', '<p style=\"background: #FCFCFC;\"><span style=\"font-size: 8.5pt; font-family: \'Tahoma\',\'sans-serif\'; color: black;\">Бывший участник и саундпродюсер хип-хоп группы &laquo;Виа чаппа&raquo; Сергей Приказчиков (некогда звезда г. Уфы репер Пицца) собрал вокруг себя талантливых ребят и начал продвигать накопившийся сольный материал в рамках своего нового проекта с вкусным названием &laquo;Пицца&raquo;. Сергей ранее являлся лидером известных в республике Башкирия коллективов &laquo;Funky голоса&raquo; и &laquo;M-1.3&raquo;.</span></p>\r\n<p style=\"background: #FCFCFC;\"><span style=\"font-size: 8.5pt; font-family: \'Tahoma\',\'sans-serif\'; color: black;\">Лидер группы &laquo;Пицца&raquo; считает, что творчество группы вполне отвечает кулинарному названию коллектива. По словам Сергея Приказчикова все творчество группы &laquo;состоит из смеси маленьких фрагментов, которые вместе составляют неповторимое и уникальное сочетание, вместе они единое целое. И притом очень даже вкусное&raquo;. И, правда, в работах коллектива угадываются мелодии порой несочетаемых музыкальных направлений: Rap, Funk, Reggae, Soul Pop, но весьма органично дополняющих друг друга как ветчина и сыр на тонком тесте.</span></p>', '0', 0, 2, 3, 2, 1130, 4, NULL, '2017-04-25 06:16:35', '2017-04-25 06:16:35'),
(1249, 'Полина Гагарина', '<p>Российская поп-певица, композитор, актриса, модель. Представительница России на музыкальном конкурсе &laquo;Евровидение-2015&raquo;, занявшая второе место.</p>\r\n<p>Несколько лет после участия в проекте &laquo;Первого канала&raquo; &laquo;Фабрика звезд&raquo; Полина Гагарина не давала о себе знать. Однако в это время певица все-таки занималась сольным творчеством. В 2005 году на экранах телевизоров появился клип на популярную песню Полины Гагариной &laquo;Колыбельная&raquo;. В это же время девушке предлагает контакт продюсерский центр Игоря Крутого, и певица выпускает дебютный альбом &laquo;Попроси у облаков&raquo;. В том же году девушка приняла участие в конкурсе &laquo;Новая волна&raquo;, где выступила с композициями &laquo;В горнице моей светло&raquo;, &laquo;Je t&rsquo;aime&raquo; и &laquo;Колыбельная&raquo;, и заняла третье место.&nbsp;А на &laquo;Новой волне&raquo; в 2007 году Полина Гагарина выступила уже как заслуженная певица, в день открытия. Чуть позже был записан саундтрек к телесериалу &laquo;Дочки-матери&raquo;.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1131, 4, NULL, '2017-04-25 06:18:29', '2017-05-03 13:07:03'),
(1250, 'Сати Казанова', '<p>Российская певица и актриса, модель, телеведущая. Бывшая участница российской женской группы &laquo;Фабрика&raquo;.</p>\r\n<p>Мечта стала осуществляться, когда появился проект &laquo;Фабрика звезд&raquo;, продюсером которого стал Игорь Матвиенко. Девушка с успехом выдержала испытание и в 2002 году вошла в состав группы &laquo;Фабрика&raquo;. Кроме Сати Казановой в трио выступали Ирина Тонева и Саша Савельева. Коллектив стал одним из самых востребованных в стране. Песни девичьего трио раздавались практически отовсюду, а композиции &laquo;Про любовь&raquo;, &laquo;Девушки фабричные&raquo;, &laquo;Рыбка&raquo; покорили вершины российских хит-парадов.<br /><br /><br /></p>', '0', 0, 2, 3, 2, 1132, 4, NULL, '2017-04-25 06:20:21', '2017-05-03 13:04:28');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1251, 'Сергей Лазерев', '<p>Российский певец, актер театра, кино&nbsp;и озвучивания, телеведущий, бывший участник группы Smash. Лауреат премии &laquo;Золотой граммофон&raquo;; многократный участник, а с 2007 года&nbsp;&mdash; ведущий фестиваля &laquo;Песня года&raquo;. Представлял Россию в конкурсе песни &laquo;Евровидение-2016&raquo;, где занял&nbsp;3&nbsp;место.</p>\r\n<p>Сергей Лазарев с детства любил музыку и уже с ранних лет выступал на сцене, участвовал в проекте &laquo;Непоседы&raquo;, был частью музыкальной группы Smash!!, а потом начал свою сольную карьеру. Теперь он именитый артист, выступающий по всему миру, собирающий большие концертные площадки, одинаково успешно исполняющий песни на русском и английском языках.</p>\r\n<p>&nbsp;1 декабря 2005 года Сергей Лазарев выпустил свой дебютный сольный альбом Don&rsquo;t Be Fake. Он состоял из 12-ти песен, которые были записаны в Лондоне. Восемь композиций певец создал в сотрудничестве с продюсером Брайаном Роулингом, который работал с такими звездами, как Селин Дион, Энрике Иглесиас, Бритни Спирс, Крейг Дэвид и Роб Томас.<br /><br /><br /><br /><br /></p>', '0', 0, 2, 3, 2, 1133, 4, NULL, '2017-04-25 06:23:02', '2017-05-03 13:02:59'),
(1252, 'Серебро', '<p>В 2006-ом году известнейший продюсер Максим Фадеев образовал свой новый музыкальный проект под названием &laquo;Серебро&raquo;. На сегодняшний день, группа &laquo;Serebro&raquo; пользуется огромной популярностью.</p>', '0', 0, 2, 3, 2, 1134, 4, NULL, '2017-04-25 06:24:21', '2017-04-25 06:24:21'),
(1253, 'София Ротару', '<p>Советская, российская и украинская эстрадная певица, актриса молдавского происхождения. Народная артистка СССР. Герой Украины.</p>\r\n<p>Первый успех пришел к Ротару уже в 1962 году. Именно в этом году София победила в районном конкурсе художественной самодеятельности. Он-то и открыл ей дорогу на областной смотр в Черновцах, где певица так же заняла первое место. За силу голоса земляки называли ее &laquo;Буковинский соловей&raquo;.</p>\r\n<p>&nbsp;В 1968 году София Ротару закончила музыкальное училище и отправилась на IX Всемирный фестиваль молодежи и студентов в Болгарию. Там она завоевала золотую медаль и первое место в конкурсе исполнителей народной песни.<br /><br /></p>', '0', 0, 2, 3, 2, 1135, 4, NULL, '2017-04-25 06:26:04', '2017-05-03 13:00:12'),
(1254, 'Стас Пьеха', '<p>Российский певец и поэт, участник проекта &laquo;Фабрика звезд&raquo;. Заслуженный артист России.</p>\r\n<p>Все началось в 2004 году &ndash; именно тогда Стас прошел кастинг четвертого сезона &laquo;Фабрики звезд&raquo;, попал на проект вместе с Домиником Джокером, Ириной Дубцовой, Тимати и Антоном Зацепиным. Продюсером шоу был Игорь Крутой, с которым у Пьехи с самого начала не сложились отношения. Крутой не скрывал своей антипатии к молодому певцу, о чем потом признался на шоу Андрея Малахова. Враждебное отношение &laquo;начальника&raquo; не помешало Стасу раскрыться: он великолепно справлялся с любым номером, образовывал гармоничный дуэт с любым артистом и неизменно восхищал публику на отчетных концертах &laquo;Фабрики&raquo;.&nbsp;Проект &laquo;Фабрика звезд&ndash;4&raquo; завершился для Пьехи победой. Молодой человек занял третье призовое место. Подарок Первого канала был солидным: Пьеха нашел продюсера для сольного альбома, получил бесплатную съемку видеоклипа и, в качестве приятного бонуса, обзавелся мотороллером. <br /><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0', 0, 2, 3, 2, 1136, 4, NULL, '2017-04-25 06:27:42', '2017-05-03 12:57:33'),
(1255, 'Тимати', '<p>Российский исполнитель, музыкальный продюсер, актёр и предприниматель, выпускник &laquo;Фабрики звёзд 4&raquo;. Заслуженный артист Чеченской Республики. С<span class=\"icard-hidden-content__payload\">отрудничал с такими американскими исполнителями, как Snoop Dogg, Баста Раймс, Дидди и его группой Diddy &ndash; Dirty Money, Xzibit, Марио Уайнэнс, Fat Joe, Ив, Крейг Дэвид, Тимбалэнд и Flo Rida.</span></p>\r\n<p><span class=\"icard-hidden-content__payload\">В 2006 году выходит долгожданный сольный альбом под название &laquo;Black Star&raquo;, а чуть позже он основывает продюсерский центр под названием &laquo;Black Star ins&raquo;, также он начал выпускать для молодежи коллекцию одежды &laquo;Black Star by TIMATI&raquo; и завершает пирамиду успеха, снявшись в фильме Федора Бондарчука под названием &laquo;Жара&raquo;.</span></p>\r\n<p><span class=\"icard-hidden-content__payload\">В 2008 году он взрывает мир своей новой песней &laquo;Moscow Never Sleeps&raquo; и по всем музыкальным каналом начинает крутиться клип &laquo;Не сходи с ума&raquo;. В этом же году он расширяет свою фирменную одежду, выпустив спортивный вариант под названием &laquo;TS Timati for Sprandi&raquo;.</span></p>\r\n<p>Ныне, Тимати сумел достичь такой точки славы, когда может спокойно сотрудничать с любыми зарубежными исполнителями. Он уже имеет немало подобных работ со знаменитыми американскими реперами. Помимо русских наград, его песни неоднократно занимали места в чартах Европы.</p>', '0', 0, 2, 3, 2, 1137, 4, NULL, '2017-04-25 06:29:07', '2017-05-03 12:55:09'),
(1256, 'Филипп Киркоров', '<p>Советский и российский эстрадный певец, актёр, композитор и продюсер. Народный артист Российской Федерации.</p>\r\n<p>Восьмикратный обладатель премии &laquo;Овация&raquo;, пятикратный обладатель награды &laquo;World Music Awards&raquo; как самый популярный исполнитель России, многократный обладатель премий &laquo;Золотой граммофон&raquo;, &laquo;Стопудовый хит&raquo;, &laquo;Серебряная калоша&raquo;, лауреат ежегодного фестиваля &laquo;Песня года&raquo;. На кинофестивале &laquo;Кинотавр&raquo; в 2002 году Киркоров стал победителем в номинации&nbsp;&laquo;Лучшая мужская роль&raquo;&nbsp;за роль в мюзикле &laquo;Вечера на хуторе близ Диканьки&raquo;</p>', '0', 0, 2, 3, 2, 1138, 4, NULL, '2017-04-25 06:30:26', '2017-05-03 12:48:16'),
(1257, 'Юлия Савичева', '<p>Российская эстрадная певица, выпускница телепроекта &laquo;Фабрика Звёзд 2&raquo;, участница конкурса &laquo;Евровидение 2004&raquo;, актриса.</p>\r\n<p>7 марта 2003 Юлия становится участницей телевизионного проекта &laquo;Фабрика звезд 2&raquo; под руководством Максима Фадеева. Пройдя все этапы отбора, она попадает в пятёрку финалисток, в числе которых также оказались Елена Терлеева, Елена Темникова, Мария Ржевская и Полина Гагарина. После телепроекта песни Савичевой &laquo;Корабли&raquo; и &laquo;Высоко&raquo;, спетые во время проекта, и последующая песня &laquo;Прости за любовь&raquo;, пользуются большим успехом. С песней &laquo;Высоко&raquo; Юлия становится обладательницей &laquo;Золотого граммофона&raquo; и с этой же песней она попадает в финал фестиваля &laquo;Песня года-2003&raquo;.</p>', '0', 0, 2, 3, 2, 1139, 4, NULL, '2017-04-25 06:31:22', '2017-05-03 12:44:01'),
(1258, 'Юрий Шатунов', '<p>Советский и российский певец, солист группы &laquo;Ласковый май&raquo;.&nbsp;В октябре 1986 года Юрий знакомится с руководителем музыкального кружка Сергеем Кунецовым, находящимся в это время в поиске исполнителя для своих песен. Уже в октябре Сергей Кузнецов пишет для него первую песню &laquo;Вечер холодной зимы&raquo; и вторую: &laquo;Метель в чужом городе&raquo;, и начинаются репетиции. Так образовался первый состав группы <strong>&laquo;</strong>Ласковый май<strong>&raquo;</strong>, в который, кроме Кузнецова и Шатунова, входили Вячеслав Пономарев (бас-гитара) и Сергей Серков&nbsp;(светомузыка). С 1986 по 1988 год группа с успехом выступает на дискотеках в интернате и местном ДК &laquo;Орбита&raquo;.</p>\r\n<p>В это время были созданы основные хиты &laquo;Ласкового мая&raquo;: &laquo;Белые розы&raquo;, &laquo;Лето&raquo;, &laquo;Пусть будет ночь&raquo;, &laquo;Седая ночь&raquo;, &laquo;Ну, что же ты&raquo;, &laquo;Тающий снег&raquo;. В 1988 год году Кузнецов записывает первый альбом &laquo;Ласкового мая&raquo; в Доме детского творчества, в котором находилась неофициальная репетиционная база группы</p>', '0', 0, 2, 3, 2, 1140, 4, NULL, '2017-04-25 06:32:50', '2017-05-03 12:39:37'),
(1259, 'Артём Мирошниченко', '<p>Из практики: В сфере фотографии с 2004 года, непосредственно свадьбы снимаю с 2006-го. &nbsp;Имею опыт репортажного фотографа т.к. работал фотокорреспондентом. Регулярно прохожу обучение на мастер классах по портретной и свадебной фотографии. Имею опыт совместных съёмок с известными фотографами СНГ и Зарубежья.</p>\r\n<p>Снимаю на профессиональную технику от Canon с объективами из элитной L серии. Техника позволяет снимать сразу на 2 носителя информации одновременно что исключает потерю фотоснимков с важного события.</p>', '0', 0, 2, 14, 2, 1141, 3, NULL, '2017-04-26 02:38:08', '2017-04-26 02:38:08'),
(1260, '30 Seconds to Mars', '<p>Рок-группа, основанная Шенноном и Джаредом Лето в 1998 году, уже стала настоящей легендой. Название своего коллектива музыканты позаимствовали из учебника. Своими наставниками братья Лето считают музыкантов из таких известных коллективов, как Pink Floyd, Led Zeppelin и Joy Division.</p>', '0', 0, 2, 3, 2, 1142, 4, NULL, '2017-04-26 02:41:29', '2017-04-26 02:41:29'),
(1261, '50 Cent', '<p>Американский рэпер, актёр, писатель, боксёрский промоутер и продюсер, известный под сценическим псевдонимом&nbsp;50 Cent, который переводится как &laquo;Пятьдесят центов&raquo;. Известность пришла к нему с выпуском альбомов Get Rich or Die Tryin&nbsp;и The Masscare<em>.</em>&nbsp;50 Cent добился успеха с обоими альбомами, продав более 40 миллионов экземпляров по всему миру.</p>', '0', 0, 2, 3, 2, 1143, 4, NULL, '2017-04-26 03:01:08', '2017-04-26 03:01:08'),
(1262, 'Авраам Руссо', '<p>Во время одного из выступлений вокальные данные певца заметил владелец ресторана, а затем пригласил Авраама в Москву. Так в биографии Авраама Руссо начался новый творческий период. Заключив контракт с компанией &laquo;Нокс мьюзик&raquo; при содействии Иосифа Пригожина, Руссо приступил к записи первого альбома. Дебютный альбом певца вышел в 2001 &ndash; &laquo;Amor&raquo;. Затем в биографии Авраама Руссо последовали альбомы &laquo;Tonight&raquo;, &laquo;Просто любовь&raquo;, &laquo;Обручальная&raquo;. Кроме великолепного голоса певец славится своей внешностью и обаянием. Песни голубоглазого брюнета уже успели покорить многие европейские страны.</p>', '0', 0, 2, 3, 2, 1145, 4, NULL, '2017-04-26 04:58:12', '2017-04-26 04:59:46'),
(1263, 'Adele', '<p>Британская певица, автор-исполнитель и поэт. Окончив BRIT School&nbsp;в 2006 году, Адель заключила контракт с лейблом XL Recordings. В 2007 году Адель победила в номинации &laquo;Выбор критиков&raquo; на премии \"<em>Brit\"</em>&nbsp;и была признана новым лучшим исполнителем на BBC&nbsp;\"Sound of 2008\"&nbsp;по итогам опроса. Дебютный альбом <em>19</em>&nbsp;был выпущен в 2008 году и стал коммерчески успешным. На 51-ой церемонии \"Грэмми\"&nbsp;в 2009 году&nbsp;Адель получила награды в номинациях &laquo;Лучший новый исполнитель&raquo; и &laquo;Лучшее женское вокальное исполнение&raquo;.</p>', '0', 0, 2, 3, 2, 1146, 4, NULL, '2017-04-26 05:06:17', '2017-04-26 05:06:17'),
(1264, 'Жандос Динмухамедов', '<p style=\"background: white;\"><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">Love Story 4-5 часа:<br /> -40-60 фотографии<br /> -запись на Disc<br /> -фотокнига 20х20см, 9 разворотов<br /></span></p>\r\n<p style=\"background: white;\"><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">Свадебная съёмка (свадебный день):<br /> -600-800 фотографии<br /> -запись на Disc<br /> -слайд шоу<br /> -фотокнига 20х20см, 9 разворотов<br /></span></p>\r\n<p style=\"background: white;\"><span style=\"font-size: 9.5pt; font-family: \'Arial\',\'sans-serif\'; color: #222222;\">Ұзату:<br /> -300-600 фотографии<br /> -запись на Disc<br /> -слайд шоу<br /> -фотокнига 20х20см, 9 разворотов<br /><br /></span></p>', '0', 0, 2, 14, 2, 1144, 3, NULL, '2017-04-26 05:07:25', '2017-04-26 05:07:25'),
(1265, 'Beyonce', '<p>Американская певица в стиле R\'n\'B, актриса, танцовщица, музыкальный продюер. Ещё будучи ребёнком, участвовала в разных вокальных и танцевальных конкурсах, в школе также принимала участие в различных художественных выступлениях. Прославилась в конце 1990-х годов, будучи солисткой женской R&amp;B группы Destiny\'s Child.</p>', '0', 0, 2, 3, 2, 1147, 4, NULL, '2017-04-26 05:13:39', '2017-04-26 05:13:39'),
(1266, 'Bob Dylan', '<p>Культовый музыкант, автор песен, актер, художник и писатель. Культовая фигура американский фолк- и рок-сцены с 60-х годов XX века. Автор бессмертных хитов &laquo;Blowin&rsquo; in the Wind&raquo; и &laquo;Knockin&rsquo; the Heaven&rsquo;s Door&raquo;. Основатель течения &laquo;кантри-рок&raquo;. Один из негласных символов левого антивоенного американского движения. Лауреат Нобелевской премии по литературе 2016 года.</p>', '0', 0, 2, 3, 2, 1148, 4, NULL, '2017-04-26 05:15:44', '2017-04-26 05:15:44'),
(1267, 'Britney Spears', '<p>Американская поп-певица, обладательница премии &laquo;Грэмми&raquo;, танцовщица, автор песен, киноактриса. Её дебютный альбом Baby One More Time сделал её всемирно популярной, а одноимённый сингл возглавил чарт Billboard Hot 100.</p>', '0', 0, 2, 3, 2, 1150, 4, NULL, '2017-04-26 05:18:17', '2017-04-26 05:18:17'),
(1268, 'RHYTMIC PULSE', '<p>RHYTMIC PULSE- стопроцентная интернациональность и полностью живой инструментал &ndash; вот, что придаёт уникальность бэнду RHYTMIC PULSE на вашем празднике.&nbsp;<br /> Шесть профессиональных музыкантов из разных стран (США, Конго, Куба, Россия, Казахстан), объединённые страстной любовью к живой музыке, исполняют популярные песни на английском, русском, французском, испанском и африканских языках.</p>\r\n<p><br /> Музыкальные направления, в котором работают сегодня музыканты RHYTMIC PULSE - это: Funk, Pop, Dance, Retro, Rumba, Bachata, R\'n\'B и Lounge (от 80-х до актуальности). В play-list коллектива входят только проверенные хиты.<br /> Встретившись и начав свой музыкальный квест, коллектив быстро получил популярность не только в самой столице Урале, но и далеко за её пределами. Бэнд RHYTMIC PULSE&nbsp;обожает выступать на корпоративах, юбилеях, свадьбах и любых других закрытых мероприятиях.&nbsp;</p>\r\n<p><br /> Также, коллектив&nbsp;неоднократно выступал на больших площадках во многих крупных городах России, Барселона, Стамбула, в качестве приглашённых хэдлайнеров на национальных и местных праздниках (день города, день нефтяника, день строителя, день металлурга, 9 мая и много крупных международных фестивали). Для каждого случая индивидуальный подход гарантирован.<br /> RHYTMIC PULSE &ndash; ритмичный пульс Вашего праздника!</p>', '0', 0, 2, 1, 2, 1149, 3, NULL, '2017-04-26 05:18:35', '2017-04-26 05:18:35'),
(1269, 'Bruno Mars', '<p>С четырех лет Бруно предстал перед публикой в качестве певца. Тогда же появляется знаменитый высокий начес Бруно Марса, ведь малыш дебютировал на сцене, изображая самого Элвиса Пресли. Во время семейных поездок с музыкальными выступлениями мальчуган начал сочинять свои первые композиции.</p>\r\n<p>Начал профессиональную карьеру Бруно как автор песен для таких исполнителей как Шон Кингстон, Адам Левин, Александра Берк, Трэвис Маккой и др. Первое участие в качестве исполнителя состоялось во время записи альбома &laquo;Animal&raquo; с группой &laquo;Far East Movement&raquo;. Популярность к Марсу пришла, когда он вместе Трэвисом Маккоем исполнил песни &laquo;B.o.B &laquo;Nothin\' on You&raquo; и &laquo;Billionaire&raquo;.<br /> </p>', '0', 0, 2, 3, 2, 1151, 4, NULL, '2017-04-26 05:20:00', '2017-04-26 05:20:00'),
(1270, 'Джамбо-Джамбо Шоу', '<p>Выступление длится 30 минут:<br /> 1) Вокал на казахском и других языках.<br /> 2) Барабан шоу.<br /> 3) Интерактивы с гостями и флешмоб.<br /> 4) Акробатическое шоу.</p>', '0', 0, 2, 1, 2, 1152, 3, NULL, '2017-04-26 05:21:21', '2017-04-26 05:21:21'),
(1271, 'Dan Balan', '<p>Молдавский певец, композитор, продюсер, музыкант-мультиинструменталист. Автор музыки и текстов всех своих песен.</p>', '0', 0, 2, 3, 2, 1153, 4, NULL, '2017-04-26 05:23:22', '2017-04-26 05:23:22'),
(1272, 'Mercedes w221', '', '0', 0, 2, 2, 2, 1154, 3, NULL, '2017-04-26 05:25:58', '2017-04-26 05:25:58'),
(1273, 'Jared Leto', '<p>Американский рок-музыкант и актёр, вокалист альтернативной рок-группы Thirty Seconds to Mars. Является режиссёром многих музыкальных клипов под псевдонимом Bartholomew Cubbins.</p>', '0', 0, 2, 3, 2, 1155, 4, NULL, '2017-04-26 05:26:56', '2017-04-26 05:26:56'),
(1274, 'Justin Bieber', '<p>Канадский поп-R&amp;B-певец, автор песен, музыкант, актёр. В 2008 году Скутер Браун ознакомился с его роликами на You Tube&nbsp;и позже стал его менеджером. Браун организовал для Бибера встречу с Ашером&nbsp;в Атланте. Вскоре Бибер стал артистом лейбла Raymond Braun Media Group (RBMG), совместного предприятия Брауна и Ашера, а ещё позже Эл Эй Рейд&nbsp;пригласил его в Island Records. По состоянию на 2012 год в мире продано более 15 миллионов экземпляров альбомов Бибера.</p>', '0', 0, 2, 3, 2, 1156, 4, NULL, '2017-04-26 05:30:48', '2017-04-26 05:30:48'),
(1275, 'Bentley Long', '', '0', 0, 2, 2, 2, 1157, 3, NULL, '2017-04-26 05:30:58', '2017-04-26 05:30:58'),
(1276, 'Justin Timberlake', '<p>Aмериканский поп- и R&amp;B-певец, композитор, продюсер, танцор и актёр. Обладатель четырёх премий &laquo;Эмми&raquo; и девяти премий &laquo;Грэмми&raquo;. Джастин Тимберлейк пришел к славе в качестве одного из солистов бой-бэнда &rsquo;N Sync.</p>', '0', 0, 2, 3, 2, 1158, 4, NULL, '2017-04-26 05:32:51', '2017-04-26 05:32:51'),
(1277, 'Мереке Мусаев', '<p>Тойларыңызды, мерекелік шараларыңызды қызықты етіп өткізетін қазақи асаба. &nbsp;</p>', '0', 0, 2, 4, 2, 1159, 3, NULL, '2017-04-26 05:34:51', '2017-04-26 05:34:51'),
(1278, 'Jennifer Lopez', '<p>Aмериканская актриса, певица, танцовщица, модельер, продюсер&nbsp;и бизнес-вумен. Лопес впервые была замечена в 1991 году будучи танцовщицей труппы Fly Girl&nbsp;в телешоу <em>In Living Color</em>. Она оставалась постоянной участницей коллектива до 1993 года, когда решила начать полноценную актёрскую карьеру.&nbsp;На музыкальной сцене Лопес дебютировала в 1999 году с альбомом <em>On the 6</em>, которому предшествовал сингл &laquo;If You Had My Love&raquo;, занявший первое место в шести странах.</p>\r\n<p>&nbsp;</p>', '0', 0, 2, 3, 2, 1160, 4, NULL, '2017-04-26 05:48:23', '2017-04-26 05:48:23'),
(1279, 'Нәжімаддин Каримов', '<p>5 жылдық тәжірибесі бар шоумэн, актер, асаба. Барған тойынан қарғыс емес алғыс алып жүрген асаба.</p>', '0', 0, 2, 4, 2, 1161, 3, NULL, '2017-04-26 05:51:22', '2017-04-26 05:51:22'),
(1280, 'Jessica Simpson', '<p>В 1999 году она попала в телешоу &laquo;Бухта Доусона&raquo;. Там прозвучала композиция в исполнении девочки &laquo;Do You Ever Love Somebody&raquo;. В том же году появился и первый сингл молодой певицы под названием &laquo;I Wanna Love You Forever&raquo;. Практические сразу последовал и успех. Диск с композицией стал платиновым по количеству проданных копий. Джессика же попала в почетный список из 25 самых молодых и знаменитых кумиров американской молодежи. Его составил журнал &laquo;Teen People&raquo;.<br /> </p>', '0', 0, 2, 3, 2, 1162, 4, NULL, '2017-04-26 05:51:28', '2017-04-26 05:51:28'),
(1281, 'Zayn Malik', '<p>Британский певец и композитор. В 2010 году Малик пробовался в качестве сольного исполнителя на шоу The X Factor. После своей неудачи его объединили в группу с Гарри Стайлзом, Найлом Хораном, Лиамом Пейном&nbsp;и Луи Томлинсоном&nbsp;под названием One Direction. За время пребывания в группе было выпущено 4 альбома: &laquo;Up All Night&raquo;, &laquo;Take Me Home&raquo; (2012), &laquo;Midnight Memories&raquo; (2013) и &laquo;Four&raquo; (2014). В марте 2015 года представители Зейна объявили о том, что он принял решение уйти из группы.</p>', '0', 0, 2, 3, 2, 1163, 4, NULL, '2017-04-26 05:56:32', '2017-04-26 05:56:32'),
(1282, 'Kanye West', '<p>Американский рэпер, продюсер и дизайнер. Он вырос в Чикаго, где с юных лет был связан с музыкой.&nbsp;Бросив обучение в университете, чтобы сосредоточиться на музыке, он решил стать рэпером, выпустив дебютный альбом, <em>The College Dropout</em>, в 2004 году.&nbsp;</p>', '0', 0, 2, 3, 2, 1164, 4, NULL, '2017-04-26 05:59:36', '2017-04-26 05:59:36'),
(1283, 'Сабит', '<p>Қарапайым Қазақи Асаба!</p>', '0', 0, 2, 4, 2, 1165, 3, NULL, '2017-04-26 05:59:55', '2017-04-26 05:59:55'),
(1284, 'Chris Brown', '<p>Ради своей музыкальной карьеры, Крис бросил школу. Он начал работу над своим первым альбомом &laquo;Chris Brown&raquo; в 2004 году. Пластинка появилась в ноябре следующего года. Она выстрелила не только по поклонникам, но и по хит-парадам. Дебютировал альбом сразу на втором месте чарта Billboard 200, более того, продажи составили 155 тысяч копий только за первую неделю. Уже через пять недель пластинка стала платиновой, спустя год &ndash; дважды платиновой. А дебютная композиция &laquo;Run It!&raquo; признана первым хитом в США, Австралии и Новой Зеландии. Следом вторая песня Криса Брауна &laquo;Yo (Excuse Me Miss)&raquo; попала на первое место хит-парада США.&nbsp;</p>', '0', 0, 2, 3, 2, 1166, 4, NULL, '2017-04-26 06:02:06', '2017-04-26 06:02:06'),
(1285, 'Салтанатов Жансерік', '<p>Батыстың Ақтау қаласының Дәстүрлі Қазақи Асабасы!</p>', '0', 0, 2, 4, 2, 1167, 3, NULL, '2017-04-26 06:02:41', '2017-04-26 06:02:41'),
(1286, 'Самат', '<p>Қайда десең ағайын қаладамын,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Бүгінде той басқарар шамадамын,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Тойың болса хабарлас қуантайын, &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p>Мен нағыз тойға керек Тамадамын&hellip;</p>', '0', 0, 2, 4, 2, 1169, 3, NULL, '2017-04-26 06:04:43', '2017-04-26 06:04:43'),
(1287, 'Christina Aguilera', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Амери<span style=\"color: #000000;\">канская </span></span><span style=\"font-size: 10.5pt; font-family: Arial; color: #000000;\">певица</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">,<span class=\"apple-converted-space\">&nbsp;автор песен</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">,<span class=\"apple-converted-space\">&nbsp;танцовщица</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">,<span class=\"apple-converted-space\">&nbsp;актриса</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">,<span class=\"apple-converted-space\">&nbsp;продюсер</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">,<span class=\"apple-converted-space\">&nbsp;телезвезда</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">.</span></span></p>\r\n<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Обладательница 6 премий &laquo;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">Грэмми&raquo; и одной &laquo;Латинской премии Грэмми</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&raquo;.<span class=\"apple-converted-space\">&nbsp;<em>Rollinf Stone</em></span><span class=\"apple-converted-space\">&nbsp;</span>назвал её одной из 100 величайших исполнителей всех времён, так она стала самой молодой представительницей и единственной младше 30 лет</span><span style=\"font-size: 10.5pt; font-family: Arial;\">.</span></span></p>', '0', 0, 2, 3, 2, 1168, 4, NULL, '2017-04-26 06:06:30', '2017-05-04 02:15:39'),
(1288, 'Шахаризат Сейдахмет', '<p>Шахаризат Сейдахмет дәстүрлі әнші, теле-радио жүргізуші, Қазақстан дауысы жобасының жеңімпазы. Эстрада әншісі, тамада.<br /> Телевизиялык шоу айтыстың бас жүлдегері.</p>', '0', 0, 2, 4, 2, 1170, 3, NULL, '2017-04-26 06:07:34', '2017-04-26 06:07:34'),
(1289, 'Katy Perry', '<p>Aмериканская певица, композитор, автор песен, актриса, посол доброй воли ООН. В апреле 2007 года Перри подписала контракт со звукозаписывающей компанией Capitol Records.</p>', '0', 0, 2, 3, 2, 1171, 4, NULL, '2017-04-26 06:08:25', '2017-04-26 06:08:25'),
(1290, 'Lana Del Rey', '<p>У Ланы появился продюсер. Им стал Дэвид Кане. Она начала сотрудничать с несколькими менеджерами, которые и предложили ей отличный псевдоним. С этого времени Элизабет стала Ланой Дэль Рэй. Такое имя гармонировало и с новым образом певицы, и с новым стилем её музыки. Определившись со своим музыкальным направлением, Лана запела в полный голос. Музыкальные критики сравнивали её голос с вокалом Чайны Форбс, Нэнси Синатра и Амброзии Парсли. Благодаря таким сравнениям Дэль Рэй начала именовать своё творчество &laquo;голливудским сэдкором&raquo;, себя же она определяла &laquo;гангстерской версией Нэнси Синатры&raquo;.<br /> </p>', '0', 0, 2, 3, 2, 1173, 4, NULL, '2017-04-26 06:10:11', '2017-04-26 06:10:11'),
(1291, 'Rolan Production ', '', '0', 0, 2, 5, 2, 1172, 3, NULL, '2017-04-26 06:10:20', '2017-04-26 06:14:06'),
(1292, 'Lara Fabian', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Франкоязычная<span class=\"apple-converted-space\">&nbsp;певица бельгийско итальянского происхождения</span></span><span class=\"apple-converted-space\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">происхождения, гражданка<span class=\"apple-converted-space\">&nbsp;Канады</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">. Исполняет<span class=\"apple-converted-space\">&nbsp;песни</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">на французском, английском, итальянском, испанском, русском и других языках. Представительница<span class=\"apple-converted-space\">&nbsp;Люксембурга</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">на<span class=\"apple-converted-space\">&nbsp;Евровидении 1998</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">.</span></span></p>\r\n<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Признается эстрадно-</span><span style=\"font-size: 10.5pt; font-family: Arial;\">вокальной</span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">этуалью</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">Европы</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">, имеющей<span class=\"apple-converted-space\">&nbsp;эталонное</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">лирическое сопрано</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">.</span></span></p>', '0', 0, 2, 3, 2, 1174, 4, NULL, '2017-04-26 06:16:33', '2017-04-26 06:18:35'),
(1293, 'Lady Gaga', '<p>Американская певица, автор песен, продюсер, филантроп, дизайнер и актриса. Начинала свою карьеру с выступлений в клубах, а к концу 2007 года продюсер Винсент Херберт подписал певицу на лейбл Streamline Records, который является ответвлением Interscope Records.&nbsp;</p>', '0', 0, 2, 3, 2, 1175, 4, NULL, '2017-04-26 06:22:40', '2017-04-26 06:22:40'),
(1294, 'Madonna', '<p>Американская певица, автор песен, музыкальный продюсер&nbsp;и предприниматель. Переехав в Нью-Йорк &nbsp;в 1978 году&nbsp;ради карьеры в танцевальной группе, Мадонна сначала стала участницей рок-группа, а потом успешной сольной исполнительницей и автором песен.</p>', '0', 0, 2, 3, 2, 1176, 4, NULL, '2017-04-26 06:30:18', '2017-04-26 06:30:18'),
(1295, 'Айбек Жұрымбаев', '<p>Домбыра десе қазағымның жүрегінде күй орнайды. Бабамыздың мұңы, даламыздың үні &mdash; қара домбыраны қазіргі таңда дәріптейтін алаш ұлы кем де кем. <br /> Бүгінгі күнде қазақтың ұлттық аспабын жандандырып жүрген ұлдарыңыз &mdash;Айбек Жұрымбаев,&nbsp; республикалық&nbsp; байқаулардың лауреаты.<br /> &laquo;Нағыз қазақ &mdash; қазақ емес, нағыз қазақ &mdash; домбыра&raquo; - демекші, қазақ ұлтының асыл мұрасымен құлақ құрышын қандырайық.</p>', '0', 0, 2, 6, 2, 1177, 3, NULL, '2017-04-26 06:33:00', '2017-04-26 06:33:00'),
(1296, 'Қалықов Нұрхат Асхатұлы', '', '0', 0, 2, 6, 2, 1179, 3, NULL, '2017-04-26 06:35:31', '2017-04-26 06:35:31'),
(1297, 'Miley Cyrus', '<p>Молодая и популярная американская певица и актриса.&nbsp;</p>', '0', 0, 2, 3, 2, 1178, 4, NULL, '2017-04-26 06:36:08', '2017-04-26 06:36:08'),
(1298, 'Nicole Scherzinger', '<p>Американская поп/RnB-певица, танцовщица, автор песен, музыкальный продюсер, актриса&nbsp;и фотомодель&nbsp;филиппино-гавайско-украинского&nbsp;происхождения, больше всего известная как вокалистка&nbsp;группы The Pussycat Dolls.</p>', '0', 0, 2, 3, 2, 1181, 4, NULL, '2017-04-26 06:42:58', '2017-04-26 06:42:58'),
(1299, 'Pink', '<p>Американская певица, автор песен и актриса, ставшая популярной в начале 2000 года после выпуска альбома Can\'t Take Me Home.</p>', '0', 0, 2, 3, 2, 1182, 4, NULL, '2017-04-26 06:46:13', '2017-04-26 06:46:13'),
(1300, 'Струнный квартет \"Актау Вива\"', '<p>Состав: 4 человека, скрипка, скрипка, альт, виолончель. Все артисты струнного квартета закончили КНК им. Курмангазы. Фуршет, банкет, встреча гостей перед началом свадьбы. Опыт игры 8 часов игры для форума журналистов РК в Актау. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>', '0', 0, 2, 6, 2, 1180, 3, NULL, '2017-04-26 06:49:57', '2017-04-26 06:49:57'),
(1301, 'Rihanna', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\"><span style=\"color: #222222;\">А<span style=\"color: #000000;\">мериканская</span></span><span class=\"apple-converted-space\" style=\"color: #000000;\">&nbsp;RnB</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">- и поп-певица и актриса<span class=\"apple-converted-space\">&nbsp;барбадосского</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">происхождения. В 16 лет переехала в США, чтобы начать карьеру певицы. Позже она подписала контракт с<span class=\"apple-converted-space\">&nbsp;Def Jam Recordings</span>.</span></span></p>', '0', 0, 2, 3, 2, 1183, 4, NULL, '2017-04-26 06:50:57', '2017-05-04 02:13:30'),
(1302, 'Selena Gomez', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Американская</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">актриса кино, телевидения и озвучивания, певица, композитор, продюсер, дизайнер, автор песен, модель,<span class=\"apple-converted-space\">&nbsp;филантроп</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">, и посол доброй воли<span class=\"apple-converted-space\">&nbsp;ЮНИСЕФ</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">.&nbsp;</span></span></p>', '0', 0, 2, 3, 2, 1184, 4, NULL, '2017-04-26 06:54:32', '2017-05-04 02:13:44'),
(1303, 'Ciara', '<p>Американская певица, автор песен, продюсер, танцовщица, актриса, модель, режисёр коипов. Родилась в Остине, будучи ребёнком путешествовала по всему миру с родителями, переехав вскоре в Атланту. Там она стала участницей девичьей группы Hearsay. В 2002 году она познакомилась с продюсером&nbsp;Jazze Pha. С его помощью она подписала контракт с лейблом LaFace Records.</p>', '0', 0, 2, 3, 2, 1185, 4, NULL, '2017-04-27 05:00:10', '2017-04-27 05:00:10'),
(1304, 'Taylor  Swift', '<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Американская<span class=\"apple-converted-space\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial; text-decoration: none;\">кантри-поп</span><span style=\"font-size: 10.5pt; font-family: Arial;\">-исполнительница,<span class=\"apple-converted-space\">&nbsp;автор песен</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">и<span class=\"apple-converted-space\">&nbsp;актриса</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">.</span></span></p>\r\n<p style=\"background: white; margin: 6.0pt 0cm 6.0pt 0cm;\"><span style=\"color: #000000;\"><span style=\"font-size: 10.5pt; font-family: Arial;\">Второй альбом Свифт<span class=\"apple-converted-space\">&nbsp;Fearless</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">был выпущен в 2008 году и стал международным прорывом. Популярность синглов &laquo;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">Love Story</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&raquo; и &laquo;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">You Belong With Me</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&raquo; помогла<span class=\"apple-converted-space\">&nbsp;</span>Fearless<span class=\"apple-converted-space\">&nbsp;</span>занять первое место в чарте<span class=\"apple-converted-space\">&nbsp;Billboard</span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10.5pt; font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10.5pt; font-family: Arial;\">и стать самым продаваемым альбомом 2009 года в США.<span class=\"apple-converted-space\">&nbsp;</span>Fearless<span class=\"apple-converted-space\">&nbsp;</span>получил четыре премии &laquo;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">Грэмми</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&raquo;, включая главную номинацию &laquo;</span><span style=\"font-size: 10.5pt; font-family: Arial;\">Альбом года</span><span style=\"font-size: 10.5pt; font-family: Arial;\">&raquo;, в которой Свифт стала самой молодой победительницей в истории.</span></span></p>', '0', 0, 2, 3, 2, 1186, 4, NULL, '2017-04-27 05:13:03', '2017-05-04 02:07:09'),
(1305, 'Toto Cutugno', '<p>Один из тех исполнителей, чье творчество четко ассоциируется с определенной эпохой. Его любили, ему подражали, по нему сходили с ума. Сегодня, кажется, он уже отошел от дел и практически не появляется на большой сцене. Однако его имя все еще так же, как и много лет назад, волнует сердца былых слушателей. Его песням хочется подпевать, его тексты (даже спетые на иностранном языке) запоминаются в одно мгновение. Все это кажется волшебством. Хотя, возможно, феномену Тото Кутуньо можно отыскать и другое объяснение. Ведь этот итальянский певец всегда отличался огромным талантом, который, наверняка, не померк даже спустя столько лет.<br /> </p>', '0', 0, 2, 3, 2, 1188, 4, NULL, '2017-04-27 05:18:52', '2017-04-27 05:18:52'),
(1306, 'Shakira', '<p>Колумбийская певица, автор песен, танцовщица, музыкальный продюсер, хореограф и модель. Широко известна как наиболее успешная латиноамериканская артистка, добившаяся успеха к началу &nbsp;2000-x&nbsp;как на испаноязычном, так и на англоязычном музыкальных рынках.&nbsp;Шакира выиграла много наград, включая пять \"MTV&nbsp;Video&nbsp;Music&nbsp;Awards\", две Грэмми, восемь \"Латинских Грэмми\", семь \"Billboard Music Awards\", двадцать-восемь \"Billboard Latin Music Awards\"&nbsp;и номинацию на \"Золотой глобус\". У неё есть звезда на \"Аллее славы\", и она одна из самых продаваемых артистов во все времена&nbsp;с продажами более 70 миллионов альбомов&nbsp;по всему миру.&nbsp;</p>', '0', 0, 2, 3, 2, 1189, 4, NULL, '2017-04-27 05:25:23', '2017-04-27 05:25:23'),
(1307, 'Жамиля', '<p>Қыз жасауы, жастық, махаббат көрпесі, сандық жапқыш, шай көрпе, күйеу көрпе.</p>', '0', 0, 2, 18, 2, 1187, 3, NULL, '2017-04-27 05:25:27', '2017-04-27 05:48:42'),
(1308, 'Қыз жасауы Толғанай', '<p>10 жылдық тәжірибесі бар тігінші. Қазақстанның барлық қаласына жеткізу бар.</p>', '0', 0, 2, 18, 2, 1191, 3, NULL, '2017-04-27 05:28:39', '2017-04-27 05:49:44'),
(1309, 'Eminem', '<p>Американский рэпер, музыкальный продюсер, композитор&nbsp;и актёр. Помимо сольной карьеры, Маршалл также состоит в группе D12&nbsp;и хип-хоп-дуэте Bad Meets Evil. Эминем является одним из самых продаваемых музыкальных артистов в мире, а также самым продаваемым артистом 2000-х. Он назван одним из самых великих музыкантов всех времён многими журналами, включая <em>Rolling Stone</em>, который разместил Эминема под 83-м номером в списке 100 самых великих артистов. Этот же журнал провозгласил его Королём хип-хопа. Если считать и студийные работы его групп, то у Эминема имеется 10 альбомов, которые достигали первой строчки в&nbsp;<em>Billboard</em>&nbsp;200. Как сольный артист, Эминем продал более 100 миллионов альбомов по всему миру<span style=\"font-size: 11.6667px;\">.</span></p>', '0', 0, 2, 3, 2, 1190, 4, NULL, '2017-04-27 05:28:46', '2017-04-27 05:28:46'),
(1310, 'Enrique Iglesias', '<p>Испанский певец, автор песен, продюсер&nbsp;и актёр. Иглесиас начинал свою карьеру под псевдонимом&nbsp;&laquo;Энрике Мартинес&raquo;&nbsp;и работал на неприметный мексиканский лейбл&nbsp;&laquo;Fono Music&raquo;. Сейчас Энрике Иглесиас&nbsp;&mdash; самый известный из представителей латиноамериканской музыки&nbsp;в мире, а в его коллекции много статуэток &laquo;Грэмми&raquo; и &laquo;American Music Awards&raquo;. За свою карьеру Энрике выпустил более 40 синглов&nbsp;и 10 студийных альбомов, которые 116 раз становились платиновыми, 227 золотыми, а общий объём продаж составляет 100&nbsp;млн пластинок.</p>', '0', 0, 2, 3, 2, 1192, 4, NULL, '2017-04-27 05:32:53', '2017-04-27 05:32:53'),
(1311, 'Adam Lambert', '<p>Американский певец и автор песен выросший в еврейской семье. Стал заметным благодаря песенному шоу \"American Idol\", когда в 2009 году занял второе место. Сразу после 23 ноября 2009 года вышел его дебютный альбом \"For Your Entertainment\".<br /> </p>', '0', 0, 2, 3, 2, 1194, 4, NULL, '2017-04-27 05:34:21', '2017-04-27 05:34:21'),
(1312, 'Женис Айтжанов', '<p>Мир белой магии пришел ко мне в раннем детстве. Шоу Девида Коперфильда заставляло многих почувствовать чудеса. А как Вы знаете, волшебство ,там где в него верят. Зная всего 6 фокусов я начал удивлять семью, друзей. В юношеском возрасте во многих книгах, в фильмах всегда присутствовал персонаж, который мог ловко и красиво перекатывать монету на пальцах. Это был второй толчок в развитии и становлении меня как Мага.<br /> <br /> Ежедневные репетиции, все свободное время &mdash; тренировка пальцев, реплик, жестов и манеры выступления &mdash; вот что главное в профессионализме. Задумайтесь об эмоциях ваших гостей. Вы желаете незабываемого ощущения на Вашем мероприятии.<br /> <br /> Сегодня предлагаю вам окунуться в новый мир волшебства, новый этап иллюзионого шоу в Казахстане. Магия, ментализм, иллюзии, фокусы, ловкость разума и многое другое потустороннее и необычное ожидает вас на шоу Жениса Айтжанова. Глоток блаженства удивлении и эйфории улыбок Гарантированы. У нас есть кое-что для каждого. Вы готовы? Абра-Кадабра!</p>', '0', 0, 2, 7, 2, 1193, 3, NULL, '2017-04-27 05:34:38', '2017-04-27 05:34:38'),
(1313, 'Arash', '<p>Серьезная карьера началась в 2003-ем году. В 2004-ом вышел сингл Boro Boro, который занял 2-ое место в хит-параде Швеции, а менее через месяц возглавил практически все значимые чарты по всему миру. С тех пор певец выпустил ещё множество хитов, стиль которых варьируется от ритм-энд-блюза до попа и хип-хопа.</p>\r\n<p>Араш сотрудничал не только с известными исполнителями Швеции. Он также запомнился дуэтом с ямайским исполнителем Шоном полом, а также проектами с русскими исполнителями, например, группами &laquo;Блестящие&raquo; и &laquo;Фабрика&raquo;, а также Анной семенович. Благодаря этому сотрудничеству в коллекции наград Араша есть два &laquo;Золотых громофона&raquo;.</p>', '0', 0, 2, 3, 2, 1195, 4, NULL, '2017-04-27 05:35:43', '2017-05-04 02:05:21'),
(1314, 'Агенство торжеств \'\'Дастан\'\'', '<p>&nbsp;Оформление свадеб, юбилеев, дни рождения и т.д.</p>', '0', 0, 2, 15, 2, 1197, 3, NULL, '2017-04-27 05:53:12', '2017-04-27 05:53:12'),
(1315, 'Ariana Grande', '<p>Американская актриса кино, телевидения и озвучивания, певица, композитор, автор песен и фотомодель.</p>\r\n<p>Ариана записывала свой дебютный альбом на протяжении трёх лет&nbsp;&mdash; с августа 2010 по июнь 2013 года. Первоначальным названием было&nbsp;<em>Daydreamin</em>. Релиз пластинки состоялся 30 августа 2013 года, и количество проданных копий за первую неделю составило 138 000. В сентябре альбом достиг первого места в альбомном чарте Billboard 200, и это сделало Ариану второй артисткой, чей дебютный альбом занял первую позицию в этом чарте. Также пластинка заняла места в первой десятке в ряде других стран: шестое в Австралии, седьмое в Великобритании, шестое в Ирландии и пятое в Нидерландах.&nbsp;<em>Yours Truly</em>&nbsp;занял седьмую позицию в новозеландском чарте &laquo;топ-40&raquo; среди альбомов.</p>', '0', 0, 2, 3, 2, 1196, 4, NULL, '2017-04-27 05:55:09', '2017-04-27 05:55:09'),
(1316, 'Carly Rae Jepsen', '<p>В 2008-ом году появился её дебютный альбом Tug of War, который за предалами Канады не получил большой огласки. Но спустя три года был реализован сингл певицы Call Me Maybe, который стал абсолютнымм хитом, как в Канаде, так и во всем мире. Песня возглавила канадские чарты, заняла 1-ое место Billboard Hot 100, а спустя год возглавила и UK Singles Chart. Во многих странах сингл стал &laquo;платиновым&raquo;: в Канаде шестикратно, в Австралии восьмикратно, в Америке пятикратно, а в Новой Зеландии трехкратно. С тех пор к Карли Джепсен приковано внимание миллионов, и певица старается не раочаровывать &ndash; её синглы Good Time и This Kiss, вышедшие сразу после мирового хита, тоже не были обделены вниманием.&nbsp;</p>\r\n<p><br /> </p>', '0', 0, 2, 3, 2, 1198, 4, NULL, '2017-04-27 05:57:42', '2017-04-27 05:57:42'),
(1317, 'Пирамида ', '<p>Пирамида на 77 и 105 персон безалкогольная (с барменом).</p>', '0', 0, 2, 7, 2, 1200, 3, NULL, '2017-04-27 05:59:37', '2017-04-27 05:59:37'),
(1318, 'Салон красоты \"Айсая\"', '', '0', 0, 2, 9, 2, 1201, 3, NULL, '2017-04-27 06:01:57', '2017-04-27 06:01:57'),
(1319, 'Demi Lovato', '<p>На Ловато оказало влияние творчество таких музыкантов, как Келли Кларксон, Кристина Агилера, Арета Франклин&nbsp;и Бритни Спирс. О Гилмане она говорила: &laquo;У нас был одинаковый диапазон, когда я была младше, и я буду практиковаться на всех его песнях&raquo;<sup id=\"cite_ref-14\" class=\"reference\"><a href=\"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D0%B2%D0%B0%D1%82%D0%BE,_%D0%94%D0%B5%D0%BC%D0%B8#cite_note-14\">[14]</a></sup>.</p>\r\n<p>С ранних лет она слушала метал&nbsp;и считает, что одним из важнейших влияний на неё произвели песни Джона Майера. Но после выхода <em>Unbroken</em>, она сказала, что её музыкальный вкус начал меняться, он стал смещаться в сторону хип-хопа и R &amp; B. Она восхищалась Кларксон: &laquo;Я просто думаю, что она образец для подражания, и она никогда не носила скандальную одежду или что-нибудь подобное, она просто была сама собой. И, тем самым, она стала действительно отличным примером для всех, к тому же она очень талантлива&raquo;<span style=\"font-size: 11.6667px;\">.</span></p>', '0', 0, 2, 3, 2, 1199, 4, NULL, '2017-04-27 06:02:38', '2017-04-27 06:02:38'),
(1320, 'Салон красоты \"Aiza\"', '', '0', 0, 2, 9, 2, 1202, 3, NULL, '2017-04-27 06:03:25', '2017-04-27 06:03:25'),
(1321, 'Inna', '<p>Настоящее имя румынской певицы&nbsp;Elena Alexandra.<strong>&nbsp;</strong>Музыкальную карьеру начала в 2006 году. В этом же году вышел ее первый сингл \"Hot\", которым девушка Инна покорила планету.<br /> </p>', '0', 0, 2, 3, 2, 1203, 4, NULL, '2017-04-27 06:04:21', '2017-04-27 06:04:21'),
(1322, 'Салон красоты \"Beauty Inn\"', '', '0', 0, 2, 9, 2, 1204, 3, NULL, '2017-04-27 06:04:45', '2017-04-27 06:04:45'),
(1323, 'Jay Z', '<p>Американский рэпер, имел собственный капитал более 500 млн $ по состоянию на 2012 год. 13 его альбомов отметились на вершине Billboard 200. Это рекорд среди всех сольных исполнителей и второе место в истории после The Beatles, у которых 19 альбомов поднимались на первое место в США. Многократный обладатель премии \"Грэмми\".</p>\r\n<p>Сенсационный дебют рэпера из Бруклина пришелся на 1996 год. С этого времени и началась стремительная карьера. Jay-Z начал выпуска по альбому каждый год и обязательно они сопровождаются миллионными тиражами. Хиты начинают выстреливать, как из пулемета. <br /><br /><br /></p>', '0', 0, 2, 3, 2, 1205, 4, NULL, '2017-04-27 06:06:03', '2017-05-04 02:03:47'),
(1324, 'KeSha', '<p>Возможно вы не догадывались но музыка Кеши появляется во многих телесериалах и шоу, в период времени с 2006 по 2009 год. Однако слава пришла с выходом сингла \"Right Round\" рэпера Флоу Райда а Кеша участвовала в нем со своим интересным женским вокалом. Флоу Райда восхитился голосом девушки и пригласил ее поработать над следующим треком того же альбом \"Touch Me\". Однако она отказалась сняться в обоих клипах, и не взяла ни копейки денег, тем самым дав понять что хочет пробиться сама. И у нее это получилось.<br /> </p>', '0', 0, 2, 3, 2, 1206, 4, NULL, '2017-04-27 06:07:13', '2017-04-27 06:07:13'),
(1325, 'Салон красоты Gulnaz Jeksenbai', '', '0', 0, 2, 9, 2, 1208, 3, NULL, '2017-04-27 06:09:09', '2017-04-27 06:09:09'),
(1326, 'Салон красоты \"Наз\"', '', '0', 0, 2, 9, 2, 1209, 3, NULL, '2017-04-27 06:10:56', '2017-04-27 06:10:56'),
(1327, 'Linkin Park', '<p>Американская мультиплатиновая&nbsp;рок-группа. Существуя с 2000 года&nbsp;под названием Linkin Park, группа была шесть раз номинирована и два раза удостоилась награды &laquo;Грэмми&raquo;. Группа обрела успех благодаря дебютному альбому 2000 году&nbsp;под названием Hybrid&nbsp;<em>Theory</em>, проданному тиражом более чем в 30 миллионов экземпляров. Следующий студийный альбом, <em>Meteora</em>, повторил, хоть и не превзошёл успех предыдущего, лидируя в 2003 году&nbsp;в чарте <em>Billboard 200</em>. В общей сложности группа выпустила шесть студийных альбомов, которые разошлись общим тиражом около 80 миллионов экземпляров.</p>', '0', 0, 2, 3, 2, 1207, 4, NULL, '2017-04-27 06:12:03', '2017-04-27 06:12:03'),
(1328, 'Bridals room', '<p>Свадебный салон \"Bridals room\". Большой ассортимент эксклюзивных свадебных и вечерних платьев от мировых брендов на прокат и на продажу.</p>', '0', 0, 2, 10, 2, 1210, 3, NULL, '2017-04-27 06:13:19', '2017-04-27 06:13:19'),
(1329, 'Nelly Furtado', '<p>Канадская певица, автор песен, музыкальный продюсер и актриса. Получила своё имя в честь знаменитой советской гимнастки Нелли Ким. Родилась Нелли Фуртадо 2 декабря 1978 в Канаде. Дебютный альбом &mdash; Whoa, Nelly!. В ноябре 2003 года появляется альбом Folklore. В середине 2005 года Нелли активно работает над своим новым альбомом, получившим название Loose. Работа над альбомом проходила в разных частях света, от Бразилии до Лос-Анджелеса. Пластинка вышла в 2006 году.<br /> </p>', '0', 0, 2, 3, 2, 1211, 4, NULL, '2017-04-27 06:13:28', '2017-04-27 06:13:28');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1330, 'OneRepublic', '<p>Американская группа основанная не так давно в 2002 году в Колорадо-Спрингс. Была создана школьными приятелями (Ryan Tedder + Zach Filkins), прославиться им помог сервис&nbsp;MySpace, через который они подписали контракт со студией звукозаписи Тимбэлэнда Mosley Music Group.&nbsp;</p>\r\n<p>Так же слава Уан Репаблик прогремела в 2007 году благодаря их синглу&nbsp;Apologize, который стал &nbsp;трижды платиновым. На данный момент в состав группы входят:&nbsp;Ryan Tedder&nbsp;(вокалист),&nbsp;Zach Filkins&nbsp;(гитара, виолончель),&nbsp;Drew Brown&nbsp;(гитара и клавишные),&nbsp;Eddie Fisher&nbsp;(ударные и перкуссия),&nbsp;Brent Kutzle&nbsp;(бас гитара, пианино).&nbsp;</p>', '0', 0, 2, 3, 2, 1212, 4, NULL, '2017-04-27 06:15:41', '2017-04-27 06:15:41'),
(1331, 'Sam Smith', '<p>Впервые исполнителя по-настоящему заметили в 2012-ом году, когда дуэт&nbsp;<em>Disclosure</em>&nbsp;использовал вокал Смита в песне&nbsp;Latch. Сингл забрался на 11-ую строчку UK Singles Chart, что, конечно же, было успехом для молодого певца.&nbsp; Исполнитель работал над дебютным альбомом, выпустил сингл&nbsp;Lay Me Down, который имел меньший успех. А звездный час исполнителя настал после совместной песни с британским продюсером&nbsp;<em>Naughty Boy</em>, с которым они записали хит&nbsp;La La La. Сингл занял первое место в Британии, а в первую неделю было продано почти 150 000 его копий.<br /> </p>', '0', 0, 2, 3, 2, 1214, 4, NULL, '2017-04-27 06:16:51', '2017-04-27 06:16:51'),
(1332, 'Love Bridal', '<p>В салоне представлены свадебные платья мировых брендов.</p>', '0', 0, 2, 10, 2, 1213, 3, NULL, '2017-04-27 06:17:40', '2017-04-27 06:17:40'),
(1333, 'Sia', '<p>Австралийская певица и автор песен в стиле эмоциональный джаз&nbsp;и поп, а также актриса. Первый её альбом вышел в 1997&nbsp;году, но коммерческий успех был связан с альбомом 2008 года&nbsp;<em>Some People Have Real Problems</em>. В 2010 году Сия получила шесть номинаций на ARIA Music&nbsp;Awards и победила в номинациях &laquo;лучший независимый&nbsp;альбом&raquo;, &laquo;лучший поп-альбом&raquo; и &laquo;лучшее видео&raquo;. В 2014 году песня &laquo;Chandelier&raquo; получила четыре номинации на &laquo;Грэмми&raquo; в категориях &laquo;Запись года&raquo;, &laquo;Песня года&raquo;, &laquo;Лучшее сольное поп-исполнение&raquo;, &laquo;Лучшее музыкальное видео&raquo;.</p>', '0', 0, 2, 3, 2, 1215, 4, NULL, '2017-04-27 06:19:36', '2017-04-27 06:19:36'),
(1334, 'Marry Me', '<p>Прокат красивых свадебных платьев.</p>', '0', 0, 2, 10, 2, 1216, 3, NULL, '2017-04-27 06:23:20', '2017-04-27 06:23:20'),
