(1340, '\"ZAMA\" центр красоты', '<p>Салон красоты премиум класса - удивительный мир роскоши и красоты , где Вы можете отдохнуть и получить удовольствие от работы лучших мастеров Центра . Индивидуальный подход к каждому клиенту - вот основная политика салона. Посетив единожды Вы уже не сможете отказать себе в их услугах . Мастера - профессионалы одарят Вас: отличным настроением , заботой и самыми лучшими впечатлениями.</p>\r\n<p>Центр косметологии представляет в г. Уральск новый современный комплекс, включающий в себя услуги:</p>\r\n<p>- косметолога</p>\r\n<p>- парикмахера</p>\r\n<p>- визажиста</p>\r\n<p>- маникюриста</p>\r\n<p>- подолога</p>\r\n<p>- spa-терапевта</p>\r\n<p>- массажиста</p>\r\n<p>&nbsp;</p>\r\n<p>Учебный центр:</p>\r\n<p>- Курсы косметологов</p>\r\n<p>- Курсы визажистов&nbsp;</p>\r\n<p>- Курсы парикмахеров</p>\r\n<p>- Курсы маникюристов</p>', '0', 0, 2, 9, 2, 1222, 4, NULL, '2017-04-28 04:29:08', '2017-04-28 04:29:08'),
(1341, 'M PRODUCTION VIDEO', '<p>Профессиональная съемка! Полностью меняют представление о свадебном видео. Это маленькая Вселенная свадебного кино и если Вы попали в этот мир, то у Вас шикарный вкус, на отличные работы. В фильмах Вы не увидите скованности и стеснения, четко знают как работать с парой, и при этом никогда не используют банальный сценарий.</p>', '0', 0, 2, 5, 2, 1223, 4, NULL, '2017-04-28 04:35:51', '2017-04-28 04:35:51'),
(1342, 'Star Video', '<p>- Свадебная видеосъемка</p>\r\n<p>- Свадебная мультикамерная съёмка (2-3-4 оператора)</p>\r\n<p>- Изготовление свадебных клипов</p>\r\n<p>- Love Story</p>\r\n<p>- Съемка корпоративных праздников</p>\r\n<p>- Запись готового продукта на USB в эксклюзивном оформлении .</p>\r\n<p>&nbsp;</p>\r\n<p>На любой бюджет найдется подходящий пакет услуг. Индивидуальный подход к каждому клиенту! Будут рады помочь Вам запомнить на долго ваш замечательный праздник!</p>', '0', 0, 2, 5, 2, 1224, 4, NULL, '2017-04-28 04:53:00', '2017-04-28 04:53:00'),
