(1345, 'Роман Григорьев', '<p>\"Поющий ведущий\"</p>\r\n<p>Стиль ведения - джентльмен, с опытом работы 4 года, более 10 лет в сфере организации праздников. Ни каких шаблонов и заученных сценариев, а 90 процентов импровизации, подбор формата мероприятия и конкурсов. В хороших отношениях с чувством юмора. Постоянно обновленная база конкурсов.</p>', '0', 0, 2, 4, 2, 1227, 4, NULL, '2017-04-28 05:16:01', '2017-04-28 05:16:01'),
