(1347, 'Мержан Аманкулов', '<p>Уже более четырех лет занимается проведением и музыкальным сопровождением мероприятий.</p>', '0', 0, 2, 4, 2, 1229, 4, NULL, '2017-04-28 05:22:48', '2017-04-28 05:22:48'),
