(1357, 'Банкет Холл', '<p>- Зал до 150 мест, проведение - конференции, фуршеты, юбилеи, дни рождения, детские дни рождения, свадьбы, презентации (имеется настенный проектор)</p>\r\n<p>- Кухня европейская, японская, американская, восточная</p>\r\n<p>- Живая музыка, фото и видеосъемка, тамада</p>\r\n<p>- Работает команда профессионалов, 100% обслуживание</p>\r\n<p>- Имеется чайная комната</p>\r\n<p>- Удобная парковка, Wi-Fi</p>', '0', 0, 2, 8, 2, 1239, 4, NULL, '2017-04-28 06:39:34', '2017-04-28 06:39:34'),
(1358, 'Руслан Ибрагимов ', '<p>Исполнение романтичных компазиций на электро гитаре. Исполнение на Английском, Итальянском, Татарском, Казахском, Русском языках.</p>', '0', 0, 2, 3, 2, 1240, 4, NULL, '2017-05-02 02:44:35', '2017-05-02 02:44:35'),
(1359, 'Кавун Эльдар ', '<p>Танцующий ведущий, тамада, шоу-мен Кавун Эльдар. Я&mdash; профессиональный ведущий, актер и организатор ярких мероприятий, а моя фантазия и мастерство позволят с размахом&nbsp;отпраздновать любое событие. Семилетняя &nbsp;работа в event-индустрии &mdash; не шутка! За это время я провел десятки корпоративов,&nbsp;вечеринок и частных праздников.&nbsp;Блистательный праздник возможен только в компании озорного зажигательного ведущего. Такого, который не только мастерски&nbsp;владеет голосом и предлагает десятки неординарных игр, но и тонко чувствует настроение публики. Пригласите меня для&nbsp;организации динамичных, необычных, помпезных или культурных праздников. Ваше мероприятие надолго запомнится гостям!</p>\r\n<p>Праздники сo мной гарантируют:</p>\r\n<p>&bull; оригинальный современный подход;</p>\r\n<p>&bull; много конкурсов, музыки, улыбок;</p>\r\n<p>&bull; импровизацию, разрешение нестандартных ситуаций;</p>\r\n<p>&bull; запоминающиеся, светлые моменты.</p>', '0', 0, 2, 4, 2, 1241, 4, NULL, '2017-05-02 02:48:53', '2017-05-02 02:48:53'),
(1360, 'Мурат Шакманов ', '<p>Вся Костанайская область!</p>\r\n<p>На каз и русском языке. Тамада на любые мероприятия начиная от корпоративов до свадеб.&nbsp;Имеется всё необходимые услуги. Всё при собеседовании!</p>', '0', 0, 2, 4, 2, 1242, 4, NULL, '2017-05-02 02:51:23', '2017-05-02 02:51:23'),
(1361, 'Тамара Коломецкая ', '<p>Если вы хотите, чтобы лучший день в вашей жизни запомнился и вам и гостям, без заказа тамады вам не обойтись. Профессиональный ведущий &mdash; это человек, который знает как развлечь целый банкетный зал приглашённых, даже если они не знакомы между собой. От его богатого опыта, профессионализма, правильного отношения во многом зависит настроение гостей, ожидавшие получить на празднике много веселья и массу приятных моментов!!! Мне можно доверить самое ценное &mdash; эмоции всех присутствующих на празднике, Отличительная особенность моей работы &mdash; импровизация! Несомненно я делаю акцент на красоту и чистоту речи, утончённое чувство юмора, душевный настрой, уровень культуры, профессиональные навыки.</p>', '0', 0, 2, 4, 2, 1243, 4, NULL, '2017-05-02 02:58:01', '2017-05-02 02:58:01'),
(1362, 'Татьяна Стрельцова', '<p>Меня зовут Татьяна Стрельцова. Занимаюсь проведением праздников более 10 лет. Давно поняла, что тот, кто не смотрит вперед, оказывается позади. Именно поэтому регулярно повышаю свой профессиональный уровень. Посещаю различные семинары, международные встречи и вебинары для ведущих. В связи с этим, в моей программе много клёвых и оригинальных фишек! Наши праздники отличаются динамичностью, отсутствием нудных речей и длинных стихов.</p>', '0', 0, 2, 4, 2, 1244, 4, NULL, '2017-05-02 03:00:58', '2017-05-02 03:00:58'),
(1363, 'NUR studio', '', '0', 0, 2, 14, 2, 1245, 4, NULL, '2017-05-02 03:15:51', '2017-05-02 03:15:51'),
(1364, 'Рубан Андрей', '<p>Что для меня фотография? Возможность остановить время. Поймать нечто по-настоящему истинное и искреннее &hellip;минуты счастья, радости, влюбленности, нежности &hellip;мгновения признательности, привязанности, уважения &hellip;ощущение и осознание любви. Я стремлюсь поймать эти эмоции и вернуть их миру! И тогда люди, запечатленные на фотографиях, будут смотреть и вспоминать, как они были счастливы. Впрочем, почему были?! Воспоминания и наши эмоции вне времени, вне пространства. Тем они и важны. Они всегда в наших сердцах! Будьте счастливы!</p>', '0', 0, 2, 14, 2, 1246, 4, NULL, '2017-05-02 03:18:52', '2017-05-02 03:18:52'),
(1366, 'Плешкова Алла', '<p>Стаж работы более 15 лет. Режиссер, сценарист, певица, пародист. Оригинальность, индивидуальный подход, позитив, неповторимые сценарии, авторские идеи. Радужный фонтан веселья дарит Алла и супер настроение!</p>', '0', 0, 2, 4, 2, 1248, 4, NULL, '2017-05-02 03:26:17', '2017-05-02 03:26:17'),
(1367, 'Алена Холодная', '<p>Изысканный вокал на Вашем мероприятии! Репертуар на русском, казахском, английском, испанском языках, а также песни из кинофильмов!</p>', '0', 0, 2, 3, 2, 1249, 4, NULL, '2017-05-02 03:29:52', '2017-05-02 03:29:52'),
(1368, 'NUR studio ', '', '0', 0, 2, 5, 2, 1250, 4, NULL, '2017-05-02 03:33:56', '2017-05-02 03:33:56'),
(1369, 'Империя тайн', '<p>Фокусы, крупные иллюзионы, леди фуршеты, светодиодно-зеркальное шоу и многое другое.</p>', '0', 0, 2, 7, 2, 1251, 4, NULL, '2017-05-02 03:46:21', '2017-05-02 03:46:21'),
