(1371, 'Ballux', '', '0', 0, 2, 15, 2, 1253, 4, NULL, '2017-05-02 04:07:54', '2017-05-02 04:07:54'),
(1372, 'АйАру', '<p>​АйАру группа из трех юных певиц исполняющие разнохарактерные песни в фольклорном и эстрадном жанрах. Состав группы отбирался кастингом в Астане. Именно: Сексенбаева Дария - лауреат международного конкурса &laquo;Жас Канат&raquo; 2009г., лауреат конкурса &laquo;Патриотических песен&raquo; и участница проекта Х &ndash; фактор, ЖыланбаеваАйдана &ndash; финалистка &laquo;Мисс Павлодар&raquo; 2008 г., лауреат 1 степени международного конкурса &laquo;Сибирь зажигает звезды&raquo;, финалистка Х &ndash; фактор 3 сезон, республиканский вокальный конкурс г.Павлодар лауреат 1 место, АндиноваАлуаВикторкызы &ndash; финалистка конкурса &laquo;Мисс Астана 2013&raquo; и финалистка Х &ndash; фактор 5 сезон. Каждая из участниц обладает не только звонким и приятным тембром голоса, но и индивидуальной внешностью и харизмой. Несмотря на недавнее появление на сцене, &laquo;АйАру&raquo; полюбились своим слушателям.</p>\r\n<p>Репертуар АйАру</p>\r\n<p>1. Халык ани - Бир бала</p>\r\n<p>2. Нуртуганнын термеси - Канекей тилим сойлеши</p>\r\n<p>3. Sway</p>\r\n<p>4. I will survive</p>\r\n<p>5. Let&amp;#39;s get loud</p>\r\n<p>6. Venus</p>\r\n<p>7. Халык ани - Козимнин молдиринай ( делается)</p>\r\n<p>8. Bengu - Iki Melek (турецкая танцевальная песня)</p>\r\n<p>9. Bengu - Gezegen (турецкая танцевальная песня)</p>', '0', 0, 2, 3, 2, 1254, 4, NULL, '2017-05-02 04:37:57', '2017-05-02 04:37:57'),
(1373, 'Айнур Байнулдинова', '<p>Айнур на каждом концерте всегда тепло и восторженно принимается публикой любых возрастов. На протяжении многих лет, работая с ней на одной площадке, мы убеждались, что ее голос никогда не узнает допустимых пределов. Очень звучный, объёмный и самый живой! И в целом её выступления всегда отличались поразительной энергетикой и шармом. Эстрадный, поп, на казахском, русском и на украинском языках. Стаж работы 10 лет, сольный концерт 2006 год, 2002 республиканский конкурс Жас канат 1 место, 2003 год лауреат премии казахстанской песни Азия дауысы, 2002 год по 2009 солист государственной филармонии города Астана, с 2010 по настоящее время солист Эстрады театра &laquo;Наз&raquo;.</p>', '0', 0, 2, 3, 2, 1255, 4, NULL, '2017-05-02 04:40:43', '2017-05-02 04:40:43'),
(1374, 'Инструментальный дуэт \"Шашу\"', '', '0', 0, 2, 6, 2, 1256, 3, NULL, '2017-05-02 04:44:08', '2017-05-02 04:44:08'),
(1375, 'Айбек Жәнібек', '<p>Ведущий на казахском языке.</p>\r\n<p>Телеведущий на канале Казахстан-Актобе.</p>', '0', 0, 2, 4, 2, 1257, 4, NULL, '2017-05-02 04:46:22', '2017-05-02 04:46:22'),
(1376, 'Асылан Сауырбаев', '<p>Шоумен, тамада проведет ваш праздник на высшем уровне, креативные идеи для вашего праздника. Стаж работы более 3-х лет.</p>', '0', 0, 2, 4, 2, 1259, 4, NULL, '2017-05-02 04:49:24', '2017-05-02 04:49:24'),
(1377, 'Тяжелый театральный пар', '<p>Без запаха в основе сухого льда.</p>', '0', 0, 2, 17, 2, 1258, 3, NULL, '2017-05-02 04:51:23', '2017-05-02 04:51:23'),
(1378, 'Асылжан Кульниязов', '<p>Профессиональный ведущий и организатор мероприятий любой сложности и тематического направления.</p>', '0', 0, 2, 4, 2, 1260, 4, NULL, '2017-05-02 04:51:41', '2017-05-02 04:51:41'),
