(1380, 'Даниэль Джеймс', '<p>Ведущий, говорящий на русском, казахском и английском языках в совершенстве !Разработка сценарного плана, игра на домбре, интерактивный конкурс с африканскими барабанами, беташар исполнение песен на 4-х языках и конкурсная программа.</p>', '0', 0, 2, 4, 2, 1263, 4, NULL, '2017-05-02 04:55:20', '2017-05-02 04:55:20'),
(1381, 'Ақбота Би Ансамбль', '<p>Ақбота Би Ансамбль ашылғанына 1 жыл болды. Көптеген қайырылымдық шараларға қатысып жүр. 2016 ж \"Ең уздік бишілер\" номинациясымен марапатталды.</p>', '0', 0, 2, 11, 2, 1262, 3, NULL, '2017-05-02 04:56:53', '2017-05-02 04:56:53'),
(1382, 'Ансамбль Нұр Лезгинка', '', '0', 0, 2, 11, 2, 1264, 3, NULL, '2017-05-02 05:01:46', '2017-05-02 05:01:46'),
(1383, 'Дастан Мендыгалиев', '<p>Начал профессиональную деятельность с 18 лет в КВНе. Проводит свадьбы, корпоративы, открытия, масштабные мероприятия, розыгрыши, различные проекты. Креативный подход к любому мероприятию, проведение на 2 языках, составление сценариев. Организатор и ведущий шоумен праздничных торжеств! Мероприятия любого формата любого масштаба! Свадьбы, юбилеи, дни рождения, тематические вечеринки, презентации, акции, розыгрыши, корпоративы. Выезд в любые города Казахстана. Работа &ndash; это творчество на протяжении более 10 лет, а творчество - это его душа! Если Вы мечтаете о том, чтобы Ваша свадьба была по настоящему стильной, яркой и непохожей на миллионы других, если Вы любите быть в центре внимания и хотите чтобы Ваше торжество произвело неизгладимое впечатление на Вас и Ваших гостей. Индивидуальный подход, индивидуальный сценарий для каждого клиента и конечно же учтение всех Ваших пожеланий!!!</p>', '0', 0, 2, 4, 2, 1265, 4, NULL, '2017-05-02 05:02:09', '2017-05-02 05:02:09'),
(1384, 'Жалгасбаева Гульшат', '<p>Стаж работы более 15 лет. Торжественные мероприятия любой тематики и выездная регистрация.</p>', '0', 0, 2, 4, 2, 1266, 4, NULL, '2017-05-02 05:04:52', '2017-05-02 05:04:52'),
(1385, 'Ансамбль танца \"Інжу\"', '<p>В репертуаре ансамбля танца \"Інжу\" имеются&nbsp; национальные, казахские танцы в разного жанра, зажигательные эстрадные танцы как карнавал, стиляги, флэшмобы, интерактивы с гостями (конкурс для гостей) классические танцы, сопровождение вальса молодожен а также индивидуальные выходы на қыз ұзату и свадьбы.</p>', '0', 0, 2, 11, 2, 1268, 3, NULL, '2017-05-02 05:08:53', '2017-05-02 05:08:53'),
(1386, 'Өркен Алтынбекұлы', '<p>Мерекелік кеш жүргізушісі. Сіздің тойыңыз креативті және позитивті көңіл-күйде өтуі тиіс. Жаңашылдық пен үздіксіз прогресс жастарға тән екенін ескерсек. Бірге қызмет жасауға дайын!</p>', '0', 0, 2, 4, 2, 1267, 4, NULL, '2017-05-02 05:09:03', '2017-05-02 05:09:03'),
(1387, 'Би - Би ансамбль', '', '0', 0, 2, 11, 2, 1269, 3, NULL, '2017-05-02 05:12:31', '2017-05-02 05:12:31'),
(1388, '«Vformate»', '<p>&laquo;Vformate&raquo; - динамично развивающееся рекламное агентство в Актау. Команда профессионалов фирмы способна предложить нестандартные решение ключевых задач рекламы, а также предложить уникальные варианты дизайна. Наличие мощной материально-технической базы и современного печатного оборудования позволяет в кратчайшие сроки воплощать в готовый продукт самые сложные и смелые дизайнерские проекты. В своей работе мы используем практически все виды печати:<br /> - Цифровую;<br /> - Офсетную;<br /> - Ризографию;<br /> - Шелкографию;<br /> - Флексографию;<br /> - Широкоформатную.</p>', '0', 0, 2, 13, 2, 1270, 3, NULL, '2017-05-02 05:22:42', '2017-05-02 05:22:42'),
(1389, 'Free Art Media Group', '<p>Free Art &ndash; амбициозная команда профессионалов оказывающая полный спектр услуг по проведению фотосъемок и разработке концепций рекламных кампаний, учитывая индивидуальные особенности бренда и ситуацию на рынке.<br /> Мы работаем как с профессиональными моделями, так и со всеми, кто хочет получить красивые фотографии для портфолио или личных целей.<br /> Имеем опыт работы в городах Алматы, Актау, Жанаозен и Талдыкорган.<br /> Наши клиенты доверяют нам весь процесс фотосъемки и пост продакшн. Мы организуем процесс фотосъемки от подбора моделей, до сдачи готового материала. Каждая фотосессия индивидуальна и соответствует всем пожеланием заказчика и мировым стандартам. <br /> Слаженная работа специалистов позволяет нам создавать продукт наивысшего качества и любого уровня сложности. <br /> Мы предлагаем нашим клиентам большой спектр услуг в области фотосъемки, главными направлениями нашей деятельности являются:<br /> - фотосъемка для каталогов и рекламы, имиджевая съемка;<br /> - фотосъемка различных луков;<br /> - фотосессия в фотостудии или на улице;<br /> - съемка портфолио для моделей / актеров;<br /> - организация и проведение фотосессий и рекламных кампаний за пределами города;<br /> - видеосъемка рекламных роликов / backstage со съемок;<br /> - ретушь фотографий, дизайн.</p>', '0', 0, 2, 14, 2, 1271, 3, NULL, '2017-05-02 05:25:15', '2017-05-02 05:25:15'),
(1390, '\"Love Story\" свадебные букеты', '<p>Эксклюзивные свадебные букеты и аксессуары ручной работы!</p>', '0', 0, 2, 15, 2, 1272, 4, NULL, '2017-05-02 05:27:19', '2017-05-02 05:27:19'),
(1391, 'Асеке Ногганов', '', '0', 0, 2, 14, 2, 1273, 3, NULL, '2017-05-02 05:30:01', '2017-05-02 05:30:01'),
(1392, '\"DOS\" сервис светооформления', '<p>Дорогие жители и гости города Актобе предлагаем вам следующий спектр услуг: Танец молодожён, проход по красной дорожке, световое оформление зала. Мыльные пузырьки, холодный дым, снег, холодные фейерверки, пушка. Помогут сделать первый танец молодожён незабываемым!!!</p>', '0', 0, 2, 7, 2, 1275, 4, NULL, '2017-05-02 05:32:33', '2017-05-02 05:32:33'),
(1393, 'Бауыржан Асылбаев', '<p>Здравствуйте! Меня зовут Бауыржан Асылбаев, я рад приветствовать Вас здесь! Живу я и работаю в городе Актау! Увлекаюсь фотографией со школьной скамьи, профессионально занимаюсь этим делом уже более 5-ти лет!<br /> Я обожаю свое дело и хочу чтобы Вы тоже почувствовали это если нам предстоит с Вами поработать!</p>', '0', 0, 2, 14, 2, 1274, 3, NULL, '2017-05-02 05:32:46', '2017-05-02 05:32:46'),
(1394, 'Ильяс Казиканов', '<p>Пародия на Кайрата Нуртаса.</p>', '0', 0, 2, 7, 2, 1276, 4, NULL, '2017-05-02 05:35:44', '2017-05-02 05:35:44'),
(1395, 'Дмитрий Демский', '', '0', 0, 2, 14, 2, 1278, 3, NULL, '2017-05-02 05:39:08', '2017-05-02 05:39:08'),
(1396, 'Лазерное шоу', '<p>Предлагаем вашему вниманию свадебное лазерное шоу! Это красочное и необычное представление на вашем мероприятии не оставит ни кого равнодушными.</p>\r\n<p>3D анимация и 3D текст с именами молодожёнов и поздравлениями проецируются в темноте лазерными лучами создавая неповторимый красочный эффект!</p>', '0', 0, 2, 7, 2, 1277, 4, NULL, '2017-05-02 05:42:21', '2017-05-02 05:42:21'),
(1397, 'Елена Байгина', '<p>Фотографом работает с 2012 года.</p>', '0', 0, 2, 14, 2, 1279, 3, NULL, '2017-05-02 05:44:05', '2017-05-02 05:44:05'),
