(1401, 'Мырзагелдиев Асхат', '<p>Фотографирую красивые свадьбы и лавстори. Буду рад подарить вам незабываемые фотографии!</p>', '0', 0, 2, 14, 2, 1283, 3, NULL, '2017-05-02 05:55:14', '2017-05-02 05:55:14'),
(1402, 'Ресторан \"Жеруйык\"', '<p>Роскошный, просторный зал торжеств на 500 человек.</p>', '0', 0, 2, 8, 2, 1285, 4, NULL, '2017-05-02 05:57:13', '2017-05-02 05:57:13'),
