(1405, 'Куренной Сергей', '<p>Нет человека не любящего фотографию. Фотография &ndash; это память о прошлом настоящем и возможно будущем. Я стараюсь правильно изобразить все моменты вашей жизни и учесть все ваши желания, изложив это на фотографии.<br /> Профессиональная фотография - это память на века и хорошее настроение изо дня в день! <br /> Выполню все мыслимые и немыслимые задачи!</p>', '0', 0, 2, 14, 2, 1287, 3, NULL, '2017-05-02 06:01:00', '2017-05-02 06:01:00'),
(1406, 'Тамерлан Удеров', '<p>Всем привет, меня зовут Тамерлан Удеров и я свадебный фотограф. Кто такой свадебный фотограф спросите вы? Это человек с разносторонним взглядом , который поможет вам подобрать определенный стиль для вашего Love Story. За впечатлит лучшие репортажные кадры , одним словом сделает ваше торжество красочно и не забываемо!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>', '0', 0, 2, 14, 2, 1288, 3, NULL, '2017-05-02 06:03:48', '2017-05-02 06:03:48'),
(1407, 'Тимофей Старовойтов', '<p>Свадебный, семейный фотограф. Призер фестивалей казахстанских свадебных фотографов \"АmurFest 2014\", &laquo;KFF2015\". <br /> Выезд в Атырау, Алматы, Астана.</p>', '0', 0, 2, 14, 2, 1289, 3, NULL, '2017-05-02 06:08:58', '2017-05-02 06:08:58'),
(1408, '\"Party Hard\"', '<p>Только самые актуальные зарубежные и российские хиты, поток драйва со сцены, танцы до упаду и отличное настроение в исполнении молодых и энергичных участников группы!</p>', '0', 0, 2, 1, 2, 1290, 4, NULL, '2017-05-03 11:06:37', '2017-05-03 11:06:37'),
(1409, '\"Radians\"', '<p>Мировые хиты прошлого и современности&nbsp; на любой вкус и состояние души&nbsp; в качественном исполнении от кавер группы - подарят вам позитивные эмоции и хорошее настроение!</p>', '0', 0, 2, 1, 2, 1291, 4, NULL, '2017-05-03 11:08:09', '2017-05-03 11:08:09'),
(1410, '\"Ханшайым\"', '<p>Предлагают Вам стать ещё красивее благодаря мастерам по визажу и прическам.</p>', '0', 0, 2, 9, 2, 1292, 4, NULL, '2017-05-03 11:11:04', '2017-05-03 11:11:04'),
(1411, 'Beauty Studio Elya Mamedova', '<p>Студия предлагает следующие виды услуг для милых дам :</p>\r\n<p>- Макияж любой сложности:&nbsp;Макияж выполняет визажист, прошедший обучение у лучших школ Казахстана и России, а именно Санди Бексырга, Рукият Акаева, Сердар Камбаров, а так же повышение квалификации у главного визажиста \"Sephora\".</p>\r\n<p>- Прически любой сложности:&nbsp;Мастер по волосам имеет стаж&nbsp; более двух лет, проходил обучение у Алексы Шев, а так же у ведущих стилистов города.</p>\r\n<p>- Маникюр и наращивание ногтей</p>\r\n<p>- Восковая / сахарная эпиляция</p>\r\n<p>- Наращивание ресниц</p>\r\n<p>- Полировка волос</p>\r\n<p>- Коррекция бровей и мн.др.</p>', '0', 0, 2, 9, 2, 1293, 4, NULL, '2017-05-03 11:13:43', '2017-05-03 11:13:43'),
(1412, 'Алтынай Мухамбетова', '<p>Все виды макияжа!</p>', '0', 0, 2, 9, 2, 1294, 4, NULL, '2017-05-03 11:14:48', '2017-05-03 11:14:48'),
(1413, 'Жаржанова Гулжанат', '<p>Мастер по прическам, обучалась&nbsp; в Москве в учебном центре \"Эль Стиль\".</p>\r\n<p>Все виды причесок и укладок.</p>\r\n<p>Будьте не отразимы в самый важный и волшебный день для Вас!</p>', '0', 0, 2, 9, 2, 1295, 4, NULL, '2017-05-03 11:16:45', '2017-05-03 11:16:45'),
(1414, 'Рената  \"Hair stylist\"', '<p>Профессиональный стилист. Создание неповторимого образа. Индивидуальный подбор причесок, шикарные косы, прически любой сложности.</p>', '0', 0, 2, 9, 2, 1296, 4, NULL, '2017-05-03 11:18:19', '2017-05-03 11:18:19'),
(1415, 'Шара Make up - Маншук Hair Stylist', '<p>Все виды макияжа, укладок и причесок.</p>', '0', 0, 2, 9, 2, 1297, 4, NULL, '2017-05-03 11:19:37', '2017-05-03 11:19:37'),
(1416, '\"Asyl Qazyna\"  by Malika Duisenbayeva', '<p>Индивидуальный эксклюзивный&nbsp; пошив казахских национальных свадебных нарядов.</p>\r\n<p>Заказ на бонбоньерки в национальном стиле, коржины, сувениры в национальном стиле из войлока и фетра.</p>', '0', 0, 2, 10, 2, 1298, 4, NULL, '2017-05-03 11:20:57', '2017-05-03 11:20:57'),
(1417, '\"Карета\"', '<p>Свадебные, вечерние и детские платья. Пошив собственная линия \"Milana Bridal\".</p>', '0', 0, 2, 10, 2, 1299, 4, NULL, '2017-05-03 11:22:17', '2017-05-03 11:22:17'),
(1418, '\"Жұлдыз шоу\"', '<p>- Шілдеxана</p>\r\n<p>- Тұсаукесер (1 жас)</p>\r\n<p>-&nbsp; Тілашар</p>\r\n<p>- Сүндет той</p>\r\n<p>-&nbsp; Қыз ұзату</p>\r\n<p>- Үйлену той</p>\r\n<p>- Ата-ана мерейтойы (юбилей) т.б.</p>', '0', 0, 2, 11, 2, 1300, 4, NULL, '2017-05-03 11:23:51', '2017-05-03 11:23:51'),
(1419, 'Театр танца \"Баян Сулу\"', '<p>Украсят Ваш праздник! Выступают на различых корпоративных вечерах, свадьбах, юбилеях и других мероприятиях.</p>', '0', 0, 2, 11, 2, 1302, 4, NULL, '2017-05-03 11:25:18', '2017-05-03 11:25:18'),
(1420, '\"Павлин\"', '<p>Праздничная и рекламная полиграфия. Разработка любого дизайна. Изготовление пригласительных, шоколадок, визиток, флаеров и многое другое.</p>', '0', 0, 2, 13, 2, 1304, 4, NULL, '2017-05-03 11:26:41', '2017-05-03 11:26:41'),
(1421, '\"Photo box\"', '<p>\"Фотобудка\" на свадьбу!</p>\r\n<p>Неограниченное количество фотографий!</p>', '0', 0, 2, 14, 2, 1305, 4, NULL, '2017-05-03 11:27:52', '2017-05-03 11:27:52'),
(1422, 'Канат Садыков', '', '0', 0, 2, 14, 2, 1306, 4, NULL, '2017-05-10 03:12:30', '2017-05-10 03:12:30'),
