(1424, 'Мади Жетибай', '<p>Свадебный Фотограф Павлодар. Снимаю лав стори. Предсвадебная съемка. Свадебная съемка. Красота и качество в каждом кадре.</p>', '0', 0, 2, 14, 2, 1308, 4, NULL, '2017-05-10 03:24:34', '2017-05-10 03:24:34'),
