(1436, 'Айбат Никулин', '<p>Ведущий мероприятий Никулин &ndash; это нестандартный подход к проведению вашего мероприятия. Индивидуальные программы для каждого клиента и уникальное чувство публики в сочетании с вокальной программой оставят яркие и позитивные эмоции в душе каждого гостя.</p>', '0', 0, 2, 4, 2, 1320, 3, NULL, '2017-05-10 05:10:33', '2017-05-10 05:10:33'),
