(1438, 'Ерлан Қабатай', '<p>Тəжірбие: 7-жыл</p>\r\n<p>Жаныр: Əзіл-шоу&nbsp;</p>\r\n<p>Əзіл фест бұравай 2016.</p>\r\n<p>Көнілашар 2015.</p>\r\n<p>Тойбестар 2015.</p>\r\n<p>Сөз патша Ұлттық арна 2014.</p>', '0', 0, 2, 4, 2, 1324, 4, NULL, '2017-05-12 02:49:30', '2017-05-12 02:49:30'),
