(1440, 'Ритмик пульс', '<p>Вокально-инструментальная группа - исполнение на разных языках, вокалист из США, состав группы из РФ, Бельгии, Конго. Исполнение в любых жанрах.</p>', '0', 0, 2, 1, 2, 1326, 4, NULL, '2017-05-12 02:59:15', '2017-05-12 02:59:15'),
(1441, 'M Studio', '<p>- Вечерние, свадебные образы</p>\r\n<p>- Наращивание ресниц любой сложности</p>\r\n<p>- Маникюр, гель-покрытие, дизайн</p>\r\n<p>- Шугаринг</p>\r\n<p>- Профессиональная косметика</p>\r\n<p>- Аксессуары для волос</p>', '0', 0, 2, 9, 2, 1327, 4, NULL, '2017-05-12 03:06:41', '2017-05-12 03:06:41'),
(1442, 'Zefir', '<p>Торты любой сложности: свадебные, детские, тематические!</p>', '0', 0, 2, 16, 2, 1329, 4, NULL, '2017-05-12 06:13:40', '2017-05-12 06:13:40'),
