(1444, 'Агентство Ярких Впечатлений', '<p>Горка шампанского с сухим льдом на Ваш праздник - это зрелищное представление от Агентства Ярких Впечатлений!</p>\r\n<p>Хотите удивить Ваших гостей?! Легко!</p>\r\n<p>NEW - эксклюзивное шоу в Актобе.</p>', '0', 0, 2, 7, 2, 1331, 4, NULL, '2017-05-12 06:25:31', '2017-05-12 06:25:31'),
(1445, 'Нұрболат асаба', '<p><span style=\"font-weight: 400;\">Ақтөбе қаласының белді асабасы, облыстық Тахауи Ахтанов атындағы драма театрының актеры. Көптеген той, салтанатты жиындарды жоғары дәрежеде өткізіп жүрген өз ісінің шебері. </span></p>', '0', 0, 2, 4, 2, 1332, 3, NULL, '2017-05-12 06:49:28', '2017-05-12 06:49:28'),
(1446, 'Ханшайым тобы', '<p><span style=\"font-weight: 400;\">Ақтөбе қаласы сонымен қатар Батыс өңірге танымал. Құрамындағы топ қыздары көптеген республикалық, халықаралық байқаулардың жеңімпаздары. Топ қыздары кез-келген &nbsp;мерекелік шараның сәнін келтіреді. Репертураларында көптеген халық әндері, орыс тілі, ағылшын тіліндегі әндер бар. </span></p>', '0', 0, 2, 3, 2, 1333, 3, NULL, '2017-05-12 06:59:33', '2017-05-12 06:59:33'),
