(1449, '\"Pro Photo Studio\"', '<p>&mdash; Фото</p>\r\n<p>&mdash; видео сьемка свадьбы</p>\r\n<p>&mdash; Услуги дизайна и монтажа</p>\r\n<p>&mdash; Пузырьки, дым, снег</p>\r\n<p>&mdash; Свадебные пригласительные на заказ</p>', '0', 0, 2, 7, 2, 1340, 3, NULL, '2017-05-14 23:55:50', '2017-05-14 23:55:50'),
