(1453, 'Жұлдыз шоу', '<p>Үйлену той, қыз ұзату, тұсау кесу, шілдехана, алтын той, кез-келген мерекеде&nbsp;жоғары деңгейде өнер көрсетеді.</p>', '0', 0, 2, 11, 2, 1349, 4, NULL, '2017-05-18 04:21:22', '2017-05-18 04:21:22'),
(1454, 'Медет Оразов', '<p>Әнші, композитор кез-келген тойды музыкалық әрлеу жасау, беташар рәсімін жасау.</p>', '0', 0, 2, 3, 2, 1350, 4, NULL, '2017-05-18 04:29:40', '2017-05-18 04:29:40'),
(1455, 'Жұлдыз шоу', '<p>Үйлену той, қыз ұзату, тұсау кесу, шілдехана, алтын той, кез-келген шараның жоғары деңгейде өнер көрсетеді.</p>', '0', 0, 2, 3, 2, 1351, 4, NULL, '2017-05-18 04:33:13', '2017-05-18 04:33:13'),
(1456, 'Las Vegas Band', '<p>Свадьбы? Вечеринки?? Шоу??? Да, да, да! Это все Las Vegas Live Band! Букет самых разнообразных и темпераментных музыкантов со всех уголков нашей необъятной Страны! 6 человек, 6 артистов, 6 профессиональных Шоуменов! Огромный репертуар от Казахского фольклора и итальянской песни до ультрасовременных битов и джаза! Золотой саксофон, чистый ангельский женский и бархатный, колоритный как персидский ковер, мужской вокал! Получив сцену и публику в свое распоряжение, Live Band Las Vegas \"затанцует\" и если потребуется - доведет до слез и экстаза любого даже самого искушенного слушателя!&nbsp;</p>\r\n<p>Выбирай Шоу! - Выбирай Las Vegas!</p>', '0', 0, 2, 1, 2, 1352, 4, NULL, '2017-05-18 04:48:24', '2017-05-18 04:48:24'),
(1457, '\"К-7\"', '<p>Группа \"К-7&amp;\" не просто живой live band, но и известный звездный коллектив с богатой историей. Всеми любимые авторские песни, такие как \"Танец под дождём\", \"Самая красивая\", \"По небу\", \"Сен\", а также зажигательные хиты зарубежных исполнителей сделают ваше мероприятие ярким и незабываемым. Репертуар группы в стиле: Диско 80-х, лаундж, джаз, рок-н- ролл, а также регулярно обновляемый репертуар из последних хитов мировых чартов. Песни исполняются на казахском, русском, английском и итальянском языках. Только качественный, живой звук настоящих мастеров своего дела. Продолжительность выступления 3 блока. Каждый блок по 30-40 минут. Мероприятия под ключ. При необходимости выступаем со своей профессиональной аппаратурой. Доверьте свое мероприятие профессионалам.</p>', '0', 0, 2, 1, 2, 1353, 4, NULL, '2017-05-18 04:53:50', '2017-05-18 04:53:50'),
(1458, 'Jewel Band', '<p>Ничто не может так много рассказать о группе &laquo;Jewel&raquo;, как ее &laquo;Летний Блюз&raquo;. Это их самая знаменитая песня, которую с момента написания уже несколько лет крутят радиостанции. Она и вам многое расскажет &ndash; о теплых летних вечерах или долгожданном дожде в жаркую погоду. В общем, &laquo;Jewel&raquo; уже имеет свою историю и засела в памяти заядлых радиослушателей, как легкая, мечтательная и летняя поп-группа. С написания &laquo;Летнего блюза&raquo; миновало достаточно и лет, и зим, однако &laquo;Jewel&raquo; остались такими же свежими. Продюсер Денис Качалаев не дает группе отойти от главной идеи &ndash; каждый участник группы должен играть с душой, именно тогда получается та музыка, которую приятно слушать и под которую приятно вытягивать из головы воспоминания. На мероприятиях &laquo;Jewel&raquo; исполняет две основные роли: 1. воссоздает атмосферу легкого ненавязчивого досуга, оформляя душевные разговоры летними мелодиями. 2. разжигает антракт, где во всю силу включаются ударные, струнные и басы. Игра &laquo;Jewel&raquo; в драйвовом режиме будет напоминать вам мощную электризованную пульсацию &ndash; каждый музыкант отдается музыке, которую играет.</p>', '0', 0, 2, 1, 2, 1354, 4, NULL, '2017-05-18 04:57:47', '2017-05-18 04:57:47'),
(1459, 'Family Band', '<p>Уникальный музыкальный проект в составе 7 человек. Семейная сплочённость и творческий профессионализм. ВИА \"Family\" это молодость, опыт и драйв. За вокал в группе отвечают Арман Камердинов и рыжеволосые сестры Дина и Кристина. Все трое, кстати, финалисты проекта &laquo;Х &ndash; фактор&raquo;. Такое мощное сочетание красивых голосов, помноженное на незаурядность исполнения &ndash; делает любое выступление &amp;quot;Family&amp;quot; &ndash; ярким и незабываемым! Ко всему стоит добавить профессионализм музыкантов, ответственность и любовь к своей работе всех участников группы, а также огромный, разнообразный музыкальный репертуар &ndash; получится незабываемая группа для любого праздника &ndash; будь-то частная вечеринка или большое концертное выступление!</p>', '0', 0, 2, 1, 2, 1355, 4, NULL, '2017-05-18 05:02:18', '2017-05-18 05:02:18'),
(1460, 'АМГ медиа групп', '', '0', 0, 2, 14, 2, 1356, 4, NULL, '2017-05-18 05:05:27', '2017-05-18 05:05:27'),
(1461, 'АМГ медиа групп', '', '0', 0, 2, 5, 2, 1357, 4, NULL, '2017-05-18 05:06:50', '2017-05-18 05:06:50'),
(1462, 'Flora Decor', '<p>Компания &laquo;Flora Decor&raquo; успешно работает на рынке уже 5 лет. За это время мы значительно расширили спектр своих возможностей и готовы на все, чтобы Вы остались довольны нашим сервисом и качеством услуг! Приглашаем Вас оценить наши несомненные преимущества:<br />&bull; Мы работаем круглосуточно! Наши флористы готовы выполнить Ваш заказ и днем, и ночью, а доставка курьером будет организована точно в указанное Вами время! <br />&bull; Мы делаем красоту и качество нашим приоритетом. Срочная доставка цветов, оформление праздника композициями или декор для дома. Вы можете быть уверены, что сделанный вами заказ будет исполнен на самом высшем уровне. Чтобы Вы остались довольны, мы согласовываем работы удаленно, по фотографиям!<br />&bull; Мы принимаем заказы как по телефону, так и выезжая для личных встреч, чтобы выслушать и почувствовать все Ваши пожелания, увидеть место мероприятия, сделать необходимые замеры. Благодаря правильно организованной логистике и грамотным сотрудникам возникновение накладок и форс-мажоров невозможно!<br />&bull; С каждым годом наш уровень профессионализма и спектр услуг растет и развивается. Смело заказывайте у нас букеты, цветочные композиции, искусственные или стабилизированные цветы, оформление интерьера, комплексный декор свадеб, дней рождений, корпоративных праздников, фитодизайн, витринистику и оригинальные подарки. <br />Флористика &ndash; это работа, которая приносит нам истинное счастье, и мы с удовольствием делимся с Вами и Вашими близкими самым прекрасным, что у нас есть, создавая замечательные флористические шедевры и доставляя их вовремя!</p>', '0', 0, 2, 15, 2, 1358, 4, NULL, '2017-05-18 05:12:59', '2017-05-18 05:12:59'),
(1463, 'Astana Decor', '<p>Правильно подобранное оформление навсегда останется в памяти ваших гостей яркими воспоминаниями. Наша студия Astana decor предлагает Вам комплексное декорирование мероприятий в различной стилистике и любой цветовой гамме. Дружелюбная команда декораторов подберет индивидуальное оформление исходя из ваших желаний и возможностей доведет ваши идеи до совершенства и реализует вашу мечту.</p>', '0', 0, 2, 15, 2, 1359, 4, NULL, '2017-05-18 05:17:00', '2017-05-18 05:18:17'),
(1464, 'Artdecor', '<p>Студия \"Artdecor\" - это слаженная команда профессионалов: дизайнеры-декораторы, флористы.</p>', '0', 0, 2, 15, 2, 1360, 4, NULL, '2017-05-18 05:21:02', '2017-05-18 05:21:02'),
(1465, 'Балакишиев Рамзат', '<p>Образование:</p>\r\n<p>2005-2009 гг. &ndash; Школа-интернат для одаренных детей музыкально-эстетического профиля по классу &laquo;Сольное пение&raquo; в г. Петропавловск.</p>\r\n<p>2009-2013 гг. &ndash; Казахский Национальный Университет Искусств по классу &laquo;Вокал&raquo; в г. Астана.</p>\r\n<p>Тип голоса: Тенор</p>\r\n<p>Место работы: НТОБ Астана Опера</p>', '0', 0, 2, 3, 2, 1361, 4, NULL, '2017-05-18 05:26:04', '2017-05-18 05:26:04'),
(1466, 'Мұсайын Сержан', '<p>1994 жылы 1 Облыстық Ж. Елебеков атындағы әншілер байқауынан жүлдегер атанып, Құрманғазы атындағы Алматы мемлекеттік консерваториясына жолдама алды.</p>\r\n<p>1999 жылы консерваторияны Бекболат Тілеуханның класынан, домбырамен ән айту мамандығы бойынша бітірді. Еңбек жолын 1998 жылы &laquo;Гүлдер&raquo; Мемлекеттік ансамблінде бастады.</p>\r\n<p>1998-2001 жылдар аралағында &laquo;Гүлдер&raquo; Мемлекеттік ансамблінде және Ұлттық Қауіпсіздік Комитеті шекара қызметінің ән-би ансамблінің солисті. Қазіргі уақытта Қарағанды облыстық Қ.Байжанов атындағы концерттік бірлестіктің әншісі, сонымен қатар Тәттімбет атындағы өнер колледжінің халық әні бөлімінің меңгерушісі қызметін атқарады.</p>\r\n<p>1998ж. Ж.Елебеков атындағы І республикалық әншілер байқауының лауреаты (Бас жүлде)</p>\r\n<p>2002ж. Ә. Қашаубаев атындағы республикалық әншілер байқауының лауреаты (ІІ орын)</p>\r\n<p>2002ж.&laquo;Шабыт&raquo; Халықаралық шығармашыл жастар фестивалі (Бас жулде)</p>\r\n<p>2005ж. Мәди Бәпиұлы атындағы І Республикалық әншілер байқауының лауреаты (Бас жүлде)</p>\r\n<p>2011ж. Қасым Аманжолов атындағы І республикалық әншілер байқауының лауреаты (Бас жүлде)</p>', '0', 0, 2, 3, 2, 1362, 4, NULL, '2017-05-18 05:30:32', '2017-05-18 05:30:32'),
(1467, 'Квартет \"Рояль\"', '<p>Квартет \"Рояль\" группа молодых исполнителей в эстрадно-классическом жанре. Бархатный тембр баритонов в созвучии со сладкими голосами теноров полюбился нашим слушателям. Каждый из участников индивидуален не только своим вокалом, но и харизмой. Группа &laquo;Рояль&raquo; Группа &laquo;Рояль&raquo; это необыкновенный квартет в сочетании звонкого голоса теноров и бархатных голосов баритона. Квартет &laquo;Рояль&raquo; создался совсем недавно в конце 2013 года, но они уже успели полубиться своим слушателям. Ребята выступают в эстрадном и классическом жанрах. Каждый из солистов достиг многих награждении: Абильда Алтынбек &ndash; баритон, лауреат ІІ степени международного конкурса &laquo;им.Н.Тлендиева&raquo; 2013 г., лауреат I степени республиканского конкурса &laquo;им.Абдуллиных&raquo;, лауреат ІІ степени международного конкурса &laquo;Сарандев &ndash; Добрич&raquo; и т.д. Ахметов Султан &ndash; тенор, лауреат Гран &ndash; При республиканского конкурса &laquo;им.Кенеса Дуйсекеева&raquo; 2014 г., Лауреат международного конкурса &laquo;им.Ш.Калдаякова&raquo; 2014 г., так же лауреат конкурса &laquo;им.Асета Бейсеуова&raquo; 2013г.. Жумагалиев Жансултан &ndash; тенор, лауреат ІІ международной романсиады Россия, Тлеулес Мейрхан &ndash; баритон, дипломант ресбуликанских и международных конкурсов. Они индивидуальны не только вокальными данными, но и харизмой. &nbsp;Группа &laquo;Рояль&raquo; выступают на разных малых и маштабных проектах. Молодые парни очень трудолюбивы и амбициозны. Желаем им удачи в их начинаниях и творческом пути.</p>', '0', 0, 2, 3, 2, 1363, 4, NULL, '2017-05-18 05:37:09', '2017-05-18 05:37:09'),
(1473, 'Гульсана Магзимбетова', '<p>Большой мастер игры на домбре и сопровождает ее пение своим - голосистым и звучным.</p>\r\n<p>Единство струнного исполнения и женского вокала - вот, что выделит ваше мероприятие и придаст ему некое смысловое значение .</p>', '0', 0, 2, 6, 2, 1365, 4, NULL, '2017-05-18 05:59:04', '2017-05-18 05:59:04'),
(1474, 'Present', '<p>Оформление залов для свадеб и других торжеств.</p>\r\n<p>Декорация тканями, искусственными цветами, вазонами, стойками, бумажными 3D цветами президиумы, выездные регистрации и пресс стены.</p>\r\n<p>Качественно и недорого!</p>\r\n<p>Учтут все желания и капризы .</p>\r\n<p>Сделайте Ваше мероприятие незабываемым, создав уютную атмосферу праздника.</p>', '0', 0, 2, 15, 2, 1366, 4, NULL, '2017-05-18 06:02:28', '2017-05-18 06:02:28'),
(1475, 'Аслан Алтай', '<p>Тойдың есте қалуы ол әрине асаба және тойды түсірген видеооператорға тікелей байланысты. Тойыңыздың жарқын сәттерін есте сақтап тамашалағыңыз келсе барлық қиындықтағы түсірілімдерді жасай аламыз.</p>', '0', 0, 2, 5, 2, 1367, 4, NULL, '2017-05-18 06:05:40', '2017-05-18 06:05:40'),
(1476, 'Азиев Артур', '<p>Үйлену той, қыз ұзату, тұсау кесу, шілдехана, алтын той, кез-келген деңгейдегі іс-шаралар.</p>', '0', 0, 2, 4, 2, 1368, 4, NULL, '2017-05-18 06:08:18', '2017-05-18 06:08:18'),
(1477, 'Еркебулан Кумаров', '<p>Облыстық филармония әртісі, Республикалық &laquo;Жас Қанат&raquo; байқауының финалисті. Көптеген авторлық әндердің орындаушысы. Кез-келген салтанатты жиынның сәнін келтіретін жас әнші.</p>', '0', 0, 2, 3, 2, 1369, 4, NULL, '2017-05-18 06:10:41', '2017-05-18 06:10:41'),
(1478, 'Djambo show', '<p>Выезд по всему РК.</p>\r\n<p>В программе: вокал на казахском и других языках, интерактивы с гостями, флешмоб, барабан шоу, аккробатические номера.</p>', '0', 0, 2, 3, 2, 1370, 4, NULL, '2017-05-18 06:14:09', '2017-05-18 06:14:09'),
(1479, 'Нурлан Алимжанов', '<p>Нурлан Алимжанов известен в Казахстане, как популярный&nbsp;певец&nbsp;и&nbsp;композитор, чьи песни неоднократно занимали верхние строчки местных&nbsp;чартов. Актёр, также, является ведущим популярного&nbsp;телевизионного шоу&nbsp;&laquo;Жұлдызды дода&raquo; (Звездные войны) на канале &laquo;Хабар&raquo;. Заслуженный деятель Казахстана. Получил широкую известность как исполнитель роли&nbsp;Нурсултана Назарбаева&nbsp;в киноэпопее &laquo;Путь лидера&raquo;.</p>', '0', 0, 2, 3, 2, 1371, 4, NULL, '2017-05-18 06:20:11', '2017-05-19 08:15:56'),
(1480, 'Сабыр Байзаков и Динара Жакупова', '<p>Сабыр и Динара никогда не скрывают положительных эмоций, улыбаются и весьма гармонично смотрятся на сцене, прекрасно дополняя друг друга.</p>\r\n<p>Сабыр Байзаков - телеведущий, конферансье, шоу-мэн, доктор PhD, Посол Доброй Воли Республики Кореи в РК, художник-живописец, актер, лицо многих рекламных кампаний. Интеллигентный, харизматичный, смелый и импозантный. Умеет себя подать не только с голубых экранов, но и на сцене. Ведет себя естественно и непринужденно в любой ситуации.</p>\r\n<p>Динара Жакупова - талантливая и сильная телеведущая, конферансье, эстрадная певица с прекраснейшим голосом, Магистр искусств.</p>', '0', 0, 2, 4, 2, 1372, 4, NULL, '2017-05-18 06:22:30', '2017-05-18 06:22:30'),
(1481, 'Сухих Алексей', '<p><span style=\"font-weight: 400;\">Молодой, драйвовый ведущий.&nbsp;</span><span style=\"font-weight: 400;\">С лёгкостью справляюсь с любым количеством зрителей.&nbsp;</span><span style=\"font-weight: 400;\">Уникальная и насыщенная программа без пошлых и глупых шуток.&nbsp;</span><span style=\"font-weight: 400;\">Правильно поставленный тембр голоса.</span></p>\r\n<p><span style=\"font-weight: 400;\">Язык проведения: Русский, прохожу усиленную подготовку к знаниям казахского языка</span></p>', '0', 0, 2, 4, 2, 1373, 4, NULL, '2017-05-18 06:26:00', '2017-05-18 06:26:00'),
(1482, 'Padishah', '<p>Всего мест 300.&nbsp;</p>', '0', 0, 2, 8, 2, 1374, 4, NULL, '2017-05-18 06:28:27', '2017-05-18 06:28:27'),
(1483, 'Валентин Петренко', '<p>Меня зовут Валентин Петренко. &nbsp;Снимаю свадьбы и портреты. Также снимаю интерьеры и свадебное оформление.</p>', '0', 0, 2, 14, 2, 1375, 4, NULL, '2017-05-18 06:31:24', '2017-05-18 06:31:24'),
(1484, 'Татьяна Ковалева', '', '0', 0, 2, 14, 2, 1376, 4, NULL, '2017-05-18 06:34:30', '2017-05-18 06:34:30');
INSERT INTO `adverts` (`id`, `name`, `description`, `rating`, `views`, `allow_type_id`, `advert_categor_id`, `advert_stat_id`, `contractor_id`, `user_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1485, 'Ustudio', '<p>Мы, команда профессионалов, которая с удовольствием отснимет любое Ваше мероприятие на высоком уровне! Более трех лет опыта, более сотни отснятых мероприятий, более 10 000 обработанных фотографий &ndash; все это дает нам возможность с уверенностью говорить о том, что Мы Вас не подведем и справимся со своей работой качественно в любой ситуации. Но нашим основным преимуществом является конкурентная стоимость, которая формируется по гибкой ценовой политике, при этом на качество продукта это не влияет. Наше оборудование отвечает всем стандартам профессионального оборудования.</p>', '0', 0, 2, 14, 2, 1377, 4, NULL, '2017-05-18 23:16:26', '2017-05-18 23:16:26'),
(1486, 'Ксения Павлова', '', '0', 0, 2, 14, 2, 1380, 4, NULL, '2017-05-18 23:18:29', '2017-05-18 23:18:29'),
(1487, 'Мирхат Толкунов', '<p>Молодой, креативный, амбициозный, люблю серьезный подход к работе. Дважды побеждал в фотоконкурсе по Алматинской области. Выезд по городам. Опыт работы около 2х лет. Свадебные фото сессий, прогулочные, модельные, предметные, репортажные. Love story.</p>', '0', 0, 2, 14, 2, 1381, 4, NULL, '2017-05-18 23:20:41', '2017-05-18 23:20:41'),
(1488, 'Темирлан Канатов', '', '0', 0, 2, 14, 2, 1383, 3, NULL, '2017-05-19 06:48:39', '2017-05-19 06:48:39'),
(1489, 'Ергулан Жанпейсов', '<p>Ергулан Жанпейсов - Вот кому вообще не нужен юмор, который не претендует на узнаваемость среди гостей. Для него любая свадьба как праздник родственников. Он любит свою работу и подходит к каждому своему заказу с неописуемым удовольствием. Ергулан приходит дарить праздник, а не отрабатывать свои деньги. Самый лучший тамада! Знает обряды и традиции и выступает за их популяризацию.</p>', '0', 0, 2, 4, 2, 1384, 4, NULL, '2017-05-19 06:49:09', '2017-05-19 06:49:09'),
(1490, 'Райымбек Зекенов', '<p>Проводит такие мероприятия как: шілдехана, тұсау кесер, сүндет той, тілашар, қыз узату, үйлену той, құда түсіру, құда аттандыру, корпоративные вечера, презентации, концерты.. Будут представлен неординарный вид ведения вашего мероприятия, в котором будут преобладать живое общение, море юмора, обаяния и приятных для Вас сюрпризов.</p>', '0', 0, 2, 4, 2, 1385, 4, NULL, '2017-05-19 06:55:58', '2017-05-19 06:55:58'),
(1491, 'Айгерим Кусайнова', '<p>Я появилась на отечественной сцене сравнительно недавно, но за столь короткий срок публика меня узнала и думаю полюбила. Мой творческий псевдоним не случайно - Jan&rsquo;n&rsquo;Soul. Слово &laquo;жан&raquo; с казахского языка переводится &laquo;родная&raquo;, а &laquo;soul&raquo; с английского - &laquo;душа&raquo;. Своими песнями исполнительница я надееюсь стать каждому слушателю родственной душой. &nbsp;&laquo;Ең асылым&raquo;, &laquo;Ламбада&raquo;, &laquo;Мені ізде&raquo;, &laquo;Астана&raquo; - мои авторские песни.</p>\r\n<p>Я являюсь Лауреатом городских и республиканских Дельфийских игр, победительницей международных вокальных конкурсов. Jan&rsquo;n&rsquo;Soul уже сняла клипы на две свои песни(&laquo;Ең асылым&raquo; и &laquo;Ламбада&raquo;). Дебют как исполнительницы активно показывают&nbsp;на отечественных музыкальных каналах радио и телевидения. Я постоянно совершенствую свое мастерство, участвуя в конкурсах разного уровня. Благодаря чему меня смогли узнать не только в Казахстане, но и в странах ближнего зарубежья. Так, я удачно выступила на международном конкурсе-фестивале &laquo;Хрустальная магнолия&raquo;, который проходил в солнечном городе Сочи, международном конкурсе молодых исполнителей &laquo;Веселый ветер&raquo; имени И. Дунаевского в Москве, конкурсе-фестивале &laquo;Белая жемчужина черного моря&raquo; в курортном городе Туапсе. На международном конкурсе-фестивале в Кишиневе среди лучших молодых исполнителей из 20 стран (Вьетнама, США, России, Румынии, Беларуси и других) я получила лауреата 1 степени, а также специальную премию от министра культуры Молдавии. На сегодня я имею награды высшей степени республиканского и городского уровня.</p>\r\n<p>В 2016 году мне удалость встретиться на одной сцене с Йосифом Давыдовичем Кобзоном, а также с любимицей публики Людмилой Казарновской (концерт в честь памяти известному &nbsp;композитору И.О.Дунаевскому), с казахстанскими звездами шоу-бизнеса Айжан Нурмаганбетовой, группой &laquo;До Ми Но&raquo;, Сиви Махмуди, Кайратом Баекеновым и &laquo;Формат тобы&raquo;, Алишером Каримовым и многими другими.</p>', '0', 0, 2, 3, 2, 1387, 4, NULL, '2017-05-19 07:07:03', '2017-05-19 07:07:03'),
(1492, 'Бегулова Адина', '<p>Лауреат международных детских конкурсов в России, Кыргызтане, Италии, Польши.</p>\r\n<p>Репертуар: зарубежные хиты</p>', '0', 0, 2, 3, 2, 1388, 4, NULL, '2017-05-19 07:11:37', '2017-05-19 07:11:37'),
(1493, '\"Crossfire\" огненно - световое шоу', '<p>Мы предлагаем спектр развлекательных услуг на праздничные мероприятия и торжества. Наше шоу для тех, кто хочет сделать праздник особенным и запоминающимся. Ваша проблема по поиску артистов успешно решена!</p>\r\n<p>У нас Вы приобретаете:</p>\r\n<p>зажигательное ФАЕР ШОУ;</p>\r\n<p>программированное СВЕТОВОЕ ШОУ:</p>\r\n<p>потрясающие ЖИВЫЕ СТАТУИ:</p>\r\n<p>уникальное шоу ЗВЕЗДНАЯ ПЫЛЬ:</p>\r\n<p>рисование светом в шоу СВЕТОВАЯ КАРТИНА:</p>\r\n<p>ОГНЕННЫЕ ИНСТАЛЛЯЦИИ: сердце, надписи, логотипы, цифры:</p>\r\n<p>наземная ПИРОТЕХНИКА:</p>\r\n<p>пиротехнические фонтаны:</p>\r\n<p>пиротехника на реквизите артистов:</p>\r\n<p>ЦВЕТНОЙ ДЫМ для фотосессий и праздничных мероприятий.</p>\r\n<p>Если вы цените зрелищность - вы выберете \"Crossfire\"!</p>', '0', 0, 2, 7, 2, 1389, 4, NULL, '2017-05-19 07:20:30', '2017-05-19 07:20:30'),
(1494, 'Иллюзион-шоу «Трансформация»', '<p>Артисты оригинального жанра Иллюзион-шоу &laquo;Трансформация&raquo; от Кабаре-шоу &ldquo;VIVA&rdquo; не предлагают Вам стандартный набор фокусов, а покажут оригинальную шоу-программу, в которой быстрая смена костюмов и трансформация образов сочетаются с искусством танца, впечатляющим самого искушенного зрителя! Посмотрев на это сплетение ослепительно ярких танцев с загадочным миром иллюзии, хочется закричать &laquo;Браво&raquo;! Единственное в Казахстане дуэтное Иллюзион-шоу! Призер многих конкурсов оригинального жанра! Шоу, которое поразит Вас загадкой, скоростью и красотой!</p>', '0', 0, 2, 7, 2, 1390, 4, NULL, '2017-05-19 07:23:37', '2017-05-19 07:23:37'),
