(1497, 'Ңұрсейіт', '<p>Тойдың есте қалуы ол әрине асаба және тойды түсірген видеооператорға тікелей байланысты. Тойыңыздың жарқын сәттерін есте сақтап тамашалағыңыз келсе барлық қиындықтағы түсірілімдерді жасай алады.</p>', '0', 0, 2, 5, 2, 1393, 3, NULL, '2017-05-19 08:58:10', '2017-05-19 08:58:10'),
(1498, 'Нұрсейіт', '<p>Тойдың есте қалуы ол әрине асаба және тойды түсірген видеооператорға тікелей байланысты. Тойыңыздың жарқын сәттерін есте сақтап тамашалағыңыз келсе барлық қиындықтағы түсірілімдерді жасай алады.</p>', '0', 0, 2, 14, 2, 1393, 3, NULL, '2017-05-19 09:07:50', '2017-05-19 09:07:50'),
(1499, 'ФЛОРИСТИЧЕСКАЯ МАСТЕРСКАЯ \"ДУЭТ\"', '<p>ФЛОРИСТИЧЕСКАЯ МАСТЕРСКАЯ ДУЭТ- это семейный, дружеский и творческий союз декоратора и флориста. Мы 20 лет работаем в свадебной индустрии и очень любим нашу работу. Наша мастерская работает в формате индивидуальных заказов, мы работаем с каждым клиентом, подбираем исключительно свежие, уникальные сорта цветов, которые будут радовать вас, вне зависимости от того, будет это подарочный букет или цветочное оформление мероприятия.</p>', '0', 0, 2, 15, 2, 1398, 3, NULL, '2017-05-20 09:00:12', '2017-05-20 09:00:12'),
(1500, 'Инкарим', '<p>Танцевальный коллектив &laquo;Инкарим&raquo; существует 7 лет и этим уже многое сказано. Коллектив не стоит на месте, всегда в поиске, а танцевальные костюмы всегда соответствуют времени и моде. В репертуаре очень много народных танцев, латиноамериканских, а также шуточных и тематических композиций. Мы рады предложить Вам наши разнообразные танцевальные номера и индивидуальные постановки по Вашему заказу. Для Вас - выступление, для нас - шанс доказать, на что мы способны! В нашей биографии участие в десятках разнообразнейших шоу-проектах, а также работа с известными исполнителями казахстанской эстрады. У нас есть свой неповторимый стиль, своё оригинальное творческое лицо.</p>', '0', 0, 2, 11, 2, 1399, 4, NULL, '2017-05-20 09:16:31', '2017-05-20 09:16:31'),
(1501, 'Ринат Сақиұлы', '<p>Ақтөбелік жас әнші Ақтөбе халықтық &laquo;Сұңқар&raquo; ансамблінің мүшесі. Тойларыңыздың, кештерінізді әдемі әнмен тербетеді !!!</p>', '0', 0, 2, 3, 2, 1400, 3, NULL, '2017-05-20 09:22:51', '2017-05-20 09:22:51'),
