(1507, 'Аризона', '<p>Молодая и очень яркая шоу-группа! От их выступлений веет ярко выраженной энергией и артистичностью! Они устроят шоу, и впечатлят ваших зрителей! Моментальное перевоплощение, от грации до дикости, из страсти в нежность, от юмора до сдержанности, все это они Аризона! Комедийные этюды, сюжетные постановки, театрализованный спектакль, интерактивные номера с гостями, Флэшмобы, конкурсы: танцы со звездами, шоу с переодеванием, групповые марафоны, баттлы и многое другое! в репертуаре более 20 разноплановых номеров! 1. Зажигательный Кантри \"Бандитки\"; 2. Арабский восток \"Амидея\"; 3. Турецкий восток \"турецкая ночь\"; 3. Бунт персонала \"Техничка и официанты\"; 4. Дикая Бразилия; 5. Карнавал Рио; 6. Бродвей \"Чаплин и ангелы\"; 7. Бурлеск; 8. Канкан; 9.Казахский танец \"шашу\"; 10. Грузинский танец \"лезгинка\"; 11. Украинский танец \"гатоп\"; 12. Латино \"Бриллиант\"; 13. Гоу Гоу \"Амазонки\"; 14. Индия Болливуд \"Салам намасте\"; 15. Эстрадный модерн \"дыши\"; 16. Рок-н- ролл \"отчаянные домохозяйки\"; 17. Индия Болливуд соло \"ищу жениха\"; 18. Дикарки \"шаман\"; 19. Диско бум \"Бони-М\"; 20. Павлин \"птица счастья\"; 21. Оперативный захват гостей \"ограбление\"; 22. Танец живота \"барабаны\"; 23. Вывод невесты (Европа, казахский под вуалью, шанырак, лепестки, арки, проводы, живой коридор, сопровождение, хостесс, антураж).</p>', '0', 0, 2, 7, 2, 1406, 4, NULL, '2017-05-20 10:13:55', '2017-05-20 10:13:55'),
(1508, 'Танец с мыльными пузырями', '', '0', 0, 2, 7, 2, 1407, 4, NULL, '2017-05-20 10:16:36', '2017-05-20 10:16:36'),
(1509, 'Александр Дикс', '<p>- Профессиональный иллюзионист, фокусник-мистификатор.</p>\r\n<p>- Почетный член клуба фокусников Казахстана</p>\r\n<p>- Участник ежегодного международного фестиваля иллюзионистов MagicAstana</p>\r\n<p>- Один из самых востребованных иллюзионистов в северном регионe</p>\r\n<p>- Победитель конкурса \"Символ Успеха\" от компании SAMSUNG</p>\r\n<p>- Ведущий шоу \"Уличная Магия в Кокшетау\"</p>\r\n<p>&nbsp;</p>\r\n<p>Виды программ:</p>\r\n<p>1. Микромагия</p>\r\n<p>2. Шоу</p>\r\n<p>3. Интерактив</p>\r\n<p>4. Детская программа</p>', '0', 0, 2, 7, 2, 1408, 4, NULL, '2017-05-20 10:23:18', '2017-05-20 10:23:18'),
(1510, 'Сағым тобы', '<p>Свежий подход к современной манере эстрадного исполнения, Сагым тобы это всегда профессиональный вокал, масштабные перформансы и впечатляющие хореографические элементы. Участницы Сагым тобы это основное праздничное решение для совершенного сюжета и интересного сценария. Вам не понадобятся дополнительные декорации и иные артисты, блистать на вашем вечере удастся только профессионалам!</p>', '0', 0, 2, 3, 2, 1409, 4, NULL, '2017-05-20 10:26:28', '2017-05-20 10:26:28'),
(1515, 'Дуэт Ерболат и Меруерт', '<p>Эстрадный дуэт - это уверенно покоряющий пока столичную эстраду тандем обаятельных исполнителей. Первое что привлекает внимание в дуэте &laquo;Ерболат и Меруерт &raquo; - это изысканность с которой ребята подошли к репертуару. Каждый вокальный блок это настоящая кладезь золотых шедевров казахской, советской, казахстанской, российской и зарубежной эстрады.</p>', '0', 0, 2, 3, 2, 1410, 4, NULL, '2017-05-20 10:38:35', '2017-05-20 10:38:35'),
(1516, 'Ақниет Алтынбек', '', '0', 0, 2, 3, 2, 1411, 4, NULL, '2017-05-20 10:53:36', '2017-05-20 10:53:36'),
(1517, 'Алибек Абдилов', '<p>Ведущий концертов всех уровней (включая правительственные). Опыт работы на сцене состовляет более 10 лет. В разные годы работал в гос.филармонии города Астаны (ведущий сцены музыкально-творческого отдела), был ведущим разных теле- и радио программ. Сегодня является ведущим главной радиостанции Казахстана - Қазақ радиосы.</p>\r\n<p>Язык ведения - казахский, русский.</p>', '0', 0, 2, 4, 2, 1412, 4, NULL, '2017-05-20 10:59:13', '2017-05-20 10:59:13'),
(1518, 'Адиль Сейфуллин', '<p>Один из самых зажигательных шоуменов столицы. Солидный опыт игры в КВН, развил в Адиле потрясающее чувство ситуационного юмора. Который так важен на праздничном событии. Он действительно тот, кого можно назвать мастером слова, и мастером развлекательных мероприятий. Работает в паре с личным звукооператом, который помимо того что выделяет музыкально все сценарные моменты, так же выступает в роли ди-джея в танцевальных антрактах. Особенно часто провожу корпоративы, дни рождения, юбилеи и детские мероприятия. Такие как: шилдехана, сундет той, кыркынан шыгару, годик ребенка, тилашар (поход ребенка в первый класс) и другие.&nbsp;</p>\r\n<p>Статус: Ведущий. Актёр КВН.&nbsp;</p>\r\n<p>Жанр: Оригинальный разговорный.</p>\r\n<p>Язык ведения: Русский, Казахский.</p>\r\n<p>Сценарий: 6 часов (официально-игровой)</p>', '0', 0, 2, 4, 2, 1413, 4, NULL, '2017-05-22 05:26:26', '2017-05-22 05:26:26'),
(1519, 'Алибек Хасенов', '<p>Один из лучших ведущих Казахстана! Мастер импровизации, за плечами которого не одна сотня проведенных мероприятий, начиная от юбилеев и свадеб и заканчивая республиканскими концертами и международными событиями.</p>', '0', 0, 2, 4, 2, 1414, 4, NULL, '2017-05-22 05:31:13', '2017-05-22 05:31:13'),
(1520, 'Аргын Аусаров', '<p>Двуязычный, поющий, беташар проводящий, игровой, заводной, статный и очень привлекательный ведущий. Индивидуальный сценарии и знание всех тонкостей казахских традиции делает его одним из лучших ведущих нашей столицы.</p>', '0', 0, 2, 1, 2, 1415, 4, NULL, '2017-05-22 05:36:11', '2017-05-22 05:36:11'),
(1521, 'Асан Абдралин', '<p>Раскрученный столичный ведущий, обладающий обширным набором шоу-программ и проводимых конкурсов, а также активный режиссер, умеющий самостоятельно смоделировать ход вашей свадьбы или любого другого мероприятия. Владеет двумя языками, профессиональный подход ко всем деталям.</p>', '0', 0, 2, 4, 2, 1416, 4, NULL, '2017-05-22 06:04:03', '2017-05-22 06:04:03'),
(1522, 'Дуэт Жан', '<p>&laquo;Дуэт из домбры и саксофона&raquo; - когда слышишь подобное, сложно представить, чего ожидать. В истории еще не было примеров сочетания столь далеких друг от друга инструментов. Домбра &ndash; исконно тюркское изобретение, прототип ее был изображен на наскальном рисунке более четырех тысяч лет назад. Саксофон &ndash; исконно европейское изобретение, изготовленное бельгийцем Адольфом Саксом в 1842 году. Казахский колорит плюс европейский лоск&ndash; такой выбор сделали Нуржан и Бауыржан, создавая свой дуэт, и нужно сказать, что выбор был столь же удивителен, сколь и великолепен. Дуэту &laquo;Жан&raquo; шесть лет, пять из которых они провели в Караганде. Изначально, Нуржан и Бауыржан выступали сольно, а решение о совмещении домбры и саксофона в одно, они приняли спонтанно, встретившись в гримерке одного ресторана. В итоге, они начали удивлять. Название - &laquo;Жан&raquo; - они придумали сразу, как узнали имена друг друга. Нуржан владеет домброй и мелодикой, Бауыржан &ndash; саксофоном. У них бы вышло неплохое пособие о том, как ломать стереотипы. Их выступление &ndash; почти всегда зажигательный номер, но и медленные композиции для медленных танцев &ndash; тоже их специализация. Помимо выступлений, парни из &laquo;Жан&raquo; записывают инструментальные композиции, переделывая старые казахские и зарубежные ретро-хиты 80-х и 90-х. На сегодня они записали порядка десяти новых треков, и в студии ведется запись еще двух. Нужно самому послушать, чтобы узнать, что же дают вместе домбра и саксофон -не сомневайтесь, что удивление будет приятным. Дуэт существует 8 лет.</p>', '0', 0, 2, 6, 2, 1417, 4, NULL, '2017-05-22 06:24:08', '2017-05-22 06:32:04'),
(1523, 'Евгений Ботников', '<p>Евгений по праву считается одним из первопроходцев на ниве столичного шоу бизнеса. Это профессиональный музыкант с солидным опытом и репертуаром, владеющий несколькими разновидностями саксофона, а так же кларнетом. В то время ещё не видевшая глобальных шоу Астана, нуждалась в профессионалах инструментального жанра, и Евгений был одним из немногих, кто мог предоставить музыку достойного качества. За минувший период времени и событий Евгению удалось не только сохранить позиции настоящего профессионала, что важно, но и значительно поднять свой и без того высокий профессиональный уровень, обновить репертуар и улучшить качество звучания всех своих инструментов. Обширный и разнообразный репертуар позволяет Евгению гармонично вписаться в мероприятие практически любого формата, а владение несколькими инструментами даёт возможность показать Его Величество Саксофон с разных сторон и во всех его неповторимых красках.</p>\r\n<p>1) Сольное выступление</p>\r\n<p>2) Фоновая музыка</p>\r\n<p>3) Дуэт EU&amp;amp;RO MUSIC</p>\r\n<p>4) Романтические сюрпризы, поздравления и т.п.</p>\r\n<p>Имеется своя звукоусиливающая аппаратура ( от 100W до 800W ). Так что если у Вас юбилей или свадьба, романтический вечер или презентация, или Вам просто захотелось порадовать своих родных и близких, Вам только нужно выбрать время и место, и позвонить по указанному</p>\r\n<p>номеру.</p>', '0', 0, 2, 6, 2, 1418, 4, NULL, '2017-05-22 06:31:29', '2017-05-22 06:31:29'),
(1524, 'Дуэт Ерболат и Меруерт', '<p>Эстрадный дуэт - это уверенно покоряющий пока столичную эстраду тандем обаятельных исполнителей. Первое что привлекает внимание в дуэте &laquo;Ерболат и Меруерт &raquo; - это изысканность с которой ребята подошли к репертуару. Каждый вокальный блок это настоящая кладезь золотых шедевров казахской, советской, казахстанской, российской и зарубежной эстрады.</p>', '0', 0, 2, 6, 2, 1419, 4, NULL, '2017-05-22 06:38:37', '2017-05-22 06:38:37'),
(1525, 'Даурен Амреев', '', '0', 0, 2, 4, 2, 1420, 4, NULL, '2017-05-22 06:42:06', '2017-05-22 06:42:06'),
(1526, 'Руслан Нурланов', '', '0', 0, 2, 4, 2, 1421, 4, NULL, '2017-05-22 06:44:04', '2017-05-22 06:44:04'),
