(1528, 'группа \"Оригами\"', '<p>За этим простым названием стоит музыкальная группа экстракласса. Мы получаем массу удовольствия от работы на сцене и хотим чтоб Вы это чувствовали. Профессиональные музыканты предлагают Вашему вниманию, музыку популярных исполнителей (House,Rock,R&amp;amp;B,Pop,Ретро,Loundgel). Живая музыка, мужской и женский вокал, многоязычное пение. Живьем. Качественно. Оригинально. Для всех, кто устраивает свадьбу, День рождения или другой праздник самостоятельно - Мы привезём звуковое и световое оборудование экстра-класса, и вам не придется самим ломать голову, выбирая прокатную компанию.</p>', '0', 0, 2, 1, 2, 1423, 4, NULL, '2017-05-22 06:50:17', '2017-05-22 06:50:17'),
(1529, '​ВИА «ACTION»', '<p>​ВИА &laquo;ACTION&raquo; &ndash; профессиональные музыканты, работающие в самых разных стилях и жанрах. Это один из авторитетных и востребованных музыкальных коллективов в столице, играющих &laquo;в живую&raquo;, основан в 2007 году музыкантом ГазизомКойшыбаевым (г. Караганда). За 8 лет своего существования коллектив успешно выступает на различных концертных площадках, корпоративных мероприятиях, семейных торжествах, презентациях, выставках и др. В составе группы 4 инструменталиста, 2 женский вокал, 1 мужской вокал. ​Коллектив постоянно обновляет и расширяет свой репертуар. В работе сочетаются такие стили и направления, как джаз, джаз-рок, кантри, рок, рок-н- ролл, дискотека 80-х, западная поп-музыка. Серьёзное отношение к сценическому виду является неотъемлемой частью выступления. Программа выступления ВИА &laquo;ACTION&raquo; составляется индивидуально с учётом вкусов и пожеланий Заказчика. Тем самым отличное настроение, масса положительных эмоций гарантированы.</p>\r\n<p>ВИА &laquo;ACTION&raquo; не ограничивает себя стилевыми рамками. Концертная программа коллектива рассчитана на широкую аудиторию. В репертуаре группы песни на многих языках мира: казахский, русский, английский, итальянский, французский, испанский, бразильский, турецкий, узбекский и др. Для клиентов специально разработаны бонусы. Мы любим делать подарки.</p>\r\n<p>ВИА &laquo;ACTION&raquo; &ndash; красивое, качественное и слаженное звучание, живое исполнение и шоу, которое никого не оставит равнодушным!</p>\r\n<p>​Все предложения обсуждаемы. Будем рады сотрудничеству с Вами!</p>', '0', 0, 2, 1, 2, 1424, 4, NULL, '2017-05-22 06:57:05', '2017-05-22 06:57:05'),
(1530, 'Rakhat Live Band', '<p>Рахат live Band украсит ваши праздники новыми и старыми хитами, зарубежный, казахский, русский репертуар. Вы получите полный драйв на танцполе и море - море замечательных эмоций и позитива. мужской вокал Аян Ералы известный в Казахстане дуэт женский вокал Кымбат студентка муз академии подающая. большие надежды на профессиональный вклад РК соло ритм гитара участник 2 состава известной в Казахстане группы Яшлык за ударной установкой Темерхан победитель и участник множества международных конкурсов 2 выступавший в самом известном в мире зале Karnegy holl звукорежиссёр Александр являющийся по совместительству аранжировщиком был звукооператором не только на концертах артистов Казахстанской эстрады но и артистов как ближнего так и дальнего зарубежья бас гитара и по совместительству музыкальный руководитель Рахат.</p>\r\n<p>100% живой звук.</p>', '0', 0, 2, 1, 2, 1425, 4, NULL, '2017-05-22 07:01:32', '2017-05-22 07:01:32'),
(1531, 'Адиль и Ерлан', '<p><span style=\"font-weight: 400;\">Дуэт шоу-ведущих Адиль и Ерлан, заключает в себе, полностью двуязычное ведение (казахский, русский), обилие шуток и искрометного юмора, огромное количество интересных игр и конкурсов, отличное сочетание как официального, так и развлекательного ведения. Имея достаточный опыт выступления на самых престижных площадках Казахстана, они зарекомендовали себя, как хорошо слаженный дуэт, умеющий найти нестандартный выход из любой непредвиденной ситуации. Особой чертой их симбиоза, является постоянное обновление сценария. На сегодняшний момент, данные ведущие, одно из лучших сочетаний в Астане, в соотношении цена - качество. Пригласив этот дуэт, вы на самом деле будете чувствовать праздник от начала и до конца.</span></p>', '0', 0, 2, 4, 2, 1426, 4, NULL, '2017-05-22 07:40:52', '2017-05-22 07:40:52'),
(1535, 'КВН «Спарта»', '<p>На протяжении двух лет команда КВН &laquo;Спарта&raquo; выступает на корпоративных праздниках, частных мероприятиях - свадьбы, юбилеи, дни рождения. Остроумные и находчивые, прекрасно выглядят, отлично говорят, умеют привлечь внимание, узнаваемые на улицах - они порадуют гостей своим незабываемым выступлением. Язык ведения: русский, казахский.&nbsp;</p>\r\n<p>Также вы можете выбрать лишь одного участника команды для роли ведущего.</p>', '0', 0, 2, 4, 2, 1427, 4, NULL, '2017-05-22 07:58:12', '2017-05-22 07:58:12'),
