(1562, 'Жансултан Сабет', '<p>Молодой, харизматичный ведущий. &nbsp;Инструктор отличного настроения! Мастер интерактива и незабываемого взамодействия! Моя задача &ndash; сделать так, чтобы на празднике царила радостная атмосфера, а гости и молодожены чувствовали себя легко и непринужденно. Я придерживаюсь современного стиля ведения, который предполагает живое интерактивное общение с гостями (вместо стихов и пламенных речей), увлекательные активности для гостей (вместо пошлых и глупых конкурсов) и внимательное отношение к пожеланиям молодоженов.&nbsp;</p>\r\n<p>Профессиональное ведение мероприятий на двух языках(казахский+русский):&nbsp;</p>\r\n<p>-Свадьбы;&nbsp;</p>\r\n<p>-Корпоративы;&nbsp;</p>\r\n<p>-Концерты;&nbsp;</p>\r\n<p>-Розыгрыши, открытия, презентации;&nbsp;</p>\r\n<p>-Юбилеи и Дни рождения.</p>', '0', 0, 2, 4, 2, 1445, 4, NULL, '2017-05-23 08:03:11', '2017-05-23 08:03:11'),
