(1597, 'Александр Петренко', '<p>Если театр начинается с вешалки, то любой праздник начинается с ведущего! Да, именно с ведущего!<br />- Ведущий<br />- Сценарист (написание сценариев, Lovestory, клипов, рекламных роликов)<br />- Вокалист</p>', '0', 0, 2, 4, 2, 1472, 3, NULL, '2017-05-26 05:44:01', '2017-05-26 05:44:01'),
(1598, 'DK Studio', '<p>Фото и видео съёмка свадебного мероприятия любого уровня. Отличное качество по доступным ценам! Индивидуальный подход к каждому клиенту!</p>', '0', 0, 2, 14, 2, 1473, 3, NULL, '2017-05-26 05:45:35', '2017-05-26 05:45:35'),
(1600, 'Намазбаев Нурсултан', '<p>Меня зовут Намазбаев Нурсултан, я профессиональный фотограф. Основные направления моего творчества: детская, предметная, семейная, студийная, свадебная и портретная фотография. Я люблю работать с людьми, люблю снимать веселые и счастливые лица, ловить незабываемые и неповторимые моменты Вашей жизни! Я обожаю работать на свадьбах. Мне нравится снимать счастливых людей, сохраняя эти моменты навсегда. Торжества бывают разные, традиционные с &laquo;выкупом&raquo; невесты, ЗАГСОМ и хлебом-солью от родителей, светские, где необходимо заказать фотосессию на выезде, проводимые на открытом воздухе с фуршетами, платьями &laquo;в пол&raquo; для женщин и фраками для мужчин, тематические - где все гости одеты как герои любимого фильма. Все они похожи одним &ndash; это День Рождения Семьи.</p>', '0', 0, 2, 14, 2, 1474, 43, NULL, '2017-05-26 11:59:30', '2017-05-27 05:36:52'),
