(1606, 'AMGMEDIAGROUP', '\r\n\r\nСтудия Amgmediagroup предлагает широкий спектр услуг фото и видеосъемки.  Это видеосъемка семейных праздников: дня рождения, выписки из роддома, юбилея, свадьбы,Кыз узату и т.д. Видеосъемка корпоративных праздников, городских мероприятий, детских и взрослых музыкальных клипов, рекламы, производственных роликов, концертов, выпускного вечера школьников. Одним из направлений деятельности студии является видеосъемка свадьбы в Астане ,+77781880794 пишете ватсапе прайс лист отправим)))\r\nБудем ждать)\r\n', '0', 0, 2, 5, 2, 1481, 45, NULL, '2017-05-27 16:23:25', '2017-05-27 16:23:25'),
(1607, 'Профессиональная 4х камерная видеосъёмка на ПТС', 'Профессиональная 4х камерная видеосъёмка на ПТС с одновременной трансляцией с четырёх камер на ЛЕД экран. Телемост. Съёмки концертов, и крупных мероприятий. Многокамерная съемка.\r\nЭто уникальное предложение на рынке г. Актобе. Концерты, семинары, спортивные состязания, любые локальные мероприятия теперь можно снять несколькими камерами и получить готовый монтаж сразу по окончании мероприятия. Также ПТС применяется при производстве корпоративного фильма. Сигнал программы (или сигнал с любой камеры) можно подать на внешний проектор, плазменный экран или ЛЕД экран. Также программу возможно записать на цифровой рекордер в качестве FullHD или на DVD.\r\n\r\nЧто входит в услугу ПТС (передвижная телевизионная станция):\r\nразработка съемочного плана\r\nработа видеоинженеров и доставка\r\nкамеры (от 2-х до 6-ти)\r\nдлина кабелей до 150 м!\r\nвозможность использования операторского крана или крана с управляемой головкой\r\nподключение компьютера для вывода презентаций PowerPoint, титров или графического оформления\r\nвозможна организация Full HD трансляции на проектор или плазменный экран с использованием видеомикшера\r\nзвуковое и динамическое световое сопровождение\r\nзапись смонтированного материала на цифровой рекордер', '0', 0, 2, 5, 2, 1482, 46, NULL, '2017-05-27 20:29:49', '2017-05-27 20:29:49'),
